INSERT INTO `posts` (`id`, `title`, `alias`, `tag`, `keyword`, `image`, `description`, `content`, `views`, `type_id`, `status`, `postcate_id`, `created_at`, `updated_at`) VALUES
(1, 'Chính sách bảo mật thông tin', 'chinh-sach-bao-mat-thong-tin', 'chính sách', 'chính sách, bảo mật', '1599535208_no-image.png', 'Chính sách bảo mật thông tin', '<p><strong>1.&nbsp;Mục đ&iacute;ch v&agrave; phạm vi thu thập th&ocirc;ng tin:</strong></p>\r\n\r\n<p>Honghungland.com lu&ocirc;n cố gắng để những th&ocirc;ng tin được đăng tr&ecirc;n trang Honghungland.com l&agrave; hữu &iacute;ch v&agrave; ch&iacute;nh x&aacute;c nhất. Để thực hiện điều đ&oacute;, Honghungland.com y&ecirc;u cầu th&agrave;nh vi&ecirc;n phải cung cấp đầy đủ v&agrave; ch&iacute;nh x&aacute;c mọi th&ocirc;ng tin tại Honghungland.com</p>\r\n\r\n<p>C&aacute;c th&ocirc;ng tin m&agrave; Honghungland.com c&oacute; thể thu thập từ th&agrave;nh vi&ecirc;n bao gồm: họ t&ecirc;n, giới t&iacute;nh, ng&agrave;y sinh, email, m&atilde; số thuế, địa chỉ, điện thoại, nghề nghiệp, nơi l&agrave;m việc v&agrave; c&aacute;c th&ocirc;ng tin cần thiết kh&aacute;c.</p>\r\n\r\n<p><strong>2.&nbsp;Phạm vi sử dụng th&ocirc;ng tin:</strong></p>\r\n\r\n<p>C&aacute;c th&ocirc;ng tin được th&agrave;nh vi&ecirc;n cung cấp c&oacute; thể d&ugrave;ng v&agrave;o c&aacute;c mục đ&iacute;ch sau:</p>\r\n\r\n<p>-&nbsp;&nbsp;Cung cấp dịch vụ tr&ecirc;n Honghungland.com m&agrave; th&agrave;nh vi&ecirc;n y&ecirc;u cầu;</p>\r\n\r\n<p>-&nbsp;&nbsp;Gửi th&ocirc;ng tin giới thiệu dịch vụ tr&ecirc;n Honghungland.com đến th&agrave;nh vi&ecirc;n;</p>\r\n\r\n<p>-&nbsp;&nbsp;Ph&acirc;n t&iacute;ch, đ&aacute;nh gi&aacute; v&agrave; ho&agrave;n thiện sản phẩm, dịch vụ (kể cả website), c&ocirc;ng nghệ, quy tr&igrave;nh;</p>\r\n\r\n<p>-&nbsp;&nbsp;N&acirc;ng cao mối tương t&aacute;c v&agrave; li&ecirc;n kết với th&agrave;nh vi&ecirc;n;</p>\r\n\r\n<p>-&nbsp;&nbsp;Giải quyết c&aacute;c vấn đề tranh chấp, khiếu nại ph&aacute;t sinh li&ecirc;n quan đến việc sử dụng Honghungland.com;</p>\r\n\r\n<p>-&nbsp;&nbsp;Ngăn chặn những hoạt động vi phạm ph&aacute;p luật tại Việt Nam.</p>\r\n\r\n<p>Nếu kh&ocirc;ng c&oacute; sự đồng &yacute; của th&agrave;nh vi&ecirc;n, Honghungland.com sẽ kh&ocirc;ng cung cấp bất kỳ th&ocirc;ng tin n&agrave;o li&ecirc;n quan đến th&agrave;nh vi&ecirc;n cho b&ecirc;n thứ ba để sử dụng vớimục đ&iacute;ch quảng c&aacute;o.</p>\r\n\r\n<p><strong>3.&nbsp;Thời gian lưu trữ th&ocirc;ng tin:</strong></p>\r\n\r\n<p>C&aacute;c th&ocirc;ng tin của th&agrave;nh vi&ecirc;n được lữu trữ trong một thời gian cần thiết, nhằm phục vụ cho c&aacute;c y&ecirc;u cầu th&agrave;nh vi&ecirc;n đưa ra.</p>\r\n\r\n<p>Th&agrave;nh vi&ecirc;n c&oacute; thể y&ecirc;u cầu Honghungland.com x&oacute;a dữ liệu c&aacute; nh&acirc;n khi đ&atilde; chấm dứt l&agrave; th&agrave;nh vi&ecirc;n của Honghungland.com.</p>\r\n\r\n<p><strong>4.&nbsp;Địa chỉ của đơn vị chủ quản Honghungland.com:</strong></p>\r\n\r\n<p>C&ocirc;ng ty Cổ phần PropertyGuru Việt Nam</p>\r\n\r\n<p>Địa chỉ:&nbsp;</p>\r\n\r\n<p>Tel: &nbsp;Email:&nbsp;hotro@Honghungland.com</p>\r\n\r\n<p><strong>5.&nbsp;Phương tiện v&agrave; c&ocirc;ng cụ để người d&ugrave;ng tiếp cận v&agrave; chỉnh sửa dữ liệu th&agrave;nh vi&ecirc;n:</strong></p>\r\n\r\n<p>C&aacute;c th&agrave;nh vi&ecirc;n được cấp một t&agrave;i khoản bao gồm t&ecirc;n t&agrave;i khoản v&agrave; mật khẩu để truy cập Honghungland.com. Sau khi đăng nhập, th&agrave;nh vi&ecirc;n c&oacute; quyền sử dụng mọi dịch vụ, tiện &iacute;ch được cung cấp tr&ecirc;n Honghungland.com theo đ&uacute;ng chức năng, quyền hạn lựa chọn v&agrave; được ph&acirc;n quyền.</p>\r\n\r\n<p><strong>6.&nbsp;&nbsp;Cam kết bảo mật th&ocirc;ng tin th&agrave;nh vi&ecirc;n:</strong></p>\r\n\r\n<p>&nbsp;- Honghungland.com cam kết sẽ bảo mật c&aacute;c th&ocirc;ng tin của th&agrave;nh vi&ecirc;n, nỗ lực v&agrave; sử dụng c&aacute;c biện ph&aacute;p th&iacute;ch hợp để bảo mật c&aacute;c th&ocirc;ng tin m&agrave; th&agrave;nh vi&ecirc;n cung cấp cho Honghungland.com trong qu&aacute; tr&igrave;nh sử dụng dịch vụ tr&ecirc;n Honghungland.com.</p>\r\n\r\n<p>&nbsp;- Kh&ocirc;ng b&aacute;n, chuyển giao dữ liệu th&ocirc;ng tin cho b&ecirc;n thứ ba, khi chưa được sự cho ph&eacute;p của th&agrave;nh vi&ecirc;n ngoại trừ trường hợp theo y&ecirc;u cầu cung cấp th&ocirc;ng tin th&agrave;nh vi&ecirc;n của cơ quan nh&agrave; nước c&oacute; thẩm quyền bằng văn bản hoặc ph&aacute;p luật c&oacute; quy định kh&aacute;c.&nbsp;</p>\r\n\r\n<p>&nbsp;- Trong trường hợp m&aacute;y chủ lưu trữ th&ocirc;ng tin th&agrave;nh vi&ecirc;n bị tấn c&ocirc;ng dẫn đến mất dữ liệu th&agrave;nh vi&ecirc;n, Honghungland.com sẽ c&oacute; tr&aacute;ch nhiệm th&ocirc;ng b&aacute;o vụ việc cho cơ quan chức năng điều tra xử l&yacute; kịp thời v&agrave; th&ocirc;ng b&aacute;o cho th&agrave;nh vi&ecirc;n được biết.</p>\r\n\r\n<p>&nbsp;- Nếu x&eacute;t thấy th&ocirc;ng tin của th&agrave;nh vi&ecirc;n cung cấp tr&ecirc;n Honghungland.com l&agrave; kh&ocirc;ng ch&iacute;nh x&aacute;c, Honghungland.com sẽ tiến h&agrave;nh hủy to&agrave;n bộ những nội dung của th&agrave;nh vi&ecirc;n đ&oacute; được đăng tải tr&ecirc;n Honghungland.com.</p>\r\n\r\n<p>&nbsp;- Th&agrave;nh vi&ecirc;n cần cung cấp th&ocirc;ng tin trong c&aacute;c trường hợp sau:</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;Truy cập, đặt mua, sử dụng dịch vụ Honghungland.com;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;Y&ecirc;u cầu b&aacute;o gi&aacute;, cung cấp th&ocirc;ng tin, dịch vụ hoặc hỗ trợ;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;Tham gia khảo s&aacute;t &yacute; kiến, dự thi c&oacute; thưởng, hoặc c&aacute;c hoạt động khuyến mại, quảng b&aacute; kh&aacute;c;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;Đăng k&yacute; nhận tin thư, email quảng c&aacute;o hoặc c&aacute;c loại tin tức kh&aacute;c;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;Đăng k&yacute; tham dự tuyển dụng, gửi hồ sơ, l&yacute; lịch;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;Việc thu thập v&agrave; sử dụng th&ocirc;ng tin th&agrave;nh vi&ecirc;n chỉ được thực hiện khi c&oacute; sự đồng &yacute; của th&agrave;nh vi&ecirc;n bằng c&aacute;ch đăngk&yacute; t&agrave;i khoản tr&ecirc;n Honghungland.com.</p>\r\n\r\n<p>Quy định về Ch&iacute;nh s&aacute;ch bảo mật th&ocirc;ng tin của Honghungland.com ch&iacute;nh thức c&oacute; hiệu lực thi h&agrave;nh kể từ ng&agrave;y 23/02/2020</p>', 0, 0, 0, 1, '2020-09-08 03:20:08', '2020-09-08 03:20:08'),
(2, 'Cho thuê chung cư GoldMark 136 Hồ Tùng Mậu 2PN full nội thất', 'cho-thue-chung-cu-goldmark-136-ho-tung-mau-2pn-full-noi-that', 'goldmark, hotungmau', 'GoldMark', '1610687654_z2276645977098_cde40d73bbdb2bfad0e13acada819aa2.jpg', 'Cho thuê chung cư GoldMark City tòa R2 136 Hồ Tùng mậu\r\nDT:83m2 2PN 2WC Full  nội thất giá 10tr.', '<p>Chung cư Goldmark City tọa lạc nằm tại 136 Hồ T&ugrave;ng Mậu &ndash; một trong những vị tr&iacute; đắc địa của thủ đ&ocirc; H&agrave; Nội, khu vực trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế năng động v&agrave; sầm uất nhất của thủ đ&ocirc; trong tương lai. Từ vị tr&iacute; dự &aacute;n, chỉ mất v&agrave;i chục ph&uacute;t l&aacute;i xe, c&aacute;c cư d&acirc;n c&oacute; thể dễ d&agrave;ng tới s&acirc;n bay Nội B&agrave;i v&agrave; c&aacute;c điểm đến th&uacute; vị, c&aacute;c khu nghỉ dưỡng đẹp nhất miềm bắc th&agrave;nh phố kết nối tương lai nằm rất gần trạm t&agrave;u điện ngầm Metro số 3 &ndash; hệ thống giao th&ocirc;ng hiện đại v&agrave; th&ocirc;ng minh nhất.<br />\r\n- Gần c&aacute;c đặc khu kinh tế lớn của H&agrave; Nội với c&aacute;c doanh nghiệp, c&aacute;c ng&acirc;n h&agrave;ng lớn<br />\r\n- Gần c&aacute;c trường ĐH lớn như ĐH Quốc Gia H&agrave; Nội, ĐH Thương Mại, ĐH Sư Phạm&hellip;<br />\r\n- Gần bến xe Mỹ Đ&igrave;nh, gần tuyến Metro Nhổn &ndash; Ga H&agrave; Nội<br />\r\n- Gần trung t&acirc;m Hội Nghị Quốc Gia, s&acirc;n vận động Mỹ Đ&igrave;nh<br />\r\nKết nối thuận tiện với c&aacute;c trục giao th&ocirc;ng quan trọng: đường 32, đường Phạm Văn Đồng, đường Ho&agrave;ng Quốc Việt k&eacute;o d&agrave;i, L&ecirc; Đức Thọ&hellip;<br />\r\nVới những lợi thế về vị tr&iacute;, cư d&acirc;n tại Goldmark City được xem l&agrave; điểm nhấn quan trọng tại khu vực cửa ng&otilde; của thủ đ&ocirc; với kh&ocirc;ng gian c&acirc;y xanh v&agrave; hồ nước tho&aacute;ng m&aacute;t, trong l&agrave;nh, tạo ngoại quan kiến tr&uacute;c đồng bộ tr&ecirc;n trục đường ch&iacute;nh &amp; tầm nh&igrave;n thẩm mỹ với khu c&ocirc;ng vi&ecirc;n quy hoạch.<br />\r\n&nbsp;</p>', 0, 0, 0, 2, '2021-01-15 12:14:14', '2021-01-15 12:14:14');
