(2, 'Chung cư GlodMark City', 'chung-cu-glodmark-city', NULL, 0, 0, 0, 1, 'goldmark city, 136 ho tung mau', 'Chung cư TNR Goldmark City mang đến cho cư dân một cuộc sống hưởng thụ thật sự. Cung cấp tới 3 bể bơi lớn nhỏ được bố trí đều quanh dự án. Hệ thống trung tâm thương mại và mua sắm hiện đại. K', '2021-01-15 12:01:35', '2021-01-15 12:14:26');
