smo T&acirc;y Hồ l&agrave; dự &aacute;n đầu ti&ecirc;n c&oacute; rạp chiếu phim 5* tại khu vực T&acirc;y Hồ T&acirc;y. Ngo&agrave;i ra, với 03 tầng trung t&acirc;m thương mại kết hợp văn ph&ograve;ng c&ugrave;ng với c&aacute;c tiện &iacute;ch phục vụ ri&ecirc;ng cho cư d&acirc;n Kosmo T&acirc;y Hồ như : si&ecirc;u thị, trường mần non đạt ti&ecirc;u chuẩn quốc tế, ph&ograve;ng tập Gym , Spa, khu ẩm thực , khu thời trang ; khu vui chơi ngo&agrave;i trời cho trẻ em, s&acirc;n vườn dạo bộ , vườn nướng BBQ , bể bơi bốn m&ugrave;a trong nh&agrave; , bể bơi ngo&agrave;i trời&hellip;&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601281231_1.jpg', '1601281231_0.jpg|1601281231_1.jpg|1601281231_2.jpg|1601281231_4.jpg|1601281231_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 00:09:44', '2020-09-28 08:20:31'),
(57, 'Cho thuê căn 2PN giá 8.5tr tại Chung cư 789 Xuân Đỉnh', 'cho-thue-can-2pn-gia-85tr-tai-chung-cu-789-xuan-dinh', 'P. Xuân Đỉnh, Q. Bắc Từ Liêm, Hà Nội', 2, '20', '50', 8500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 50m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, &nbsp;nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n chung cư 789 Xu&acirc;n Đỉnh nằm liền kề khu nh&agrave; ở Ngoại Giao Đo&agrave;n, mặt đường Nguyễn Văn Huy&ecirc;n k&eacute;o d&agrave;i nối liền từ khu đ&ocirc; thị &nbsp;T&acirc;y Hồ T&acirc;y ra Q. Cầu Giấy<br />\r\nPh&iacute;a nam: nh&igrave;n về khu Ngoại Giao Đo&agrave;n, c&aacute;ch c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a đ&atilde; h&igrave;nh th&agrave;nh 100 m<br />\r\nPh&iacute;a t&acirc;y: mặt đường nội bộ 17,5 m nối ra c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh ( chỉ 250 m )<br />\r\nPh&iacute;a bắc: tiếp gi&aacute;p mặt đường Xu&acirc;n Đỉnh<br />\r\nPh&iacute;a đ&ocirc;ng: View Hồ T&acirc;y v&agrave; cầu Nhật T&acirc;n, chưa đầy 1km<br />\r\nNgo&agrave;i ra từ dự &aacute;n, qu&yacute; kh&aacute;ch c&oacute; thể dễ d&agrave;ng di chuyển v&agrave;o trung t&acirc;m th&agrave;nh phố hay s&acirc;n bay Nội B&agrave;i qua trục đường lớn Phạm Văn Đồng, Nguyễn Văn Huy&ecirc;n v&agrave; đường cầu Nhật T&acirc;n &hellip;<br />\r\nDự &aacute;n 789 Xu&acirc;n Đỉnh c&oacute; một lợi thế lớn l&agrave; được sở hữu c&aacute;c tiện &iacute;ch sẵn c&oacute; của KĐT &nbsp;Ngoại Giao Đo&agrave;n v&agrave; KĐT T&acirc;y Hồ T&acirc;y như trường học quốc tế, c&aacute;c trường Đại học, bệnh viện, c&ocirc;ng vi&ecirc;n, khu vui chơi giải tr&iacute; &hellip;<br />\r\nC&aacute;c tiện &iacute;ch hiện đại kh&aacute;c như nh&agrave; h&agrave;ng, salon, cửa h&agrave;ng tiện lợi, shop rượu vang, c&agrave; ph&ecirc; &amp; b&aacute;nh ngọt, dịch vụ giặt l&agrave;, bưu điện, spa, ph&ograve;ng tập gym, lễ t&acirc;n v&agrave; an ninh &hellip; cũng gi&uacute;p bạn trải nghiệm cuộc sống trọn vẹn hơn.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 8.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601283706_1.jpg', '1601283707_1.jpg|1601283707_2.jpg|1601283707_3.jpg|1601283707_4.jpg|1601283707_5.jpg|1601283707_6.jpg|1601283707_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 00:16:23', '2020-09-28 09:01:47'),
