ng, salon, cửa h&agrave;ng tiện lợi, shop rượu vang, c&agrave; ph&ecirc; &amp; b&aacute;nh ngọt, dịch vụ giặt l&agrave;, bưu điện, spa, ph&ograve;ng tập gym, lễ t&acirc;n v&agrave; an ninh &hellip; cũng gi&uacute;p bạn trải nghiệm cuộc sống trọn vẹn hơn.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599756353_z2049867996332_8bba3497f37f674106421ebffb906381.jpg', '1599756353_z2049867996332_8bba3497f37f674106421ebffb906381.jpg|1599756353_z2049867999075_e73eb06c244b6e872393f28d08b2624a.jpg|1599756353_z2049868001964_d149f96a4439327871cc5fa5c4161b4f.jpg|1599756353_z2049868003583_fab9c60fed01679837831c332c235f6b.jpg|1599756353_z2049868006006_5cbe166c40b7a3c348a48c73d6f76263.jpg|1599756353_z2049868008389_34f9b804314ddfd4f0c7afa004d76303.jpg|1599756353_z2049868010394_cb106a44ef43af96c8d17b1c1f50277d.jpg|1599756353_z2049868011678_74e841ceae5dbbecf9a5983c852d5990.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 00:18:23', '2020-09-28 09:02:02'),
(61, 'Cho thuê căn 2PN full nội thất giá 7.5tr tại KĐT Nam Thăng Long - Ciputra', 'cho-thue-can-2pn-full-noi-that-gia-75tr-tai-kdt-nam-thang-long-ciputra', 'Đường Lạc Long Quân, Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '21', '90', 7500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 90m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n khu đ&ocirc; thị Nam Thăng Long nằm ở ph&iacute;a T&acirc;y Bắc của H&agrave; Nội, c&aacute;ch trung t&acirc;m th&agrave;nh phố khoảng 10km, toạ lạc tr&ecirc;n đường Lạc Long Qu&acirc;n, thuộc phường Xu&acirc;n La v&agrave; Ph&uacute; Thượng, quận T&acirc;y Hồ, ph&iacute;a &ETH;&ocirc;ng gi&aacute;p đường v&agrave;nh đai 2, bao quanh bởi s&ocirc;ng Hồng v&agrave; Hồ T&acirc;y. Cổng ch&iacute;nh ph&iacute;a T&acirc;y, gi&aacute;p đường v&agrave;nh đai 3, s&aacute;t ch&acirc;n cầu Thăng Long v&agrave; hướng đi s&acirc;n bay quốc tế Nội B&agrave;i.</p>\r\n\r\n<p>Trong khu đ&ocirc; thị, trường học, nh&agrave; trẻ mẫu gi&aacute;o được bố tr&iacute; đảm bảo an to&agrave;n thuận tiện, linh động, tiện lợi cho trẻ em học tập, vui chơi, cơ quan h&agrave;nh ch&iacute;nh, y tế được bố tr&iacute; ở trung t&acirc;m mỗi đơn vị ở để thuận tiện cho sử dụng v&agrave; quản l&yacute;. Ph&iacute;a T&acirc;y l&agrave; khu dịch vụ t&agrave;i ch&iacute;nh, thương mại, văn ho&aacute;, văn ph&ograve;ng giao dịch, kh&aacute;ch sạn cao cấp.<br />\r\nTrung t&acirc;m mua sắm Ciputra Mall bao gồm bốn tầng nổi v&agrave; một tầng hầm, được coi l&agrave; trung t&acirc;m thương mại đa năng lớn nhất H&agrave; Nội, rộng khoảng 130.000m2. Ngo&agrave;i ra, nơi đ&acirc;y c&ograve;n c&oacute; một trung t&acirc;m chiếu phim đa năng với 12 rạp m&agrave;n h&igrave;nh rộng.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 7.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600834857_10.jpg', '1601105455_3.jpg|1601105455_5.jpg|1601105455_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 00:27:14', '2020-09-26 07:40:17'),
(62, 'Cho thuê căn 2PN full nội thất giá 11.5tr tại Goldmark City Hồ Tùng Mậu', 'cho-thue-can-2pn-full-noi-that-gia-115tr-tai-goldmark-city-ho-tung-mau', '136 Hồ Tùng Mậu, Phường Phú Diễn, Bắc Từ Liêm, Hà Nội', 2, '8', '1', 11500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 115m2.<br />\r\nThiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Tọa lạc tại vị tr&iacute; đắc địa, nơi sẽ l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế của Thủ đ&ocirc; trong tương lai, đầu mối trung t&acirc;m kết nối c&aacute;c trục đường lớn. GoldMark City &ndash; nằm ngay tr&ecirc;n mặt đường Nguyễn Cơ Thạch k&eacute;o d&agrave;i, đối diện khu c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a Mai Dịch gần 2 ha đ&atilde; được quy hoạch. Một vị tr&iacute; đắc địa, một điểm cộng vượt trội cho Goldmark City.</p>\r\n\r\n<p>Đặc biệt, đ&acirc;y cũng l&agrave; nơi tập trung tất cả c&aacute;c tuyến xe li&ecirc;n tỉnh, đặc biệt l&agrave; c&aacute;c tỉnh ph&iacute;a Đ&ocirc;ng, ph&iacute;a Nam Thủ đ&ocirc; như Bắc Ninh, Hưng Y&ecirc;n, Hải Dương, H&agrave; Nam, Ninh B&igrave;nh, Th&aacute;i B&igrave;nh, Nam Định, Thanh H&oacute;a, Nghệ An&hellip;</p>\r\n\r\n<p>Dễ d&agrave;ng di chuyển đến c&aacute;c địa điểm bệnh viện, trường đại học, bến xe: C&aacute;ch Đại học Thương Mại, Đại học S&acirc;n khấu Điện ảnh, Đại học Quốc Gia, Đại học Ngoại ngữ 0.3km; C&aacute;ch bệnh viện 198 0.9km; đi xe m&aacute;y đến S&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3p;gần c&aacute;c si&ecirc;u thị Fivimart, Pico Plaza, Media mart&hellip; Chung cư TNR GoldMark City t&iacute;ch hợp hơn 20 tiện &iacute;ch đẳng cấp như: Khu vui chơi trẻ em, Trung t&acirc;m thương mại hiện đại, Bar &ndash; Caf&eacute;, Vườn BBQ ngo&agrave;i trời, Spa thư gi&atilde;n &ndash; X&ocirc;ng hơi, Ph&ograve;ng tập Gym hiện đại&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 11.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601278808_2.jpg', '1601278808_1.jpg|1601278808_2.jpg|1601278808_3.jpg|1601278808_4.jpg|1601278808_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 00:30:11', '2020-09-28 07:40:08'),
(63, 'Cho thuê căn 2PN full nội thất giá 10tr tại CC Green Star Phạm Văn Đồng', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-cc-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '1', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGreen Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1599755155_z2050986638162_71162fcf2ed9ba809eb5387271222778.jpg', '1599755155_z2050986369222_496a7d82b5a854e45db783a9f0a57987.jpg|1599755155_z2050986371586_98da016cf0ec9e16ee92abd4c7679ef2.jpg|1599755155_z2050986372895_d62242a39aeac0a22f536739e1c14ae5.jpg|1599755155_z2050986375061_69de0b92b54f5adb807f1cc0071e7a0c.jpg|1599755155_z2050986379677_0e2bbc07b863fc866ea895fa11da9c86.jpg|1599755155_z2050986390252_e99fd14f018cc209d1d2b5099272f1fb.jpg|1599755155_z2050986392962_03b80face62ac4c67034bd5f902b6400.jpg|1599755155_z2050986634304_5839f3aef5c41df38f6571af4bba9fa7.jpg|1599755155_z2050986638162_71162fcf2ed9ba809eb5387271222778.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 00:37:00', '2020-09-25 04:11:47'),
