(74, 'Cho thuê căn 3PN full nội thất giá 11.5tr tại Mon City Mỹ Đình', 'cho-thue-can-3pn-full-noi-that-gia-115tr-tai-mon-city-my-dinh', 'Đường Hàm Nghi, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '26', '80', 11500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n quy hoạch th&agrave;nh một khu phố nhỏ sầm uất giữa mảnh đất v&agrave;ng, tiện lợi cho việc sinh sống v&agrave; kinh doanh. Gồm c&aacute;c c&ocirc;ng tr&igrave;nh hỗn hợp cao tầng với tầng hầm li&ecirc;n th&ocirc;ng, c&aacute;c tầng thương mại đẳng cấp, c&aacute;c khu vực dịch vụ, vui chơi phong ph&uacute;.</p>\r\n\r\n<p>Dự &aacute;n Mon City sở hữu vị tr&iacute; v&agrave;ng đắc địa với 03 mặt tiền tiếp gi&aacute;p với những con đường đẹp nhất Mỹ Đ&igrave;nh &ndash; v&ugrave;ng đất c&oacute; nhiều tiềm năng ph&aacute;t triển v&agrave; đang ng&agrave;y c&agrave;ng trở n&ecirc;n thịnh vượng.</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Nam l&agrave; đường L&ecirc; Đức Thọ</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Nam l&agrave; đường H&agrave;m Nghi</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Bắc l&agrave; đường Nguyễn Cơ Thạch</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Bắc l&agrave; c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Mai Dịch rộng 17ha</p>\r\n\r\n<p>HD Mon City nằm ở vị tr&iacute; trung t&acirc;m khu vực h&agrave;nh ch&iacute;nh nơi Mỹ Đ&igrave;nh, dự &aacute;n được thừa hưởng lợi thế từ những c&ocirc;ng tr&igrave;nh tiện &iacute;ch, hạ tầng đồng bộ, hiện đại của c&aacute;c dự &aacute;n, c&ocirc;ng tr&igrave;nh liền kề, từ c&ocirc;ng vi&ecirc;n c&acirc;y xanh, cho đến c&aacute;c tiện &iacute;ch trường học, bệnh viện, kh&aacute;ch sạn, bến xe. B&ecirc;n cạnh c&aacute;c tiện &iacute;ch nội khu, cư d&acirc;n của dự &aacute;n HD Mon City c&ograve;n được hưởng c&aacute;c tiện &iacute;ch b&ecirc;n ngo&agrave;i dự &aacute;n: như trường học (gần c&aacute;c trường đại học Thương Mại, đại học Quốc gia H&agrave; Nội, Đại học Ngoại ngữ&hellip;), bệnh viện (bệnh viện Thể thao, bệnh viện 19 &ndash; 8,&hellip;),&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 11.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601883514_20201001101310-4133_wm.jpg', '1601883514_20201001101310-4133_wm.jpg|1601883514_20201001101310-9835_wm.jpg|1601883514_20201001101310-b93e_wm.jpg|1601883514_20201001101310-da3a_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 01:21:16', '2020-10-05 07:38:34'),
(75, 'Cho thuê căn 2PN full nội thất giá 11tr tại Mỹ Đình Plaza', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-my-dinh-plaza', '140 Trần Bình, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '27', '70', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm trong khu vực ph&aacute;t triển bậc nhất quận Cầu Giấy &ndash; Mỹ Đ&igrave;nh, dự &aacute;n Mỹ Đ&igrave;nh Plaza 2 hứa hẹn sẽ đem đến cho cư d&acirc;n cuộc sống vi&ecirc;n m&atilde;n, tiện nghi, hiện đại với hệ thống tiện &iacute;ch đa dạng, c&aacute;c căn hộ thiết kế hợp l&yacute;, tinh tế.<br />\r\nTọa lạc ngay tại trung t&acirc;m Mỹ Đ&igrave;nh, Mỹ Đ&igrave;nh Plaza 2 sở hữu một vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, nơi thuận tiện kết nối giao th&ocirc;ng với c&aacute;c tuyến đường huyết mạch của th&agrave;nh phố: Phạm H&ugrave;ng &ndash; Phạm Văn Đồng, Hồ T&ugrave;ng Mậu &ndash; Xu&acirc;n Thủy &ndash; Cầu Giấy, tuyến Metro Nhổn &ndash; Ga H&agrave; Nội. Từ dự &aacute;n, c&aacute;c cư d&acirc;n cũng c&oacute; thể dễ d&agrave;ng tiếp cận đến c&aacute;c tiện &iacute;ch h&agrave;ng đầu của khu vực như TTTM The Garden, đại si&ecirc;u thị Metro, bệnh viện 198, Trung t&acirc;m Hội nghị Quốc gia, SVĐ Mỹ Đ&igrave;nh, Đại học Quốc Gia, Đại học FPT...</p>\r\n\r\n<p>Với 3 tầng hầm v&agrave; 4 tầng khối đế d&agrave;nh cho văn ph&ograve;ng, thương mại dịch vụ, dự &aacute;n hội tụ hệ thống tiện &iacute;ch cao cấp cho cư d&acirc;n: hầm để xe, trung t&acirc;m thương mại, nh&agrave; trẻ, nh&agrave; h&agrave;ng, caf&eacute;, ph&ograve;ng sinh hoạt cộng đồng. Khu&ocirc;n vi&ecirc;n tho&aacute;ng rộng, nhiều c&acirc;y xanh c&ugrave;ng với hệ thống s&acirc;n vườn, đi dạo tr&ecirc;n m&aacute;i của t&ograve;a nh&agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1600335322_12.jpg', '1601087303_1.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 01:24:08', '2020-09-26 02:28:23'),
(76, 'Cho thuê căn 2PN full nội thất giá 9tr tại CC MHDI Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-9tr-tai-cc-mhdi-my-dinh', 'Phường Mỹ Đình 2, quận Nam Từ Liêm, TP. Hà Nội', 2, '28', '70', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư MHDI 1 Mỹ Đ&igrave;nh tọa lạc tại ng&atilde; tư L&ecirc; Đức Thọ - Trần Hữu Dực thuộc Phường Mỹ Đ&igrave;nh II, Quận Nam Từ Li&ecirc;m, Th&agrave;nh Phố H&agrave; Nội.&nbsp;Nơi tập trung nhiều vận động vi&ecirc;n cấp cao, trường học quốc tế, gần khu d&acirc;n cư đ&atilde; ph&aacute;t triển v&agrave; h&igrave;nh th&agrave;nh từ l&acirc;u, tập trung nhiều văn ph&ograve;ng v&agrave; trung t&acirc;m thương mại, dịch vụ lớn như: kh&aacute;ch sạn Crown Plaza Complex, Trụ sở tập đo&agrave;n Viettel, Vạn Hoa club, si&ecirc;u thị Fivimax.&nbsp;</p>\r\n\r\n<p>Hệ thống tiện &iacute;ch được ho&agrave;n thiện đồng bộ, Chung cư MHDI Mỹ Đ&igrave;nh đ&aacute;p ứng đầy đủ cho kh&aacute;ch h&agrave;ng hệ thống tiện &iacute;ch: hệ thống trung t&acirc;m thương mại, hệ thống bể bơi bốn m&ugrave;a, khu&ocirc;n vi&ecirc;n c&acirc;y xanh, kh&ocirc;ng gian xanh rộng r&atilde;i ph&iacute;a dưới dự &aacute;n sẽ l&agrave; nơi vui chơi v&agrave; sinh hoạt cộng đồng&hellip;</p>\r\n\r\n<p>Khu trung t&acirc;m thương mại tại MHDI L&ecirc; Đức Thọ được thiết kế với kh&ocirc;ng gian rộng r&atilde;i, tho&aacute;ng m&aacute;t với nhiều thương hiệu nổi tiếng trong nước cũng như quốc tế, khu trung t&acirc;m thương mại sẽ đ&aacute;p ứng được nhu cầu mua sắm của mọi gia đ&igrave;nh.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1599704251_3.jpg', '1599704251_1.jpg|1599704251_2.jpg|1599704251_4.jpg|1599704251_5.jpg|1599704251_6.jpg|1599704251_7.jpg|1599704251_8.jpg|1599704251_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 01:28:55', '2020-09-26 02:36:21'),
(77, 'Cho thuê căn 2PN full nội thất giá 11tr tại CC Central Field Trung Kính', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-cc-central-field-trung-kinh', 'số 219 Trung Kính, Yên Hòa, quận Cầu Giấy, Hà Nội', 2, '24', '70', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự án 219 Trung Kính tọa lạc tại địa chỉ số 219 Trung K&iacute;nh phường Y&ecirc;n H&ograve;a, quận Cầu Giấy - trung t&acirc;m của kinh tế, x&atilde; hội, văn h&oacute;a, ch&iacute;nh trị v&agrave; gi&aacute;o dục của Thủ Đ&ocirc; H&agrave; Nội. Nơi đ&acirc;y kh&ocirc;ng chỉ sở hữu 1 mạng lưới giao th&ocirc;ng hiện đại, t&acirc;n tiến m&agrave; c&ograve;n l&agrave; khu vực tập trung nhiều cơ sở hạ tầng trọng điểm, c&aacute;c khu đ&ocirc; thị ph&aacute;t triển năng động của Quận Cầu Giấy. Chung cư 219 Trung K&iacute;nh c&oacute; ưu thế đặc biệt kh&ocirc;ng chỉ nhờ vị tr&iacute; đẳng cấp, cảnh quan m&ocirc;i trường c&acirc;y xanh, kh&iacute; hậu m&aacute;t mẻ ngay giữa trung t&acirc;m thủ đ&ocirc; H&agrave; Nội m&agrave; c&ograve;n được thừa hưởng hệ thống c&aacute;c tiện &iacute;ch ngoại khu vượt trội.<br />\r\n- Dự &aacute;n cũng gần ngay c&aacute;c trường học nổi tiếng H&agrave; Nội như: Trường Amsterdam, trường THPT Nguyễn Si&ecirc;u, Trường THPT Y&ecirc;n H&ograve;a, trường Lương Thế Vinh....<br />\r\n- C&aacute;c c&ocirc;ng tr&igrave;nh trọng điểm đầy cũng ch&iacute;nh l&agrave; điểm s&aacute;ng của dự &aacute;n: Chợ Trung K&iacute;nh, Viện Huyết Học, c&aacute;c trường Đại Học, Cao Đẳng trong b&aacute;n k&iacute;nh chưa đầy 2km.<br />\r\n- C&aacute;c cơ quan quan trọng của H&agrave; Nội v&agrave; ch&iacute;nh phủ như: Thanh Tra Ch&iacute;nh Phủ; Bộ Nội Vụ; Bộ T&agrave;i nguy&ecirc;n &amp; M&ocirc;i trường; Bộ Kế hoạch &amp; Đầu tư; Viện kiểm s&aacute;t nh&acirc;n d&acirc;n Tối Cao (đang x&acirc;y dựng); Tổng cục Hải Quan; Tổng cục đường bộ; Viện dầu kh&iacute; Việt Nam<br />\r\n- Nhiều bệnh viện lớn: Bệnh viện 19-8; Bệnh viện Giao Th&ocirc;ng Vận Tải TW; Bệnh viện Nhi; Bệnh viện Phụ Sản;&hellip;<br />\r\n- Chợ v&agrave; si&ecirc;u thị lớn như: Chợ Y&ecirc;n H&ograve;a, chợ Trung K&iacute;nh, Si&ecirc;u thị Fivimart, BigC Thăng Long, BigC Garden,&hellip;<br />\r\n- Khu hội nghị, vui chơi giải tr&iacute;: Trung t&acirc;m Hội nghị Quốc Gia, Bảo t&agrave;ng H&agrave; Nội, C&ocirc;ng vi&ecirc;n Cầu Giấy, C&ocirc;ng vi&ecirc;n mini Khu đ&ocirc; thị mới Y&ecirc;n H&ograve;a, Rạp chiếu phim Lotte Cinema; nhiều s&acirc;n b&oacute;ng đ&aacute; xung quanh dự &aacute;n;&hellip;<br />\r\n<br />\r\nThiết kế khu&ocirc;n vi&ecirc;n với c&aacute;c c&ocirc;ng vi&ecirc;n c&acirc;y xanh lớn kết hợp với nhiều tiện &iacute;ch gi&uacute;p cho cư d&acirc;n c&oacute; một kh&ocirc;ng gian thư gi&atilde;n ho&agrave;n hảo, đẳng cấp b&ecirc;n gia đ&igrave;nh. Trung t&acirc;m thương mại nằm từ tầng 1 tới tầng 6 của t&ograve;a nh&agrave;, bao gồm c&aacute;c thương hiệu h&agrave;ng đầu trong nước v&agrave; thế giới, c&aacute;c dịch vụ ẩm thực, spa tiện nghi, khu thể thao, khu vui chơi, khu tiện &iacute;ch c&ocirc;ng cộng như: ph&ograve;ng sinh hoạt chung, bể bơi, spa, gym, yoga, thể dục thẩm mỹ, si&ecirc;u thị, trung t&acirc;m mua sắm, nh&agrave; h&agrave;ng hay c&aacute;c dịch vụ tại nh&agrave; s&acirc;n chơi ngo&agrave;i trời tại tầng 6&hellip;..Bể bơi bốn m&ugrave;a được bố tr&iacute; tr&ecirc;n tầng 17 to&agrave; văn ph&ograve;ng l&agrave; điểm nhấn của dự &aacute;n.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600764710_4.jpg', '1600764710_1.jpg|1600764710_2.jpg|1600764710_3.jpg|1600764710_5.jpg|1600764710_6.jpg|1600764710_7.jpg|1600764710_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 01:30:28', '2020-09-26 08:52:45'),
(78, 'Cho thuê căn 2PN full nội thất giá 14tr tại Dolphin Plaza Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-14tr-tai-dolphin-plaza-my-dinh', '28 Trần Bình, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '29', '75', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Dolphin Plaza c&oacute; tọa lạc tại 28 Trần B&igrave;nh &ndash; Từ Li&ecirc;m, khu vực trung t&acirc;m đ&ocirc; thị &ndash; h&agrave;nh ch&iacute;nh mới ph&iacute;a T&acirc;y H&agrave; Nội, được thiết kế đồng bộ, ho&agrave;n chỉnh.</p>\r\n\r\n<p>Dự &aacute;n c&oacute; lợi thế nổi trội về vị tr&iacute;, cảnh quan, kh&ocirc;ng gian sống d&agrave;nh cho những chủ gia đ&igrave;nh năng động trong c&ocirc;ng việc, tinh tế trong cuộc sống. Từ Dolphin Plaza, chỉ mất 5 &ndash; 10 ph&uacute;t đi &ocirc;t&ocirc;, bạn c&oacute; thể đến: Trung t&acirc;m thể thao quốc gia, Trung t&acirc;m hội nghị Quốc gia, Đại học Quốc gia, Đại học Thương mại, Bệnh viện 19 &ndash; 8; Si&ecirc;u thị Big C, Si&ecirc;u thị Metro; Khu c&ocirc;ng vi&ecirc;n 22ha, 2 hồ điều ho&agrave; phục vụ cho cộng đồng d&acirc;n cư ph&iacute;a T&acirc;y H&agrave; Nội, Hệ thống trường học chất lượng cao như: L&ecirc; Qu&yacute; Đ&ocirc;n, Lomonoxop, Đo&agrave;n Thị Điểm&hellip;<br />\r\nDolphin Plaza cũng nằm tr&ecirc;n tuyến đường chủ đạo từ nội đ&ocirc; th&agrave;nh phố l&ecirc;n S&acirc;n bay Quốc tế Nội B&agrave;i. Với vị tr&iacute; v&agrave; giao th&ocirc;ng thuận lợi, Dolphin Plaza được đ&aacute;nh gi&aacute; l&agrave; một trong những tổ hợp căn hộ cao cấp hiện đại v&agrave; tiện nghi bậc nhất tại thủ đ&ocirc; H&agrave; Nội.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1600336148_8.jpg', '1601087943_3.jpg|1601087943_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 01:33:51', '2020-09-26 02:39:03'),
(80, 'Cho thuê căn 3PN full nội thất giá 12tr tại CC FLC Green Apartment Phạm Hùng', 'cho-thue-can-3pn-full-noi-that-gia-12tr-tai-cc-flc-green-apartment-pham-hung', '18 Đường Phạm Hùng, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '31', '85', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 85m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư FLC Green Home tọa lạc tại một trong những vị tr&iacute; đẹp nhất khu vực ph&iacute;a T&acirc;y H&agrave; Nội. Nằm tr&ecirc;n mặt đường của một trong những tuyến giao th&ocirc;ng huyết mạch v&agrave; tấp nập bậc nhất Thủ đ&ocirc;, cạnh hai c&ocirc;ng vi&ecirc;n lớn Cầu Giấy v&agrave; hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh.&nbsp;</p>\r\n\r\n<p>Từ dự &aacute;n qu&yacute; kh&aacute;ch di chuyển theo đường Xu&acirc;n Thủy Cầu Giấy để đi v&agrave;o nội th&agrave;nh c&aacute;c quận l&acirc;n cận như &ndash; Cầu Giấy &ndash; Đống Đa &ndash; Ba Đ&igrave;nh &ndash; Thanh Xu&acirc;n&hellip;Dự &aacute;n nằm tiếp gi&aacute;p ngay với tuyến đường sắt tr&ecirc;n cao sẽ tiết kiệm tối đa thời gian di chuyển của kh&aacute;ch h&agrave;ng.</p>\r\n\r\n<p>FLC Green Home nằm tiếp gi&aacute;p với rất nhiều cơ quan kinh tế &ndash; ch&iacute;nh trị &ndash; văn h&oacute;a của thủ đ&ocirc; H&agrave; Nội thuận tiện cho việc c&ocirc;ng t&aacute;c cũng như n&acirc;ng cao chất lượng cuộc sống cho cư d&acirc;n : Trung t&acirc;m hội nghị quốc gia, kh&aacute;ch sạn Grand Palaza, BigC, Trường ĐH Sư Phạm , ĐH C&ocirc;ng Nghiệp, ĐH S&acirc;n Khấu Điện Ảnh, Trường Amsetdam H&agrave; Nội&hellip; Dự &aacute;n nằm ngay cạnh bến xe Mỹ Đ&igrave;nh 1, 2 gi&uacute;p cho qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể đi c&ocirc;ng t&aacute;c cũng như về qu&ecirc; của m&igrave;nh nhanh ch&oacute;ng v&agrave; tiện lợi nhất.</p>\r\n\r\n<p>Dự &aacute;n chung cư FLC Green Home 18 Phạm H&ugrave;ng được chủ đầu tư t&iacute;ch hợp v&agrave; bố tr&iacute; những tiện &iacute;ch cực kỳ th&ocirc;ng minh v&agrave; hiện đại với mong muốn đem lại cho cư d&acirc;n tương lai một cuộc sống tiện nghi đầy đủ mang sắc th&aacute;i tận hưởng cuộc sống cho kh&aacute;ch h&agrave;ng. Tiện &iacute;ch m&agrave; những cư d&acirc;n khi về ở tại chung cư FLC Green Home được tận hưởng sẽ thật đẳng cấp với bể bơi, ph&ograve;ng kh&aacute;m cao cấp, si&ecirc;u thị, ng&acirc;n h&agrave;ng, spa, trường mầm non,&hellip;.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600396054_5.jpg', '1601088351_7.jpg|1601088351_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 01:44:11', '2020-09-26 02:45:51'),
(84, 'Cho thuê căn 3PN giá 13.5tr tại CC Hà Nội Center Point Lê Văn Lương', 'cho-thue-can-3pn-gia-135tr-tai-cc-ha-noi-center-point-le-van-luong', 'Đường Lê Văn Lương, P. Nhân Chính, Q. Thanh Xuân', 2, '33', '95', 13500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 95m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Hanoi Center Point tọa lạc ngay ng&atilde; tư hai mặt tiền L&ecirc; Văn Lương giao với Ho&agrave;ng Đạo Th&uacute;y. Chung cư H&agrave; Nội CenterPoint l&agrave; ng&ocirc;i sao s&aacute;ng trong l&ograve;ng đ&ocirc; thị Trung H&ograve;a Nh&acirc;n Ch&iacute;nh với đầy đủ c&aacute;c ti&ecirc;u ch&iacute; dịch vụ tốt, nhiều tiện &iacute;ch.&nbsp;</p>\r\n\r\n<p>Nằm tại tuyến đường huyết mạch nơi nối liền quận Thanh Xu&acirc;n &ndash; Cầu Giấy, Quận Thanh Xu&acirc;n &ndash; Đống Đa v&agrave; quận Thanh Xu&acirc;n &ndash; H&agrave; Đ&ocirc;ng. Gần c&aacute;c trường nổi tiếng như: Trường Mầm non Họa Mi, Trường tiểu học quốc tế Brendon, Trường THPT Nh&acirc;n Ch&iacute;nh, Trường Chuy&ecirc;n H&agrave; Nội Amsterdam, Trường ĐH Ph&ograve;ng ch&aacute;y Chữa ch&aacute;y, Trường ĐH Khoa học x&atilde; hội v&agrave; Nh&acirc;n Văn.</p>\r\n\r\n<p>Tiện &iacute;ch chung cư H&agrave; nội CenterPoint L&ecirc; Văn Lương gồm đầy đủ trung t&acirc;m thương mại hiện đại đ&aacute;p ứng nhu cầu mua sắm, nh&agrave; trẻ, rạp chiếu phim ti&ecirc;u chuẩn, Trung t&acirc;m thẩm mỹ, Spa, GYM r&egrave;n luyện sức khỏe v&agrave; tận hưởng từng ph&uacute;t gi&acirc;y thư gi&atilde;n&hellip; Dự &aacute;n với nhiều tiện &iacute;ch của một chung cư cao cấp như Trung t&acirc;m TM với c&aacute;c của h&agrave;ng, qu&aacute;n ẩm thực, khu vui chơi giải tr&iacute;.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1598925226_1.jpg', '1598925226_2.jpg|1598925226_3.jpg|1598925226_4.jpg|1598925226_5.jpg|1598925226_6.jpg|1598925226_7.jpg|1598925226_8.jpg|1598925226_9.jpg|1598925226_10.jpg|1598925226_11.jpg|1598925226_12.jpg|1598925226_13.jpg|1598925226_14.jpg|1598925226_15.jpg|1598925226_16.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 01:55:42', '2020-09-26 03:40:33'),
(85, 'Cho thuê căn 3PN giá 10.5tr tại CC FLC Green Apartment Phạm Hùng', 'cho-thue-can-3pn-gia-105tr-tai-cc-flc-green-apartment-pham-hung', '18 Đường Phạm Hùng, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '31', '80', 10500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, 02&nbsp;nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư FLC Green Home tọa lạc tại một trong những vị tr&iacute; đẹp nhất khu vực ph&iacute;a T&acirc;y H&agrave; Nội. Nằm tr&ecirc;n mặt đường của một trong những tuyến giao th&ocirc;ng huyết mạch v&agrave; tấp nập bậc nhất Thủ đ&ocirc;, cạnh hai c&ocirc;ng vi&ecirc;n lớn Cầu Giấy v&agrave; hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh.&nbsp;</p>\r\n\r\n<p>Từ dự &aacute;n qu&yacute; kh&aacute;ch di chuyển theo đường Xu&acirc;n Thủy Cầu Giấy để đi v&agrave;o nội th&agrave;nh c&aacute;c quận l&acirc;n cận như &ndash; Cầu Giấy &ndash; Đống Đa &ndash; Ba Đ&igrave;nh &ndash; Thanh Xu&acirc;n&hellip;Dự &aacute;n nằm tiếp gi&aacute;p ngay với tuyến đường sắt tr&ecirc;n cao sẽ tiết kiệm tối đa thời gian di chuyển của kh&aacute;ch h&agrave;ng.</p>\r\n\r\n<p>FLC Green Home nằm tiếp gi&aacute;p với rất nhiều cơ quan kinh tế &ndash; ch&iacute;nh trị &ndash; văn h&oacute;a của thủ đ&ocirc; H&agrave; Nội thuận tiện cho việc c&ocirc;ng t&aacute;c cũng như n&acirc;ng cao chất lượng cuộc sống cho cư d&acirc;n : Trung t&acirc;m hội nghị quốc gia, kh&aacute;ch sạn Grand Palaza, BigC, Trường ĐH Sư Phạm , ĐH C&ocirc;ng Nghiệp, ĐH S&acirc;n Khấu Điện Ảnh, Trường Amsetdam H&agrave; Nội&hellip; Dự &aacute;n nằm ngay cạnh bến xe Mỹ Đ&igrave;nh 1, 2 gi&uacute;p cho qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể đi c&ocirc;ng t&aacute;c cũng như về qu&ecirc; của m&igrave;nh nhanh ch&oacute;ng v&agrave; tiện lợi nhất.</p>\r\n\r\n<p>Dự &aacute;n chung cư FLC Green Home 18 Phạm H&ugrave;ng được chủ đầu tư t&iacute;ch hợp v&agrave; bố tr&iacute; những tiện &iacute;ch cực kỳ th&ocirc;ng minh v&agrave; hiện đại với mong muốn đem lại cho cư d&acirc;n tương lai một cuộc sống tiện nghi đầy đủ mang sắc th&aacute;i tận hưởng cuộc sống cho kh&aacute;ch h&agrave;ng. Tiện &iacute;ch m&agrave; những cư d&acirc;n khi về ở tại chung cư FLC Green Home được tận hưởng sẽ thật đẳng cấp với bể bơi, ph&ograve;ng kh&aacute;m cao cấp, si&ecirc;u thị, ng&acirc;n h&agrave;ng, spa, trường mầm non,&hellip;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1600395979_1.jpg', '1601088296_1.jpg|1601088296_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 01:57:40', '2020-09-26 02:44:56'),
(88, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT TẠI ECOLIFE TÂY HỒ', 'cho-thue-can-2pn-full-noi-that-tai-ecolife-tay-ho', 'Lô đất O17 - HH1 Khu đô thị mới Tây Hồ Tây, quận Tây Hồ, Hà Nội', 2, '17', '88', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 88m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Ecolife T&acirc;y Hồ được x&acirc;y dựng tr&ecirc;n &ocirc; đất O17 &ndash; HH1 trong quy hoạch chung của khu đ&ocirc; thị mới T&acirc;y Hồ T&acirc;y &ndash; T&acirc;y Hồ - H&agrave; Nội. Từ đ&acirc;y cư d&acirc;n c&oacute; thể kết nối đến h&agrave;ng loạt c&aacute;c tiện &iacute;ch hạ tầng x&atilde; hội bao quanh dự &aacute;n một c&aacute;ch dễ d&agrave;ng thuận tiện nhất.</p>\r\n\r\n<p>Đ&acirc;y l&agrave; một khu đ&ocirc; thị sầm uất tập trung nhiều cụm c&ocirc;ng tr&igrave;nh cao tầng v&agrave; l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh, thương mại, ng&acirc;n h&agrave;ng, dịch vụ... thu h&uacute;t được sự quan t&acirc;m của nhiều tập đo&agrave;n lớn, c&aacute;c c&ocirc;ng ty con trong nước v&agrave; ngo&agrave;i nước đến kinh doanh l&agrave;m việc.</p>\r\n\r\n<p>Từ dự &aacute;n Ecolife T&acirc;y Hồ kết nối dễ d&agrave;ng tới c&aacute;c điểm lớn của HN như:</p>\r\n\r\n<p>C&aacute;ch L&agrave;ng hoa đ&agrave;o Nhật T&acirc;n: 5.5km</p>\r\n\r\n<p>C&aacute;ch Lăng B&aacute;c: 6km</p>\r\n\r\n<p>C&aacute;ch Bảo t&agrave;ng D&acirc;n tộc học: 2.5 km</p>\r\n\r\n<p>C&aacute;ch si&ecirc;u thị Metro: 4km</p>\r\n\r\n<p>C&aacute;ch Bệnh Viện Thu C&uacute;c: 3km&nbsp;</p>\r\n\r\n<p>C&aacute;ch Hồ T&acirc;y: 1.5 km</p>\r\n\r\n<p>C&aacute;ch Chợ Bưởi: 2km</p>\r\n\r\n<p>C&aacute;ch c&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y: 5.5 Km</p>\r\n\r\n<p>Sự kết hợp h&agrave;i h&ograve;a giữa kiến tr&uacute;c đầy hiện đại v&agrave; kh&ocirc;ng gian xanh chung cư Ecolife T&acirc;y Hồ đ&atilde; l&agrave;m n&ecirc;n sự kh&aacute;c biệt cho dự &aacute;n n&agrave;y. Cư d&acirc;n c&oacute; thể thỏa sức mua sắm ở trung t&acirc;m thương mại v&agrave; si&ecirc;u thị sầm uất tại chung cư Ecolife T&acirc;y Hồ.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599704573_3.jpg', '1599704574_1.jpg|1599704574_2.jpg|1599704574_4.jpg|1599704574_5.jpg|1599704574_6.jpg|1599704574_7.jpg|1599704574_8.jpg|1599704574_9.jpg|1599704574_10.jpg|1599704574_11.jpg|1599704574_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 02:02:43', '2020-09-26 07:24:59'),
(97, 'Cho thuê căn 3PN giá 11tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-gia-11tr-khu-ngoai-giao-doan', 'Đường Xuân Đỉnh, Xã Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '9', '95', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 95m2, nằm tại t&ograve;a N01T1, tầng cao.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1601263431_4.jpg', '1601263431_1.jpg|1601263431_2.jpg|1601263431_3.jpg|1601263431_4.jpg|1601263431_5.jpg|1601263431_6.jpg|1601263431_7.jpg|1601263431_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28 02:42:01', '2020-09-28 03:23:51'),
(98, 'Cho thuê căn 3PN giá 9tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-gia-9tr-khu-ngoai-giao-doan', 'Đường Xuân Đỉnh, Xã Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '9', '105', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 105m2, nằm tại t&ograve;a N02T2, tầng cao.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản: giường, tủ, tủ bếp, điều hòa, nóng lạnh...', NULL, '1601001467_6.jpg', '1601001467_8.jpg|1601001467_9.jpg|1601001467_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-28