(104, 'Cho thuê căn 4PN full nội thất giá 15tr tại Dolphin Plaza Mỹ Đình', 'cho-thue-can-4pn-full-noi-that-gia-15tr-tai-dolphin-plaza-my-dinh', '28 Trần Bình, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '29', '186', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 186m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 04 ph&ograve;ng ngủ, 02 nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Dolphin Plaza c&oacute; tọa lạc tại 28 Trần B&igrave;nh &ndash; Từ Li&ecirc;m, khu vực trung t&acirc;m đ&ocirc; thị &ndash; h&agrave;nh ch&iacute;nh mới ph&iacute;a T&acirc;y H&agrave; Nội, được thiết kế đồng bộ, ho&agrave;n chỉnh.</p>\r\n\r\n<p>Dự &aacute;n c&oacute; lợi thế nổi trội về vị tr&iacute;, cảnh quan, kh&ocirc;ng gian sống d&agrave;nh cho những chủ gia đ&igrave;nh năng động trong c&ocirc;ng việc, tinh tế trong cuộc sống. Từ Dolphin Plaza, chỉ mất 5 &ndash; 10 ph&uacute;t đi &ocirc;t&ocirc;, bạn c&oacute; thể đến: Trung t&acirc;m thể thao quốc gia, Trung t&acirc;m hội nghị Quốc gia, Đại học Quốc gia, Đại học Thương mại, Bệnh viện 19 &ndash; 8; Si&ecirc;u thị Big C, Si&ecirc;u thị Metro; Khu c&ocirc;ng vi&ecirc;n 22ha, 2 hồ điều ho&agrave; phục vụ cho cộng đồng d&acirc;n cư ph&iacute;a T&acirc;y H&agrave; Nội, Hệ thống trường học chất lượng cao như: L&ecirc; Qu&yacute; Đ&ocirc;n, Lomonoxop, Đo&agrave;n Thị Điểm&hellip;<br />\r\nDolphin Plaza cũng nằm tr&ecirc;n tuyến đường chủ đạo từ nội đ&ocirc; th&agrave;nh phố l&ecirc;n S&acirc;n bay Quốc tế Nội B&agrave;i. Với vị tr&iacute; v&agrave; giao th&ocirc;ng thuận lợi, Dolphin Plaza được đ&aacute;nh gi&aacute; l&agrave; một trong những tổ hợp căn hộ cao cấp hiện đại v&agrave; tiện nghi bậc nhất tại thủ đ&ocirc; H&agrave; Nội.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 4, 2, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1598842709_3.jpg', '1598842709_1.jpg|1598842709_2.jpg|1598842709_4.jpg|1598842709_5.jpg|1598842709_6.jpg|1598842709_7.jpg|1598842709_8.jpg|1598842709_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-08-30 19:57:42', '2020-09-26 02:38:05'),
(106, 'Cho thuê căn 2PN đủ đồ văn phòng giá 8tr tại CC Thái Hà BCA Phạm Văn Đồng', 'cho-thue-can-2pn-du-do-van-phong-gia-8tr-tai-cc-thai-ha-bca-pham-van-dong', '43 Phạm Văn Đồng, P. Cổ Nhuế 2, Bắc Từ Liêm, Hà Nội', 2, '39', '70', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Th&aacute;i H&agrave; &ndash; Bộ c&ocirc;ng an Cổ Nhuế 2 tọa lạc Số 43 Phạm Văn Đồng &ndash; Quận Bắc Từ Li&ecirc;m, H&agrave; Nội sở hữu một trong những vị tr&iacute; bậc nhất H&agrave; Nội:<br />\r\nĐ&acirc;y l&agrave; vị tr&iacute; huyết mạch kết nối giao th&ocirc;ng của Thủ Đ&ocirc; bằng c&aacute;c con đường như: Ho&agrave;ng Quốc Việt đi T&acirc;y Hồ ,Hồ T&ugrave;ng Mậu, Xu&acirc;n Thuỷ kết nối quận Cầu Giấy đi Sơn T&acirc;y, đường Phạm Văn Đồng.<br />\r\nTừ vị tr&iacute; dự &aacute;n bạn dễ d&agrave;ng di chuyển thuận tiện v&agrave; nhanh ch&oacute;ng đến S&acirc;n bay Quốc Tế Nội B&agrave;i,Khu c&ocirc;ng nghiệp Thăng Long, C&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y, KĐT&nbsp;Ngoại Giao đo&agrave;n.<br />\r\nGần c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Th&agrave;nh Phố Giao Lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Mai Dịch, c&ocirc;ng Nghĩa Đ&ocirc; v&agrave; C&ocirc;ng vi&ecirc;n Cầu Giấy,&hellip;.<br />\r\nC&aacute;c si&ecirc;u thị mua sắm lớn như Metro, Vinmart,&hellip;mua sắm thả ga.<br />\r\nGần nhiều bệnh viện lớn, nhỏ như Bệnh viện E, bệnh viện 198, bệnh viện Y học cổ truyền&hellip;.<br />\r\nGần nhiều trường Đại Hoc nổi tiếng nhất tại Việt Nam như ĐH Quốc Gia, Thương Mại, Ngoại ngữ, Sư phạm, học viện B&aacute;o ch&iacute; v&agrave; Tuy&ecirc;n Truyền,&hellip;<br />\r\nTại đ&acirc;y cư d&acirc;n c&oacute; thể tận hưởng dịch vụ tiện &iacute;ch v&ocirc; c&ugrave;ng nổi bật: Hệ thống trung t&acirc;m thương mại, mua sắm được x&acirc;y dựng đồng bộ ngay dưới sảnh t&ograve;a nh&agrave;; Trung t&acirc;m tập Gym, Spa...;Khu vui chơi giải tr&iacute; cho c&aacute;c bạn nhỏ trong to&agrave;n t&ograve;a nh&agrave;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601287301_2617676119154217537.jpg', '1601287301_3455268166511769180.jpg|1601287301_3819971582227106021.jpg|1601287301_-6174566248329374653.jpg|1601287301_-8262259236560103537.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-08-30 20:20:01', '2020-09-28 10:01:41'),
(107, 'Cho thuê căn 3PN full nội thất giá 12.5tr tại Chung cư An Bình City', 'cho-thue-can-3pn-full-noi-that-gia-125tr-tai-chung-cu-an-binh-city', 'Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '5', '84', 12500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ tầng trung tại t&ograve;a A8, rộng 84m2.</p>\r\n\r\n<p>Căn hộ&nbsp;thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ,nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n An B&igrave;nh City c&oacute; vị tr&iacute; địa l&yacute; trắc địa tại số 234 Phạm Văn Đồng &nbsp;nằm trong địa giới h&agrave;nh ch&iacute;nh giữa phường Cổ Nhuế 1 Quận Bắc Từ Li&ecirc;m v&agrave; phường Mai Dịch quận Cầu Giấy.</p>\r\n\r\n<p>An B&igrave;nh city c&ograve;n t&iacute;ch hợp nhiều tiện &iacute;ch vượt trội so với c&aacute;c chung cư kh&aacute;c như: C&ocirc;ng vi&ecirc;n sinh th&aacute;i, hồ điều h&ograve;a rộng 15 ha, tuyến phố thương mại với h&agrave;ng trăm thương hiệu uy t&iacute;n, trường mầm non đạt chuẩn quốc gia,02 bể bơi ngo&agrave;i trời rộng 1200 m2. C&aacute;c c&ocirc;ng tr&igrave;nh tiện &iacute;ch đẳng cấp: Quảng trường c&aacute;c vị thần, quảng trường nhạc nước, quảng trường m&ugrave;a hạ, vườn treo&hellip;<br />\r\nVới lợi thế l&agrave; nơi giao thoa của nhiều tuyến đường giao th&ocirc;ng quan trọng: Đường V&agrave;nh đai 3, đường Ho&agrave;ng Quốc Việt k&eacute;o d&agrave;i, đường quy hoạch 40 m kết nối với khu đ&ocirc; thị T&acirc;y Hồ T&acirc;y, từ An B&igrave;nh city cư d&acirc;n c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực h&agrave;nh ch&iacute;nh v&agrave; vui chơi như: nằm ngay mặt đường Phạm Văn Đồng, di chuyển đến s&acirc;n bay Nội B&agrave;i,bến xe Nam Thăng Long chỉ mất 25 ph&uacute;t; gần C&ocirc;ng vi&ecirc;n Th&agrave;nh phố Giao lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh; gần c&aacute;c si&ecirc;u thị lớn như HC, Mega market...</p>\r\n\r\n<p>Nằm trong l&ograve;ng Khu đ&ocirc; thị Th&agrave;nh phố Giao lưu &ndash; l&agrave; khu đ&ocirc; thị mới được biết đến với hệ thống thảm thực vật xanh, sạch c&ugrave;ng với hệ thống tiện &iacute;ch cao cấp v&agrave; cơ sở hạ tầng ho&agrave;n chỉnh. Khu đ&ocirc; thị An B&igrave;nh thực sự sẽ tỏa s&aacute;ng tr&ecirc;n bầu trời ph&iacute;a T&acirc;y Bắc của trung t&acirc;m thủ đ&ocirc; H&agrave; Nội.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598845493_thumb.jpg', '1598845493_1.jpg|1598845493_2.jpg|1598845493_3.jpg|1598845493_4.jpg|1598845493_5.jpg|1598845493_6.jpg|1598845493_7.jpg|1598845493_8.jpg|1598845493_9.jpg|1598845493_10.jpg|1598845493_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 20:44:53', '2020-09-28 07:35:33'),
(108, 'Cho thuê căn 3PN giá 12tr tại Chung cư Ban cơ yếu Chính phủ - Khuất Duy Tiến', 'cho-thue-can-3pn-gia-12tr-tai-chung-cu-ban-co-yeu-chinh-phu-khuat-duy-tien', 'Ngõ 164 Khuất Duy Tiến, phường Nhân Chính, quận Thanh Xuân, Hà Nội', 2, '14', '124', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 124m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung Cư Ban Cơ Yếu &nbsp;tọa lạc tại ng&otilde; 164 Khuất Duy Tiến &ndash; quận Thanh Xu&acirc;n &ndash; th&agrave;nh phố H&agrave; Nội. Đ&acirc;y l&agrave; một trục đường quy hoạch kết nối giao th&ocirc;ng từ Nguyễn Tu&acirc;n đến Nguyễn Xiển, ngo&agrave;i ra n&oacute; c&ograve;n kết nối thuận lợi ra đường L&ecirc; Văn Lương. Giao th&ocirc;ng l&agrave; một trong những điểm mạnh của dự &aacute;n.Ph&iacute;a T&acirc;y Bắc gi&aacute;p đường L&ecirc; Văn Lương v&agrave; nh&igrave;n về ph&iacute;a c&ocirc;ng vi&ecirc;n Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, ph&iacute;a đ&ocirc;ng gi&aacute;p đường view nh&igrave;n về th&agrave;nh phố về Hapulico, ph&iacute;a T&acirc;y Nam gi&aacute;p đường view nh&igrave;n trực diện về đường Khuất Duy Tiến.<br />\r\nNgo&agrave;i ra, dự &aacute;n chung cư Ban Cơ Yếu &ndash; L&ecirc; Văn Lương tọa lạc vị tr&iacute; đắc địa n&ecirc;n những tiện &iacute;ch hạ tầng đồng bộ, cư d&acirc;n rất dễ di chuyển đến nhiều địa điểm li&ecirc;n quan đến gi&aacute;o dục v&agrave; y tế. Gần cTrường học: C&aacute;ch tiểu học Thanh Xu&acirc;n (600 m), THPT Amsterdam (1,5 km), THPT Nh&acirc;n Ch&iacute;nh (2 km), Đại học H&agrave; Nội (1 km), C&aacute;ch bệnh viện nội tiết chỉ 3,3 km, c&aacute;ch C&ocirc;ng vi&ecirc;n, hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh 500 m.<br />\r\nCuộc sống tại chung cư Ban Cơ Yếu &ndash; L&ecirc; Văn Lương được thừa hưởng kh&ocirc;ng gian xanh v&agrave; được bố tr&iacute; đầy đủ c&aacute;c tiện &iacute;ch phục vụ cho cư d&acirc;n sinh sống tại đ&acirc;y. Si&ecirc;u thị, trung t&acirc;m thương mại, nh&agrave; trẻ, trường học, khu sinh hoạt cộng đồng&hellip;tất cả đều được chủ đầu tư ch&uacute; trọng đ&aacute;p ứng đầy đủ nhất.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1598845929_1.jpg', '1598845929_2.jpg|1598845929_3.jpg|1598845929_4.jpg|1598845929_5.jpg|1598845929_6.jpg|1598845929_7.jpg|1598845929_8.jpg|1598845929_9.jpg|1598845929_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 20:52:09', '2020-09-26 03:36:47');
INSERT INTO `products` (`id`, `name`, `alias`, `address`, `product_cate_id`, `project_id`, `acreage`, `price`, `price_type`, `description`, `witdh`, `land_witdh`, `home_direction`, `bacon_direction`, `floor_number`, `room_number`, `toilet_number`, `furniture`, `legality`, `image`, `gallerys`, `video_url`, `map`, `contact_name`, `contact_address`, `contact_phone`, `contact_mobile`, `contact_email`, `status`, `publish`, `created_at`, `updated_at`) VALUES
(109, 'Cho thuê căn 2PN full nội thất giá 12tr tại Ecolife Capital Tố Hữu', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-ecolife-capital-to-huu', '58 Tố Hữu, P. Trung Văn, Q, Nam Từ Liêm, Hà Nội', 2, '40', '75', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh,ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>EcoLife Capital l&agrave; một tổ hợp bao gồm nh&agrave; ở, văn ph&ograve;ng cao cấp nằm tại ngay cửa ng&otilde; ph&iacute;a T&acirc;y thủ đ&ocirc; H&agrave; Nội với quy m&ocirc; 10.622 m2.&nbsp;Sở hữu vị tr&iacute; đắc địa tại số 58 Tố Hữu (đường L&ecirc; Văn Lương k&eacute;o d&agrave;i), Quận H&agrave; Đ&ocirc;ng&ndash; một trong những vị tr&iacute; đắc địa, c&oacute; vị thế đẹp của thủ đ&ocirc; H&agrave; Nội, trong tương lai sẽ l&agrave; khu vực trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế sầm uất nhất của H&agrave; Nội, dễ d&agrave;ng để kết nối tới Trung T&acirc;m H&agrave; Nội; hoặc đi ngoại th&agrave;nh, tới s&acirc;n bay v&agrave; kh&aacute; thuận tiện khi nằm rất gần tuyến đường v&agrave;nh đai 3 v&agrave; tuyến t&agrave;u cao tốc tr&ecirc;n cao C&aacute;t Linh&ndash; H&agrave; Đ&ocirc;ng.</p>\r\n\r\n<p>Gần c&aacute;c khu trung t&acirc;m kinh tế, t&agrave;i ch&iacute;nh lớn của H&agrave; Nội với c&aacute;c doanh nghiệp, đầy đủ c&aacute;c ng&acirc;n h&agrave;ng. Kết nối thuận tiện với c&aacute;c tuyến đường giao th&ocirc;ng quan trọng: L&ecirc; Văn Lương, đường Trần Duy Hưng, đường Khuất Duy Tiến...Trong b&aacute;n k&iacute;nh 1km l&agrave; c&aacute;c t&ograve;a văn ph&ograve;ng chuy&ecirc;n nghiệp: Nam Cường Building, H&agrave; Đ&ocirc;ng Complex Tower, Hồ Gươm Plaza.</p>\r\n\r\n<p>Thừa hưởng hệ thống 64 tiện &iacute;ch kh&eacute;p k&iacute;n như: s&acirc;n tennis, bể bơi kho&aacute;ng mặn trong nh&agrave;, ph&ograve;ng tập Gym, Spa sang trọng.... Nằm trong quần thể cảnh quan c&ocirc;ng vi&ecirc;n c&acirc;y xanh v&agrave; hồ nước, bao quanh bởi c&aacute;c địa điểm sang trọng trong th&agrave;nh phố, gồm c&aacute;c kh&aacute;ch sạn 5 sao, căn hộ cao cấp, trung t&acirc;m thương mại v&agrave; văn ph&ograve;ng cho thu&ecirc;. Kh&ocirc;ng gian văn ph&ograve;ng th&ocirc;ng tho&aacute;ng với ban c&ocirc;ng mở. Hệ thống c&aacute;c tiện &iacute;ch t&iacute;ch hợp trong c&ugrave;ng một khu sẽ mang đến cho c&aacute;n bộ, nh&acirc;n vi&ecirc;n l&agrave;m việc trong t&ograve;a nh&agrave; một m&ocirc;i trường l&agrave;m việc trẻ trung, năng động v&agrave; s&aacute;ng tạo, lựa chọn thu&ecirc; văn ph&ograve;ng quận H&agrave; Đ&ocirc;ng đ&aacute;ng quan t&acirc;m.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598846361_4.jpg', '1598846361_2.jpg|1598846361_3.jpg|1598846361_5.jpg|1598846361_6.jpg|1598846361_7.jpg|1598846361_8.jpg|1598846361_4117972df95c06025f4d.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 20:59:21', '2020-09-26 02:51:15'),
(110, 'Cho thuê căn 3PN giá 14tr tại FLC Twin Tower Cầu Giấy', 'cho-thue-can-3pn-gia-14tr-tai-flc-twin-tower-cau-giay', '265 Đường Cầu Giấy, P. Dịch Vọng, Q. Cầu Giấy, Hà Nội', 2, '41', '120', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 120m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Vị tr&iacute; FLC Twin Towers tọa lạc tại 265 Cầu Giấy, tiếp gi&aacute;p với phố Trần Đăng Ninh v&agrave; phố Ch&ugrave;a H&agrave;, nằm trong vị tr&iacute; trung t&acirc;m của tam gi&aacute;c c&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a, Nghĩa T&acirc;n v&agrave; Thủ Lệ, dự &aacute;n FLC Twin Towers sở hữu vị tr&iacute; đẹp nhất khu vực trung t&acirc;m quận Cầu Giấy.</p>\r\n\r\n<p>Tuyến đường sắt tr&ecirc;n kh&ocirc;ng đầu ti&ecirc;n tại Việt Nam kết nối trực tiếp ga số 7 từ nhiều điểm kh&aacute;c nhau trong th&agrave;nh phố. Tuyến đường sắt tr&ecirc;n cao của th&agrave;nh phố (chạy từ Nhổn về Ga H&agrave; Nội) được kết nối với dự &aacute;n tại tầng 2 của Trung t&acirc;m thương mại l&agrave; một lợi thế to lớn so với c&aacute;c dự &aacute;n kh&aacute;c, đem lại sự thuận tiện trong giao th&ocirc;ng, sự đ&ocirc;ng đ&uacute;c &amp; nhộn nhịp của nhu cầu mua sắm, l&agrave; tiền đề cho sự th&agrave;nh c&ocirc;ng của Trung t&acirc;m thương mại.</p>\r\n\r\n<p>FLC Twin Towers hứa hẹn sẽ l&agrave; đ&iacute;ch đến của những thương hiệu mua sắm h&agrave;ng đầu trong khu vực v&agrave; thế giới.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1598847029_thumb.jpg', '1598847029_1.jpg|1598847029_2.jpg|1598847029_3.jpg|1598847029_4.jpg|1598847029_5.jpg|1598847029_6.jpg|1598847029_7.jpg|1598847029_8.jpg|1598847029_9.jpg|1598847029_10.jpg|1598847029_11.jpg|1598847029_12.jpg|1598847029_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 21:10:29', '2020-09-26 09:11:52'),
(111, 'Cho thuê căn 2PN full nội thất giá 12tr tại Golden West Complex Lê Văn Thiêm', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-golden-west-complex-le-van-thiem', 'Số 2 Lê Văn Thiêm, P. Nhân Chính, Q. Thanh Xuân, Hà Nội', 2, '42', '82', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 82m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n tọa lạc tại KĐT mới &quot;Trung H&ograve;a - Nh&acirc;n Ch&iacute;nh&quot; thuộc quận Thanh Xu&acirc;n, HN, nơi đ&acirc;y giao th&ocirc;ng thuận lợi, giao thương ph&aacute;t triển, l&agrave; đầu mối giao th&ocirc;ng giữa c&aacute;c con đường V&agrave;nh đai 3 với khu C&aacute;t Linh - Giảng V&otilde;.&nbsp;</p>\r\n\r\n<p>Nằm gần c&aacute;c trung t&acirc;m đạo tạo, gi&aacute;o dục lớn, c&aacute;c trường Đại học lớn của HN như: Đại học H&agrave; Nội, Đại học Kiến Tr&uacute;c, ĐH KHXH v&agrave; Nh&acirc;n Văn, ĐH An Ninh, ĐH SP Nghệ Thuật trung ương, Đại Học Khoa Học Tự nhi&ecirc;n, HV C&ocirc;ng Nghệ Bưu Ch&iacute;nh Viễn Th&ocirc;ng, Đại Học X&acirc;y Dựng ...Nằm gần c&aacute;c trường tiểu học, trung học, phổ th&ocirc;ng như: Trường Mầm non Họa My, Trường tiểu học QT Bredon, Trường Cở Sở Phan Đ&Igrave;nh Gi&oacute;t, Trường Phổ Th&ocirc;ng Nh&acirc;n Ch&iacute;nh, Trường trung cấp Achimedes, trường PT chuy&ecirc;n Amsterdam ...</p>\r\n\r\n<p>Gần c&aacute;c bệnh viện: Bệnh viện x&acirc;y dựng, Bệnh viện Y cổ truyền (198 - BCA), Bệnh Viện Y Học Tuệ Tĩnh (Đường Nguyễn Tr&atilde;i), Bệnh viện 103 (H&agrave; Đ&ocirc;ng), Bệnh Viện Đa Khoa H&agrave; Đ&ocirc;ng, Gần viện y học h&agrave;ng kh&ocirc;ng, v&agrave; c&aacute;c t&ograve;a nh&agrave; chung cư lớn: Royal City Nguyễn Tr&atilde;i, T&ograve;a nh&agrave; KeangNam . Đồng thời nằm ngay tổ hợp c&aacute;c t&ograve;a nh&agrave; lớn như: T&ograve;a nh&agrave; Hapulico Center Building Vũ trọng phụng, T&ograve;a nh&agrave; Mandarin Garden ...<br />\r\nĐến với Golden West bạn sẽ cảm nhận được một cuộc sống ho&agrave;n mỹ nhất.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598847646_6.jpg', '1598847647_1.jpg|1598847647_2.jpg|1598847647_3.jpg|1598847647_4.jpg|1598847647_5.jpg|1598847647_7.jpg|1598847647_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 21:20:47', '2020-09-26 03:42:04'),
(112, 'Cho thuê căn 2PN full nội thất giá 13tr tại Imperia Garden Nguyễn Huy Tưởng', 'cho-thue-can-2pn-full-noi-that-gia-13tr-tai-imperia-garden-nguyen-huy-tuong', '115 Nguyễn Huy Tưởng, P. Thanh Xuân Trung,Q. Thanh Xuân, Hà Nội', 2, '43', '70', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Toạ lạc tr&ecirc;n trục đường Nguyễn Huy Tưởng thuộc Quận Thanh Xu&acirc;n &ndash; H&agrave; Nội, thuộc khu vực trung t&acirc;m kinh tế mới tại quận Thanh Xu&acirc;n &ndash; Cầu Giấy, Chung cư Imperia được hưởng trọn vẹn những li&ecirc;n kết v&ugrave;ng đầy đủ tiện &iacute;ch nhất, trường mẫu gi&aacute;o , tiểu học, trung học, đại học chỉ c&aacute;ch c&oacute; v&agrave;i chục đến v&agrave;i trăm m&eacute;t, chợ Nh&acirc;n Ch&iacute;nh, Big C&hellip;<br />\r\nTừ vị tr&iacute; của t&ograve;a nh&agrave; c&oacute; thể dễ d&agrave;ng kết nối với h&agrave;ng loạt c&aacute;c t&ograve;a chung cư cao cấp, hiện đại l&acirc;n cận như: Thăng Long Number One, Hapulico Complex, Royal City Nguyễn Tr&atilde;i, Golden Land Nguyễn Tr&atilde;i .Đặc biệt vị tr&iacute; chung cư Imperia Garden rất gần với điểm bắt t&agrave;u điện tr&ecirc;n kh&ocirc;ng dọc đường Nguyễn Tr&atilde;i, chắc chắn sẽ l&agrave;m tăng gi&aacute; trị của khu căn hộ hạng sang v&agrave; đồng bộ nhất quận Thanh Xu&acirc;n. Chỉ mất &iacute;t ph&uacute;t để đi tới c&aacute;c trục đường lớn: Đường Nguyễn Tr&atilde;i, Đường V&agrave;nh đai 3. C&aacute;c địa điểm lớn như: Si&ecirc;u thị BigC, Bến Xe Mỹ Đ&igrave;nh, S&acirc;n vận động quốc gia Mỹ Đ&igrave;nh, chung cư Grand Plaza, Chung cư 88 L&aacute;ng Hạ,&hellip;</p>\r\n\r\n<p>Được x&acirc;y dựng như một đ&ocirc; thị kiểu mẫu, Imperia Garden 203 Nguyễn Huy Tưởng mang đến cho cư d&acirc;n một hệ thống hạ tầng tiện &iacute;ch v&agrave; dịch vụ đồng bộ, kh&eacute;p k&iacute;n bao gồm: bể bơi 4 m&ugrave;a, bể bơi ngo&agrave;i trời, khu tập gym, khu vui chơi trẻ em, khu dưỡng sinh,chuỗi tiện &iacute;ch thương mại, hầm đỗ xe th&ocirc;ng minh, an ninh 3 lớp&hellip; tất cả nhằm tạo n&ecirc;n m&ocirc;i trường sống chất lượng cho cư d&acirc;n.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598848180_3.jpg', '1598848180_1.jpg|1598848180_2.jpg|1598848180_4.jpg|1598848180_5.jpg|1598848180_6.jpg|1598848180_7.jpg|1598848180_8.jpg|1598848180_9.jpg|1598848180_10.jpg|1598848180_11.jpg|1598848180_12.jpg|1598848180_13.jpg|1598848180_14.jpg|1598848180_15.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 21:29:40', '2020-09-26 03:56:55'),
(113, 'Cho thuê căn 2PN full nội thất giá 11tr tại Iris Garden Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-iris-garden-my-dinh', 'Số 30 Trần Hữu Dực, Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '10', '62', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 62m2 nằm tại t&ograve;a CT3.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Iris Garden l&agrave; tổ hợp căn hộ cao cấp, kết hợp thương mại dịch vụ, nhưng vẫn bảo đảm c&aacute;c điều kiện chặt chẽ về d&ograve;ng sản phẩm &quot;căn hộ sức khỏe&quot; của Tập đo&agrave;n Vimefulland.</p>\r\n\r\n<p>C&ocirc;ng tr&igrave;nh nằm tr&ecirc;n đường Trần Hữu Dực, trục đường huyết mạch của quận Nam Từ Li&ecirc;m, H&agrave; Nội. Chung cư c&oacute; hạ tầng đồng bộ, tầm nh&igrave;n kho&aacute;ng đạt, đối diện ngay Cung Điền kinh Thể thao Quốc gia. C&aacute;ch S&acirc;n vận động Mỹ Đ&igrave;nh 2 ph&uacute;t đi xe, c&aacute;ch bến xe Mỹ Đ&igrave;nh v&agrave; đường Phạm H&ugrave;ng 3 ph&uacute;t, đi bộ ra đường Hồ T&ugrave;ng Mậu khoảng 2 ph&uacute;t, gần c&aacute;c trường đại học như Đại học Thương Mại, Đại học Quốc Gia, Đại học Ngoại ngữ.</p>\r\n\r\n<p>Xung quanh l&agrave; c&aacute;c chung cư cao cấp như Mon City, Sun Square với đầy đủ c&aacute;c tiện &iacute;ch: nh&agrave; h&agrave;ng, ph&ograve;ng gym, s&acirc;n b&oacute;ng, rạp chiếu phim, bể bơi&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều 