(114, 'Cho thuê nhà riêng 6PN giá 20tr tại phố Đỗ Quang - Trung Hòa Nhân Chính', 'cho-thue-nha-rieng-6pn-gia-20tr-tai-pho-do-quang-trung-hoa-nhan-chinh', 'Phố Đỗ Quang,P. Trung Hòa,Q. Cầu Giấy,Hà Nội', 1, '44', '60', 20000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 60m2 x 4 tầng.<br />\r\nThiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ v&agrave; 01&nbsp;nh&agrave; vệ sinh/ 1 tầng. Tầng 1 th&ocirc;ng s&agrave;n gồm ph&ograve;ng kh&aacute;ch v&agrave; bếp.&nbsp;<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>Mặt tiền 4,5m, &ocirc; t&ocirc; đỗ cửa.&nbsp;</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>- Nh&agrave; trong ng&otilde; ph&acirc;n l&ocirc; phố Đỗ Quang, th&ocirc;ng sang phố Trần Duy Hưng, Ho&agrave;ng Đạo Th&uacute;y, khu vực nhiều văn ph&ograve;ng c&ocirc;ng ty, kinh doanh hiệu quả, hạ tầng đẹp, đồng bộ.<br />\r\n- Gần c&aacute;c trung t&acirc;m thương mại&nbsp;lớn v&agrave; c&aacute;c địa điểm nổi tiếng&nbsp;của thủ đ&ocirc;&nbsp;như si&ecirc;u thị&nbsp;Big C, Vincom Trần Duy Hưng,&nbsp;Chuy&ecirc;n Amterdam H&agrave; Nội...</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 20tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 6, 4, 'Nội thất cơ bản', NULL, '1598848973_2.jpg', '1598848973_1.jpg|1598848973_3.jpg|1598848973_4.mp4|1598848973_5.mp4|1598848973_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 21:42:53', '2020-09-26 09:12:55'),
(115, 'Cho thuê căn 1PN full nội thất giá 8tr tại Green Bay Mễ Trì', 'cho-thue-can-1pn-full-noi-that-gia-8tr-tai-green-bay-me-tri', '7 ĐCT08, P. Mễ Trì, Q. Nam Từ Liêm, Hà Nội', 2, '45', '40', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng&nbsp;40m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 01 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGọi Vinhomes Green Bay l&agrave; Vịnh Xanh trong l&ograve;ng phố bởi vị tr&iacute; trung t&acirc;m của đặc khu h&agrave;nh ch&iacute;nh mới của thủ đ&ocirc;.&nbsp;Sở hữu vị tr&iacute; v&agrave;ng tại cửa ng&otilde; ph&iacute;a T&acirc;y Thủ đ&ocirc;: 3 Ph&uacute;t tới Trung t&acirc;m Hội nghị Quốc gia, 5 Ph&uacute;t tới Trường THPT Hanoi &ndash; Amsterdam, si&ecirc;u thị Big C,7 Ph&uacute;t tới Bảo T&agrave;ng H&agrave; Nội, Bến xe Mỹ đ&igrave;nh, Tổ hợp Văn ph&ograve;ng &ndash; TTTM Vincom Nguyễn ch&iacute; Thanh, Keangnam Hanoi landmark Tower, 20 Ph&uacute;t tới s&acirc;n bay Quốc tế Nội B&agrave;i.<br />\r\nVinhomes Green Bay sở hữu hơn 100 tiện &iacute;ch, cảnh quan đa dạng, tinh tế v&agrave; được quy hoạch th&agrave;nh 17 cụm tiện &iacute;ch đan xen giữa kh&ocirc;ng gian sống xanh m&aacute;t. Đ&acirc;y l&agrave; nơi nơi mang đến những tiện &iacute;ch ho&agrave;n hảo mang ti&ecirc;u chuẩn 5 sao: Clubhouse, khu vui chơi trẻ em, đường chạy bộ ven hồ 3,6km, hồ bơi 5 sao, khu đ&aacute;nh cờ, khu dưỡng sinh, gym, thể thao, si&ecirc;u thị, nh&agrave; h&agrave;ng, trường học, thư viện,Ph&ograve;ng kh&aacute;m đa khoa quốc tế Vinmec, Trường li&ecirc;n cấp Vinschool, Si&ecirc;u thị Vinmart, Kh&ocirc;ng gian cảnh quan s&acirc;n vườn, khu vui chơi trẻ em, s&acirc;n thể thao ngo&agrave;i trời, khu đ&aacute;nh cờ, khu dưỡng sinh, vườn hoa, thảm cỏ,&hellip;<br />\r\nSống mỗi ng&agrave;y tại Vinhomes Green Bay được v&iacute; như sống mỗi ng&agrave;y tr&ecirc;n chiếc du thuyền sang trọng để kh&aacute;m ph&aacute; trọn vẹn bờ vịnh xanh tươi.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 1, 1, 'Full nội thất', NULL, '1598849568_2.jpg', '1598849568_1.jpg|1598849568_3.jpg|1598849568_4.jpg|1598849568_5.jpg|1598849568_6.jpg|1598849568_7.jpg|1598849568_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 21:52:48', '2020-09-26 02:59:28'),
(116, 'Cho thuê căn 2PN full nội thất giá 13tr tại Sun Square Lê Đức Thọ', 'cho-thue-can-2pn-full-noi-that-gia-13tr-tai-sun-square-le-duc-tho', '21 Đường Lê Đức Thọ, P. Mỹ Đình,Q. Từ Liêm, Hà Nội', 2, '46', '90', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng&nbsp;90m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Sun Square tọa lạc tại số 21 đường L&ecirc; Đức Thọ, Mỹ Đ&igrave;nh II, quận Nam Từ Li&ecirc;m &ndash; được coi l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh, văn h&oacute;a , kinh tế, x&atilde; hội của TP H&agrave; Nội v&agrave; cả nước. Hơn thế nữa đ&acirc;y c&ograve;n l&agrave; điểm nối giao th&ocirc;ng quan trọng tr&ecirc;n trục đường v&agrave;nh đai 3, Ho&agrave;ng Quốc Việt, L&aacute;ng H&ograve;a Lạc, đường 32&hellip; Nhờ vậy m&agrave; cư d&acirc;n của dự &aacute;n sẽ rất thuận lợi trong việc đi lại cũng như tiếp cận dễ d&agrave;ng với c&aacute;c tiện &iacute;ch của khu vực.</p>\r\n\r\n<p>Xung quanh dự &aacute;n cũng tập trung nhiều tổ hợp căn hộ, văn ph&ograve;ng cao cấp như Vinhomes Gardenia, Goldmark City, The Matrix One, HD Mon...C&aacute;c &ldquo;điểm đến&rdquo; trong b&aacute;n k&iacute;nh 1km như: S&acirc;n vận động Quốc gia Mỹ Đ&igrave;nh, Bảo t&agrave;ng H&agrave; Nội, Trung t&acirc;m Hội nghị Quốc gia, Trường ĐH Thương mại, Học Viện B&aacute;o Ch&iacute; V&agrave; Tuy&ecirc;n Truyền, Bệnh viện 198 &nbsp;&ndash; Bộ C&ocirc;ng an, bệnh viện Y học cổ truyền, bệnh viện thể dục thể thao.</p>\r\n\r\n<p>Dự &aacute;n là qu&acirc;̀n th&ecirc;̉ các c&ocirc;ng trình: Văn phòng và nhà ở cao c&acirc;́p,Trung t&acirc;m thương mại với các thương hi&ecirc;̣u hàng đ&acirc;̀u th&ecirc;́ giới, Khu Club House ti&ecirc;u chuẩn quốc tế với bể bơi bốn m&ugrave;a, yoga, gym, spa, caf&eacute;&hellip;Trường học ti&ecirc;u chuẩn quốc tế, Khu&ocirc;n vi&ecirc;n c&acirc;y xanh, đường đi dạo v&agrave; khu vui chơi giải tr&iacute; cho trẻ em, Hệ thống tầng hầm đỗ xe rộng r&atilde;i v&agrave; an to&agrave;n...</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598850056_4.jpg', '1598850057_1.jpg|1598850057_2.jpg|1598850057_3.jpg|1598850057_5.jpg|1598850057_6.jpg|1598850057_7.jpg|1598850057_8.jpg|1598850057_9.jpg|1598850057_10.jpg|1598850057_11.jpg|1598850057_12.jpg|1598850057_13.jpg|1598850057_14.jpg|1598850057_15.jpg|1598850057_16.jpg|1598850057_17.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 22:00:57', '2020-09-26 03:02:05'),
(119, 'Cho thuê căn 3PN giá 10.3tr tại Học Viện Quốc Phòng - Hoàng Quốc Việt', 'cho-thue-can-3pn-gia-103tr-tai-hoc-vien-quoc-phong-hoang-quoc-viet', 'Ngõ 20 Hoàng Quốc Việt, phường Xuân La, Tây Hồ, Hà Nội', 2, '36', '106', 10300000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ tầng cao tại t&ograve;a th&aacute;p t&acirc;y,&nbsp;rộng 106m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Được x&acirc;y dựng tr&ecirc;n &Ocirc; đất 017-HH2 trong quy hoạch chung của khu đ&ocirc; thị mới T&acirc;y Hồ T&acirc;y, quận T&acirc;y Hồ, H&agrave; Nội, Chung cư Học Viện Quốc Ph&ograve;ng c&oacute; thể dễ d&agrave;ng kết nối với h&agrave;ng loạt c&aacute;c tiện &iacute;ch hạ tầng x&atilde; hội bao quanh dự &aacute;n.</p>\r\n\r\n<p>Đ&acirc;y l&agrave; khu đ&ocirc; thị sầm uất, tập trung rất nhiều cụm c&ocirc;ng tr&igrave;nh cao tầng, trung t&acirc;m t&agrave;i ch&iacute;nh, thương mại, ng&acirc;n h&agrave;ng, dịch vụ quốc tế,... thu h&uacute;t số lượng lớn c&aacute;c tập đo&agrave;n, c&aacute;c c&ocirc;ng ty trong v&agrave; ngo&agrave;i nước đến kinh doanh, l&agrave;m việc. Với vị tr&iacute; đắc địa, hệ thống giao th&ocirc;ng thuận lợi, kh&ocirc;ng gian rộng, đ&oacute;n gi&oacute; v&agrave; &aacute;nh s&aacute;ng từ Hồ T&acirc;y, Chung cư Học Viện Quốc Ph&ograve;ng l&agrave; sự lựa chọn ho&agrave;n hảo cho cuộc sống b&igrave;nh y&ecirc;n.<br />\r\n&nbsp;B&ecirc;n cạnh điểm vượt trội trong thiết kế căn hộ l&agrave; gi&aacute; trị cộng hưởng hệ thống dịch vụ tiện &iacute;ch đa dạng trong một tổng thể kh&eacute;p k&iacute;n. Cư d&acirc;n Học Viện Quốc Ph&ograve;ng sẽ được tận hưởng một cuộc sống xanh với bản h&ograve;a ca thi&ecirc;n nhi&ecirc;n bao quanh từng kh&ocirc;ng gian sống, cộng hưởng với c&aacute;c dịch vụ v&agrave; tiện &iacute;ch ho&agrave;n hảo,&hellip; Trung t&acirc;m thương mại, trường mầm non, hệ thống s&acirc;n vườn, đường dạo, bể bơi, khu vui chơi trẻ em, s&acirc;n tập thể thao, hồ điều h&ograve;a,&hellip; được đầu tư v&agrave; x&acirc;y dựng theo ti&ecirc;u chuẩn quốc tế.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;<br />\r\nGi&aacute; thu&ecirc;: 10.3tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1598857143_thumb.jpg', '1598857143_1.jpg|1598857143_2.jpg|1598857143_3.jpg|1598857143_4.jpg|1598857143_5.jpg|1598857143_6.jpg|1598857143_7.jpg|1598857143_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-30 23:59:03', '2020-09-26 07:48:59'),
(121, 'Cho thuê căn 3PN full nội thất giá 15tr tại CC Gold Season Nguyễn Tuân', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-cc-gold-season-nguyen-tuan', '47 đường Nguyễn Tuân, Thanh Xuân Trung, Thanh Xuân, Hà Nội', 2, '49', '107', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 107m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n Gold Season tọa lạc tại vị tr&iacute; đắc địa Q.Thanh Xuận, nơi c&oacute; giao th&ocirc;ng thuận lợi, cơ sở hạ tầng đồng bộ, hệ thống gi&aacute;o dục TOP đầu H&agrave; Nội. Mua sắm, vui chơi giải tr&iacute; v&agrave; di chuyển dễ d&agrave;ng bằng c&aacute;c con đường huyết mạch: L&ecirc; Văn Lương, Nguyễn Tr&atilde;i, Trần Duy Hưng, L&aacute;ng, V&agrave;nh đại 3.<br />\r\nNgo&agrave;i ra với lợi thế nằm tr&ecirc;n tuyến xe Bus nhanh BRT đ&atilde; đi v&agrave;o hoạt đồng, tuyến t&agrave;u điện tr&ecirc;n cao sắp đưa v&agrave;o vận h&agrave;nh.&nbsp;<br />\r\nSống tại Gold Season cư d&acirc;n được hưởng tới 99 tiện &iacute;ch kh&aacute;c nhau, với an ninh 3 lớp kh&eacute;p k&iacute;n an to&agrave;n tuyệt đối, hệ thống quản l&yacute; t&ograve;a nh&agrave; th&ocirc;ng minh, hệ thống ph&ograve;ng ch&aacute;y tự động, đơn vị quản l&yacute; t&ograve;a nh&agrave; chuy&ecirc;n nghiệp. Điểm nhấn của dự &aacute;n l&agrave; c&ocirc;ng vi&ecirc;n Manhattan, đ&acirc;y được v&iacute; như l&aacute; phổi xanh của dự &aacute;n. Nơi sẽ đ&acirc;y diễn ra mọi hoạt đồng ngo&agrave;i trời của cư d&acirc;n từ giải tr&iacute;, thể thao đến thư gi&atilde;n.</p>\r\n\r\n<p>Ngo&agrave;i ra dự &aacute;n Gold Season c&ograve;n được đầu tư ri&ecirc;ng một trường học mẫu gi&aacute;o chất lượng cao d&agrave;nh ri&ecirc;ng cho con em cư d&acirc;n, được kết nối trực tiếp với c&ocirc;ng vi&ecirc;n tạo m&ocirc;i trường mở trong c&aacute;c hoạt đồng ngo&agrave;i trời.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598858138_2.jpg', '1598858138_1.jpg|1598858138_2.jpg|1598858138_3.jpg|1598858138_4.jpg|1598858138_5.jpg|1598858138_6.jpg|1598858138_7.jpg|1598858138_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 00:15:38', '2020-09-26 03:58:31'),
(122, 'Cho thuê căn 4PN full nội thất giá 25tr tại Goldmark City Hồ Tùng Mậu', 'cho-thue-can-4pn-full-noi-that-gia-25tr-tai-goldmark-city-ho-tung-mau', '136 Hồ Tùng Mậu, Phường Phú Diễn, Bắc Từ Liêm, Hà Nội', 2, '8', '169', 25000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ tầng thấp rộng 169m2.<br />\r\nCăn hộ&nbsp;thiết kế hợp l&yacute; bao gồm 04 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất cao cấp gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, n&oacute;ng lạnh, giường, sopha, đệm, tủ bếp,h&uacute;t m&ugrave;i, b&agrave;n ăn..</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Tọa lạc tại vị tr&iacute; đắc địa, nơi sẽ l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế của Thủ đ&ocirc; trong tương lai, đầu mối trung t&acirc;m kết nối c&aacute;c trục đường lớn. GoldMark City &ndash; nằm ngay tr&ecirc;n mặt đường Nguyễn Cơ Thạch k&eacute;o d&agrave;i, đối diện khu c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a Mai Dịch gần 2 ha đ&atilde; được quy hoạch. Một vị tr&iacute; đắc địa, một điểm cộng vượt trội cho Goldmark City.</p>\r\n\r\n<p>Đặc biệt, đ&acirc;y cũng l&agrave; nơi tập trung tất cả c&aacute;c tuyến xe li&ecirc;n tỉnh, đặc biệt l&agrave; c&aacute;c tỉnh ph&iacute;a Đ&ocirc;ng, ph&iacute;a Nam Thủ đ&ocirc; như Bắc Ninh, Hưng Y&ecirc;n, Hải Dương, H&agrave; Nam, Ninh B&igrave;nh, Th&aacute;i B&igrave;nh, Nam Định, Thanh H&oacute;a, Nghệ An&hellip;</p>\r\n\r\n<p>Dễ d&agrave;ng di chuyển đến c&aacute;c địa điểm bệnh viện, trường đại học, bến xe: C&aacute;ch Đại học Thương Mại, Đại học S&acirc;n khấu Điện ảnh, Đại học Quốc Gia, Đại học Ngoại ngữ 0.3km; C&aacute;ch bệnh viện 198 0.9km; đi xe m&aacute;y đến S&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3p;gần c&aacute;c si&ecirc;u thị Fivimart, Pico Plaza, Media mart&hellip; Chung cư TNR GoldMark City t&iacute;ch hợp hơn 20 tiện &iacute;ch đẳng cấp như: Khu vui chơi trẻ em, Trung t&acirc;m thương mại hiện đại, Bar &ndash; Caf&eacute;, Vườn BBQ ngo&agrave;i trời, Spa thư gi&atilde;n &ndash; X&ocirc;ng hơi, Ph&ograve;ng tập Gym hiện đại&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 25tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 4, 2, 'Full nội thất cao cấp', NULL, '1598858537_2.jpg', '1598858538_1.jpg|1598858538_3.jpg|1598858538_4.jpg|1598858538_5.jpg|1598858538_6.jpg|1598858538_7.jpg|1598858538_8.jpg|1598858538_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 00:22:18', '2020-09-28 07:40:29'),
(123, 'Cho thuê nhà riêng 3PN full nội thất giá 16tr tại phố Phùng Chí Kiên - Cầu Giấy', 'cho-thue-nha-rieng-3pn-full-noi-that-gia-16tr-tai-pho-phung-chi-kien-cau-giay', 'Phố Phùng Chí Kiên, P. Nghĩa Đô, Q. Cầu Giấy, Hà Nội', 1, '50', '55', 16000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 55m2 x 4&nbsp;tầng.</p>\r\n\r\n<p>Thiết kế&nbsp;bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng. Tầng 1 th&ocirc;ng s&agrave;n.&nbsp;Nh&agrave; c&oacute; garo &ocirc; t&ocirc;,mặt tiền rộng &ocirc; t&ocirc; đỗ cửa.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nh&agrave; nằm tại mặt phố Ph&ugrave;ng Ch&iacute; Ki&ecirc;n, dễ d&agrave;ng di chuyển đến c&aacute;c tuyến đường ch&iacute;nh của th&agrave;nh phố như: Ho&agrave;ng Quốc Việt, Cầu Giấy, Trần Đăng Ninh. Gần Chợ Bưởi, Chợ Nghĩa T&acirc;n, C&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;, C&ocirc;ng an Quận Cầu Giấy, Bệnh viện E...v&agrave; nhiều trung t&acirc;m thương mại,h&agrave;nh ch&iacute;nh kh&aacute;c.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;16tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 3, 'Full nội thất', NULL, '1598859008_thumb.jpg', '1598859008_1.jpg|1598859008_2.jpg|1598859008_3.jpg|1598859008_4.jpg|1598859008_5.jpg|1598859008_6.jpg|1598859008_7.jpg|1598859008_8.jpg|1598859008_thumb.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 00:30:08', '2020-09-26 09:13:55'),
(124, 'Cho thuê căn 3PN full nội thất giá 12.5tr tại Thăng Long Number One - Đại lộ Thăng Long', 'cho-thue-can-3pn-full-noi-that-gia-125tr-tai-thang-long-number-one-dai-lo-thang-long', 'Số 1 Đại lộ Thăng Long,P. Mễ Trì, Q. Nam Từ Liêm, Hà Nội', 2, '51', '120', 12500000, 0, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 120m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ,nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTọa lạc tại Số 1 Đại lộ Thăng Long &ndash; đại lộ hiện đại nhất Việt Nam, Thăng Long Number One ở t&acirc;m của c&aacute;c hệ thống giao th&ocirc;ng đường bộ, đường cao tốc tr&ecirc;n cao, hệ thống t&agrave;u điện tr&ecirc;n cao c&ugrave;ng với Khu li&ecirc;n cơ h&agrave;nh ch&iacute;nh của H&agrave; nội v&agrave; 64 tỉnh th&agrave;nh, trung t&acirc;m ch&iacute;nh trị, t&agrave;i ch&iacute;nh b&aacute;n lẻ, văn h&oacute;a &ndash; thể thao h&agrave;ng đầu của đất nước như: Trung t&acirc;m Hội nghị Quốc gia, si&ecirc;u thị big C, Tổ hợp thể thao Mỹ Đ&igrave;nh, Trung t&acirc;m thương mại Grand Plaza&hellip;</p>\r\n\r\n<p>Đ&acirc;y cũng l&agrave; điểm giao giữa c&aacute;c khu đ&ocirc; thị mới của Ph&iacute;a T&acirc;y v&agrave; Ph&iacute;a Bắc th&agrave;nh phố như: Khu đ&ocirc; thị Mỹ Đ&igrave;nh, Trung H&ograve;a, Nam An Kh&aacute;nh, Bắc An Kh&aacute;nh Splendora, Dương Nội, Văn Kh&ecirc;&hellip; Với chiến lược ph&aacute;t triển đ&ocirc; thị về ph&iacute;a T&acirc;y th&agrave;nh phố, Thăng Long Number One nằm ở ch&iacute;nh giữa d&ograve;ng chảy ch&iacute;nh trị &ndash; kinh tế &ndash; văn h&oacute;a ng&agrave;y c&agrave;ng phong ph&uacute;.</p>\r\n\r\n<p>Dự &aacute;n nằm ở trung t&acirc;m của 3 c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a: s&aacute;t c&ocirc;ng vi&ecirc;n hồ Mễ Tr&igrave;, nh&igrave;n ra c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh, hồ Ph&ugrave;ng Khoang. Nằm đối diện Trung t&acirc;m hội nghị Quốc gia&hellip; n&ecirc;n c&oacute; kh&ocirc;ng gian tho&aacute;ng đ&atilde;ng v&agrave; tầm nh&igrave;n rộng, đem lại kh&ocirc;ng gian sống trong l&agrave;nh v&agrave; thoải m&aacute;i.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598859472_11.jpg', '1598859472_1.jpg|1598859472_2.jpg|1598859472_3.jpg|1598859472_4.jpg|1598859472_5.jpg|1598859472_6.jpg|1598859472_7.jpg|1598859472_8.jpg|1598859472_9.jpg|1598859472_10.jpg|1598859472_12.jpg|1598859472_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 00:37:52', '2020-09-26 03:04:12'),
(125, 'Cho thuê nhà riêng 7 tầng có thang máy 6PN làm văn phòng giá 60tr tại phố Tô Hiệu - Cầu Giấy', 'cho-thue-nha-rieng-7-tang-co-thang-may-6pn-lam-van-phong-gia-60tr-tai-pho-to-hieu-cau-giay', 'Phố Tô Hiệu, P. Nghĩa Tân, Q. Cầu Giấy, Hà Nội', 1, '52', '70', 60000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nNh&agrave;&nbsp;7 tầng c&oacute; thang m&aacute;y,&nbsp;rộng 70m2/tầng.&nbsp;</p>\r\n\r\n<p>Thiết kế&nbsp;bao gồm 06 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Tầng 1, tầng 2 th&ocirc;ng s&agrave;n. Cho thu&ecirc; l&agrave;m ăn ph&ograve;ng, trung t&acirc;m dạy học, spa...<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tại mặt phố T&ocirc; Hiệu - Cầu Giấy, con phố kinh doanh dịch vụ ăn uống nổi tiếng tại H&agrave; Nội. Di chuyển dễ d&agrave;ng ra c&aacute;c đường lớn như Ho&agrave;ng Quốc Việt, Cầu Giấy, Nguyễn Văn Huy&ecirc;n, Xu&acirc;n Thủy...</p>\r\n\r\n<p>Gần C&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;, Ch&ugrave;a H&agrave;,&nbsp;Trường THPT Cầu Giấy, THCS Dịch Vọng, Đại học Thủ đ&ocirc; H&agrave; Nội... Thuận tiện cho l&agrave;m văn ph&ograve;ng hoặc kinh doanh dịch vụ.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 60tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 6, 6, 'Full nội thất', NULL, '1598859992_2.jpg', '1598859992_1.jpg|1598859992_3.jpg|1598859992_4.jpg|1598859992_5.jpg|1598859992_6.jpg|1598859992_7.jpg|1598859992_8.jpg|1598859992_9.jpg|1598859992_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 00:46:32', '2020-09-26 09:14:49'),
(126, 'Cho thuê căn 3PN full nội thất giá 12tr tại CC Học Viện Quốc Phòng - Hoàng Quốc Việt', 'cho-thue-can-3pn-full-noi-that-gia-12tr-tai-cc-hoc-vien-quoc-phong-hoang-quoc-viet', 'Ngõ 20 Hoàng Quốc Việt, phường Xuân La, Tây Hồ, Hà Nội', 2, '36', '136', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ tầng trung&nbsp;rộng&nbsp;136m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Được x&acirc;y dựng tr&ecirc;n &Ocirc; đất 017-HH2 trong quy hoạch chung của khu đ&ocirc; thị mới T&acirc;y Hồ T&acirc;y, quận T&acirc;y Hồ, H&agrave; Nội, Chung cư Học Viện Quốc Ph&ograve;ng c&oacute; thể dễ d&agrave;ng kết nối với h&agrave;ng loạt c&aacute;c tiện &iacute;ch hạ tầng x&atilde; hội bao quanh dự &aacute;n.</p>\r\n\r\n<p>Đ&acirc;y l&agrave; khu đ&ocirc; thị sầm uất, tập trung rất nhiều cụm c&ocirc;ng tr&igrave;nh cao tầng, trung t&acirc;m t&agrave;i ch&iacute;nh, thương mại, ng&acirc;n h&agrave;ng, dịch vụ quốc tế,... thu h&uacute;t số lượng lớn c&aacute;c tập đo&agrave;n, c&aacute;c c&ocirc;ng ty trong v&agrave; ngo&agrave;i nước đến kinh doanh, l&agrave;m việc. Với vị tr&iacute; đắc địa, hệ thống giao th&ocirc;ng thuận lợi, kh&ocirc;ng gian rộng, đ&oacute;n gi&oacute; v&agrave; &aacute;nh s&aacute;ng từ Hồ T&acirc;y, Chung cư Học Viện Quốc Ph&ograve;ng l&agrave; sự lựa chọn ho&agrave;n hảo cho cuộc sống b&igrave;nh y&ecirc;n.<br />\r\n&nbsp;<br />\r\nB&ecirc;n cạnh điểm vượt trội trong thiết kế căn hộ l&agrave; gi&aacute; trị cộng hưởng hệ thống dịch vụ tiện &iacute;ch đa dạng trong một tổng thể kh&eacute;p k&iacute;n. Cư d&acirc;n Học Viện Quốc Ph&ograve;ng sẽ được tận hưởng một cuộc sống xanh với bản h&ograve;a ca thi&ecirc;n nhi&ecirc;n bao quanh từng kh&ocirc;ng gian sống, cộng hưởng với c&aacute;c dịch vụ v&agrave; tiện &iacute;ch ho&agrave;n hảo,&hellip; Trung t&acirc;m thương mại, trường mầm non, hệ thống s&acirc;n vườn, đường dạo, bể bơi, khu vui chơi trẻ em, s&acirc;n tập thể thao, hồ điều h&ograve;a,&hellip; được đầu tư v&agrave; x&acirc;y dựng theo ti&ecirc;u chuẩn quốc tế.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;<br />\r\nGi&aacute; thu&ecirc;: 12/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598860757_thumb.jpg', '1598860758_2.jpg|1598860758_3.jpg|1598860758_4.jpg|1598860758_5.jpg|1598860758_6.jpg|1598860758_7.jpg|1598860758_8.jpg|1598860758_9.jpg|1598860758_4583645823713997451.mp4', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 00:59:19', '2020-09-26 07:48:07'),
(127, 'Cho thuê căn 3PN full nội thất giá 17tr tại Center Point Lê Văn Lương', 'cho-thue-can-3pn-full-noi-that-gia-17tr-tai-center-point-le-van-luong', '27 Lê Văn Lương, P. Nhân Chính, Q. Thanh Xuân, Hà Nội', 2, '33', '91', 17000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 91m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Hanoi Center Point tọa lạc ngay ng&atilde; tư hai mặt tiền L&ecirc; Văn Lương giao với Ho&agrave;ng Đạo Th&uacute;y. Chung cư H&agrave; Nội CenterPoint l&agrave; ng&ocirc;i sao s&aacute;ng trong l&ograve;ng đ&ocirc; thị Trung H&ograve;a Nh&acirc;n Ch&iacute;nh với đầy đủ c&aacute;c ti&ecirc;u ch&iacute; dịch vụ tốt, nhiều tiện &iacute;ch.&nbsp;</p>\r\n\r\n<p>Nằm tại tuyến đường huyết mạch nơi nối liền quận Thanh Xu&acirc;n &ndash; Cầu Giấy, Quận Thanh Xu&acirc;n &ndash; Đống Đa v&agrave; quận Thanh Xu&acirc;n &ndash; H&agrave; Đ&ocirc;ng. Gần c&aacute;c trường nổi tiếng như: Trường Mầm non Họa Mi, Trường tiểu học quốc tế Brendon, Trường THPT Nh&acirc;n Ch&iacute;nh, Trường Chuy&ecirc;n H&agrave; Nội Amsterdam, Trường ĐH Ph&ograve;ng ch&aacute;y Chữa ch&aacute;y, Trường ĐH Khoa học x&atilde; hội v&agrave; Nh&acirc;n Văn.</p>\r\n\r\n<p>Tiện &iacute;ch chung cư H&agrave; nội CenterPoint L&ecirc; Văn Lương gồm đầy đủ trung t&acirc;m thương mại hiện đại đ&aacute;p ứng nhu cầu mua sắm, nh&agrave; trẻ, rạp chiếu phim ti&ecirc;u chuẩn, Trung t&acirc;m thẩm mỹ, Spa, GYM r&egrave;n luyện sức khỏe v&agrave; tận hưởng từng ph&uacute;t gi&acirc;y thư gi&atilde;n&hellip; Dự &aacute;n với nhiều tiện &iacute;ch của một chung cư cao cấp như Trung t&acirc;m TM với c&aacute;c của h&agrave;ng, qu&aacute;n ẩm thực, khu vui chơi giải tr&iacute;.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 17tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598861367_thumb.jpg', '1598861367_1.jpg|1598861367_2.jpg|1598861367_3.jpg|1598861367_4.jpg|1598861367_5.jpg|1598861367_6.jpg|1598861367_7.jpg|1598861367_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 01:09:27', '2020-09-26 03:40:07'),
(128, 'Cho thuê căn 2PN full nội thất giá 9.5tr tại KĐT Nghĩa Đô', 'cho-thue-can-2pn-full-noi-that-gia-95tr-tai-kdt-nghia-do', 'Phố Trần Cung, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '35', '60', 9500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ tầng trung rộng 60m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; với hạ tầng kỹ thuật đồng bộ, tạo cảnh quan đẹp cho khu vực sẽ l&agrave; trung t&acirc;m mới của Thủ đ&ocirc; trong tương lai.&nbsp;Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; kh&ocirc;ng chỉ c&oacute; gi&aacute; trị cao về kh&ocirc;ng gian kiến tr&uacute;c, chất lượng c&ocirc;ng tr&igrave;nh m&agrave; c&ograve;n c&ograve;n sở hữu vị tr&iacute; đắc địa v&agrave; n&eacute;t đặc trưng m&agrave; &iacute;t dự &aacute;n c&oacute; được.</p>\r\n\r\n<p>Khu đ&ocirc; thị Nghĩa Đ&ocirc; nằm trong mạng lưới giao th&ocirc;ng huyết mạch khu vực T&acirc;y Nam H&agrave; Nội, s&aacute;t tuyến đường v&agrave;nh đai 2 v&agrave; kh&ocirc;ng qu&aacute; xa so với đường v&agrave;nh đai 3, chỉ c&aacute;ch đường Ho&agrave;ng Quốc Việt khoảng 200m, c&aacute;ch chợ Bưởi hơn 1 km, gần c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc; v&agrave; gần 6 tuyến đường lớn như Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt, Phạm Văn Đồng, Nguyễn Ho&agrave;ng T&ocirc;n, Trần Cung, Lạc Long Qu&acirc;n.</p>\r\n\r\n<p>Khu đ&ocirc; thị c&oacute; thiết kế tho&aacute;ng, hệ thống c&acirc;y xanh v&agrave; đường dạo bộ, mật độ x&acirc;y dựng khoảng 30-32%, c&oacute; cơ sở hạ tầng đồng bộ. Ngo&agrave;i ra, Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; nằm cạnh trục đường 40m hiện đang thi c&ocirc;ng, đối diện với hồ điều h&ograve;a rộng 4,9ha của dự &aacute;n Starlake (dự &aacute;n T&acirc;y Hồ T&acirc;y cũ) n&ecirc;n cư d&acirc;n nơi đ&acirc;y sẽ được hưởng lợi chung hạ tầng n&agrave;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 9.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598861675_3.jpg', '1601286279_1.jpg|1601286279_2.jpg|1601286279_3.jpg|1601286279_4.jpg|1601286279_5.jpg|1601286279_6.jpg|1601286279_7.jpg|1601286279_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 01:14:36', '2020-09-28 09:44:39'),
(129, 'Cho thuê căn 3PN full nội thất giá 13tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-full-noi-that-gia-13tr-khu-ngoai-giao-doan', 'Đường Xuân Đỉnh, Xã Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '9', '95', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 95m2, nằm tại t&ograve;a N01T1.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1598862073_6.jpg', '1598862073_1.jpg|1598862073_2.jpg|1598862073_3.jpg|1598862073_4.jpg|1598862073_5.jpg|1598862073_7.jpg|1598862073_8.jpg|1598862073_9.jpg|1598862073_10.jpg|1598862073_11.jpg|1598862073_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 01:21:13', '2020-09-25 03:04:33');
