(131, 'Cho thuê căn 2PN full nội thất giá 12tr tại CC FLC Complex Phạm Hùng', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-cc-flc-complex-pham-hung', '36 Phạm Hùng, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '32', '70', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp....<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Vị tr&iacute; của dự &aacute;n FLC Complex được xem l&agrave; một những vị tr&iacute; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội. Nằm tr&ecirc;n mặt đường của một trong những n&uacute;t giao th&ocirc;ng huyết mạch tấp nập h&agrave;ng đầu thu đ&ocirc; H&agrave; Nội. Căn hộ nằm ngay cạnh hai c&ocirc;ng vi&ecirc;n lớn Cầu Giấy v&agrave; Nh&acirc;n Ch&iacute;nh. Dự &aacute;n cũng được bao quanh bởi c&aacute;c khu văn ph&ograve;ng cao cấp như phố Duy T&acirc;n, KeangNam, Indochina Plaza c&ugrave;ng với c&aacute;c trường học v&agrave; bệnh viện.</p>\r\n\r\n<p>Dự &aacute;n nằm tiếp gi&aacute;p ngay với tuyến đường sắt tr&ecirc;n cao sẽ tiết kiệm tối đa thời gian di chuyển của kh&aacute;ch h&agrave;ng. Dự &aacute;n nằm ngay cạnh bến xe Mỹ Đ&igrave;nh 1, 2 gi&uacute;p cho qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể đi c&ocirc;ng t&aacute;c cũng như về qu&ecirc; của m&igrave;nh nhanh ch&oacute;ng v&agrave; tiện lợi nhất. FLC Complex nằm tiếp gi&aacute;p với rất nhiều cơ quan kinh tế &ndash; ch&iacute;nh trị &ndash; văn h&oacute;a của thủ đ&ocirc; H&agrave; Nội thuận tiện cho việc c&ocirc;ng t&aacute;c cũng như n&acirc;ng cao chất lượng cuộc sống cho cư d&acirc;n : Trung t&acirc;m hội nghị quốc gia, kh&aacute;ch sạn Grand Palaza, BigC, Trường ĐH Sư Phạm , ĐH C&ocirc;ng Nghiệp, ĐH S&acirc;n Khấu Điện Ảnh, Trường Amsetdam H&agrave; Nội&hellip;</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch xung quanh t&ograve;a chung cư FLC Complex 36 Phạm H&ugrave;ng đều to&aacute;t l&ecirc;n một kh&ocirc;ng gian sống ti&ecirc;n nghi, thư gi&atilde;n nghỉ ngơi sau những giờ l&agrave;m việc căng thẳng. Tại đ&acirc;y cũng được x&acirc;y dựng c&aacute;c dịch vụ kh&aacute;c như khu tập thể thao, trung t&acirc;m thương mại, bể bơi, nh&agrave; trẻ, s&acirc;n đậu trực thăng.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598866271_3.jpg', '1598866271_1.jpg|1598866271_2.jpg|1598866271_4.jpg|1598866271_5.jpg|1598866271_6.jpg|1598866271_7.jpg|1598866271_8.jpg|1598866271_9.jpg|1598866271_10.jpg|1598866271_11.jpg|1598866271_12.jpg|1598866271_13.jpg|1598866271_14.jpg|1598866271_15.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 02:31:11', '2020-09-26 02:48:48'),
(132, 'Cho thuê căn 3PN full nội thất giá 13.5tr tại Hà Đô Park View Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-135tr-tai-ha-do-park-view-cau-giay', 'Đường Duy Tân, Phường Dịch Vọng, Cầu Giấy, Hà Nội', 2, '54', '140', 13500000, 0, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 140m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nThuộc Khu đ&ocirc; thị mới Dịch Vọng, H&agrave; Đ&ocirc; Park View nằm ngay trục đường Mễ Tr&igrave; nối đường Cầu Giấy ra Phạm H&ugrave;ng gắn kết với c&aacute;c khu đ&ocirc; thị v&agrave; c&aacute;c t&ograve;a chung cư cao cấp kh&aacute;c, gần c&aacute;c trường học uy t&iacute;n nhất H&agrave; Nội: Trường H&agrave; Nội &ndash; Amsterdam, trường Quốc tế Singapore, trường Quốc tế Concordia v&agrave; nhiều trường c&ocirc;ng lập c&aacute;c cấp&hellip; đồng thời đi k&egrave;m với hệ thống hạ tầng x&atilde; hội đồng bộ ho&agrave;n chỉnh: c&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a, TTTM Parkson, si&ecirc;u thị BigC&hellip;</p>\r\n\r\n<p>Khu vực n&agrave;y đang ph&aacute;t triển s&ocirc;i động, sẽ l&agrave; nơi tập trung nhiều văn ph&ograve;ng, c&aacute;c ng&acirc;n h&agrave;ng, đại sứ qu&aacute;n, những c&ocirc;ng ty v&agrave; tập đo&agrave;n đa ng&agrave;nh đa quốc gia. Với nhiều trung t&acirc;m thương mại, đa dạng về h&agrave;ng h&oacute;a, phong ph&uacute; về dịch vụ, cư d&acirc;n chắc chắn sẽ được thỏa m&atilde;n mọi nhu cầu. C&aacute;c tiện &iacute;ch của t&ograve;a nh&agrave; được thiết kế để phục vụ cho nhu cầu phong ph&uacute; của d&acirc;n cư bao gồm: trung t&acirc;m thể dục thể thao, vườn trẻ, c&aacute;c dịch vụ spa, thẩm mỹ&hellip; Kh&ocirc;ng chỉ thế, kh&aacute;ch h&agrave;ng c&oacute; thể dễ d&agrave;ng mua sắm, thưởng thức c&aacute;c m&oacute;n đặc sản v&agrave; nh&acirc;m nhi li c&agrave; ph&ecirc; ngắm nh&igrave;n th&agrave;nh phố m&agrave; kh&ocirc;ng phải đi xa.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598929855_thumb.jpg', '1598929855_1.jpg|1598929855_2.jpg|1598929855_3.jpg|1598929855_4.jpg|1598929855_5.jpg|1598929855_6.jpg|1598929855_7.jpg|1598929855_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 20:10:55', '2020-09-26 09:17:15'),
(133, 'Cho thuê căn 3PN full nội thất giá 15tr tại Dreamland Bonanza Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-dreamland-bonanza-cau-giay', 'Số 23 phố Duy Tân, P. Dịch Vọng Hậu, Q. Cầu Giấy, Hà Nội', 2, '55', '98', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 98m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Dreamland Bonanza tọa lạc tại vị tr&iacute; đắc địa trung t&acirc;m phố Duy T&acirc;n, quận Cầu Giấy &ndash; khu vực được v&iacute; như Khu t&agrave;i ch&iacute;nh Phố Wall của Việt Nam. Nơi đ&acirc;y tập trung nhiều tập đo&agrave;n c&ocirc;ng nghệ - t&agrave;i ch&iacute;nh, trụ sở c&ocirc;ng ty lớn như FPT, Viettel, CMC, Samsung, Manulife, Prudential, 16 chi nh&aacute;nh - ph&ograve;ng giao dịch ng&acirc;n h&agrave;ng thương mại&hellip;<br />\r\nĐ&acirc;y l&agrave; dự &aacute;n chung cư cao cấp hiếm hoi thuộc &ldquo;thủ phủ văn ph&ograve;ng&rdquo; Duy T&acirc;n, được bao quanh bởi những tuyến đường huyết mạch như: Phạm H&ugrave;ng - V&agrave;nh đai 3, Trần Th&aacute;i T&ocirc;ng &ndash; Xu&acirc;n Thủy. Dreamland Bonanza chỉ c&aacute;ch mặt đường Phạm H&ugrave;ng 20m, bến xe Mỹ Đ&igrave;nh khoảng 1km, đường Trần Th&aacute;i T&ocirc;ng 500m, c&ocirc;ng vi&ecirc;n Cầu Giấy 1 km, s&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3km, Hồ T&acirc;y 4,5km&hellip;Từ nơi đ&acirc;y, cư d&acirc;n sẽ dễ d&agrave;ng tiếp cận tới c&aacute;c địa điểm trọng yếu, những tiện &iacute;ch ngoại khu h&agrave;ng đầu như:<br />\r\n+ C&aacute;c bệnh viện uy t&iacute;n: Bệnh viện 198, Bệnh viện Y học cổ truyền H&agrave; Nội, Viện Huyết học v&agrave; Truyền m&aacute;u Trung ương...<br />\r\n+ Hệ thống c&aacute;c trường học chất lượng cao: Đại học FPT, ĐH Quốc gia H&agrave; Nội, ĐH Thương mại, ĐH Sư phạm, THCS Đo&agrave;n Thị Điểm, THCS Dịch Vọng Hậu, THCS Cầu Giấy...<br />\r\n+ Trụ sở c&aacute;c Bộ ban ng&agrave;nh: Bộ C&ocirc;ng an, Bộ T&agrave;i nguy&ecirc;n M&ocirc;i trường, Bộ Ngoại giao, Tổng cục Hải quan, Viện Kiểm s&aacute;t Nh&acirc;n d&acirc;n Tối cao&hellip;<br />\r\n+ Gần c&aacute;c trung t&acirc;m thương mại, khu vui chơi giải tr&iacute; lớn: Indochina Plaza Hanoi, Keangnam Landmark Tower, The Garden, C&ocirc;ng vi&ecirc;n Cầu Giấy&hellip;<br />\r\nChung cư Dreamland 23 Duy T&acirc;n được CĐT chăm ch&uacute;t, d&agrave;nh tới cho cư d&acirc;n những tiện &iacute;ch hiện đại, đa dạng &amp; đẳng cấp bậc nhất nhằm mang tới cuộc sống thịnh vượng, đủ đầy &amp; vi&ecirc;n m&atilde;n: S&acirc;n tập Golf trong nh&agrave;, s&acirc;n tập Tennis tự động, s&acirc;n tập b&oacute;ng rổ, Khu vui chơi trẻ em ngo&agrave;i trời, Khu tập thể thao ngo&agrave;i trời...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598930282_2.jpg', '1598930282_1.jpg|1598930282_3.jpg|1598930282_4.jpg|1598930282_5.jpg|1598930282_6.jpg|1598930282_7.jpg|1598930282_8.jpg|1598930282_9.jpg|1598930282_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 20:18:02', '2020-09-26 09:21:42'),
(134, 'Cho thuê căn 3PN full nội thất giá 13tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-full-noi-that-gia-13tr-khu-ngoai-giao-doan', 'Đường Xuân Đỉnh, Xã Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '9', '105', 13000000, 0, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 105m2, nằm tại t&ograve;a N02T3.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1598931576_thumb.jpg', '1598931576_4.jpg|1598931576_6.jpg|1598931576_8.jpg|1598931576_10.jpg|1598931576_11.jpg|1598931576_13.jpg|1598931576_14.jpg|1598931576_15.jpg|1598931576_16.jpg|1598931576_18.jpg|1598931576_19.jpg|1598931576_21.jpg|1598931576_23.jpg|1598931576_26.jpg|1598931576_27.jpg|1598931576_28.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-08-31 20:39:36', '2020-09-25 03:04:20'),
