(140, 'Cho thuê căn 3PN giá 10tr tại CC Học Viện Quốc Phòng - Hoàng Quốc Việt', 'cho-thue-can-3pn-gia-10tr-tai-cc-hoc-vien-quoc-phong-hoang-quoc-viet', 'Ngõ 20 Hoàng Quốc Việt, phường Xuân La, Tây Hồ, Hà Nội', 2, '36', '136', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ tại t&ograve;a th&aacute;p đ&ocirc;ng, rộng&nbsp;136m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nĐược x&acirc;y dựng tr&ecirc;n &Ocirc; đất 017-HH2 trong quy hoạch chung của khu đ&ocirc; thị mới T&acirc;y Hồ T&acirc;y, quận T&acirc;y Hồ, H&agrave; Nội, Chung cư Học Viện Quốc Ph&ograve;ng c&oacute; thể dễ d&agrave;ng kết nối với h&agrave;ng loạt c&aacute;c tiện &iacute;ch hạ tầng x&atilde; hội bao quanh dự &aacute;n.</p>\r\n\r\n<p>Đ&acirc;y l&agrave; khu đ&ocirc; thị sầm uất, tập trung rất nhiều cụm c&ocirc;ng tr&igrave;nh cao tầng, trung t&acirc;m t&agrave;i ch&iacute;nh, thương mại, ng&acirc;n h&agrave;ng, dịch vụ quốc tế,... thu h&uacute;t số lượng lớn c&aacute;c tập đo&agrave;n, c&aacute;c c&ocirc;ng ty trong v&agrave; ngo&agrave;i nước đến kinh doanh, l&agrave;m việc. Với vị tr&iacute; đắc địa, hệ thống giao th&ocirc;ng thuận lợi, kh&ocirc;ng gian rộng, đ&oacute;n gi&oacute; v&agrave; &aacute;nh s&aacute;ng từ Hồ T&acirc;y, Chung cư Học Viện Quốc Ph&ograve;ng l&agrave; sự lựa chọn ho&agrave;n hảo cho cuộc sống b&igrave;nh y&ecirc;n.<br />\r\n&nbsp;<br />\r\nB&ecirc;n cạnh điểm vượt trội trong thiết kế căn hộ l&agrave; gi&aacute; trị cộng hưởng hệ thống dịch vụ tiện &iacute;ch đa dạng trong một tổng thể kh&eacute;p k&iacute;n. Cư d&acirc;n Học Viện Quốc Ph&ograve;ng sẽ được tận hưởng một cuộc sống xanh với bản h&ograve;a ca thi&ecirc;n nhi&ecirc;n bao quanh từng kh&ocirc;ng gian sống, cộng hưởng với c&aacute;c dịch vụ v&agrave; tiện &iacute;ch ho&agrave;n hảo,&hellip; Trung t&acirc;m thương mại, trường mầm non, hệ thống s&acirc;n vườn, đường dạo, bể bơi, khu vui chơi trẻ em, s&acirc;n tập thể thao, hồ điều h&ograve;a,&hellip; được đầu tư v&agrave; x&acirc;y dựng theo ti&ecirc;u chuẩn quốc tế.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;<br />\r\nGi&aacute; thu&ecirc;: 10/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1598945623_1.jpg', '1598945623_2.jpg|1598945623_3.jpg|1598945623_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 00:30:51', '2020-09-26 07:47:43'),
(141, 'Cho thuê căn 2PN full nội thất giá 14tr tại khu Ngoại Giao Đoàn', 'cho-thue-can-2pn-full-noi-that-gia-14tr-tai-khu-ngoai-giao-doan', 'Đường Xuân Đỉnh, Xã Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '9', '105', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 105m2, nằm tại t&ograve;a N01T2.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất cao cấp gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, n&oacute;ng lạnh, giường, sopha, đệm, tủ bếp,h&uacute;t m&ugrave;i, b&agrave;n ăn...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất cao cấp gồm: Tivi, tủ lạnh, máy giặt, điều hòa, nóng lạnh, giường, sopha, đệm, tủ bếp,hút mùi, bàn ăn...', NULL, '1598946051_4.jpg', '1598946051_3.jpg|1598946051_4.jpg|1598946051_5.jpg|1598946051_6.jpg|1598946051_7.jpg|1598946051_8.jpg|1598946051_9.jpg|1598946051_10.jpg|1598946051_11.jpg|1598946051_12.jpg|1598946051_13.jpg|1598946051_14.jpg|1598946051_15.jpg|1598946051_16.jpg|1598946051_17.jpg|1598946051_18.jpg|1598946051_19.jpg|1598946051_20.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 00:40:51', '2020-09-25 03:02:56'),
