(143, 'Cho thuê căn 2PN full nội thất giá 12tr tại The Garden Hill Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-the-garden-hill-my-dinh', '99 Trần Bình, P. Mỹ Đình 1,Q. Nam Từ Liêm, Hà Nội', 2, '56', '70', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư The Garden Hill tọa lạc tại 99 Trần B&igrave;nh. Tọa độ trung t&acirc;m đắc địa giao thoa 2 quận sầm uất l&agrave; Cầu Giấy v&agrave; Nam Từ Li&ecirc;m. Dự &aacute;n cạnh ngay bến xe Mỹ Đ&igrave;nh, đường v&agrave;nh đai 3 cao tốc đ&ocirc; thị. Bao quanh The Garden Hill l&agrave; những con đường lớn, huyết mạch của thủ đ&ocirc; như V&agrave;nh đai 3 cao tốc đ&ocirc; thị &ndash; Phạm H&ugrave;ng, quốc lộ 32 &ndash; Xu&acirc;n Thủy, Trục Nguyễn Ho&agrave;ng &ndash; T&ocirc;n Thất Thuyết, Trục L&ecirc; Đức Thọ &ndash; L&ecirc; Quang Đạo&hellip;</p>\r\n\r\n<p>Ngo&agrave;i ra chung cư 99 Trần B&igrave;nh c&ograve;n l&agrave; Trung t&acirc;m gi&aacute;o dục của Thủ đ&ocirc;. Nơi gần rất nhiều c&aacute;c trường đại học lớn như Đại Học Thương Mại, Đại Học Quốc Gia, Đại Học Sư Phạm, Đại Học FPT.., v&agrave; thuận tiện về cả hệ thống c&aacute;c cơ sở y tế uy t&iacute;n như Bệnh viện 19-8, bệnh viện Y Học Cổ Truyền, gần t&ograve;a nh&agrave; chung cư cao cấp Dolphin Plaza&hellip;</p>\r\n\r\n<p>Dự &aacute;n hưởng trọn bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh của 3 c&ocirc;ng vi&ecirc;n hồ nước lớn: C&ocirc;ng vi&ecirc;n Cầu Giấy, C&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Trung t&acirc;m, C&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a. Cư d&acirc;n The Garden Hill Trần B&igrave;nh được hưởng đầy đủ c&aacute;c dịch vụ tiện &iacute;ch như khu trung t&acirc;m thương mại, k&egrave;m theo l&agrave; ph&ograve;ng tập gym, vườn dạo, qu&aacute;n c&agrave; ph&ecirc; tr&ecirc;n tầng 6, khu vui chơi giải tr&iacute; trẻ em&hellip; Xung quanh căn hộ được bố tr&iacute; c&acirc;y xanh hợp l&yacute; mang đến một bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh, gi&uacute;p ph&aacute;t triển cả thể chất lẫn tinh thần cho c&aacute;c thế hệ sinh sống tại đ&acirc;y.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598946995_1.jpg', '1598946995_2.jpg|1598946995_3.jpg|1598946995_4.jpg|1598946995_5.jpg|1598946995_6.jpg|1598946995_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 00:56:35', '2020-09-26 03:13:56'),
(144, 'Cho thuê căn 2PN full nội thất giá 11tr tại The Garden Hill Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-the-garden-hill-my-dinh', '99 Trần Bình, P. Mỹ Đình 1,Q. Nam Từ Liêm, Hà Nội', 2, '56', '70', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư The Garden Hill tọa lạc tại 99 Trần B&igrave;nh. Tọa độ trung t&acirc;m đắc địa giao thoa 2 quận sầm uất l&agrave; Cầu Giấy v&agrave; Nam Từ Li&ecirc;m. Dự &aacute;n cạnh ngay bến xe Mỹ Đ&igrave;nh, đường v&agrave;nh đai 3 cao tốc đ&ocirc; thị. Bao quanh The Garden Hill l&agrave; những con đường lớn, huyết mạch của thủ đ&ocirc; như V&agrave;nh đai 3 cao tốc đ&ocirc; thị &ndash; Phạm H&ugrave;ng, quốc lộ 32 &ndash; Xu&acirc;n Thủy, Trục Nguyễn Ho&agrave;ng &ndash; T&ocirc;n Thất Thuyết, Trục L&ecirc; Đức Thọ &ndash; L&ecirc; Quang Đạo&hellip;</p>\r\n\r\n<p>Ngo&agrave;i ra chung cư 99 Trần B&igrave;nh c&ograve;n l&agrave; Trung t&acirc;m gi&aacute;o dục của Thủ đ&ocirc;. Nơi gần rất nhiều c&aacute;c trường đại học lớn như Đại Học Thương Mại, Đại Học Quốc Gia, Đại Học Sư Phạm, Đại Học FPT.., v&agrave; thuận tiện về cả hệ thống c&aacute;c cơ sở y tế uy t&iacute;n như Bệnh viện 19-8, bệnh viện Y Học Cổ Truyền, gần t&ograve;a nh&agrave; chung cư cao cấp Dolphin Plaza&hellip;</p>\r\n\r\n<p>Dự &aacute;n hưởng trọn bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh của 3 c&ocirc;ng vi&ecirc;n hồ nước lớn: C&ocirc;ng vi&ecirc;n Cầu Giấy, C&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Trung t&acirc;m, C&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a. Cư d&acirc;n The Garden Hill Trần B&igrave;nh được hưởng đầy đủ c&aacute;c dịch vụ tiện &iacute;ch như khu trung t&acirc;m thương mại, k&egrave;m theo l&agrave; ph&ograve;ng tập gym, vườn dạo, qu&aacute;n c&agrave; ph&ecirc; tr&ecirc;n tầng 6, khu vui chơi giải tr&iacute; trẻ em&hellip; Xung quanh căn hộ được bố tr&iacute; c&acirc;y xanh hợp l&yacute; mang đến một bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh, gi&uacute;p ph&aacute;t triển cả thể chất lẫn tinh thần cho c&aacute;c thế hệ sinh sống tại đ&acirc;y.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598947211_4.jpg', '1598947212_1.jpg|1598947212_2.jpg|1598947212_3.jpg|1598947212_5.jpg|1598947212_6.jpg|1598947212_7.jpg|1598947212_8.jpg|1598947212_9.jpg|1598947212_10.jpg|1598947212_11.jpg|1598947212_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 01:00:12', '2020-09-26 03:13:23'),
(145, 'Cho thuê căn 2PN giá 7.5tr tại Intracom Cầu Diễn', 'cho-thue-can-2pn-gia-75tr-tai-intracom-cau-dien', '33 Đường Cầu Diễn, Phúc Diễn, Bắc Từ Liêm, Hà Nội', 2, '57', '95', 7500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 95m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm ngay tr&ecirc;n mặt đường 32, gần chợ Cầu Diễn c&oacute; khu d&acirc;n tr&iacute; cao. Dự &aacute;n rất gần với đường Phạm H&ugrave;ng, L&ecirc; Đức Thọ, n&ecirc;n giao th&ocirc;ng đi lại thuận tiện. Từ t&ograve;a nh&agrave;, bạn c&oacute; thể dễ d&agrave;ng di chuyển về mọi hướng của Thủ đ&ocirc;.<br />\r\nGần Đại học Thương Mại, Cao Đẳng C&ocirc;ng Nghiệp In, Đại học Quốc gia, Si&ecirc;u thị BigC, Trung t&acirc;m H&ocirc;̣i nghị Qu&ocirc;́c gia, S&acirc;n vận động Mỹ Đ&igrave;nh, B&ecirc;́n xe Mỹ Đình; Nhi&ecirc;̀u trường học c&acirc;́p cơ sở, trung học, đại học danh ti&ecirc;́ng v&agrave; c&aacute;c ng&acirc;n h&agrave;ng, TTTM lớn...</p>\r\n\r\n<p>INTRACOM d&agrave;nh diện t&iacute;ch cho việc x&acirc;y dựng trường mẫu gi&aacute;o, s&acirc;n chơi trẻ em, khu sinh hoạt cộng đồng, khu thể dục thể thao, thư gi&atilde;n, giải tr&iacute; c&ugrave;ng vườn hoa, c&acirc;y xanh&hellip; Bao quanh t&ograve;a nh&agrave; l&agrave; một hệ thống gi&aacute;o dục đồng bộ từ cấp tiểu học đến đại học, gần to&agrave; nh&agrave; l&agrave; trường Đại học Thương mại đến c&aacute;c trường học uy t&iacute;n của th&agrave;nh phố như Đo&agrave;n Thị Điểm, L&ecirc; Qu&yacute; Đ&ocirc;n, Việt &ndash; &Uacute;c&hellip; những địa chỉ gi&aacute;o dục cần thiết trong sổ tay của c&aacute;c bậc phụ huynh lu&ocirc;n mong muốn c&oacute; một nền gi&aacute;o dục chất lượng cho con m&igrave;nh.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 7.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1600331486_2.jpg', '1601086809_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 01:10:28', '2020-09-26 02:20:09'),
(146, 'Cho thuê căn 3PN full nội thất giá 13tr tại Home City Trung Kính', 'cho-thue-can-3pn-full-noi-that-gia-13tr-tai-home-city-trung-kinh', '177 Trung Kính, Tổ 51, Phường Yên Hòa, Cầu Giấy, Hà Nội', 2, '22', '100', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 100m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm cạnh dự &aacute;n c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Nam Trung Y&ecirc;n rộng tới 12ha, tr&ecirc;n con phố Trung K&iacute;nh đang mở rộng 42m với những h&agrave;ng c&acirc;y tỏa b&oacute;ng hai b&ecirc;n đường phố, Home City 177 Trung K&iacute;nh c&oacute; ưu thế đặc biệt về cảnh quan, m&ocirc;i trường v&agrave; kh&iacute; hậu m&aacute;t mẻ trong l&agrave;nh ngay giữa trung t&acirc;m Thủ đ&ocirc; H&agrave; Nội. Với vị tr&iacute; trung t&acirc;m, được bao bọc xung quanh bởi c&aacute;c khu đ&ocirc; thị như Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Trung H&ograve;a với những c&ocirc;ng vi&ecirc;n c&acirc;y xanh, những ng&ocirc;i nh&agrave; biệt thự, nh&agrave; vườn thanh b&igrave;nh dọc c&aacute;c tuyến phố &ocirc; b&agrave;n cờ; Xung quanh dự &aacute;n l&agrave; trung t&acirc;m thương mại sầm uất như Big C, Grand Plaza, Keangnam, Fivimart&hellip;</p>\r\n\r\n<p>Home City 177 Trung K&iacute;nh được thừa hưởng ngay một hệ thống dịch vụ tiện &iacute;ch v&agrave; hạ tầng đ&ocirc; thị đồng bộ. Chung cư Home City l&agrave; sự tổng h&ograve;a của những thiết kế th&ocirc;ng minh, kh&ocirc;ng gian cảnh quan lu&ocirc;n mở v&agrave; hệ thống dịch vụ tiện &iacute;ch, chu đ&aacute;o. Khối đế của c&aacute;c t&ograve;a nh&agrave; li&ecirc;n th&ocirc;ng nhau tạo ra một khoảng kh&ocirc;ng gian rộng lớn, nơi sẽ được bố tr&iacute; c&aacute;c dịch vụ như cửa h&agrave;ng thời trang, ăn uống, giải kh&aacute;t, si&ecirc;u thị, spa, nh&agrave; trẻ, văn ph&ograve;ng&hellip; nhằm mang đến cho cư d&acirc;n cuộc sống tiện nghi v&agrave; h&ograve;a nhập c&ugrave;ng cộng đồng.</p>\r\n\r\n<p>Phần khối đế ph&iacute;a trong khu đất được thiết kế th&ocirc;ng tầng để sử dụng l&agrave;m s&acirc;n chơi, đường dạo kết hợp c&acirc;y xanh cho c&aacute;c t&ograve;a nh&agrave;. Tại đ&acirc;y được bố tr&iacute; một trường tiểu học cao 5 tầng với diện t&iacute;ch s&agrave;n 2200 m2, kết hợp với diện t&iacute;ch s&agrave;n d&agrave;nh cho nh&agrave; trẻ trong c&aacute;c t&ograve;a cao tầng sẽ g&oacute;p phần tạo điều kiện thuận lợi cho cư d&acirc;n trong việc chăm s&oacute;c, gi&aacute;o dục những thế hệ tương lai.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598948059_1.jpg', '1598948059_2.jpg|1598948059_3.jpg|1598948059_4.jpg|1598948059_5.jpg|1598948059_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 01:14:19', '2020-09-26 08:04:19'),
(149, 'Cho thuê căn 3PN full nội thất giá 18tr tại Sky City Tower Láng Hạ', 'cho-thue-can-3pn-full-noi-that-gia-18tr-tai-sky-city-tower-lang-ha', '88 Láng Hạ,P. Láng Hạ, Q. Đống Đa, Hà Nội', 2, '59', '140', 18000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 140m2 thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Skycity 88 L&aacute;ng Hạ l&agrave; chung cư cao cấp nằm tại trung t&acirc;m th&agrave;nh phố H&agrave; Nội &ndash; Mảnh đất v&agrave;ng của thủ đ&ocirc; &ndash; với vị tr&iacute; v&ocirc; c&ugrave;ng thuận lợi khi được nằm gần rất nhiều địa điểm lớn của th&agrave;nh phố như: Rạp chiếu phim quốc gia, si&ecirc;u thi FiviMart, chợ L&aacute;ng Hạ, triển l&atilde;m Giảng V&otilde;, si&ecirc;u thị Big C c&ugrave;ng nhiều trường học, bệnh viện v&agrave; trung t&acirc;m thương mại đ&aacute;p ứng mọi nhu cầu thiết yếu cho c&aacute;c hộ gia đ&igrave;nh. C&aacute;c căn hộ được thiết kế với c&aacute;c ph&ograve;ng tận hưởng tối đa &aacute;nh s&aacute;ng tự nhi&ecirc;n khiến kh&ocirc;ng gian sống c&agrave;ng th&ecirc;m ho&agrave;n hảo. Thiết kế c&aacute;c căn hộ chung cư 88 L&aacute;ng Hạ c&oacute; ban c&ocirc;ng rộng v&agrave; tho&aacute;ng nh&igrave;n được to&agrave;n cảnh khu vực L&aacute;ng Hạ v&agrave; đường L&aacute;ng, gi&uacute;p mỗi cư d&acirc;n lu&ocirc;n c&oacute; cả gi&aacute;c thoải m&aacute;i v&agrave; thư gi&atilde;n tại ng&ocirc;i nh&agrave; của m&igrave;nh. Chung cư Skycity 88 L&aacute;ng Hạ với đầy đủ tiện &iacute;ch đa chức năng: văn ph&ograve;ng cao cấp, cửa h&agrave;ng b&aacute;n lẻ của nhiều thương hiệu, c&aacute;c nh&agrave; h&agrave;ng v&agrave; tiệm caf&eacute;, khu vui chơi d&agrave;nh cho trẻ em, trung t&acirc;m y tế, ph&ograve;ng tập, bể bơi trong nh&agrave; v&agrave; trung t&acirc;m thể thao. Khu&ocirc;n vi&ecirc;n chung cư Skycity 88 L&aacute;ng Hạ bố tr&iacute; s&acirc;n chơi d&agrave;nh cho trẻ em với c&aacute;c thiết bị vui chơi ngo&agrave;i trời an to&agrave;n v&agrave; hiện đại. Hệ thống ng&acirc;n h&agrave;ng được đặt dưới tầng 1, Th&aacute;p A, chung cư 88 L&aacute;ng Hạ gồm ng&acirc;n h&agrave;ng maritime bank v&agrave; một số ng&acirc;n h&agrave;ng kh&aacute;c, hệ thống si&ecirc;u thị đặt ở tầng 1 của t&ograve;a th&aacute;p B 88 L&aacute;ng Hạ, si&ecirc;u thị n&agrave;y cung cấp c&aacute;c loại mặt h&agrave;ng phong ph&uacute; như thực phẩm, đồ uống, đồ gia dụng, đồ chơi trẻ em, c&aacute;c loại h&oacute;a mỹ phẩm phục vụ mọi nhu cầu của hộ gia đ&igrave;nh. Hệ thống nh&agrave; h&agrave;ng ẩm thực v&agrave; khu ăn uống, dịch vụ kh&aacute;c đều c&oacute; mặt ở tầng 1 t&ograve;a th&aacute;p B với c&aacute;c nh&agrave; h&agrave;ng &nbsp;v&agrave; qu&aacute;n cafe t&ecirc;n tuổi như: Chezmai Restaurant, Y &ndash; Not Restaurant, Red Coffee&hellip; với chỗ ngồi rộng r&atilde;i, c&aacute;c m&oacute;n ăn mang đậm phong c&aacute;ch &Aacute; &ndash; &Acirc;u v&agrave; thuần Việt.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 18tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1598949386_7.jpg', '1598949387_1.jpg|1598949387_2.jpg|1598949387_3.jpg|1598949387_4.jpg|1598949387_5.jpg|1598949387_6.jpg|1598949387_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 01:36:27', '2020-09-23 08:32:55');
