(150, 'Cho thuê căn 2PN full nội thất giá 18tr tại Vinhomes Nguyễn Chí Thanh', 'cho-thue-can-2pn-full-noi-that-gia-18tr-tai-vinhomes-nguyen-chi-thanh', '54A Nguyễn Chí Thanh, Láng Thượng, Đống Đa, Hà Nội', 2, '60', '86', 18000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 86m2 thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất cao cấp gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, n&oacute;ng lạnh, giường, sopha, đệm, tủ bếp,h&uacute;t m&ugrave;i, b&agrave;n ăn..<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nVinhomes Nguyễn Ch&iacute; Thanh nằm tại địa chỉ số 54A Nguyễn Ch&iacute; Thanh, phường L&aacute;ng Thượng, quận Đống Đa, H&agrave; Nội. Với lợi thế nằm ngay trung t&acirc;m s&ocirc;i động của th&agrave;nh phố, trong b&aacute;n k&iacute;nh 1 km quanh khu căn hộ l&agrave; h&agrave;ng loại c&aacute;c trường đại học, điểm vui chơi, giải tr&iacute;, nổi bật như đại học Ngoại Thương, đại học Luật, học viện phụ nữ Việt Nam, c&ocirc;ng vi&ecirc;n Thủ Lệ, c&ocirc;ng vi&ecirc;n Indira Gandhi&hellip; Trong tất cả c&aacute;c dự &aacute;n của Vingroup tại H&agrave; Nội, Vinhomes Nguyễn Ch&iacute; Thanh, Vinhomes Liễu Giai, Vinhomes Giảng V&otilde; l&agrave; 3 dự &aacute;n c&oacute; vị tr&iacute; đẳng cấp v&agrave; đắt gi&aacute; nhất.&nbsp;<br />\r\nVới mục ti&ecirc;u đem đến cho cư d&acirc;n cuộc sống tiện &iacute;ch vượt trội kh&aacute;c biệt với c&aacute;c t&ograve;a nh&agrave; hiện đại ngay giữa trung t&acirc;m th&agrave;nh phố, Vinhomes Nguyễn Ch&iacute; Thanh &ndash; H&agrave; Nội &nbsp;được t&iacute;ch hợp nhiều tiện &iacute;ch theo ti&ecirc;u chuẩn quốc tế vượt trội đem đến cho cư d&acirc;n ti&ecirc;u chuẩn sống đẳng cấp:<br />\r\n+ Khu vực sinh hoạt cộng đồng: Sảnh Lounge sang trọng đặt tại tầng 7 của t&ograve;a nh&agrave; với tầm nh&igrave;n xanh m&aacute;t, hướng thẳng ra khu vực bể bơi bốn m&ugrave;a m&aacute;i k&iacute;nh ngo&agrave;i trời được thiết kế tinh tế, sang trọng v&agrave; sử dụng c&aacute;c trang thiết bị chất lượng cao cấp chắc chắn sẽ l&agrave; địa điểm sum họp l&yacute; tưởng của cộng đồng cư d&acirc;n.<br />\r\n+ Y tế - Ph&ograve;ng kh&aacute;m đa khoa quốc tế Vinmec: Ph&ograve;ng kh&aacute;m đa khoa quốc tế Vinmec (thuộc hệ thống Bệnh viện đa khoa quốc tế Vinmec) sử dụng c&aacute;c trang bị đồng bộ, hiện đại, dịch vụ tiện nghi, cao cấp theo ti&ecirc;u chuẩn bệnh viện đa khoa Quốc tế. Đặc biệt, đội ngũ y - b&aacute;c sỹ tại Vinmec l&agrave; c&aacute;c chuy&ecirc;n gia đầu ng&agrave;nh, tr&igrave;nh độ chuy&ecirc;n m&ocirc;n cao, &nbsp;lu&ocirc;n hết l&ograve;ng v&igrave; lợi &iacute;ch của bệnh nh&acirc;n, Với lợi thế về chuy&ecirc;n m&ocirc;n v&agrave; c&ocirc;ng nghệ cao c&ugrave;ng t&ocirc;n chỉ &ldquo;Hết l&ograve;ng v&igrave; người bệnh&rdquo; VINMEC lu&ocirc;n l&agrave; địa chỉ chăm s&oacute;c sức khoẻ chất lượng cao v&agrave; uy t&iacute;n ngay tại Việt Nam với ti&ecirc;u chuẩn quốc tế.<br />\r\n+ Gi&aacute;o dục - Trường mầm non Vinschool: Được chắt lọc, kết hợp kh&eacute;o l&eacute;o những tinh hoa của nền gi&aacute;o dục trong nước v&agrave; quốc tế, trường mầm non Vinschool tại Vinhomes Nguyễn Ch&iacute; Thanh &ndash; H&agrave; Nội (thuộc hệ thống trường Vinschool danh tiếng) sẽ đem đến một m&ocirc; h&igrave;nh gi&aacute;o dục ưu việt, đ&aacute;p ứng tốt chương tr&igrave;nh trong nước nhưng đồng thời trang bị cho c&aacute;c em những tố chất v&agrave; phẩm chất cần thiết để tự tin hội nhập, th&agrave;nh c&ocirc;ng trong xu hướng to&agrave;n cầu h&oacute;a.<br />\r\n+ Khu thể thao v&agrave; r&egrave;n luyện sức khỏe: gồm bể bơi bốn m&ugrave;a m&aacute;i k&iacute;nh ngo&agrave;i trời đầu ti&ecirc;n tại H&agrave; Nội, Ph&ograve;ng tập Gym hiện đại, Spa, S&acirc;n chơi&hellip; sẽ g&oacute;p phần n&acirc;ng cao chất lượng cuộc sống v&agrave; kh&ocirc;ng gian sống cho cư d&acirc;n.<br />\r\n+ Trung t&acirc;m thương mại v&agrave; Khu ẩm thực, vui chơi, giải tr&iacute; hiện đại trải dọc từ tầng 1 đến tầng 6 v&agrave; đại si&ecirc;u thị tại hầm B1 theo ti&ecirc;u chuẩn của hệ thống TTTM mang thương hiệu Vincom gồm c&aacute;c loại h&igrave;nh mua sắm - vui chơi giải tr&iacute; như Nh&agrave; h&agrave;ng &Aacute; &ndash; &Acirc;u sang trọng; Rạp chiếu phim; Khu vui chơi giải tr&iacute; Vinplearlland Games&hellip; sẽ mang tới cho cư d&acirc;n v&agrave; kh&aacute;ch h&agrave;ng phong c&aacute;ch mua sắm v&agrave; giải tr&iacute; th&uacute; vị.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 18tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598951446_3.jpg', '1598951446_1.jpg|1598951446_2.jpg|1598951446_4.jpg|1598951446_5.jpg|1598951446_6.jpg|1598951446_7.jpg|1598951446_8.jpg|1598951446_9.jpg|1598951446_10.jpg|1598951446_11.jpg|1598951446_12.jpg|1598951446_13.jpg|1598951446_14.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 02:10:46', '2020-09-23 08:28:33'),
(152, 'Cho thuê căn 4PN nội thất giá 15tr tại phố Doãn Kế Thiện', 'cho-thue-can-4pn-noi-that-gia-15tr-tai-pho-doan-ke-thien', 'Phố Doãn Kế Thiện,P. Mai Dịch.Q. Cầu Giấy, Hà Nội', 2, '62', '60', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nNh&agrave; 4 tầng, rộng 60m2/tầng.</p>\r\n\r\n<p>Thiết kế bao gồm 04 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nh&agrave; nằm tại ng&otilde; 105 Do&atilde;n Kế Thiện, gần c&aacute;c trường đại học lớn như: S&acirc;n Khấu Điện Ảnh, Thương Mại, Ngoại Ngữ, Đại học Quốc gia, CĐ Thương mại v&agrave; Du lịch...Chỉ mất v&agrave;i ph&uacute;t di chuyển ra c&aacute;c tuyến đường lớn như Phạm Văn Đồng, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 4, 4, 'Full nội thất', NULL, '1598953888_thumb.jpg', '1598953889_1.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 02:51:29', '2020-09-26 09:22:17'),
(153, 'Cho thuê căn 2PN full nội thất giá 10tr tại KĐT Nam Cường - Cổ Nhuế', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-kdt-nam-cuong-co-nhue', 'KĐT Nam Cường, P. Cổ Nhuế 1. Q. Bắc Từ Liêm, Hà Nội', 2, '34', '89', 10000000, 0, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ tầng cao rộng 89m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp..</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Đ&acirc;y l&agrave; khu đ&ocirc; thị c&oacute; vị tr&iacute; kh&aacute; thuận lợi nằm ở ph&iacute;a t&acirc;y trung t&acirc;m TP H&agrave; Nội, ph&iacute;a Đ&ocirc;ng v&agrave; Đ&ocirc;ng bắc gi&aacute;p với khu d&acirc;n cư x&atilde; Cổ Nhuế, ph&iacute;a T&acirc;y s&aacute;t cạnh đường Phạm Văn Đồng (tuyến đường cao tốc Thăng long đi Nội B&agrave;i).</p>\r\n\r\n<p>Bao quanh KĐT Nam Cường l&agrave; 3 tuyến đường lớn Phạm Văn Đồng, Ho&agrave;ng Quốc Việt v&agrave; đường 69- đ&acirc;y l&agrave; khu vực hết sức thuận lợi về giao th&ocirc;ng đi lại v&agrave; hệ thống đường trong khu vực n&agrave;y phần lớn được x&acirc;y mới ho&agrave;n to&agrave;n n&ecirc;n đ&aacute;p ứng nhu cầu cần thiết của một Khu đ&ocirc; thị hiện đại.<br />\r\nƯu điểm nổi bật nhất l&agrave; vị tr&iacute; Khu đ&ocirc; thị Nam Cường nằm ngay mặt tiền đại lộ Phạm Văn Đồng rộng 60m, từ khu đ&ocirc; thị chỉ mất 30 ph&uacute;t xe chạy sẽ đến s&acirc;n bay Nội B&agrave;i v&agrave; 20 ph&uacute;t để v&agrave;o trung t&acirc;m th&agrave;nh phố.</p>\r\n\r\n<p>Ngo&agrave;i ra bao quanh KĐT Nam Cường l&agrave; si&ecirc;u thị Metro- 1 si&ecirc;u thị b&aacute;n bu&ocirc;n lớn của HN hiện nay, hệ thống c&aacute;c trường đại học, cao đẳng v&agrave; bệnh viện như viện E, bệnh viện y học cổ truyền &hellip; v&agrave; h&agrave;ng loạt c&aacute;c dự &aacute;n đ&ocirc; thị mới cận kề.<br />\r\nL&agrave; khu đ&ocirc; thị khang trang, hiện đại, đồng bộ về CSHT x&atilde; hội, hạ tầng kỹ thuật v&agrave; kiến tr&uacute;c cảnh quan m&ocirc;i trường.&nbsp;C&aacute;c c&ocirc;ng tr&igrave;nh thấp tầng bố tr&iacute; gần kh&ocirc;ng gian c&acirc;y xanh, trường học, nh&agrave; trẻ để h&agrave;i ho&agrave; với kh&ocirc;ng gian khu vực x&oacute;m l&agrave;ng hiện c&oacute; l&acirc;n cận.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1598954675_11.jpg', '1598954675_1.jpg|1598954675_2.jpg|1598954675_3.jpg|1598954675_4.jpg|1598954675_5.jpg|1598954675_6.jpg|1598954675_7.jpg|1598954675_8.jpg|1598954675_9.jpg|1598954675_10.jpg|1598954675_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-01 03:04:35', '2020-09-28 09:13:24'),
(154, 'Cho thuê căn 2PN full nội thất giá 10.5tr tại Chung cư Thái Hà BCA Phạm Văn Đồng', 'cho-thue-can-2pn-full-noi-that-gia-105tr-tai-chung-cu-thai-ha-bca-pham-van-dong', '43 Phạm Văn Đồng, P. Cổ Nhuế 2, Bắc Từ Liêm, Hà Nội', 2, '39', '70', 10500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Th&aacute;i H&agrave; &ndash; Bộ c&ocirc;ng an Cổ Nhuế 2 tọa lạc Số 43 Phạm Văn Đồng &ndash; Quận Bắc Từ Li&ecirc;m, H&agrave; Nội sở hữu một trong những vị tr&iacute; bậc nhất H&agrave; Nội:<br />\r\nĐ&acirc;y l&agrave; vị tr&iacute; huyết mạch kết nối giao th&ocirc;ng của Thủ Đ&ocirc; bằng c&aacute;c con đường như: Ho&agrave;ng Quốc Việt đi T&acirc;y Hồ ,Hồ T&ugrave;ng Mậu, Xu&acirc;n Thuỷ kết nối quận Cầu Giấy đi Sơn T&acirc;y, đường Phạm Văn Đồng.<br />\r\nTừ vị tr&iacute; dự &aacute;n bạn dễ d&agrave;ng di chuyển thuận tiện v&agrave; nhanh ch&oacute;ng đến S&acirc;n bay Quốc Tế Nội B&agrave;i,Khu c&ocirc;ng nghiệp Thăng Long, C&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y, KĐT&nbsp;Ngoại Giao đo&agrave;n.<br />\r\nGần c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Th&agrave;nh Phố Giao Lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Mai Dịch, c&ocirc;ng Nghĩa Đ&ocirc; v&agrave; C&ocirc;ng vi&ecirc;n Cầu Giấy,&hellip;.<br />\r\nC&aacute;c si&ecirc;u thị mua sắm lớn như Metro, Vinmart,&hellip;mua sắm thả ga.<br />\r\nGần nhiều bệnh viện lớn, nhỏ như Bệnh viện E, bệnh viện 198, bệnh viện Y học cổ truyền&hellip;.<br />\r\nGần nhiều trường Đại Hoc nổi tiếng nhất tại Việt Nam như ĐH Quốc Gia, Thương Mại, Ngoại ngữ, Sư phạm, học viện B&aacute;o ch&iacute; v&agrave; Tuy&ecirc;n Truyền,&hellip;<br />\r\nTại đ&acirc;y cư d&acirc;n c&oacute; thể tận hưởng dịch vụ tiện &iacute;ch v&ocirc; c&ugrave;ng nổi bật: Hệ thống trung t&acirc;m thương mại, mua sắm được x&acirc;y dựng đồng bộ ngay dưới sảnh t&ograve;a nh&agrave;; Trung t&acirc;m tập Gym, Spa...;Khu vui chơi giải tr&iacute; cho c&aacute;c bạn nhỏ trong to&agrave;n t&ograve;a nh&agrave;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599097582_5.jpg', '1599097583_1.jpg|1599097583_2.jpg|1599097583_3.jpg|1599097583_4.jpg|1599097583_6.jpg|1599097583_7.jpg|1599097583_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 18:46:23', '2020-09-28 09:56:41'),
(156, 'Cho thuê căn 2PN full nội thất giá 11tr tại Star City Lê Văn Lương', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-star-city-le-van-luong', '23 Lê Văn Lương, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '4', '80', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Star City nằm tại đường L&ecirc; Văn Lương, Phường Nh&acirc;n Ch&iacute;nh, Quận Thanh Xu&acirc;n, một trong những trục đường huyết mạch v&agrave; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội.</p>\r\n\r\n<p>Từ vị tr&iacute; dự &aacute;n, c&oacute; thể dễ d&agrave;ng kết nối với c&aacute;c khu vực trong v&agrave; ngo&agrave;i th&agrave;nh phố th&ocirc;ng qua c&aacute;c tuyến đường: V&agrave;nh Đai 3, Đường L&aacute;ng, Nguyễn Ch&iacute; Thanh, L&aacute;ng Hạ&hellip; C&aacute;ch BigC Thăng Long chỉ 3 ph&uacute;t, về trung t&acirc;m Bờ Hồ 20 ph&uacute;t&hellip;Ngo&agrave;i ra, trong v&ograve;ng b&aacute;n k&iacute;nh 500m từ Star City l&agrave; hệ thống c&aacute;c si&ecirc;u thị, ng&acirc;n h&agrave;ng, trường học, trung t&acirc;m y tế, mua sắm&hellip;&nbsp; Tiếp gi&aacute;p c&aacute;c KĐTM ph&aacute;t triển, hạ tầng đồng bộ: Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, The Manor, Trung Y&ecirc;n,&hellip; Trung t&acirc;m hội nghị Quốc Gia, Si&ecirc;u thị BigC, Trung t&acirc;m thương mại Grand Plaza, Keangnam Landmark&hellip;</p>\r\n\r\n<p>Hệ thống dịch vụ, trường học, y tế đầy đủ. Star City L&ecirc; Văn Lương được đ&aacute;nh gi&aacute; l&agrave; một trong những vị tr&iacute; v&agrave;ng của thủ đ&ocirc; H&agrave; Nội, mang đến cho cư d&acirc;n nơi đ&acirc;y một cuộc sống tiện nghi v&agrave; đẳng cấp. Với những thiết kế vượt trội v&agrave; đẳng cấp của một kh&aacute;ch sạn 4 sao ti&ecirc;u chuẩn quốc tế, chung cư Star City L&ecirc; Văn Lương được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch hiện đại v&agrave; cao cấp trong khu vực: ph&ograve;ng đọc s&aacute;ch ph&ograve;ng tập thể thao, khu giải tr&iacute;, ph&ograve;ng đọc s&aacute;ch, chơi cờ, khu c&acirc;u lạc bộ người gi&agrave;, nh&agrave; trẻ, ph&ograve;ng xem phim, chơi game, khu mua sắm&hellip; ngay trong nh&agrave;. Đặc biệt, hệ thống bể bơi tr&ecirc;n tầng thượng một trong những sự kh&aacute;c biệt v&agrave; độc đ&aacute;o tại Star City.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599098988_5.jpg', '1599098988_1.jpg|1599098988_2.jpg|1599098988_3.jpg|1599098988_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 19:09:48', '2020-09-26 03:35:02'),
(157, 'Cho thuê căn 2PN giá 9tr tại Handi Resco Lê Văn Lương', 'cho-thue-can-2pn-gia-9tr-tai-handi-resco-le-van-luong', '31 Đường Lê Văn Lương, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '64', '80', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Handi Resco L&ecirc; Văn Lương c&oacute; vị tr&iacute; đắc địa tại đường&nbsp;L&ecirc; Văn Lương, Nh&acirc;n Ch&iacute;nh, Thanh Xu&acirc;n, H&agrave; Nội. Đ&acirc;y l&agrave; khu vực được quy hoạch ph&aacute;t triển với nhiều c&ocirc;ng tr&igrave;nh kiến tr&uacute;c hiện đại.</p>\r\n\r\n<p>Dự &aacute;n Handi Resco được thừa hưởng rất nhiều hạ tầng tiện &iacute;ch từ vị tr&iacute; bao gồm: nằm trong quần thể khu đ&ocirc; thị Đ&ocirc;ng Nam Trần Duy Hưng,&nbsp;rất dễ d&agrave;ng di chuyển đến BigC, trường Amstecdam H&agrave; Nội, Trung t&acirc;m hội nghị Quốc Gia...</p>\r\n\r\n<p>Nằm cạnh hồ điều h&ograve;a C&ocirc;ng vi&ecirc;n Trung h&ograve;a &ndash; Nh&acirc;n ch&iacute;nh rộng tới 80.000m2 mang tới kh&ocirc;ng gian sống trong l&agrave;nh v&agrave; tho&aacute;ng m&aacute;t. Rất gần c&aacute;c trường học h&agrave;ng đầu Việt Nam từ Mầm Non đến Đại Học: Trường Mầm Non Họa My, Tiểu học Quốc tế Brendon, Trường THPT Amsterdam.</p>\r\n\r\n<p>Dự &aacute;n chung cư Handi Resco hội tụ những tiện nghi bậc nhất m&agrave; mọi kh&aacute;ch h&agrave;ng đều mong muốn, nơi đ&aacute;p ứng tốt nhất mọi nhu cầu của cuộc sống hiện đại. Tiện &iacute;ch c&ocirc;ng cộng rất đầy đủ: ph&ograve;ng kh&aacute;m, ng&acirc;n h&agrave;ng, si&ecirc;u thị, trường mầm non, spa, ph&ograve;ng tậm GYM&hellip; để bạn c&oacute; thể hưởng thụ cuộc sống một c&aacute;ch đ&iacute;ch thực.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1599099431_3.jpg', '1599099432_1.jpg|1599099432_2.jpg|1599099432_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 19:17:12', '2020-09-26 04:01:02'),
(158, 'Cho thuê căn 2PN full nội thất giá 10.5tr tại Mon City Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-105tr-tai-mon-city-my-dinh', 'Đường Hàm Nghi, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '26', '62', 10500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ t&ograve;a B,&nbsp;rộng 62m2 thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n quy hoạch th&agrave;nh một khu phố nhỏ sầm uất giữa mảnh đất v&agrave;ng, tiện lợi cho việc sinh sống v&agrave; kinh doanh. Gồm c&aacute;c c&ocirc;ng tr&igrave;nh hỗn hợp cao tầng với tầng hầm li&ecirc;n th&ocirc;ng, c&aacute;c tầng thương mại đẳng cấp, c&aacute;c khu vực dịch vụ, vui chơi phong ph&uacute;.</p>\r\n\r\n<p>Dự &aacute;n Mon City sở hữu vị tr&iacute; v&agrave;ng đắc địa với 03 mặt tiền tiếp gi&aacute;p với những con đường đẹp nhất Mỹ Đ&igrave;nh &ndash; v&ugrave;ng đất c&oacute; nhiều tiềm năng ph&aacute;t triển v&agrave; đang ng&agrave;y c&agrave;ng trở n&ecirc;n thịnh vượng.</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Nam l&agrave; đường L&ecirc; Đức Thọ</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Nam l&agrave; đường H&agrave;m Nghi</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Bắc l&agrave; đường Nguyễn Cơ Thạch</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Bắc l&agrave; c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Mai Dịch rộng 17ha</p>\r\n\r\n<p>HD Mon City nằm ở vị tr&iacute; trung t&acirc;m khu vực h&agrave;nh ch&iacute;nh nơi Mỹ Đ&igrave;nh, dự &aacute;n được thừa hưởng lợi thế từ những c&ocirc;ng tr&igrave;nh tiện &iacute;ch, hạ tầng đồng bộ, hiện đại của c&aacute;c dự &aacute;n, c&ocirc;ng tr&igrave;nh liền kề, từ c&ocirc;ng vi&ecirc;n c&acirc;y xanh, cho đến c&aacute;c tiện &iacute;ch trường học, bệnh viện, kh&aacute;ch sạn, bến xe. B&ecirc;n cạnh c&aacute;c tiện &iacute;ch nội khu, cư d&acirc;n của dự &aacute;n HD Mon City c&ograve;n được hưởng c&aacute;c tiện &iacute;ch b&ecirc;n ngo&agrave;i dự &aacute;n: như trường học (gần c&aacute;c trường đại học Thương Mại, đại học Quốc gia H&agrave; Nội, Đại học Ngoại ngữ&hellip;), bệnh viện (bệnh viện Thể thao, bệnh viện 19 &ndash; 8,&hellip;),&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601883369_20191228105832-f061_wm.jpg', '1601883369_20191228105830-04e0_wm.jpg|1601883369_20191228105831-13ae_wm.jpg|1601883369_20191228105831-60c4_wm.jpg|1601883369_20191228105831-e771_wm.jpg|1601883369_20191228105831-f877_wm.jpg|1601883369_20191228105832-edcd_wm.jpg|1601883369_20191228105832-f061_wm.jpg|1601883369_20191228105840-be94_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 19:21:44', '2020-10-05 07:36:09'),
(159, 'Cho thuê căn 2PN full nội thất giá 11tr tại CT1-2 KĐT Mễ Trì Hạ', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-ct1-2-kdt-me-tri-ha', 'KĐT Mễ Trì Hạ, P. Mễ Trì, Q. Nam Từ Liêm, Hà Nội', 2, '65', '90', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 90m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tr&ecirc;n trục đường Phạm H&ugrave;ng - cửa ng&otilde; ph&iacute;a T&acirc;y thủ đ&ocirc;, KĐT Mễ Trị Hạ c&oacute; 1 vị thế đắc địa cho cư d&acirc;n ở đ&acirc;y sinh sống v&agrave; l&agrave;m việc.</p>\r\n\r\n<p>KĐT quy tụ nhiều t&iacute;ch &iacute;ch đa dạng như c&aacute;c nh&agrave; h&agrave;ng lớn, hệ thống ph&ograve;ng gym, rạp chiếu phim, khu vui chơi cho trẻ em, chuỗi c&agrave; ph&ecirc;...hệ thống c&acirc;y x&acirc;y bao phủ mang lại kh&ocirc;ng gian tho&aacute;ng m&aacute;t cho cư d&acirc;n sinh sống tại đ&acirc;y.</p>\r\n\r\n<p>Căn hộ Khu đ&ocirc; thị Mễ Tr&igrave; Hạ được quy hoạch nằm trong khu vực ph&aacute;t triển của Thủ đ&ocirc; H&agrave; Nội với hệ thống tiện &iacute;ch ngoại khu đầy đủ được thừa hưởng từ nhiều c&ocirc;ng tr&igrave;nh dự &aacute;n lớn như: Khu đ&ocirc; thị Mỹ Đ&igrave;nh, Khu đ&ocirc; thị Mỹ Đ&igrave;nh I, The Manor H&agrave; Nội...Gần c&aacute;c trung t&acirc;m thương mại lớn như BigC Thăng Long, The Garden, Vincom Trần Duy Hưng...</p>\r\n\r\n<p>Từ đ&acirc;y, c&oacute; thể dễ d&agrave;ng di chuyển ra ph&iacute;a ngoại th&agrave;nh H&agrave; Nội hướng về c&aacute;c tỉnh ph&iacute;a T&acirc;y như H&agrave; Nam, Nam Định, Th&aacute;i B&igrave;nh...KĐT Mễ Tr&igrave; Hạ l&agrave; sự lựa chọn l&yacute; tưởng để sinh sống v&agrave; l&agrave;m việc.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599100087_3.jpg', '1599100087_2.jpg|1599100087_3.jpg|1599100087_4.jpg|1599100087_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 19:28:07', '2020-09-26 03:16:28'),
(160, 'Cho thuê căn 3PN giá 9.5tr tại Licogi 13 Tower Khuất Duy Tiến', 'cho-thue-can-3pn-gia-95tr-tai-licogi-13-tower-khuat-duy-tien', '164 Khuất Duy Tiến, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '66', '92', 9500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 92m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTừ vị tr&iacute; t&ograve;a nh&agrave;, dễ d&agrave;ng di chuyển tới đường Nguyễn Tr&atilde;i, V&agrave;nh Đai 3 - L&ecirc; Văn Lương, Trần Duy Hưng, L&aacute;ng Hạ... kết nối nhanh ch&oacute;ng tới quận Nam Từ Li&ecirc;m, Cầu Giấy v&agrave; Đống Đa.<br />\r\nGần với:&nbsp;Văn ph&ograve;ng C&ocirc;ng Chứng Thanh Xu&acirc;n, Nh&agrave; văn ho&aacute; quận Thanh Xu&acirc;n, Trường Đại học Ph&ograve;ng Ch&aacute;y Chữa Ch&aacute;y, di chuyển 01 km tới Trung T&acirc;m Hội nghị Quốc Gia, Bảo T&agrave;ng H&agrave; Nội, BigC Thăng Long, Đại Lộ Thăng Long.</p>\r\n\r\n<p>Đi khoảng 03 km tới Bến xe Mỹ Đ&igrave;nh, Khu li&ecirc;n hợp thể thao Mỹ Đ&igrave;nh, S&acirc;n vận động Mỹ Đ&igrave;nh. Tới trung t&acirc;m c&aacute;c quận l&acirc;n cận Đống Đa, Cầu Giấy chỉ mất 10 ph&uacute;t.<br />\r\nXung quanh t&ograve;a nh&agrave; c&oacute; nhiều nh&agrave; h&agrave;ng v&agrave; trung t&acirc;m thương mại, si&ecirc;u thị phục vụ kh&aacute;ch thu&ecirc; như: Nh&agrave; H&agrave;ng At, Anh H&ograve;a Bakery, Bami Bread Tố Hữu, Cafe Nguyễn, Si&ecirc;u thị BigC, Vinmart+...</p>\r\n\r\n<p>Trong t&ograve;a nh&agrave; v&agrave; l&acirc;n cận t&ograve;a nh&agrave; c&oacute; c&aacute;c ng&acirc;n h&agrave;ng: Ng&acirc;n H&agrave;ng Tmcp Ti&ecirc;n Phong (Tpbank), Agribank-Chi nh&aacute;nh L&aacute;ng Hạ, ATM- BIDV, ATM Techcombank, ATM - Maritime Bank&hellip;phục vụ nhu cầu giao dịch t&agrave;i ch&iacute;nh của kh&aacute;ch thu&ecirc;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1599100608_2.jpg', '1599100608_1.jpg|1599100608_3.jpg|1599100608_4.jpg|1599100608_5.jpg|1599100608_6.jpg|1599100608_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 1, 0, '2020-09-02 19:36:48', '2020-09-26 04:02:59'),
(161, 'Cho thuê căn 2PN full nội thất giá 20tr tại Tòa Tân Hoàng Minh - Tây Hồ', 'cho-thue-can-2pn-full-noi-that-gia-20tr-tai-toa-tan-hoang-minh-tay-ho', 'Khu D9, lô CC, phường Phú Thượng, Q. Tây Hồ, Tp. Hà Nội', 2, '67', '140', 20000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 140m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất cao cấp gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, n&oacute;ng lạnh, giường, sopha, đệm, tủ bếp,h&uacute;t m&ugrave;i, b&agrave;n ăn..<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n D&rsquo; El Dorado T&acirc;n Ho&agrave;ng Minh nằm tr&ecirc;n địa b&agrave;n quận T&acirc;y Hồ. Đ&acirc;y l&agrave; quận được được đ&aacute;nh gi&aacute; l&agrave; c&oacute; m&ocirc;i trường sống trong l&agrave;nh bậc nhất H&agrave; Nội. Dự &aacute;n tọa lạc giữa ng&atilde; tư Lạc Long Qu&acirc;n giao cắt với Nguyễn Ho&agrave;ng T&ocirc;n. Giao th&ocirc;ng th&ocirc;ng suất, đối nội đối ngoại cực kỳ thuận lợi.<br />\r\nTừ vị tr&iacute; trung t&acirc;m n&agrave;y, cư d&acirc;n tại dự &aacute;n Chung cư D&rsquo; El Dorado chỉ mất khoảng 5 ph&uacute;t để đi v&agrave;o trung t&acirc;m 2 quận Ba Đ&igrave;nh, Ho&agrave;n Kiếm.<br />\r\nVới thế đất 2 mặt tiền rộng r&atilde;i. Thật hiếm c&oacute; dự &aacute;n n&agrave;o khu vực Hồ T&acirc;y lại đắc địa như D&rsquo;. El dorado. Th&ecirc;m nữa, Dự &aacute;n D&rsquo;. El dorado kh&ocirc;ng bị bất kỳ t&ograve;a nh&agrave; n&agrave;o che chắn, ảnh hưởng tầm nh&igrave;n.<br />\r\nTừ Dự &aacute;n D&rsquo;. El dorado Ph&uacute; Thượng, qu&yacute; vị dễ d&agrave;ng kết nối với c&aacute;c khu vực trung t&acirc;m, vui chơi giải tr&iacute; sầm uất bậc nhất của thủ đ&ocirc; H&agrave; Nội:<br />\r\n&ndash; Đi đến Hồ Ho&agrave;n Kiếm chỉ mất khoảng 20 ph&uacute;t.<br />\r\n&ndash; Đi bộ ra Hồ T&acirc;y mất 1 ph&uacute;t.<br />\r\n&ndash; Đi đến cầu Nhật T&acirc;n chỉ mất 5 ph&uacute;t.<br />\r\n&ndash; Đi Cầu Giấy mất 10 ph&uacute;t.<br />\r\n&ndash; Đi đến Metro mất 15 ph&uacute;t.<br />\r\n&ndash; Đến C&ocirc;ng Vi&ecirc;n Nghĩa Đ&ocirc; mất 10 ph&uacute;t.<br />\r\nHoặc di chuyển ra ngoại th&agrave;nh hay đến c&aacute;c th&agrave;nh phố kh&aacute;c cũng v&ocirc; c&ugrave;ng nhanh ch&oacute;ng. Dự &aacute;n D&rsquo;. El dorado rất gần với cầu Nhật T&acirc;n, bến xe Mỹ Đ&igrave;nh v&agrave; nhanh ch&oacute;ng di chuyển ra s&acirc;n bay Nội B&agrave;i.<br />\r\nTrung t&acirc;m Spa, bể bơi v&agrave; Gym tại Chung cư D&rsquo; El dorado T&acirc;n Ho&agrave;ng Minh mang lại cho cư d&acirc;n kh&ocirc;ng gian chăm s&oacute;c sắc đẹp, sức khỏe. Vườn vọng cảnh Sky Garden l&agrave; kh&ocirc;ng gian thư gi&atilde;n v&ocirc; c&ugrave;ng th&uacute; vị.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 20tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất cao cấp', NULL, '1599101151_6.jpg', '1599101151_1.jpg|1599101151_2.jpg|1599101151_4.jpg|1599101151_6.jpg|1599101151_13.jpg|1599101151_14.jpg|1599101151_15.jpg|1599101151_16.jpg|1599101151_18.jpg|1599101151_20.jpg|1599101151_22.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 19:45:51', '2020-09-26 07:51:01'),
(162, 'Cho thuê căn 3PN full nội thất giá 14tr tại Hapulico Complex Thanh Xuân', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-hapulico-complex-thanh-xuan', 'Số 1 Nguyễn Huy Tưởng, Phường Thanh Xuân Trung, Thanh Xuân, Hà Nội', 2, '68', '110', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 110m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Hapulico Complex l&agrave; tổ hợp c&aacute;c c&ocirc;ng tr&igrave;nh khu thương mại, văn ph&ograve;ng, nh&agrave; ở cao cấp, nh&agrave; trẻ được x&acirc;y dựng&nbsp;ở vị tr&iacute; cực kỳ đắc địa: 3 mặt phố Nguyễn Huy Tưởng, Vũ Trọng Phụng v&agrave; Ngụy Như Kon Tum.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nhằm phục vụ tối đa bao gồm những căn hộ cao cấp, những văn ph&ograve;ng hiện đại v&agrave; trung t&acirc;m mua sắm lớn bậc nhất nh&igrave; H&agrave; Nội, trường học, bể bơi, ph&ograve;ng tập thể thao, s&acirc;n chơi cho trẻ em, khu vui chơi cho gia đ&igrave;nh &hellip; tất cả đều được bao quanh bởi những khu&ocirc;n vi&ecirc;n tr&agrave;n ngập m&agrave;u xanh v&agrave; &aacute;nh nắng.<br />\r\nHapulico Complex được x&acirc;y dựng theo ti&ecirc;u chuẩn quốc tế nhằm l&agrave;m h&agrave;i l&ograve;ng những chủ nh&acirc;n kh&oacute; t&iacute;nh nhất.&nbsp;Khu trung t&acirc;m thương mại được coi l&agrave; một điểm nhấn của khu Tổ hợp, với kh&ocirc;ng gian rộng lớn, được ph&acirc;n bổ đều tại c&aacute;c khối đế trong tất cả c&aacute;c t&ograve;a nh&agrave; của khu Hapulico Complex. Vị tr&iacute; thuận lợi cho việc đi lại, mua sắm, v&agrave; giải tr&iacute;.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&a