(163, 'Cho thuê nhà riêng nguyên căn 5 tầng 3PN full nội thất giá 15tr tại phố Phùng Chí Kiên - Cầu Giấy', 'cho-thue-nha-rieng-nguyen-can-5-tang-3pn-full-noi-that-gia-15tr-tai-pho-phung-chi-kien-cau-giay', 'Phố Phùng Chí Kiên, P. Nghĩa Đô, Q. Cầu Giấy, Hà Nội', 1, '50', '60', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 60m2 x 5 tầng.<br />\r\nThiết kế&nbsp;bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng. Tầng 1 th&ocirc;ng s&agrave;n.&nbsp;Nh&agrave; c&oacute; garo &ocirc; t&ocirc;,mặt tiền rộng &ocirc; t&ocirc; đỗ cửa.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nh&agrave; nằm tại mặt phố Ph&ugrave;ng Ch&iacute; Ki&ecirc;n, dễ d&agrave;ng di chuyển đến c&aacute;c tuyến đường ch&iacute;nh của th&agrave;nh phố như: Ho&agrave;ng Quốc Việt, Cầu Giấy, Trần Đăng Ninh. Gần Chợ Bưởi, Chợ Nghĩa T&acirc;n, C&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;, C&ocirc;ng an Quận Cầu Giấy, Bệnh viện E...v&agrave; nhiều trung t&acirc;m thương mại,h&agrave;nh ch&iacute;nh kh&aacute;c.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 3, 'Full nội thất', NULL, '1599102227_9.jpg', '1599102227_1.jpg|1599102227_2.jpg|1599102227_3.jpg|1599102227_4.jpg|1599102227_5.jpg|1599102227_6.jpg|1599102227_7.jpg|1599102227_8.jpg|1599102227_10.jpg|1599102227_11.jpg|1599102227_12.jpg|1599102227_13.jpg|1599102227_14.jpg|1599102227_15.jpg|1599102227_16.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 20:03:47', '2020-09-26 09:13:38'),
(164, 'Cho thuê căn 3PN full nội thất giá 14tr tại Chung cư phố Ngụy Như Kon Tum', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-chung-cu-pho-nguy-nhu-kon-tum', 'Đường Ngụy Như Kon Tum, P. Nhân Chính, Thanh Xuân, Hà Nội', 2, '69', '86.2', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 86.2m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, &nbsp;nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm tại phố Ngụy Như Kon Tum -&nbsp;Đ&acirc;y l&agrave; khu đất v&agrave;ng tại quận Thanh Xu&acirc;n với tiềm năng ph&aacute;t triển c&ugrave;ng quy hoạch đồng bộ.&nbsp;Từ dự &aacute;n c&oacute; thể dễ d&agrave;ng di chuyển qua c&aacute;c tuyến đường lớn kết nối v&ugrave;ng thuận tiện; gần c&aacute;c tuyến đường lớn, giao th&ocirc;ng huyết mạnh của quận Thanh Xu&acirc;n như L&ecirc; Văn Lương, Nguyễn Tr&atilde;i,&hellip;&nbsp;&nbsp;</p>\r\n\r\n<p>Dự &aacute;n&nbsp;sở hữu vị tr&iacute; đắc địa trong khu đ&ocirc; thị Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, khu đ&ocirc; thi hiện đại sầm uất nhất H&agrave; nội m&agrave; vẫn đảm bảo cho chủ nh&acirc;n căn hộ kh&ocirc;ng gian để tịnh dưỡng tinh thần.&nbsp; &nbsp;</p>\r\n\r\n<p>Với lợi thế hạ tầng tốt v&agrave; đồng bộ của quận Thanh Xu&acirc;n,&nbsp;chung cư Ngụy Như Kon Tum&nbsp;nằm trong khu vực d&acirc;n cư đ&atilde; ổn định sống từ l&acirc;u, gi&uacute;p cho việc sử dụng c&aacute;c dịch vụ xung quanh ngo&agrave;i dự &aacute;n dễ d&agrave;ng hơn.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599102764_thumb.jpg', '1599102764_1.jpg|1599102764_2.jpg|1599102764_3.jpg|1599102764_4.jpg|1599102764_5.jpg|1599102764_6.jpg|1599102764_7.jpg|1599102764_8.jpg|1599102764_9.jpg|1599102764_10.jpg|1599102764_11.jpg|1599102764_12.jpg|1599102764_13.jpg|1599102764_14.jpg|1599102764_15.jpg|1599102764_16.jpg|1599102764_17.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 20:12:44', '2020-09-26 04:10:31'),
(165, 'Cho thuê căn 3PN full nội thất giá 15tr tại Ngọc Khánh Plaza - Ba Đình', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-ngoc-khanh-plaza-ba-dinh', 'Số 2 Phạm Huy Thông, Phường Ngọc Khánh, Ba Đình, Hà Nội', 2, '70', '110', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 110m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNgọc Kh&aacute;nh Plaza nằm ngay tại vị tr&iacute; trung t&acirc;m quận Ba Đ&igrave;nh, thuận tiện cho giao thương v&agrave; h&agrave;nh ch&iacute;nh, l&yacute; tưởng cho c&aacute;c doanh nghiệp l&agrave;m việc. Vị tr&iacute; t&ograve;a nh&agrave; được coi l&agrave; cầu nối giữa trung t&acirc;m H&agrave; Nội cũ v&agrave; khu vực mới ph&aacute;t triển, được thừa hưởng trọn vẹn những ưu thế trong kết nối giao th&ocirc;ng v&agrave; hạ tầng. Đồng thời lại nằm gần Hồ Ngọc Kh&aacute;nh, được thừa hưởng trọn vẹn cảnh quan tuyệt đẹp, kh&ocirc;ng gian th&ocirc;ng tho&aacute;ng, trong l&agrave;nh hiếm c&oacute;.&nbsp;<br />\r\n+ Ph&iacute;a bắc gi&aacute;p với Hồ Ngọc Kh&aacute;nh</p>\r\n\r\n<p>+ Ph&iacute;a T&acirc;y Nam gi&aacute;p với đường La Th&agrave;nh, dự kiến sẽ mở rộng v&agrave; n&acirc;ng cấp.</p>\r\n\r\n<p>+ Ph&iacute;a Đ&ocirc;ng gi&aacute;p với đường Nguyễn Ch&iacute; Thanh.</p>\r\n\r\n<p>+ Nằm ngay gần những trục đường lớn như: Kim M&atilde;, Nguyễn Ch&iacute; Thanh, Ngọc Kh&aacute;nh, Giảng V&otilde;&hellip;</p>\r\n\r\n<p>+ 10 ph&uacute;t kết nối tới quận Ho&agrave;n Kiếm, T&acirc;y Hồ, Đống Đa, Cầu Giấy</p>\r\n\r\n<p>+ Gần c&aacute;c t&ograve;a nh&agrave; văn ph&ograve;ng lớn: Handi Resco Tower, VIT Tower&hellip;</p>\r\n\r\n<p>+ Chỉ 10 ph&uacute;t đi bộ l&agrave; tới kh&aacute;ch sạn Daewoo</p>\r\n\r\n<p>+ 8 ph&uacute;t đi bộ l&agrave; trung t&acirc;m thương mại Vincom Nguyễn Ch&iacute; Thanh</p>\r\n\r\n<p>+ Chỉ mất 10 ph&uacute;t l&agrave; tới c&aacute;c Đại sứ qu&aacute;n &Uacute;c, Nhật, Thụy Điển&hellip;<br />\r\nNgọc Kh&aacute;nh Plaza l&agrave; t&ograve;a văn ph&ograve;ng hạng B chất lượng, được đầu tư đồng bộ về hạ tầng kỹ thuật, tiện &iacute;ch v&agrave; dịch vụ chuy&ecirc;n nghiệp, mong muốn mang tới một nơi l&agrave;m việc tiện nghi, hiện đại cho c&aacute;c kh&aacute;ch h&agrave;ng.</p>\r\n\r\n<p>Đặc biệt l&agrave; t&ograve;a nh&agrave; hỗn hợp, l&agrave;m việc tại đ&acirc;y c&aacute;c kh&aacute;ch thu&ecirc; c&ograve;n được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch hiện đại từ khối chung cư như: ph&ograve;ng đọc s&aacute;ch, ph&ograve;ng tập thể thao, khu giải tr&iacute;, chơi cờ, chơi cờ, khu mua sắm đầy đủ.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599103501_2.jpg', '1599103501_1.jpg|1599103501_3.jpg|1599103501_4.jpg|1599103501_5.jpg|1599103501_6.jpg|1599103501_7.jpg|1599103501_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 20:25:01', '2020-09-26 08:01:41'),
(166, 'Cho thuê căn 3PN full nội thất giá 15tr tại Imperia Garden Nguyễn Huy Tưởng', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-imperia-garden-nguyen-huy-tuong', '115 Nguyễn Huy Tưởng, P. Thanh Xuân Trung,Q. Thanh Xuân, Hà Nội', 2, '43', '95', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 95m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Toạ lạc tr&ecirc;n trục đường Nguyễn Huy Tưởng thuộc Quận Thanh Xu&acirc;n &ndash; H&agrave; Nội, thuộc khu vực trung t&acirc;m kinh tế mới tại quận Thanh Xu&acirc;n &ndash; Cầu Giấy, Chung cư Imperia được hưởng trọn vẹn những li&ecirc;n kết v&ugrave;ng đầy đủ tiện &iacute;ch nhất, trường mẫu gi&aacute;o , tiểu học, trung học, đại học chỉ c&aacute;ch c&oacute; v&agrave;i chục đến v&agrave;i trăm m&eacute;t, chợ Nh&acirc;n Ch&iacute;nh, Big C&hellip;<br />\r\nTừ vị tr&iacute; của t&ograve;a nh&agrave; c&oacute; thể dễ d&agrave;ng kết nối với h&agrave;ng loạt c&aacute;c t&ograve;a chung cư cao cấp, hiện đại l&acirc;n cận như: Thăng Long Number One, Hapulico Complex, Royal City Nguyễn Tr&atilde;i, Golden Land Nguyễn Tr&atilde;i .Đặc biệt vị tr&iacute; chung cư Imperia Garden rất gần với điểm bắt t&agrave;u điện tr&ecirc;n kh&ocirc;ng dọc đường Nguyễn Tr&atilde;i, chắc chắn sẽ l&agrave;m tăng gi&aacute; trị của khu căn hộ hạng sang v&agrave; đồng bộ nhất quận Thanh Xu&acirc;n. Chỉ mất &iacute;t ph&uacute;t để đi tới c&aacute;c trục đường lớn: Đường Nguyễn Tr&atilde;i, Đường V&agrave;nh đai 3. C&aacute;c địa điểm lớn như: Si&ecirc;u thị BigC, Bến Xe Mỹ Đ&igrave;nh, S&acirc;n vận động quốc gia Mỹ Đ&igrave;nh, chung cư Grand Plaza, Chung cư 88 L&aacute;ng Hạ,&hellip;</p>\r\n\r\n<p>Được x&acirc;y dựng như một đ&ocirc; thị kiểu mẫu, Imperia Garden 203 Nguyễn Huy Tưởng mang đến cho cư d&acirc;n một hệ thống hạ tầng tiện &iacute;ch v&agrave; dịch vụ đồng bộ, kh&eacute;p k&iacute;n bao gồm: bể bơi 4 m&ugrave;a, bể bơi ngo&agrave;i trời, khu tập gym, khu vui chơi trẻ em, khu dưỡng sinh,chuỗi tiện &iacute;ch thương mại, hầm đỗ xe th&ocirc;ng minh, an ninh 3 lớp&hellip; tất cả nhằm tạo n&ecirc;n m&ocirc;i trường sống chất lượng cho cư d&acirc;n.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599104197_1.jpg', '1599104197_2.jpg|1599104197_3.jpg|1599104197_4.jpg|1599104197_5.jpg|1599104197_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 20:36:37', '2020-09-26 03:56:10'),
(168, 'Cho thuê nhà riêng nguyên căn 4 tầng 4PN giá 12tr tại Phố Trần Bình - Mỹ Đình', 'cho-thue-nha-rieng-nguyen-can-4-tang-4pn-gia-12tr-tai-pho-tran-binh-my-dinh', 'Đường Trần Bình, P. Mỹ Đình, Q. Nam Từ Liêm, Hà Nội', 2, '71', '45', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nNh&agrave;&nbsp;rộng 45m2 x 4 tầng,&nbsp;thiết kế hợp l&yacute; bao gồm 04 ph&ograve;ng ngủ, 02 nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng&nbsp;: Hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nh&agrave; c&oacute; garo &ocirc; t&ocirc; rộng, mặt tiền rộng &ocirc; t&ocirc; đỗ cửa. Nằm tại Phố Trần B&igrave;nh, thuận tiện di chuyển đến c&aacute;c địa điểm lớn như Bến xe Mỹ Đ&igrave;nh, S&acirc;n vận động Mỹ Đ&igrave;nh,&nbsp;Bệnh viện 19-8, Bệnh viện Y học cổ truyền; C&aacute;c trường đại học như Đại học Thương Mại, Đại học Ngoại Ngữ, Đại Học Quốc gia...Di chuyển ra đường Phạm H&ugrave;ng, đường Hồ T&ugrave;ng Mậu, đường Phạm H&ugrave;ng chỉ mất 2-3 ph&uacute;t.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 4, 2, 'Nội thất cơ bản', NULL, '1599105166_1.jpg', '1599105166_2.jpg|1599105166_3.jpg|1599105166_4.jpg|1599105166_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 20:52:46', '2020-09-26 03:17:09'),
