C&ocirc;ng vi&ecirc;n Y&ecirc;n Ho&agrave; diện t&iacute;ch 40ha, Khu tổ hợp văn ph&ograve;ng- nh&agrave; ở cao cấp Keangnam, Khu chung cư cao cấp The Manor, Trung t&acirc;m mua sắm BigC...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599107760_3.jpg', '1599107760_1.jpg|1599107760_2.jpg|1599107760_4.jpg|1599107760_5.jpg|1599107760_6.jpg|1599107760_7.jpg|1599107760_8.jpg|1599107760_9.jpg|1599107760_10.jpg|1599107760_11.jpg|1599107760_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 21:36:00', '2020-09-26 09:24:40'),
