(176, 'Cho thuê căn 2PN giá 10.5tr tại Goldmark City Hồ Tùng Mậu', 'cho-thue-can-2pn-gia-105tr-tai-goldmark-city-ho-tung-mau', '136 Hồ Tùng Mậu, Phường Phú Diễn, Bắc Từ Liêm, Hà Nội', 2, '8', '84', 10500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 84m2, t&ograve;a R3.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất nguy&ecirc;n bản.</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Tọa lạc tại vị tr&iacute; đắc địa, nơi sẽ l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế của Thủ đ&ocirc; trong tương lai, đầu mối trung t&acirc;m kết nối c&aacute;c trục đường lớn. GoldMark City &ndash; nằm ngay tr&ecirc;n mặt đường Nguyễn Cơ Thạch k&eacute;o d&agrave;i, đối diện khu c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a Mai Dịch gần 2 ha đ&atilde; được quy hoạch. Một vị tr&iacute; đắc địa, một điểm cộng vượt trội cho Goldmark City.</p>\r\n\r\n<p>Đặc biệt, đ&acirc;y cũng l&agrave; nơi tập trung tất cả c&aacute;c tuyến xe li&ecirc;n tỉnh, đặc biệt l&agrave; c&aacute;c tỉnh ph&iacute;a Đ&ocirc;ng, ph&iacute;a Nam Thủ đ&ocirc; như Bắc Ninh, Hưng Y&ecirc;n, Hải Dương, H&agrave; Nam, Ninh B&igrave;nh, Th&aacute;i B&igrave;nh, Nam Định, Thanh H&oacute;a, Nghệ An&hellip;</p>\r\n\r\n<p>Dễ d&agrave;ng di chuyển đến c&aacute;c địa điểm bệnh viện, trường đại học, bến xe: C&aacute;ch Đại học Thương Mại, Đại học S&acirc;n khấu Điện ảnh, Đại học Quốc Gia, Đại học Ngoại ngữ 0.3km; C&aacute;ch bệnh viện 198 0.9km; đi xe m&aacute;y đến S&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3p;gần c&aacute;c si&ecirc;u thị Fivimart, Pico Plaza, Media mart&hellip; Chung cư TNR GoldMark City t&iacute;ch hợp hơn 20 tiện &iacute;ch đẳng cấp như: Khu vui chơi trẻ em, Trung t&acirc;m thương mại hiện đại, Bar &ndash; Caf&eacute;, Vườn BBQ ngo&agrave;i trời, Spa thư gi&atilde;n &ndash; X&ocirc;ng hơi, Ph&ograve;ng tập Gym hiện đại&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất nguyên bản.', NULL, '1599108378_thumb.jpg', '1599108378_1.jpg|1599108378_2.jpg|1599108378_3.jpg|1599108378_4.jpg|1599108378_5.jpg|1599108378_6.jpg|1599108378_7.jpg|1599108378_8.jpg|1599108378_9.jpg|1599108378_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-02 21:46:18', '2020-09-25 03:10:34'),
(177, 'Cho thuê căn 2PN full nội thất giá 10.5tr tại 36 Xuân La - Tây Hồ', 'cho-thue-can-2pn-full-noi-that-gia-105tr-tai-36-xuan-la-tay-ho', '36 Xuân La, P. Xuân La, Q. Tây Hồ, Hà Nội', 2, '74', '74', 10500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 74m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nVị tr&iacute; CT36 Xu&acirc;n La &ndash; Bộ Quốc Ph&ograve;ng được x&acirc;y dựng tại l&ocirc; đất số 50 ng&otilde; 28 Xu&acirc;n La &ndash; Quận T&acirc;y Hồ &ndash; H&agrave; Nội, dự &aacute;n nằm trong khu vực d&acirc;n tr&iacute; cao của trung t&acirc;m quận.</p>\r\n\r\n<p>Khi đến với chung cư 36 Xu&acirc;n La, kh&aacute;ch h&agrave;ng kh&ocirc;ng phải lo lắng về việc đi lại của m&igrave;nh. Từ vị tr&iacute; n&agrave;y, cư d&acirc;n c&oacute; thể dễ d&agrave;ng di chuyển đến bất k&igrave; địa điểm n&agrave;o. C&aacute;ch Hồ t&acirc;y 200m, c&aacute;ch Cầu Nhật T&acirc;n 1km, c&aacute;ch c&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y hơn 1km, c&aacute;ch bến xe Mỹ Đ&igrave;nh v&agrave; S&acirc;n vận động Mỹ Đ&igrave;nh 6-8km...</p>\r\n\r\n<p>Dự &aacute;n CT36 Xu&acirc;n La sẽ mang lại cho cư d&acirc;n nơi đ&acirc;y cả về tiện &iacute;ch nội khu v&agrave; tiện &iacute;ch ngoại khu vượt trội, đ&aacute;p ứng đến 99% nhu cầu của mọi gia đ&igrave;nh: Trung t&acirc;m thương mại; Ph&ograve;ng tập Gym, Spa chăm s&oacute;c sức khỏe; Cảnh quan xanh Hồ T&acirc;y; Khu phố mua sắm: cửa h&agrave;ng tiện lợi, shop rượu, b&aacute;nh kẹo, dịch vụ giặt l&agrave;, bưu điện&hellip;; Đặc biệt hệ thống an ninh đảm bảo tối đa, an to&agrave;n, tiện lợi cho mọi cư d&acirc;n.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599108756_2.jpg', '1599108756_1.jpg|1599108756_3.jpg|1599108756_4.jpg|1599108756_5.jpg|1599108756_6.jpg|1599108756_7.jpg|1599108756_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 21:52:36', '2020-09-26 07:53:06'),
(178, 'Cho thuê căn 3PN full nội thất giá 16.5tr tại FLC Twin Tower Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-165tr-tai-flc-twin-tower-cau-giay', '265 Đường Cầu Giấy, P. Dịch Vọng, Q. Cầu Giấy, Hà Nội', 2, '41', '120', 16500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 120m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nVị tr&iacute; FLC Twin Towers tọa lạc tại 265 Cầu Giấy, tiếp gi&aacute;p với phố Trần Đăng Ninh v&agrave; phố Ch&ugrave;a H&agrave;, nằm trong vị tr&iacute; trung t&acirc;m của tam gi&aacute;c c&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a, Nghĩa T&acirc;n v&agrave; Thủ Lệ, dự &aacute;n FLC Twin Towers sở hữu vị tr&iacute; đẹp nhất khu vực trung t&acirc;m quận Cầu Giấy.</p>\r\n\r\n<p>Tuyến đường sắt tr&ecirc;n kh&ocirc;ng đầu ti&ecirc;n tại Việt Nam kết nối trực tiếp ga số 7 từ nhiều điểm kh&aacute;c nhau trong th&agrave;nh phố. Tuyến đường sắt tr&ecirc;n cao của th&agrave;nh phố (chạy từ Nhổn về Ga H&agrave; Nội) được kết nối với dự &aacute;n tại tầng 2 của Trung t&acirc;m thương mại l&agrave; một lợi thế to lớn so với c&aacute;c dự &aacute;n kh&aacute;c, đem lại sự thuận tiện trong giao th&ocirc;ng, sự đ&ocirc;ng đ&uacute;c &amp; nhộn nhịp của nhu cầu mua sắm, l&agrave; tiền đề cho sự th&agrave;nh c&ocirc;ng của Trung t&acirc;m thương mại.</p>\r\n\r\n<p>FLC Twin Towers hứa hẹn sẽ l&agrave; đ&iacute;ch đến của những thương hiệu mua sắm h&agrave;ng đầu trong khu vực v&agrave; thế giới.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 16.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599115403_11.jpg', '1599115404_1.jpg|1599115404_2.jpg|1599115404_3.jpg|1599115404_4.jpg|1599115404_5.jpg|1599115404_6.jpg|1599115404_7.jpg|1599115404_8.jpg|1599115404_9.jpg|1599115404_10.jpg|1599115404_11.jpg|1599115404_12.jpg|1599115404_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 23:43:24', '2020-09-26 09:11:27'),
(180, 'Cho thuê căn 3PN full nội thất giá 16tr tại Home City Trung Kính', 'cho-thue-can-3pn-full-noi-that-gia-16tr-tai-home-city-trung-kinh', '177 Trung Kính, Tổ 51, Phường Yên Hòa, Cầu Giấy, Hà Nội', 2, '22', '100', 16000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 100m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm cạnh dự &aacute;n c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Nam Trung Y&ecirc;n rộng tới 12ha, tr&ecirc;n con phố Trung K&iacute;nh đang mở rộng 42m với những h&agrave;ng c&acirc;y tỏa b&oacute;ng hai b&ecirc;n đường phố, Home City 177 Trung K&iacute;nh c&oacute; ưu thế đặc biệt về cảnh quan, m&ocirc;i trường v&agrave; kh&iacute; hậu m&aacute;t mẻ trong l&agrave;nh ngay giữa trung t&acirc;m Thủ đ&ocirc; H&agrave; Nội. Với vị tr&iacute; trung t&acirc;m, được bao bọc xung quanh bởi c&aacute;c khu đ&ocirc; thị như Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Trung H&ograve;a với những c&ocirc;ng vi&ecirc;n c&acirc;y xanh, những ng&ocirc;i nh&agrave; biệt thự, nh&agrave; vườn thanh b&igrave;nh dọc c&aacute;c tuyến phố &ocirc; b&agrave;n cờ; Xung quanh dự &aacute;n l&agrave; trung t&acirc;m thương mại sầm uất như Big C, Grand Plaza, Keangnam, Fivimart&hellip;</p>\r\n\r\n<p>Home City 177 Trung K&iacute;nh được thừa hưởng ngay một hệ thống dịch vụ tiện &iacute;ch v&agrave; hạ tầng đ&ocirc; thị đồng bộ. Chung cư Home City l&agrave; sự tổng h&ograve;a của những thiết kế th&ocirc;ng minh, kh&ocirc;ng gian cảnh quan lu&ocirc;n mở v&agrave; hệ thống dịch vụ tiện &iacute;ch, chu đ&aacute;o. Khối đế của c&aacute;c t&ograve;a nh&agrave; li&ecirc;n th&ocirc;ng nhau tạo ra một khoảng kh&ocirc;ng gian rộng lớn, nơi sẽ được bố tr&iacute; c&aacute;c dịch vụ như cửa h&agrave;ng thời trang, ăn uống, giải kh&aacute;t, si&ecirc;u thị, spa, nh&agrave; trẻ, văn ph&ograve;ng&hellip; nhằm mang đến cho cư d&acirc;n cuộc sống tiện nghi v&agrave; h&ograve;a nhập c&ugrave;ng cộng đồng.</p>\r\n\r\n<p>Phần khối đế ph&iacute;a trong khu đất được thiết kế th&ocirc;ng tầng để sử dụng l&agrave;m s&acirc;n chơi, đường dạo kết hợp c&acirc;y xanh cho c&aacute;c t&ograve;a nh&agrave;. Tại đ&acirc;y được bố tr&iacute; một trường tiểu học cao 5 tầng với diện t&iacute;ch s&agrave;n 2200 m2, kết hợp với diện t&iacute;ch s&agrave;n d&agrave;nh cho nh&agrave; trẻ trong c&aacute;c t&ograve;a cao tầng sẽ g&oacute;p phần tạo điều kiện thuận lợi cho cư d&acirc;n trong việc chăm s&oacute;c, gi&aacute;o dục những thế hệ tương lai.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 16tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599115987_1.jpg', '1599115987_2.jpg|1599115987_3.jpg|1599115987_4.jpg|1599115987_5.jpg|1599115987_6.jpg|1599115987_7.jpg|1599115987_8.jpg|1599115987_9.jpg|1599115987_10.jpg|1599115987_11.jpg|1599115987_12.jpg|1599115987_13.jpg|1599115987_14.jpg|1599115987_15.jpg|1599115987_16.jpg|1599115987_17.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-02 23:53:07', '2020-09-26 08:03:51'),
(181, 'Cho thuê căn 2PN full nội thất giá 12tr tại Luxury Park View - Cầu Giấy', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-luxury-park-view-cau-giay', '8 Phạm Văn Bạch, Yên Hoà, Cầu Giấy, Hà Nội', 2, '75', '70', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Luxury Park Views sở hữu vị tr&iacute; đắc địa tại KĐT mới Cầu Giấy, từ đ&acirc;y, cư d&acirc;n chỉ mất 2 ph&uacute;t di chuyển đến bến xe Mỹ Đ&igrave;nh, đường v&agrave;nh đai 3; 5 ph&uacute;t đến trung t&acirc;m Hội nghị Quốc gia, si&ecirc;u thị BigC Thăng Long...Hướng T&acirc;y Bắc dự &aacute;n đối diện Đại sứ qu&aacute;n Mỹ, hướng Bắc view trọn c&ocirc;ng vi&ecirc;n Cầu Giấy. Hướng T&acirc;y Nam nh&igrave;n ra đường Phạm Văn Bạch v&agrave; Viện Huyết học truyền m&aacute;u Trung ương. Hướng Đ&ocirc;ng Bắc nh&igrave;n ra trường Mầm non Vietkids...<br />\r\nNhờ vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, những cư d&acirc;n tương lai của Luxury Park Views được hưởng trọn một cuộc sống tiện nghi v&agrave; chất lượng.<br />\r\nChung cư Luxury Park Views c&oacute; hệ thống tiện &iacute;ch hiện đại, đẳng cấp: 03 tầng hầm để xe, Hệ thống an ninh 24/7, Khu vui chơi trẻ em, trường mầm non, Ph&ograve;ng gym, yoga, spa, Khu trung t&acirc;m thương mại, Bể bơi v&ocirc; cực, Sky garden...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599122572_7.jpg', '1599122572_1.jpg|1599122572_2.jpg|1599122572_3.jpg|1599122572_4.jpg|1599122572_5.jpg|1599122572_6.jpg|1599122572_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-03 01:42:52', '2020-09-26 09:25:58'),
(182, 'Cho thuê căn 3PN giá 10tr tại FLC Complex Phạm Hùng', 'cho-thue-can-3pn-gia-10tr-tai-flc-complex-pham-hung', '36 Phạm Hùng, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '32', '98', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng&nbsp;98m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Vị tr&iacute; của dự &aacute;n FLC Complex được xem l&agrave; một những vị tr&iacute; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội. Nằm tr&ecirc;n mặt đường của một trong những n&uacute;t giao th&ocirc;ng huyết mạch tấp nập h&agrave;ng đầu thu đ&ocirc; H&agrave; Nội. Căn hộ nằm ngay cạnh hai c&ocirc;ng vi&ecirc;n lớn Cầu Giấy v&agrave; Nh&acirc;n Ch&iacute;nh. Dự &aacute;n cũng được bao quanh bởi c&aacute;c khu văn ph&ograve;ng cao cấp như phố Duy T&acirc;n, KeangNam, Indochina Plaza c&ugrave;ng với c&aacute;c trường học v&agrave; bệnh viện.</p>\r\n\r\n<p>Dự &aacute;n nằm tiếp gi&aacute;p ngay với tuyến đường sắt tr&ecirc;n cao sẽ tiết kiệm tối đa thời gian di chuyển của kh&aacute;ch h&agrave;ng. Dự &aacute;n nằm ngay cạnh bến xe Mỹ Đ&igrave;nh 1, 2 gi&uacute;p cho qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể đi c&ocirc;ng t&aacute;c cũng như về qu&ecirc; của m&igrave;nh nhanh ch&oacute;ng v&agrave; tiện lợi nhất. FLC Complex nằm tiếp gi&aacute;p với rất nhiều cơ quan kinh tế &ndash; ch&iacute;nh trị &ndash; văn h&oacute;a của thủ đ&ocirc; H&agrave; Nội thuận tiện cho việc c&ocirc;ng t&aacute;c cũng như n&acirc;ng cao chất lượng cuộc sống cho cư d&acirc;n : Trung t&acirc;m hội nghị quốc gia, kh&aacute;ch sạn Grand Palaza, BigC, Trường ĐH Sư Phạm , ĐH C&ocirc;ng Nghiệp, ĐH S&acirc;n Khấu Điện Ảnh, Trường Amsetdam H&agrave; Nội&hellip;</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch xung quanh t&ograve;a chung cư FLC Complex 36 Phạm H&ugrave;ng đều to&aacute;t l&ecirc;n một kh&ocirc;ng gian sống ti&ecirc;n nghi, thư gi&atilde;n nghỉ ngơi sau những giờ l&agrave;m việc căng thẳng. Tại đ&acirc;y cũng được x&acirc;y dựng c&aacute;c dịch vụ kh&aacute;c như khu tập thể thao, trung t&acirc;m thương mại, bể bơi, nh&agrave; trẻ, s&acirc;n đậu trực thăng.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1599122952_thumb.jpg', '1599122952_1.jpg|1599122952_2.jpg|1599122952_3.jpg|1599122952_4.jpg|1599122952_5.jpg|1599122952_6.jpg|1599122952_7.jpg|1599122952_8.jpg|1599122952_9.jpg|1599122952_10.jpg|1599122952_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-03 01:49:12', '2020-09-26 02:48:20'),
(183, 'Cho thuê căn 2PN giá 11tr tại Vinhome D\'Capitale Trần Duy Hưng', 'cho-thue-can-2pn-gia-11tr-tai-vinhome-dcapitale-tran-duy-hung', 'Đường Trần Duy Hưng, Trung Hoà, Cầu Giấy, Hà Nội', 2, '76', '58', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 58m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n chung cư D&rsquo;. Capitale Trần Duy Hưng của T&acirc;n Ho&agrave;ng Minh tọa lạc tại khu đất v&agrave;ng tr&ecirc;n đường Trần Duy Hưng nơi c&oacute; hạ tầng cơ sở đồng bộ v&agrave; hiện đại bậc nhất của thủ đ&ocirc;. Tổ hợp dự &aacute;n sở hữu cả 4 mặt tiền tho&aacute;ng đ&atilde;ng, tiếp gi&aacute;p với c&aacute;c trục đường huyết mạch cửa ng&otilde; ph&iacute;a T&acirc;y như Khuất Duy Tiến, Ho&agrave;ng Minh Gi&aacute;m, Trần Duy Hưng. &nbsp;</p>\r\n\r\n<p>Hồ điều h&ograve;a C&ocirc;ng vi&ecirc;n Nh&acirc;n Ch&iacute;nh l&agrave; điểm nhấn nổi bật của to&agrave;n dự &aacute;n &ndash; vừa đ&oacute;ng vai tr&ograve; &ldquo;l&aacute; phổi xanh&rdquo; điều h&ograve;a kh&ocirc;ng kh&iacute; &ndash; mang đến kh&ocirc;ng gian sống trong l&agrave;nh cho Qu&yacute; cư d&acirc;n, vừa tượng trưng cho yếu tố &ldquo;thịnh vượng&rdquo; &ndash; phong thủy hanh th&ocirc;ng cho gia chủ. Từ vị tr&iacute; dự &aacute;n, Qu&yacute; cư d&acirc;n tương lai dễ d&agrave;ng kết nối đến c&aacute;c cơ quan h&agrave;nh ch&iacute;nh, trung t&acirc;m thương mại &ndash; giải tr&iacute;, bệnh viện, trường học &hellip; trong &nbsp;th&agrave;nh phố:<br />\r\n+ C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i: 25 ph&uacute;t l&aacute;i xe<br />\r\n+ C&aacute;ch trung t&acirc;m H&agrave; Nội &ndash; Hồ Gươm, Ga H&agrave; Nội: 15 ph&uacute;t l&aacute;i xe</p>\r\n\r\n<p>+ C&aacute;ch TT Hội nghị Quốc Gia: 01km<br />\r\n&nbsp;<br />\r\n+ C&aacute;ch s&acirc;n Vận động Quốc Gia Mỹ Đ&igrave;nh: 1.5km</p>\r\n\r\n<p>+ Gần hệ thống trường học c&aacute;c cấp: Trường Chuy&ecirc;n H&agrave; Nội &ndash; Amsterdam, trường Đại Học Quốc Gia, Trường ĐH Thương Mại, Trường THPT Lương Thế Vinh &hellip;</p>\r\n\r\n<p>+ Gần hệ thống TTTM &ndash; si&ecirc;u thị: Big C Thăng Long, Grand Plaza, The Garden, &hellip;</p>\r\n\r\n<p>+ Gần hệ thống bệnh viện: Bệnh viện 198, Viện Huyết Học Truyền M&aacute;u Trung ương, BV Giao Th&ocirc;ng Vận Tải &hellip;<br />\r\nNằm trong Trung t&acirc;m thương mại Vincom, si&ecirc;u thị VinMart sẽ mang đến cả một thế giới h&agrave;ng ti&ecirc;u d&ugrave;ng đa dạng, phong ph&uacute;, thỏa m&atilde;n mọi nhu cầu cho cuộc sống h&agrave;ng ng&agrave;y của cư d&acirc;n DCapitale Trần Duy Hưng.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1599123401_1.jpg', '1599123401_1.jpg|1599123401_2.jpg|1599123401_3.jpg|1599123401_4.jpg|1599123401_5.jpg|1599123401_6.jpg|1599123401_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-03 01:56:41', '2020-09-26 09:27:12'),
(184, 'Cho thuê căn 2PN full nội thất giá 8tr tại N04-B1 Thành Thái', 'cho-thue-can-2pn-full-noi-that-gia-8tr-tai-n04-b1-thanh-thai', 'Phố Thành Thái, Dịch Vọng, Cầu Giấy, Hà Nội', 2, '77', '60', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 60m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n Chung Cư N04 B1 - Tọa lạc Tr&ecirc;n đường Th&agrave;nh Th&aacute;i, khu đ&ocirc; thị Dịch Vọng, Cầu Giấy, H&agrave; Nội. Chung Cư N04 B1 nằm trong quần thể khu đ&ocirc; thị mới Dịch Vọng bao gồm c&aacute;c t&ograve;a nh&agrave; như: Chung cư H&agrave; Đ&ocirc; Park View, Chung cư N04B2, chung cư N06, Chung cư N07B1, Chung cư N07B2, Chung cư N07B3, Chung Cư N09B1, Chung cư N09B2, Chung cư CC1...<br />\r\nVị tr&iacute; đắc địa cạnh c&ocirc;ng vi&ecirc;n Cầu Giấy bao gồm khu hồ nước ,c&acirc;y xanh , s&acirc;n chơi &hellip; l&agrave; nơi giải tr&iacute; , thể dục thể thao l&yacute; tưởng của dư d&acirc;n chung cư N04 B1.&nbsp;<br />\r\nC&ocirc;ng vi&ecirc;n Cầu Giấy đ&oacute;ng vai tr&ograve; l&aacute; phổi xanh cho to&agrave;n khu vực, sống tại đ&acirc;y sẽ được hưởng kh&ocirc;ng kh&iacute; trong l&agrave;nh v&agrave; tho&aacute;ng m&aacute;t, rất tốt cho việc thư gi&atilde;n chạy bộ trong c&ocirc;ng vi&ecirc;n. Chung cư N04 B1 nắm trọn cả kh&ocirc;ng gian trong tầm mắt, tầm nh&igrave;n kh&ocirc;ng giới hạn với hướng nh&igrave;n về ph&iacute;a c&ocirc;ng vi&ecirc;n.</p>\r\n\r\n<p>Với phương ch&acirc;m đem đến cho kh&aacute;ch h&agrave;ng một cuộc sống thoải m&aacute;i v&agrave; tiện nghi, c&aacute;c nh&agrave; l&agrave;m N04B1 Dịch Vọng - Cầu Giấy kh&ocirc;ng những ch&uacute; trọng đặc biệt đến thiết kế c&aacute;c căn hộ cho ph&ugrave; hợp với phong thủy m&agrave; c&ograve;n đem đến cho c&aacute;c kh&aacute;ch h&agrave;ng của m&igrave;nh một cuộc sống đầy đủ ngay ch&iacute;nh tại nơi đ&acirc;y m&agrave; kh&ocirc;ng phải đi bất cứ đ&acirc;u như: mua sắm, giải tr&iacute;, chăm s&oacute;c sức khỏe, l&agrave;m đẹp, tập luyện thể thao... C&aacute;c tiện &iacute;ch ngay tại dự &aacute;n gi&uacute;p bạn tiết kiệm nhiều thời gian, c&ocirc;ng sức v&agrave; tiền bạc sẽ n&acirc;ng tầm cuộc sống cho bạn.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599123989_2.jpg', '1599123989_1.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-03 02:06:29', '2020-09-26 09:29:10'),
(185, 'Cho thuê căn 2PN giá 13.5tr tại Golden Palm Lê Văn Lương', 'cho-thue-can-2pn-gia-135tr-tai-golden-palm-le-van-luong', '71 Lê Văn Lương, Nhân Chính, Thanh Xuân, Hà Nội', 2, '78', '85', 13500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 85m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGolden Palm l&agrave; tổ hợp tiện &iacute;ch, trung t&acirc;m thương mại, chung cư cao cấp v&agrave; kh&ocirc;ng gian văn ph&ograve;ng được x&acirc;y dựng tr&ecirc;n 2 khối th&aacute;p cao 27 tầng. &nbsp;<br />\r\nThuận tiện kết nối linh hoạt: Tọa lạc tr&ecirc;n cung đường lớn L&ecirc; Văn Lương, t&ograve;a nh&agrave; Golden Palm c&oacute; được mạng lưới li&ecirc;n kết thuận tiện. Từ kh&ocirc;ng gian l&agrave;m việc, nh&acirc;n vi&ecirc;n văn ph&ograve;ng dễ d&agrave;ng di chuyển tới c&aacute;c địa điểm giao dịch, di chuyển về nh&agrave; hoặc hội nhập giao thương cũng như thừa hưởng hệ thống tiện &iacute;ch phong ph&uacute; xung quanh.<br />\r\nĐầy đủ hệ thống tiện &iacute;ch: B&ecirc;n cạnh hệ thống tiện &iacute;ch ngoại khu, b&ecirc;n trong t&ograve;a nh&agrave; Golden Palm cũng hiện hữu chuỗi tiện &iacute;ch nội khu đầy đủ c&oacute; khả năng đ&aacute;p ứng nhu cầu của to&agrave;n nh&acirc;n vi&ecirc;n khối văn ph&ograve;ng. Duy tr&igrave; v&agrave; ph&aacute;t triển những lợi thế sẵn c&oacute;, ban quản l&yacute; t&ograve;a nh&agrave; hứa hẹn một kh&ocirc;ng gian l&agrave;m việc tr&agrave;n đầy cảm hứng.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1600500062_9.jpg', '1601093570_5.jpg|1601093570_8.jpg|1601093570_9.jpg|1601093570_16.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-03 02:22:18', '2020-09-26 04:12:50'),
(186, 'Cho thuê căn 2PN giá 11.5tr tại Golden Land Nguyễn Trãi', 'cho-thue-can-2pn-gia-115tr-tai-golden-land-nguyen-trai', '275 Nguyễn Trãi, Thanh Xuân Trung, Thanh Xuân, Hà Nội', 2, '79', '93', 11500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 93m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Golden Land tọa lạc tại một vị tr&iacute; đắc địa &ndash; số 275 đường Nguyễn Tr&atilde;i, phường Thanh Xu&acirc;n Trung, Quận Thanh Xu&acirc;n, H&agrave; Nội, xung quanh c&oacute; nhiều trường đại học lớn như: Đại học Quốc gia H&agrave; Nội, Đại học H&agrave; Nội, Đại Học Kiến Tr&uacute;c, Học viện kỹ thuật Mật m&atilde;, Cao đẳng giao th&ocirc;ng vận tải&hellip;</p>\r\n\r\n<p>Tiếp gi&aacute;p với đường v&agrave;nh đai 3 (Nguyễn Xiển), Khuất Duy Tiến n&ecirc;n chỉ mất 10 ph&uacute;t để di chuyển tới Trung t&acirc;m thương mại BigC, Pico, Trung t&acirc;m hội nghị Quốc Gia, Khu đ&ocirc; thị Trung H&ograve;a- Nh&acirc;n Ch&iacute;nh, ng&atilde; tư Sở&hellip;&nbsp;Nằm tr&ecirc;n trục đường kết nối với c&aacute;c dự &aacute;n lớn như: Royal City, Mipec Tower, Viglacera, Vinaconex1&hellip;<br />\r\nGolden Land l&agrave; khu tổ hợp thương mại v&agrave; nh&agrave; ở cao cấp, kh&eacute;p k&iacute;n với đầy đủ tiện &iacute;ch: Bể bơi th&ocirc;ng minh, ph&ograve;ng tập GYM, Spa, nh&agrave; h&agrave;ng, hệ thống gi&aacute;o dục mầm non li&ecirc;n kết quốc tế để đưa ra một chương tr&igrave;nh ph&aacute;t triển tr&iacute; tuệ to&agrave;n diện cho trẻ thơ, hệ thống ph&ograve;ng kh&aacute;m đa khoa phục vụ 24/24, hệ thống si&ecirc;u thị, trung t&acirc;m thương mại.<br />\r\nC&aacute;c khu vui chơi trẻ em với đường đi dạo, ghế nghỉ, khu nh&agrave; h&agrave;ng được bố tr&iacute; kh&eacute;o l&eacute;o giữa những s&acirc;n vườn, dưới những c&acirc;y t&aacute;n l&aacute; rộng khiến kh&ocirc;ng gian xanh v&agrave; sạch của to&agrave; nh&agrave; như t&aacute;ch biệt với cuộc sống ồn &agrave;o của khu vực đang ph&aacute;t triển năng động nhất H&agrave; Nội.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1599126305_1.jpg', '1599126305_2.jpg|1599126305_3.jpg|1599126305_4.jpg|1599126305_5.jpg|1599126305_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-03 02:45:05', '2020-09-26 04:14:24'),
(187, 'Cho thuê căn 3PN giá 13tr tại Việt Đức Complex Lê Văn Lương', 'cho-thue-can-3pn-gia-13tr-tai-viet-duc-complex-le-van-luong', '39 Lê Văn Lương, Nhân Chính, Thanh Xuân, Hà Nội', 2, '80', '86', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 86m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Việt Đức Complex nằm tại ng&otilde; 164 Khuất Duy Tiến v&agrave; 39 L&ecirc; Văn Lương lại c&oacute; 4 hướng di chuyển thuận tiện v&agrave; linh hoạt, hưởng lợi từ cơ sở hạ tầng c&oacute; sẵn của khu vực về gi&aacute;o dục, kinh tế, giao th&ocirc;ng c&ocirc;ng cộng.</p>\r\n\r\n<p>Nằm ở vị tr&iacute; đắc địa của khu vực Thanh Xu&acirc;n, từ dự &aacute;n bạn c&oacute; thể dễ d&agrave;ng đi đến c&aacute;c địa điểm ch&iacute;nh kết nối của khu vực như trường học:THPT Amsterdam 700m, đại học ph&ograve;ng ch&aacute;y chữa ch&aacute;y 500m, Big C thăng long 1.3km, c&aacute;c bệnh viện Bộ x&acirc;y dựng 2.2 km, c&ocirc;ng vi&ecirc;n nh&acirc;n ch&iacute;nh 200m v&agrave; trung t&acirc;m hội nghị quốc gia 2km,&hellip;..rất ph&ugrave; hợp cho cư d&acirc;n khu lựa chọn mua tại đ&acirc;y d&ugrave; ở ngay hay đầu tư. Ngo&agrave;i ra, từ chung cư Việt Đức Complex c&oacute; nhiều c&aacute;ch dễ d&agrave;ng di chuyển đến c&aacute;c địa điểm ch&iacute;nh kh&aacute;c của khu vực bằng BRT kim m&atilde; &ndash; y&ecirc;n nghĩa từ đ&ocirc;ng sang t&acirc;y,v&agrave;nh đai 3- khuất duy tiến đi từ ph&iacute;a bắc xuống ph&iacute;a nam. Kết nối giao th&ocirc;ng thuận tiện với 4 trục đường lớn l&agrave; L&ecirc; Văn Lương, Khuất Duy Tiến, Ngụy Như Kontum, Nguyễn Tu&acirc;n; C&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh rộng hơn 13ha ngay đối diện dự &aacute;n.</p>\r\n\r\n<p>Nằm trong khu vực c&oacute; cơ sở hạ tầng về giao th&ocirc;ng, kinh tế, gi&aacute;o dục ph&aacute;t triển hiện đại nhất H&agrave; nội. Tiện &iacute;ch nội khu với bể bơi bốn m&ugrave;a, GYM, SPA, khu vui chơi trẻ em, khu mua sắm, hệ thống gi&aacute;o dục quốc tế.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1599127100_7.jpg', '1599127100_1.jpg|1599127100_2.jpg|1599127100_3.jpg|1599127100_4.jpg|1599127100_5.jpg|1599127100_6.jpg|1599127100_8.jpg|1599127100_9.jpg|1599127100_10.jpg|1599127100_11.jpg|1599127100_12.jpg|1599127100_13.jpg|1599127100_14.jpg|1599127100_15.jpg|1599127100_16.jpg|1599127100_17.jpg|1599127100_18.jpg|1599127100_19.jpg|1599127100_20.jpg', NULL, '21.000677, 105.799078', 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-03 02:58:20', '2020-09-26 04:21:05'),
(188, 'Cho thuê căn 2PN, 1P đa năng full nội thất giá 9tr tại CT1-2 KĐT Mễ Trì Hạ', 'cho-thue-can-2pn-1p-da-nang-full-noi-that-gia-9tr-tai-ct1-2-kdt-me-tri-ha', 'KĐT Mễ Trì Hạ, P. Mễ Trì, Q. Nam Từ Liêm, Hà Nội', 2, '65', '75', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, 1 ph&ograve;ng đa năng, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp..<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tr&ecirc;n trục đường Phạm H&ugrave;ng - cửa ng&otilde; ph&iacute;a T&acirc;y thủ đ&ocirc;, KĐT Mễ Trị Hạ c&oacute; 1 vị thế đắc địa cho cư d&acirc;n ở đ&acirc;y sinh sống v&agrave; l&agrave;m việc.</p>\r\n\r\n<p>KĐT quy tụ nhiều t&iacute;ch &iacute;ch đa dạng như c&aacute;c nh&agrave; h&agrave;ng lớn, hệ thống ph&ograve;ng gym, rạp chiếu phim, khu vui chơi cho trẻ em, chuỗi c&agrave; ph&ecirc;...hệ thống c&acirc;y x&acirc;y bao phủ mang lại kh&ocirc;ng gian tho&aacute;ng m&aacute;t cho cư d&acirc;n sinh sống tại đ&acirc;y.</p>\r\n\r\n<p>Căn hộ Khu đ&ocirc; thị Mễ Tr&igrave; Hạ được quy hoạch nằm trong khu vực ph&aacute;t triển của Thủ đ&ocirc; H&agrave; Nội với hệ thống tiện &iacute;ch ngoại khu đầy đủ được thừa hưởng từ nhiều c&ocirc;ng tr&igrave;nh dự &aacute;n lớn như: Khu đ&ocirc; thị Mỹ Đ&igrave;nh, Khu đ&ocirc; thị Mỹ Đ&igrave;nh I, The Manor H&agrave; Nội...Gần c&aacute;c trung t&acirc;m thương mại lớn như BigC Thăng Long, The Garden, Vincom Trần Duy Hưng...</p>\r\n\r\n<p>Từ đ&acirc;y, c&oacute; thể dễ d&agrave;ng di chuyển ra ph&iacute;a ngoại th&agrave;nh H&agrave; Nội hướng về c&aacute;c tỉnh ph&iacute;a T&acirc;y như H&agrave; Nam, Nam Định, Th&aacute;i B&igrave;nh...KĐT Mễ Tr&igrave; Hạ l&agrave; sự lựa chọn l&yacute; tưởng để sinh sống v&agrave; l&agrave;m việc.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599446570_18.jpg', '1599446570_1.jpg|1599446570_2.jpg|1599446570_3.jpg|1599446570_4.jpg|1599446570_5.jpg|1599446570_6.jpg|1599446570_7.jpg|1599446570_8.jpg|1599446570_9.jpg|1599446570_10.jpg|1599446570_11.jpg|1599446570_12.jpg|1599446570_13.jpg|1599446570_14.jpg|1599446570_15.jpg|1599446570_16.jpg|1599446570_17.jpg|1599446570_19.jpg|1599446570_20.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 02:42:50', '2020-09-26 03:16:04');
