(189, 'Cho thuê căn 2PN giá 9tr tại N06-B1 Thành Thái', 'cho-thue-can-2pn-gia-9tr-tai-n06-b1-thanh-thai', 'Phố Thành Thái, Dịch Vọng, Cầu Giấy, Hà Nội', 2, '81', '70', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &Aacute;n Chung Cư N06 -&nbsp;B1 - Tọa lạc Tr&ecirc;n đường Th&agrave;nh Th&aacute;i, khu đ&ocirc; thị Dịch Vọng, Cầu Giấy, H&agrave; Nội. Chung Cư N06 -&nbsp;B1 nằm trong quần thể khu đ&ocirc; thị mới Dịch Vọng bao gồm c&aacute;c t&ograve;a nh&agrave; như: Chung cư H&agrave; Đ&ocirc; Park View, Chung cư N04B2, Chung cư N07B1, Chung cư N07B2, Chung cư N07B3, Chung Cư N09B1, Chung cư N09B2, Chung cư CC1...<br />\r\nVị tr&iacute; đắc địa cạnh c&ocirc;ng vi&ecirc;n Cầu Giấy bao gồm khu hồ nước ,c&acirc;y xanh , s&acirc;n chơi &hellip; l&agrave; nơi giải tr&iacute; , thể dục thể thao l&yacute; tưởng của dư d&acirc;n chung cư N06 -&nbsp;B1.&nbsp;<br />\r\nChung cư N06 -&nbsp;B1 nắm trọn cả kh&ocirc;ng gian trong tầm mắt, tầm nh&igrave;n kh&ocirc;ng giới hạn với hướng nh&igrave;n về ph&iacute;a c&ocirc;ng vi&ecirc;n. Với phương ch&acirc;m đem đến cho kh&aacute;ch h&agrave;ng một cuộc sống thoải m&aacute;i v&agrave; tiện nghi, c&aacute;c nh&agrave; l&agrave;m N06 - B1 Dịch Vọng - Cầu Giấy kh&ocirc;ng những ch&uacute; trọng đặc biệt đến thiết kế c&aacute;c căn hộ cho ph&ugrave; hợp với phong thủy m&agrave; c&ograve;n đem đến cho c&aacute;c kh&aacute;ch h&agrave;ng của m&igrave;nh một cuộc sống đầy đủ ngay ch&iacute;nh tại nơi đ&acirc;y m&agrave; kh&ocirc;ng phải đi bất cứ đ&acirc;u như: mua sắm, giải tr&iacute;, chăm s&oacute;c sức khỏe, l&agrave;m đẹp, tập luyện thể thao...</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch ngay tại dự &aacute;n gi&uacute;p bạn tiết kiệm nhiều thời gian, c&ocirc;ng sức v&agrave; tiền bạc sẽ n&acirc;ng tầm cuộc sống cho bạn.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1599446979_thumb.jpg', '1599446979_1.jpg|1599446979_2.jpg|1599446979_3.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 02:49:39', '2020-09-26 09:30:46'),
(190, 'Cho thuê căn 2PN giá 8tr tại N04-B1 Thành Thái', 'cho-thue-can-2pn-gia-8tr-tai-n04-b1-thanh-thai', 'Phố Thành Thái, Dịch Vọng, Cầu Giấy, Hà Nội', 2, '77', '60', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 60m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Chung Cư N04 B1 - Tọa lạc Tr&ecirc;n đường Th&agrave;nh Th&aacute;i, khu đ&ocirc; thị Dịch Vọng, Cầu Giấy, H&agrave; Nội. Chung Cư N04 B1 nằm trong quần thể khu đ&ocirc; thị mới Dịch Vọng bao gồm c&aacute;c t&ograve;a nh&agrave; như: Chung cư H&agrave; Đ&ocirc; Park View, Chung cư N04B2, chung cư N06, Chung cư N07B1, Chung cư N07B2, Chung cư N07B3, Chung Cư N09B1, Chung cư N09B2, Chung cư CC1...<br />\r\nVị tr&iacute; đắc địa cạnh c&ocirc;ng vi&ecirc;n Cầu Giấy bao gồm khu hồ nước ,c&acirc;y xanh , s&acirc;n chơi &hellip; l&agrave; nơi giải tr&iacute; , thể dục thể thao l&yacute; tưởng của dư d&acirc;n chung cư N04 B1.&nbsp;<br />\r\nC&ocirc;ng vi&ecirc;n Cầu Giấy đ&oacute;ng vai tr&ograve; l&aacute; phổi xanh cho to&agrave;n khu vực, sống tại đ&acirc;y sẽ được hưởng kh&ocirc;ng kh&iacute; trong l&agrave;nh v&agrave; tho&aacute;ng m&aacute;t, rất tốt cho việc thư gi&atilde;n chạy bộ trong c&ocirc;ng vi&ecirc;n. Chung cư N04 B1 nắm trọn cả kh&ocirc;ng gian trong tầm mắt, tầm nh&igrave;n kh&ocirc;ng giới hạn với hướng nh&igrave;n về ph&iacute;a c&ocirc;ng vi&ecirc;n.</p>\r\n\r\n<p>Với phương ch&acirc;m đem đến cho kh&aacute;ch h&agrave;ng một cuộc sống thoải m&aacute;i v&agrave; tiện nghi, c&aacute;c nh&agrave; l&agrave;m N04B1 Dịch Vọng - Cầu Giấy kh&ocirc;ng những ch&uacute; trọng đặc biệt đến thiết kế c&aacute;c căn hộ cho ph&ugrave; hợp với phong thủy m&agrave; c&ograve;n đem đến cho c&aacute;c kh&aacute;ch h&agrave;ng của m&igrave;nh một cuộc sống đầy đủ ngay ch&iacute;nh tại nơi đ&acirc;y m&agrave; kh&ocirc;ng phải đi bất cứ đ&acirc;u như: mua sắm, giải tr&iacute;, chăm s&oacute;c sức khỏe, l&agrave;m đẹp, tập luyện thể thao... C&aacute;c tiện &iacute;ch ngay tại dự &aacute;n gi&uacute;p bạn tiết kiệm nhiều thời gian, c&ocirc;ng sức v&agrave; tiền bạc sẽ n&acirc;ng tầm cuộc sống cho bạn.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1599447239_2.jpg', '1599447239_1.jpg|1599447239_3.jpg|1599447239_4.jpg|1599447239_5.jpg|1599447239_6.jpg|1599447239_7.jpg|1599447239_8.jpg|1599447239_9.jpg|1599447239_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 02:53:59', '2020-09-26 09:28:33'),
(192, 'Cho thuê căn 3PN full nội thất giá 12tr tại Tultraco 335 Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-12tr-tai-tultraco-335-cau-giay', '335 đường Cầu Giấy, P. Dịch Vọng, Q. Cầu Giấy, Hà Nội', 2, '83', '95', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 95m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTo&agrave; nh&agrave; Tultraco sở hữu kiến tr&uacute;c hiện đại đột ph&aacute;, toạ lạc ngay tr&ecirc;n mặt đường 335 Cầu Giấy, H&agrave; Nội.</p>\r\n\r\n<p>Nằm tr&ecirc;n tuyến đường lớn của th&agrave;nh phố, từ t&ograve;a nh&agrave; dễ d&agrave;ng di chuyển v&agrave;o khu trung t&acirc;m chỉ mất v&agrave;i ph&uacute;t đi xe. Tầng 1 &ndash; 3 của t&ograve;a nh&agrave; l&agrave; si&ecirc;u thị phục vụ cho nhu cầu sinh hoạt v&agrave; mua b&aacute;n của cư d&acirc;n; từ tầng 4 trở l&ecirc;n l&agrave; c&aacute;c căn hộ cao cấp.</p>\r\n\r\n<p>To&agrave; Nh&agrave; 335 Cầu Giấy tận hưởng c&aacute;c tiện &iacute;ch ngoại khu phong ph&uacute;: gần c&ocirc;ng vi&ecirc;n Cầu Giấy, c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;; c&aacute;c trường đại học như B&aacute;o ch&iacute; Tuy&ecirc;n truyền, Đại học Sư phạm, Đại học Ngoại ngữ, Đại học Quốc gia...v&agrave; c&aacute;c bệnh viện lớn như Bệnh viện 19-8, Bệnh viện Y học cổ truyền....<br />\r\nNằm tại quận Cầu Giấy, trung t&acirc;m h&agrave;nh ch&iacute;nh mới của Thủ đ&ocirc;, t&ograve;a nh&agrave; Tultraco Cầu Giấy l&agrave; nơi sống v&agrave; l&agrave;m việc l&yacute; tưởng cho mọi gia đ&igrave;nh v&agrave; doanh nghiệp.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599448322_2.jpg', '1599448322_1.jpg|1599448322_3.jpg|1599448322_4.jpg|1599448322_5.jpg|1599448322_6.jpg|1599448322_7.jpg|1599448322_8.jpg|1599448322_9.jpg|1599448322_10.mp4.tmp', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 03:12:02', '2020-09-26 09:32:32'),
(193, 'Cho thuê căn 2PN full nội thất giá 10tr tại Green Star Phạm Văn Đồng', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '70', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ,nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGreen Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1599448762_2.jpg', '1599448763_1.jpg|1599448763_3.jpg|1599448763_4.jpg|1599448763_5.jpg|1599448763_6.jpg|1599448763_7.jpg|1599448763_8.jpg|1599448763_9.jpg|1599448763_10.jpg|1599448763_11.jpg|1599448763_12.jpg|1599448763_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 03:19:23', '2020-09-25 04:10:04'),
