(198, 'Cho thuê căn 2PN full nội thất giá 11tr tại Iris Garden Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-iris-garden-my-dinh', 'Số 30 Trần Hữu Dực, Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '10', '62', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 62m2 nằm tại t&ograve;a CT3.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Iris Garden l&agrave; tổ hợp căn hộ cao cấp, kết hợp thương mại dịch vụ, nhưng vẫn bảo đảm c&aacute;c điều kiện chặt chẽ về d&ograve;ng sản phẩm &quot;căn hộ sức khỏe&quot; của Tập đo&agrave;n Vimefulland.</p>\r\n\r\n<p>C&ocirc;ng tr&igrave;nh nằm tr&ecirc;n đường Trần Hữu Dực, trục đường huyết mạch của quận Nam Từ Li&ecirc;m, H&agrave; Nội. Chung cư c&oacute; hạ tầng đồng bộ, tầm nh&igrave;n kho&aacute;ng đạt, đối diện ngay Cung Điền kinh Thể thao Quốc gia. C&aacute;ch S&acirc;n vận động Mỹ Đ&igrave;nh 2 ph&uacute;t đi xe, c&aacute;ch bến xe Mỹ Đ&igrave;nh v&agrave; đường Phạm H&ugrave;ng 3 ph&uacute;t, đi bộ ra đường Hồ T&ugrave;ng Mậu khoảng 2 ph&uacute;t, gần c&aacute;c trường đại học như Đại học Thương Mại, Đại học Quốc Gia, Đại học Ngoại ngữ.</p>\r\n\r\n<p>Xung quanh l&agrave; c&aacute;c chung cư cao cấp như Mon City, Sun Square với đầy đủ c&aacute;c tiện &iacute;ch: nh&agrave; h&agrave;ng, ph&ograve;ng gym, s&acirc;n b&oacute;ng, rạp chiếu phim, bể bơi&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599452325_6.jpg', '1599452325_1.jpg|1599452325_2.jpg|1599452325_3.jpg|1599452325_4.jpg|1599452325_5.jpg|1599452325_7.jpg|1599452325_8.jpg|1599452325_9.jpg|1599452325_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 04:18:45', '2020-10-05 04:36:37'),
(199, 'Cho thuê căn 2PN full nội thất giá 10tr tại Vimeco II - Nguyễn Chánh', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-vimeco-ii-nguyen-chanh', 'Đường Nguyễn Chánh, Phường Trung Hòa, Cầu Giấy, Hà Nội', 2, '86', '88', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 88m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư CT4 Vimeco Nguyễn Ch&aacute;nh tọa lạc tại vị tr&iacute; v&agrave;ng phố Nguyễn Ch&aacute;nh, khu đ&ocirc; thị Trung H&ograve;a, được coi l&agrave; tuyến phố đẹp v&agrave; rộng r&atilde;i nhất quận Cầu Giấy, giao th&ocirc;ng cực k&igrave; thuận tiện. L&agrave; t&acirc;m điểm của những tuyến phố trọng điểm của thủ đ&ocirc; như: Phạm H&ugrave;ng, Trần Duy Hưng, Trung K&iacute;nh, đường L&aacute;ng&hellip;&nbsp;<br />\r\nVới vị tr&iacute; trung t&acirc;m: được bao bọc bởi c&aacute;c khu đ&ocirc; thị lớn như Trung H&ograve;a &ndash; Nh&acirc;n Ch&iacute;nh, Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Y&ecirc;n H&ograve;a&hellip;<br />\r\n&ndash; L&agrave; khu vực c&oacute; hạ tầng kĩ thuật đồng bộ, ho&agrave;n hảo. Xung quanh l&agrave; c&aacute;c si&ecirc;u thị, trung t&acirc;m thương mại sầm uất như BigC, Grand Plaza, KeangNam, The Garden&hellip;<br />\r\nVì nằm ở vị trí được coi là trung t&acirc;m b&acirc;̣c nh&acirc;́t thủ đ&ocirc; n&ecirc;n xung quanh chung cư CT4 Vimeco có đ&acirc;̀y đủ các ti&ecirc;̣n ích từ:<br />\r\n&ndash; H&ecirc;̣ th&ocirc;́ng các trường ti&ecirc;̉u học, c&acirc;́p 1, c&acirc;́p 2, c&acirc;́p 3 (Y&ecirc;n H&ograve;a, Nh&acirc;n Ch&iacute;nh, Amsterdams&hellip;)<br />\r\n&ndash; Hệ thống c&aacute;c trường đại học lớn: Lao Động &ndash; X&atilde; Hội, Ngoại Thương, Giao Th&ocirc;ng, Luật, C&ocirc;ng Đo&agrave;n&hellip;<br />\r\n&ndash; H&ecirc;̣ th&ocirc;́ng chợ, si&ecirc;u thị, b&ecirc;̣nh vi&ecirc;̣n&hellip;<br />\r\nTừ tầng 1 &ndash; 4 của dự &aacute;n CT4 Vimeco Nguyễn Ch&aacute;nh được d&agrave;nh l&agrave;m sảnh đ&oacute;n tiếp v&agrave; trung t&acirc;m thương mại hiện đại, đầy đủ vừa cung cấp c&aacute;c dịch vụ cao cấp cho cư d&acirc;n trong t&ograve;a nh&agrave; vừa cung cấp những dịch vụ h&agrave;ng đầu cho cả những người d&acirc;n ở khu vực l&acirc;n cận c&ugrave;ng được sử dụng: si&ecirc;u thị mini, khu vui chơi giải tr&iacute;, nh&agrave; h&agrave;ng ẩm thực,&hellip;.<br />\r\nNgo&agrave;i c&aacute;c tiện &iacute;ch nằm ở tầng 1 &ndash; 4 của dự &aacute;n, chung cư CT4 Vimeco Nguyễn Ch&aacute;nh c&ograve;n x&acirc;y dựng hệ thống c&ocirc;ng vi&ecirc;n c&acirc;y xanh v&agrave; đường tản bộ xung quanh dự &aacute;n để tăng kh&ocirc;ng gian xanh trong l&agrave;nh của dự &aacute;n v&agrave; cư d&acirc;n được hưởng trọn vẹn hơn cuộc sống trong l&agrave;nh ngay giữa thủ đ&ocirc;.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599452674_1.jpg', '1599452674_2.jpg|1599452674_3.jpg|1599452674_4.jpg|1599452674_5.jpg|1599452674_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 04:24:34', '2020-09-26 09:37:02'),
