 C&ocirc;ng Đo&agrave;n&hellip;<br />\r\n&ndash; H&ecirc;̣ th&ocirc;́ng chợ, si&ecirc;u thị, b&ecirc;̣nh vi&ecirc;̣n&hellip;</p>\r\n\r\n<p>Từ tầng 1 &ndash; 4 của dự &aacute;n CT4 Vimeco Nguyễn Ch&aacute;nh được d&agrave;nh l&agrave;m sảnh đ&oacute;n tiếp v&agrave; trung t&acirc;m thương mại hiện đại, đầy đủ vừa cung cấp c&aacute;c dịch vụ cao cấp cho cư d&acirc;n trong t&ograve;a nh&agrave; vừa cung cấp những dịch vụ h&agrave;ng đầu cho cả những người d&acirc;n ở khu vực l&acirc;n cận c&ugrave;ng được sử dụng: si&ecirc;u thị mini, khu vui chơi giải tr&iacute;, nh&agrave; h&agrave;ng ẩm thực,&hellip;.<br />\r\nNgo&agrave;i c&aacute;c tiện &iacute;ch nằm ở tầng 1 &ndash; 4 của dự &aacute;n, chung cư CT4 Vimeco Nguyễn Ch&aacute;nh c&ograve;n x&acirc;y dựng hệ thống c&ocirc;ng vi&ecirc;n c&acirc;y xanh v&agrave; đường tản bộ xung quanh dự &aacute;n để tăng kh&ocirc;ng gian xanh trong l&agrave;nh của dự &aacute;n v&agrave; cư d&acirc;n được hưởng trọn vẹn hơn cuộc sống trong l&agrave;nh ngay giữa thủ đ&ocirc;.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599453166_1.jpg', '1599453166_2.jpg|1599453166_3.jpg|1599453166_4.jpg|1599453166_5.jpg|1599453166_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 04:32:46', '2020-09-26 09:36:37'),
(201, 'Cho thuê căn 2PN full nội thất giá 12tr tại CC Central Field Trung Kính', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-cc-central-field-trung-kinh', 'Số 219 Trung Kính, Yên Hòa, quận Cầu Giấy, Hà Nội', 2, '24', '70', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự án 219 Trung Kính tọa lạc tại địa chỉ số 219 Trung K&iacute;nh phường Y&ecirc;n H&ograve;a, quận Cầu Giấy - trung t&acirc;m của kinh tế, x&atilde; hội, văn h&oacute;a, ch&iacute;nh trị v&agrave; gi&aacute;o dục của Thủ Đ&ocirc; H&agrave; Nội. Nơi đ&acirc;y kh&ocirc;ng chỉ sở hữu 1 mạng lưới giao th&ocirc;ng hiện đại, t&acirc;n tiến m&agrave; c&ograve;n l&agrave; khu vực tập trung nhiều cơ sở hạ tầng trọng điểm, c&aacute;c khu đ&ocirc; thị ph&aacute;t triển năng động của Quận Cầu Giấy. Chung cư 219 Trung K&iacute;nh c&oacute; ưu thế đặc biệt kh&ocirc;ng chỉ nhờ vị tr&iacute; đẳng cấp, cảnh quan m&ocirc;i trường c&acirc;y xanh, kh&iacute; hậu m&aacute;t mẻ ngay giữa trung t&acirc;m thủ đ&ocirc; H&agrave; Nội m&agrave; c&ograve;n được thừa hưởng hệ thống c&aacute;c tiện &iacute;ch ngoại khu vượt trội.<br />\r\n- Dự &aacute;n cũng gần ngay c&aacute;c trường học nổi tiếng H&agrave; Nội như: Trường Amsterdam, trường THPT Nguyễn Si&ecirc;u, Trường THPT Y&ecirc;n H&ograve;a, trường Lương Thế Vinh....<br />\r\n- C&aacute;c c&ocirc;ng tr&igrave;nh trọng điểm đầy cũng ch&iacute;nh l&agrave; điểm s&aacute;ng của dự &aacute;n: Chợ Trung K&iacute;nh, Viện Huyết Học, c&aacute;c trường Đại Học, Cao Đẳng trong b&aacute;n k&iacute;nh chưa đầy 2km.<br />\r\n- C&aacute;c cơ quan quan trọng của H&agrave; Nội v&agrave; ch&iacute;nh phủ như: Thanh Tra Ch&iacute;nh Phủ; Bộ Nội Vụ; Bộ T&agrave;i nguy&ecirc;n &amp; M&ocirc;i trường; Bộ Kế hoạch &amp; Đầu tư; Viện kiểm s&aacute;t nh&acirc;n d&acirc;n Tối Cao (đang x&acirc;y dựng); Tổng cục Hải Quan; Tổng cục đường bộ; Viện dầu kh&iacute; Việt Nam<br />\r\n- Nhiều bệnh viện lớn: Bệnh viện 19-8; Bệnh viện Giao Th&ocirc;ng Vận Tải TW; Bệnh viện Nhi; Bệnh viện Phụ Sản;&hellip;<br />\r\n- Chợ v&agrave; si&ecirc;u thị lớn như: Chợ Y&ecirc;n H&ograve;a, chợ Trung K&iacute;nh, Si&ecirc;u thị Fivimart, BigC Thăng Long, BigC Garden,&hellip;<br />\r\n- Khu hội nghị, vui chơi giải tr&iacute;: Trung t&acirc;m Hội nghị Quốc Gia, Bảo t&agrave;ng H&agrave; Nội, C&ocirc;ng vi&ecirc;n Cầu Giấy, C&ocirc;ng vi&ecirc;n mini Khu đ&ocirc; thị mới Y&ecirc;n H&ograve;a, Rạp chiếu phim Lotte Cinema; nhiều s&acirc;n b&oacute;ng đ&aacute; xung quanh dự &aacute;n;&hellip;<br />\r\n<br />\r\nThiết kế khu&ocirc;n vi&ecirc;n với c&aacute;c c&ocirc;ng vi&ecirc;n c&acirc;y xanh lớn kết hợp với nhiều tiện &iacute;ch gi&uacute;p cho cư d&acirc;n c&oacute; một kh&ocirc;ng gian thư gi&atilde;n ho&agrave;n hảo, đẳng cấp b&ecirc;n gia đ&igrave;nh. Trung t&acirc;m thương mại nằm từ tầng 1 tới tầng 6 của t&ograve;a nh&agrave;, bao gồm c&aacute;c thương hiệu h&agrave;ng đầu trong nước v&agrave; thế giới, c&aacute;c dịch vụ ẩm thực, spa tiện nghi, khu thể thao, khu vui chơi, khu tiện &iacute;ch c&ocirc;ng cộng như: ph&ograve;ng sinh hoạt chung, bể bơi, spa, gym, yoga, thể dục thẩm mỹ, si&ecirc;u thị, trung t&acirc;m mua sắm, nh&agrave; h&agrave;ng hay c&aacute;c dịch vụ tại nh&agrave; s&acirc;n chơi ngo&agrave;i trời tại tầng 6&hellip;..Bể bơi bốn m&ugrave;a được bố tr&iacute; tr&ecirc;n tầng 17 to&agrave; văn ph&ograve;ng l&agrave; điểm nhấn của dự &aacute;n.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599461158_5.jpg', '1599461158_1.jpg|1599461158_2.jpg|1599461158_3.jpg|1599461158_4.jpg|1599461158_6.jpg|1599461158_7.jpg|1599461158_8.jpg|1599461158_9.jpg|1599461158_10.jpg|1599461158_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 06:45:58', '2020-09-26 08:52:05'),
(203, 'Cho thuê căn 2PN giá 8tr tại KĐT Nghĩa Đô', 'cho-thue-can-2pn-gia-8tr-tai-kdt-nghia-do', 'Phố Trần Cung, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '35', '62', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ tầng thấp rộng 62m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; với hạ tầng kỹ thuật đồng bộ, tạo cảnh quan đẹp cho khu vực sẽ l&agrave; trung t&acirc;m mới của Thủ đ&ocirc; trong tương lai.&nbsp;Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; kh&ocirc;ng chỉ c&oacute; gi&aacute; trị cao về kh&ocirc;ng gian kiến tr&uacute;c, chất lượng c&ocirc;ng tr&igrave;nh m&agrave; c&ograve;n c&ograve;n sở hữu vị tr&iacute; đắc địa v&agrave; n&eacute;t đặc trưng m&agrave; &iacute;t dự &aacute;n c&oacute; được.</p>\r\n\r\n<p>Khu đ&ocirc; thị Nghĩa Đ&ocirc; nằm trong mạng lưới giao th&ocirc;ng huyết mạch khu vực T&acirc;y Nam H&agrave; Nội, s&aacute;t tuyến đường v&agrave;nh đai 2 v&agrave; kh&ocirc;ng qu&aacute; xa so với đường v&agrave;nh đai 3, chỉ c&aacute;ch đường Ho&agrave;ng Quốc Việt khoảng 200m, c&aacute;ch chợ Bưởi hơn 1 km, gần c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc; v&agrave; gần 6 tuyến đường lớn như Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt, Phạm Văn Đồng, Nguyễn Ho&agrave;ng T&ocirc;n, Trần Cung, Lạc Long Qu&acirc;n.</p>\r\n\r\n<p>Khu đ&ocirc; thị c&oacute; thiết kế tho&aacute;ng, hệ thống c&acirc;y xanh v&agrave; đường dạo bộ, mật độ x&acirc;y dựng khoảng 30-32%, c&oacute; cơ sở hạ tầng đồng bộ. Ngo&agrave;i ra, Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; nằm cạnh trục đường 40m hiện đang thi c&ocirc;ng, đối diện với hồ điều h&ograve;a rộng 4,9ha của dự &aacute;n Starlake (dự &aacute;n T&acirc;y Hồ T&acirc;y cũ) n&ecirc;n cư d&acirc;n nơi đ&acirc;y sẽ được hưởng lợi chung hạ tầng n&agrave;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601286487_8.jpg', '1601286487_4.jpg|1601286487_8.jpg|1601286487_9.jpg|1601286487_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 06:59:37', '2020-09-28 09:48:07'),
(206, 'Cho thuê căn 3PN giá 12tr tại Viwaseen Tower Tố Hữu', 'cho-thue-can-3pn-gia-12tr-tai-viwaseen-tower-to-huu', '48 P. Tố Hữu, Trung Văn, Từ Liêm, Hà Nội', 2, '88', '130', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 130m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Viwaseen Tower nằm tr&ecirc;n mặt đường Tố Hữu (L&ecirc; Văn Lương k&eacute;o d&agrave;i), c&aacute;ch ng&atilde; tư Khuất Duy Tiến với L&ecirc; Văn Lương khoảng 300m, c&aacute;ch BigC khoảng 800m, giao th&ocirc;ng đi lại thuận tiện.&nbsp;Đ&acirc;y l&agrave; trục giao th&ocirc;ng cửa ng&otilde; của khu đ&ocirc; thị mới Ph&ugrave;ng Khoang đồng thời l&agrave; tuyến giao th&ocirc;ng huyết mạch kết nối chuỗi khu đ&ocirc; thị mới như Nam Cường, Văn Ph&uacute; &ndash; H&agrave; Đ&ocirc;ng.. với trung t&acirc;m th&agrave;nh phố H&agrave; Nội.</p>\r\n\r\n<p>Xung quanh l&agrave; hệ thống c&aacute;c trường ĐH lớn như : Trường ĐH Quốc Gia, Đại học Ngoại ngữ H&agrave; Nội, Đại học Thương Mại. Trường PTTH Amsterdam 800m. Trường THCS Việt Nam &ndash; Angieri, Trường TH Đặng Trần C&ocirc;n c&aacute;ch 400m. C&aacute;ch Trung t&acirc;m Hội Nghị Quốc Gia, si&ecirc;u thị BigC 1km, Chợ Nh&acirc;n Ch&iacute;nh, Thanh Xu&acirc;n Bắc, Ph&ugrave;ng Khoang&hellip; khoảng 1km. Tiệm cận hệ thống c&aacute;c bệnh viện lớn: Bệnh viện y học cổ truyền &ndash; Bộ C&ocirc;ng An, Bệnh viện quốc tế Nam Cường.</p>\r\n\r\n<p>Chung cư Viwaseen Tower Tố Hữu kh&ocirc;ng chỉ thừa hưởng to&agrave;n bộ c&aacute;c ti&ecirc;n &iacute;ch khu vực m&agrave; c&ograve;n c&oacute; nhiều dịch vụ, tiện &iacute;ch nội khu cao cấp đ&aacute;p ứng mọi nhu cầu thường nhật của qu&yacute; kh&aacute;ch h&agrave;ng ngay tại dự &aacute;n. 05 tầng dịch vụ thương mại tại chung cư Viwaseen Tower l&ecirc; văn lương bao gồm: Sảnh ch&iacute;nh, thang m&aacute;y, giếng trời, khu sinh hoạt chung, nh&agrave; trẻ, khu y tế, hệ thống trung t&acirc;m thương mại, si&ecirc;u thị, khu tập Gym, spa, chăm s&oacute;c sắc đẹp với c&aacute;c trang thiết bị hiện đại, s&acirc;n chơi trẻ em, khu vực s&acirc;n vườn cảnh quan,&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599469956_6.jpg', '1599469956_1.jpg|1599469956_2.jpg|1599469956_3.jpg|1599469956_4.jpg|1599469956_5.jpg|1599469956_6.jpg|1599469956_7.jpg|1599469956_8.jpg|1599469956_9.jpg|1599469956_10.jpg|1599469956_11.jpg|1599469956_12.jpg|1599469956_13.jpg|1599469956_14.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-07 09:12:36', '2020-09-26 03:20:58'),
(207, 'Cho thuê căn 3PN giá 10.5tr tại Sakura Tower 47 Vũ Trọng Phụng', 'cho-thue-can-3pn-gia-105tr-tai-sakura-tower-47-vu-trong-phung', '47 Vũ Trọng Phụng, Phường Thanh Xuân Trung, Thanh Xuân, Hà Nội', 2, '6', '80', 10500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung Cư Sakura được thiết kế t&iacute;ch hợp quần thể đa chức năng bao gồm cả khu thương mại, mua sắm, giải tr&iacute;, chăm s&oacute;c sức khỏe ngay trong t&ograve;a nh&agrave;, gi&uacute;p c&aacute;c đối tượng d&acirc;n cư sinh sống tại đ&acirc;y tiết kiệm được thời gian đ&aacute;ng kể khi sử dụng những dịch vụ tiện nghi v&agrave; gần nhất.</p>\r\n\r\n<p>Phong c&aacute;ch thiết kế của t&ograve;a nh&agrave; vừa c&oacute; n&eacute;t cổ điển mang đến cảnh quan sống v&agrave; l&agrave;m việc sang trọng, cao cấp v&agrave; tiện nghi, vừa c&oacute; n&eacute;t hiện đại của sự th&ocirc;ng tho&aacute;ng tốt nhất cho c&ocirc;ng tr&igrave;nh bao gồm cả về mặt giao th&ocirc;ng, nguồn s&aacute;ng v&agrave; hướng gi&oacute;. Sakura Tower chắc chắn sẽ l&agrave; điểm dừng ch&acirc;n l&yacute; tưởng cho cuộc sống cũng như c&ocirc;ng việc của c&aacute;c đối tượng cư d&acirc;n trong v&agrave; ngo&agrave;i th&agrave;nh phố.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1600484095_6.jpg', '1601091367_10.jpg|1601091367_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-08 02:14:36', '2020-09-26 03:36:07'),
(208, 'Cho thuê căn 3PN giá 12tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-gia-12tr-khu-ngoai-giao-doan', 'Đường Xuân Đỉnh, Xã Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '9', '130', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 130m2, nằm tại t&ograve;a N01T2.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: điều h&ograve;a, n&oacute;ng lạnh, giường tủ, tủ bếp.</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản: điều hòa, nóng lạnh, giường tủ, tủ bếp.', NULL, '1601262516_2.jpg', '1601262516_1.jpg|1601262516_2.jpg|1601262516_3.jpg|1601262516_4.jpg|1601262516_5.jpg|1601262516_6.jpg|1601262516_7.jpg|1601262516_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-08 03:06:44', '2020-09-28 03:08:36'),
