(213, 'Cho thuê căn 2PN giá 10tr tại Handi Resco Lê Văn Lương', 'cho-thue-can-2pn-gia-10tr-tai-handi-resco-le-van-luong', '31 Đường Lê Văn Lương, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '64', '70', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Handi Resco L&ecirc; Văn Lương c&oacute; vị tr&iacute; đắc địa tại đường&nbsp;L&ecirc; Văn Lương, Nh&acirc;n Ch&iacute;nh, Thanh Xu&acirc;n, H&agrave; Nội. Đ&acirc;y l&agrave; khu vực được quy hoạch ph&aacute;t triển với nhiều c&ocirc;ng tr&igrave;nh kiến tr&uacute;c hiện đại.</p>\r\n\r\n<p>Dự &aacute;n Handi Resco được thừa hưởng rất nhiều hạ tầng tiện &iacute;ch từ vị tr&iacute; bao gồm: nằm trong quần thể khu đ&ocirc; thị Đ&ocirc;ng Nam Trần Duy Hưng,&nbsp;rất dễ d&agrave;ng di chuyển đến BigC, trường Amstecdam H&agrave; Nội, Trung t&acirc;m hội nghị Quốc Gia...</p>\r\n\r\n<p>Nằm cạnh hồ điều h&ograve;a C&ocirc;ng vi&ecirc;n Trung h&ograve;a &ndash; Nh&acirc;n ch&iacute;nh rộng tới 80.000m2 mang tới kh&ocirc;ng gian sống trong l&agrave;nh v&agrave; tho&aacute;ng m&aacute;t. Rất gần c&aacute;c trường học h&agrave;ng đầu Việt Nam từ Mầm Non đến Đại Học: Trường Mầm Non Họa My, Tiểu học Quốc tế Brendon, Trường THPT Amsterdam.</p>\r\n\r\n<p>Dự &aacute;n chung cư Handi Resco hội tụ những tiện nghi bậc nhất m&agrave; mọi kh&aacute;ch h&agrave;ng đều mong muốn, nơi đ&aacute;p ứng tốt nhất mọi nhu cầu của cuộc sống hiện đại. Tiện &iacute;ch c&ocirc;ng cộng rất đầy đủ: ph&ograve;ng kh&aacute;m, ng&acirc;n h&agrave;ng, si&ecirc;u thị, trường mầm non, spa, ph&ograve;ng tậm GYM&hellip; để bạn c&oacute; thể hưởng thụ cuộc sống một c&aacute;ch đ&iacute;ch thực.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1600498075_3.jpg', '1601092821_1.jpg|1601092821_7.jpg|1601092821_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-08 04:06:02', '2020-09-26 04:00:21'),
(215, 'Cho thuê căn 3PN full nội thất giá 15tr tại Golden Palace - Mễ Trì', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-golden-palace-me-tri', 'Đường Mễ Trì, Nam Từ Liêm, Hà Nội', 2, '90', '125', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 125m2 thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTọa lạc tại vị tr&iacute; đắc địa đang ng&agrave;y một ph&aacute;t triển mạnh mẽ của th&agrave;nh phố H&agrave; Nội, Golden Palace l&agrave; một lựa chọn thu&ecirc; văn ph&ograve;ng Nam Từ Li&ecirc;m nhận được nhiều sự quan t&acirc;m của c&aacute;c doanh nghiệp lớn nhỏ tr&ecirc;n địa b&agrave;n th&agrave;nh phố. T&ograve;a nh&agrave; cung cấp một nơi l&agrave;m việc th&acirc;n thiện với lối kiến tr&uacute;c hiện đại, thoải m&aacute;i, gi&uacute;p cho nhiều doanh nghiệp ổn định, ph&aacute;t triển cũng như giao thương, hợp t&aacute;c với c&aacute;c đơn vị kh&aacute;c trong t&ograve;a nh&agrave;.&nbsp;<br />\r\nGolden Palace Mễ Tr&igrave; nằm tại trung t&acirc;m quận Nam Từ Li&ecirc;m, một nơi đang được ph&aacute;t triển mạnh mẽ với nhiều dự &aacute;n trọng điểm của H&agrave; Nội. Ngo&agrave;i ra, tổ hợp c&ograve;n nằm tr&ecirc;n đường Mễ Tr&igrave;, giao cắt với Phạm H&ugrave;ng, đường v&agrave;nh đai 3, đại lộ Thăng Long, đường L&ecirc; Quang Đạo, bến xe Mỹ Đ&igrave;nh,&hellip; rất thuận tiện cho việc di chuyển, giao thương hợp t&aacute;c với c&aacute;c doanh nghiệp kh&aacute;c tr&ecirc;n địa b&agrave;n H&agrave; Nội.<br />\r\nVới những doanh nghiệp đang t&igrave;m kiếm một văn ph&ograve;ng chuy&ecirc;n nghiệp ph&ugrave; hợp t&agrave;i ch&iacute;nh với hệ thống kỹ thuật hiện đại th&igrave; Golden Palace Mễ Tr&igrave; sẽ l&agrave; sự lựa chọn thu&ecirc; văn ph&ograve;ng h&agrave;ng C quận Nam Từ Li&ecirc;m l&yacute; tưởng nhất. B&ecirc;n cạnh đ&oacute;, trong tổ hợp c&ograve;n c&oacute; nhiều tiện &iacute;ch như nh&agrave; h&agrave;ng, qu&aacute;n c&agrave; ph&ecirc;, si&ecirc;u thị, trung t&acirc;m mua sắm,&hellip; tạo n&ecirc;n m&ocirc;i trường thuận tiện cho người l&agrave;m việc tại đ&acirc;y.<br />\r\nC&aacute;c ng&acirc;n h&agrave;ng trong b&aacute;n k&iacute;nh 1km: Ng&acirc;n h&agrave;ng &Aacute; Ch&acirc;u, Vietcombank, Ng&acirc;n h&agrave;ng Qu&acirc;n đội, AGRIBANK,&hellip;<br />\r\nC&aacute;ch bến xe Mỹ Đ&igrave;nh 5 ph&uacute;t di chuyển<br />\r\nGần với c&aacute;c t&ograve;a văn ph&ograve;ng chuy&ecirc;n nghiệp như: Vinaconex 9, CEO, Handico, Sudico, The Manor<br />\r\nC&aacute;ch UBND Quận Nam Từ Li&ecirc;m 9 ph&uacute;t di chuyển<br />\r\nC&aacute;c tiện &iacute;ch nổi bật v&agrave; phong ph&uacute; đ&aacute;p ứng ti&ecirc;u chuẩn quốc tế gồm: si&ecirc;u thị, nh&agrave; h&agrave;ng, Spa, trung t&acirc;m thể thao, bể bơi, nh&agrave; trẻ, bệnh viện được thiết kế hợp l&yacute; giữa c&aacute;c t&ograve;a nh&agrave; tạo n&ecirc;n sự thuận tiện khi sử dụng, phục vụ tốt nhất những nhu cầu cuộc sống của cư d&acirc;n.<br />\r\nB&ecirc;n cạnh đ&oacute;, việc nằm trong quy hoạch đồng bộ Golden Palace được hưởng lợi từ m&ocirc;i trường c&ocirc;ng cộng xung quanh với c&ocirc;ng vi&ecirc;n c&acirc;y xanh, hồ điều h&ograve;a, trung t&acirc;m văn h&oacute;a giải tr&iacute; lớn nhất th&agrave;nh phố&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1599551095_2.jpg', '1599551096_1.jpg|1599551096_3.jpg|1599551096_4.jpg|1599551096_5.jpg|1599551096_6.jpg|1599551096_7.jpg|1599551096_8.jpg|1599551096_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-08 07:44:56', '2020-09-18 09:42:58'),
(216, 'Cho thuê căn 3PN full nội thất + 1P đa năng giá 18tr tại Star City Lê Văn Lương', 'cho-thue-can-3pn-full-noi-that-1p-da-nang-gia-18tr-tai-star-city-le-van-luong', '23 Lê Văn Lương, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '4', '153', 18000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 153m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, 1 ph&ograve;ng chức năng,&nbsp;nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Star City nằm tại đường L&ecirc; Văn Lương, Phường Nh&acirc;n Ch&iacute;nh, Quận Thanh Xu&acirc;n, một trong những trục đường huyết mạch v&agrave; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội.</p>\r\n\r\n<p>Từ vị tr&iacute; dự &aacute;n, c&oacute; thể dễ d&agrave;ng kết nối với c&aacute;c khu vực trong v&agrave; ngo&agrave;i th&agrave;nh phố th&ocirc;ng qua c&aacute;c tuyến đường: V&agrave;nh Đai 3, Đường L&aacute;ng, Nguyễn Ch&iacute; Thanh, L&aacute;ng Hạ&hellip; C&aacute;ch BigC Thăng Long chỉ 3 ph&uacute;t, về trung t&acirc;m Bờ Hồ 20 ph&uacute;t&hellip;Ngo&agrave;i ra, trong v&ograve;ng b&aacute;n k&iacute;nh 500m từ Star City l&agrave; hệ thống c&aacute;c si&ecirc;u thị, ng&acirc;n h&agrave;ng, trường học, trung t&acirc;m y tế, mua sắm&hellip;&nbsp; Tiếp gi&aacute;p c&aacute;c KĐTM ph&aacute;t triển, hạ tầng đồng bộ: Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, The Manor, Trung Y&ecirc;n,&hellip; Trung t&acirc;m hội nghị Quốc Gia, Si&ecirc;u thị BigC, Trung t&acirc;m thương mại Grand Plaza, Keangnam Landmark&hellip;</p>\r\n\r\n<p>Hệ thống dịch vụ, trường học, y tế đầy đủ. Star City L&ecirc; Văn Lương được đ&aacute;nh gi&aacute; l&agrave; một trong những vị tr&iacute; v&agrave;ng của thủ đ&ocirc; H&agrave; Nội, mang đến cho cư d&acirc;n nơi đ&acirc;y một cuộc sống tiện nghi v&agrave; đẳng cấp. Với những thiết kế vượt trội v&agrave; đẳng cấp của một kh&aacute;ch sạn 4 sao ti&ecirc;u chuẩn quốc tế, chung cư Star City L&ecirc; Văn Lương được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch hiện đại v&agrave; cao cấp trong khu vực: ph&ograve;ng đọc s&aacute;ch ph&ograve;ng tập thể thao, khu giải tr&iacute;, ph&ograve;ng đọc s&aacute;ch, chơi cờ, khu c&acirc;u lạc bộ người gi&agrave;, nh&agrave; trẻ, ph&ograve;ng xem phim, chơi game, khu mua sắm&hellip; ngay trong nh&agrave;. Đặc biệt, hệ thống bể bơi tr&ecirc;n tầng thượng một trong những sự kh&aacute;c biệt v&agrave; độc đ&aacute;o tại Star City.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 18tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599616963_11.jpg', '1599616963_1.jpg|1599616963_2.jpg|1599616963_3.jpg|1599616963_4.jpg|1599616963_5.jpg|1599616963_6.jpg|1599616963_7.jpg|1599616963_8.jpg|1599616963_9.jpg|1599616963_10.jpg|1599616963_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 02:02:43', '2020-09-26 03:34:36'),
(217, 'Cho thuê căn 3PN giá 12tr tại Eco Green City Nguyễn Xiển', 'cho-thue-can-3pn-gia-12tr-tai-eco-green-city-nguyen-xien', '286 Đường Nguyễn Xiển, Tân Triều, Thanh Trì, Hà Nội', 2, '91', '95', 12000000, 1, '<p>mega:B&aacute;o Nguồn: ng&agrave;y 8/9/2020<br />\r\nDự &aacute;n: Ecogreen ct4<br />\r\nM&atilde; căn hộ:tầng trung<br />\r\nDiện t&iacute;ch: 95m<br />\r\nSố ph&ograve;ng ngủ:3pn<br />\r\nGi&aacute; thu&ecirc; :12tr thương lượng<br />\r\nPh&iacute;:1/2<br />\r\nNội thất:cb<br />\r\nH&igrave;nh thức 3c1<br />\r\nĐối tượng :&nbsp;<br />\r\nThời gian v&agrave;o lu&ocirc;n<br />\r\nnguồn: &Aacute;nh</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1599617304_1.jpg', '1599617304_2.jpg|1599617304_3.jpg|1599617304_4.jpg|1599617304_5.jpg|1599617304_6.jpg|1599617304_7.jpg|1599617304_8.jpg|1599617304_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 02:08:24', '2020-09-09 02:08:24'),
(218, 'Cho thuê căn 4PN full nội thất giá 14tr tại Tòa 17T8 Trung Hòa Nhân Chính', 'cho-thue-can-4pn-full-noi-that-gia-14tr-tai-toa-17t8-trung-hoa-nhan-chinh', 'Đường Hoàng Đạo Thúy, Trung Hoà, Cầu Giấy, Hà Nội', 2, '92', '160', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 160m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 04 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTổ hợp chung cư Ho&agrave;ng Đạo Th&uacute;y &ndash; Trung H&ograve;a Nh&acirc;n ch&iacute;nh nằm tr&ecirc;n mặt đường Ho&agrave;ng Đạo Th&uacute;y. . Tuyến đường Ho&agrave;ng đạo th&uacute;y gồm 2 l&agrave;n đường nối 2 tuyến đường lớn l&agrave; Trần Duy Hưng v&agrave; L&ecirc; Văn Lương. N&ecirc;n c&oacute; thể n&oacute;i vị tr&iacute; n&agrave;y rất thuận tiện kh&ocirc;ng những cho hộ gia đ&igrave;nh ở m&agrave; c&aacute;c c&ocirc;ng ty thu&ecirc; l&agrave;m văn ph&ograve;ng cũng rất hợp l&yacute; bởi từ đ&acirc;y c&oacute; thể đi sang mảnh &ldquo;đất v&agrave;ng Đống Đa&rdquo; một khu kinh tế ph&aacute;t triển của H&agrave; Nội.</p>\r\n\r\n<p>Từ chung cư Ho&agrave;ng Đạo Th&uacute;y &ndash; Trung H&ograve;a Nh&acirc;n Ch&iacute;nh đi v&agrave;o Quận Đồng Đa chỉ mất 7 Ph&uacute;t, Sang tuyến đường V&agrave;nh Đai 3, khu H&agrave; Đ&ocirc;ng, Mỹ Đ&igrave;nh, Cầu Giấy chỉ mất từ 10 đến 15 ph&uacute;t. Chung cư 17T Trung H&ograve;a Nh&acirc;n Ch&iacute;nh chỉ c&aacute;ch trung t&acirc;m thương mại Big C, Grand Plaza chỉ hơn 1Km, v&agrave; c&aacute;ch bến xe Mỹ Đ&igrave;nh 15 ph&uacute;t đi xe.C&aacute;ch Trung t&acirc;m văn ho&aacute; của Thủ đ&ocirc; như: Keang Nam, S&acirc;n vận động Quốc gia Mỹ Đ&igrave;nh, Trung t&acirc;m hội nghị quốc gia... chỉ với 10 ph&uacute;t l&aacute;i xe.<br />\r\nTổ hợp chung cư Ho&agrave;ng Đạo Th&uacute;y &ndash; Trung H&ograve;a Nh&acirc;n ch&iacute;nh gồm gần 20 &nbsp;t&ograve;a chung cư về cơ bản tất cả những tiện &iacute;ch sinh hoạt h&agrave;ng ng&agrave;y đ&atilde; ho&agrave;n thiện,<br />\r\n&ndash; Hệ thống si&ecirc;u thị đ&atilde; hoạt động tại dưới tầng thương mại t&ograve;a chung cư hoặc tại khu thương mại Vinmart<br />\r\n&ndash; &nbsp;Hệ thống cửa h&agrave;ng ăn uống dọc tuyến đường Ho&agrave;ng Đạo Th&uacute;y, Nguyễn Thị Định, Trần Duy Hưng.<br />\r\n&ndash; Hệ thống giải tr&iacute; Karaoke tại Dọc trục Trần Duy Hưng&hellip;<br />\r\n&ndash; Hệ Thống Gara sửa chữa oto tr&ecirc;n đường Trần Duy Hưng, L&ecirc; Văn Lương, Hệ thống ng&acirc;n h&agrave;ng tại từng t&ograve;a nh&agrave; lớn<br />\r\n&ndash; Hệ thống Trường Học gần t&ograve;a 17T7<br />\r\nV&agrave; nhiều tiện &iacute;ch kh&aacute;c&hellip;&hellip;&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 4, 3, 'Full nội thất', NULL, '1599617648_2.jpg', '1599617648_1.jpg|1599617648_3.jpg|1599617648_4.jpg|1599617648_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 02:14:08', '2020-09-26 09:42:54'),
(219, 'Cho thuê căn 3PN full nội thất giá 14tr tại Star City Lê Văn Lương', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-star-city-le-van-luong', '23 Lê Văn Lương, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '4', '105', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 105m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh,&nbsp;ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Star City nằm tại đường L&ecirc; Văn Lương, Phường Nh&acirc;n Ch&iacute;nh, Quận Thanh Xu&acirc;n, một trong những trục đường huyết mạch v&agrave; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội.</p>\r\n\r\n<p>Từ vị tr&iacute; dự &aacute;n, c&oacute; thể dễ d&agrave;ng kết nối với c&aacute;c khu vực trong v&agrave; ngo&agrave;i th&agrave;nh phố th&ocirc;ng qua c&aacute;c tuyến đường: V&agrave;nh Đai 3, Đường L&aacute;ng, Nguyễn Ch&iacute; Thanh, L&aacute;ng Hạ&hellip; C&aacute;ch BigC Thăng Long chỉ 3 ph&uacute;t, về trung t&acirc;m Bờ Hồ 20 ph&uacute;t&hellip;Ngo&agrave;i ra, trong v&ograve;ng b&aacute;n k&iacute;nh 500m từ Star City l&agrave; hệ thống c&aacute;c si&ecirc;u thị, ng&acirc;n h&agrave;ng, trường học, trung t&acirc;m y tế, mua sắm&hellip;&nbsp; Tiếp gi&aacute;p c&aacute;c KĐTM ph&aacute;t triển, hạ tầng đồng bộ: Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, The Manor, Trung Y&ecirc;n,&hellip; Trung t&acirc;m hội nghị Quốc Gia, Si&ecirc;u thị BigC, Trung t&acirc;m thương mại Grand Plaza, Keangnam Landmark&hellip;</p>\r\n\r\n<p>Hệ thống dịch vụ, trường học, y tế đầy đủ. Star City L&ecirc; Văn Lương được đ&aacute;nh gi&aacute; l&agrave; một trong những vị tr&iacute; v&agrave;ng của thủ đ&ocirc; H&agrave; Nội, mang đến cho cư d&acirc;n nơi đ&acirc;y một cuộc sống tiện nghi v&agrave; đẳng cấp. Với những thiết kế vượt trội v&agrave; đẳng cấp của một kh&aacute;ch sạn 4 sao ti&ecirc;u chuẩn quốc tế, chung cư Star City L&ecirc; Văn Lương được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch hiện đại v&agrave; cao cấp trong khu vực: ph&ograve;ng đọc s&aacute;ch ph&ograve;ng tập thể thao, khu giải tr&iacute;, ph&ograve;ng đọc s&aacute;ch, chơi cờ, khu c&acirc;u lạc bộ người gi&agrave;, nh&agrave; trẻ, ph&ograve;ng xem phim, chơi game, khu mua sắm&hellip; ngay trong nh&agrave;. Đặc biệt, hệ thống bể bơi tr&ecirc;n tầng thượng một trong những sự kh&aacute;c biệt v&agrave; độc đ&aacute;o tại Star City.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599617934_7.jpg', '1599617934_1.jpg|1599617934_2.jpg|1599617934_3.jpg|1599617934_4.jpg|1599617934_5.jpg|1599617934_6.jpg|1599617934_8.jpg|1599617934_9.jpg|1599617934_10.jpg|1599617934_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 02:18:54', '2020-09-26 03:34:09'),
(220, 'Cho thuê căn 2PN giá 9tr tại Chung cư 282 Nguyễn Huy Tưởng', 'cho-thue-can-2pn-gia-9tr-tai-chung-cu-282-nguyen-huy-tuong', '282 Đường Nguyễn Huy Tưởng, Phường Thanh Xuân Bắc, Thanh Xuân, Hà Nội', 2, '93', '70', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm tại khu đất v&agrave;ng của Quận Thanh Xu&acirc;n, chung cư Bộ C&ocirc;ng An 282 Nguyễn Huy Tưởng tọa lạc tr&ecirc;n tuyến đường Nguyễn Huy Tưởng. Với lợi thế vượt trội, dự &aacute;n được kết nối với nhiều con phố lớn như: Nguyễn Tr&atilde;i, L&ecirc; Văn Lương, Vũ Trọng Phụng, Ngụy cư Kom Tum, đường v&agrave;nh đai 3&hellip; cũng như tuyến đường sắt tr&ecirc;n cao H&agrave; Đ&ocirc;ng &ndash; C&aacute;t Linh.</p>\r\n\r\n<p>Với vị tr&iacute; n&agrave;y, cũng như những cư d&acirc;n chung cư quận Thanh Xu&acirc;n, cư d&acirc;n sẽ rất thuận tiện trong việc di chuyển qua lại tới những khu vực trong v&agrave; ngoại th&agrave;nh. Đặc biệt, vị tr&iacute; dự &aacute;n tọa lạc gần với nhiều trung t&acirc;m h&agrave;nh ch&iacute;nh, nền gi&aacute;o dục của Thủ Đ&ocirc; từ cấp mầm non đới đại học, dễ d&agrave;ng với những bệnh viện, c&ocirc;ng vi&ecirc;n, c&aacute;c trung t&acirc;m thương mại lớn, nhiều khu đ&ocirc; thị l&acirc;n cận.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1599618217_2.jpg', '1599618217_1.jpg|1599618217_3.jpg|1599618217_4.jpg|1599618217_5.jpg|1599618217_6.jpg|1599618217_7.jpg|1599618217_8.jpg|1599618217_9.jpg|1599618217_10.jpg', NULL, NULL, 'Vũ Việt Dũng', N