(221, 'Cho thuê nhà riêng nguyên căn 4PN full nội thất gái 15tr tại phố Nguyễn Đình Hoàn, Cầu Giấy', 'cho-thue-nha-rieng-nguyen-can-4pn-full-noi-that-gai-15tr-tai-pho-nguyen-dinh-hoan-cau-giay', 'Ngõ 152 Nguyễn Đình Hoàn, P. Nghĩa Đô, Q. Cầu Giấy, Hà Nội', 1, '94', '42', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ 5 tầng,&nbsp;rộng 42m2/tầng.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 04 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng. Nh&agrave; mặt phố rộng 3m, &ocirc; t&ocirc; đỗ cửa.&nbsp;<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tr&ecirc;n mặt phố Nguyễn Đ&igrave;nh Ho&agrave;n, P. Nghĩa Đ&ocirc;, Q. Cầu Giấy, H&agrave; Nội.&nbsp;</p>\r\n\r\n<p>Di chuyển ra c&aacute;c tuyến đường lớn của th&agrave;nh phố chỉ mất 3-5 ph&uacute;t l&aacute;i xe: Ho&agrave;ng Qu&ocirc;cs Việt, đường Bưởi, đường V&agrave;nh đai 2, V&otilde; Ch&iacute; C&ocirc;ng, Cầu Giấy.</p>\r\n\r\n<p>Gần C&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;, c&ocirc;ng vi&ecirc;n Thủ Lệ, Học viện Quốc Ph&ograve;ng , Viện Kỹ thuật cơ giới Qu&acirc;n sự..v&agrave; nhiều trung t&acirc;m h&agrave;nh ch&iacute;nh kh&aacute;c của th&agrave;nh phố.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 4, 4, 'Full nội thất', NULL, '1599626879_2.jpg', '1599626880_1.jpg|1599626880_3.jpg|1599626880_4.jpg|1599626880_5.jpg|1599626880_6.jpg|1599626880_7.jpg|1599626880_8.jpg|1599626880_9.jpg|1599626880_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 04:48:00', '2020-09-26 09:43:25'),
(222, 'Cho thuê căn 2PN giá 7.5tr tại Lạc Hồng West Lake - Tây Hồ', 'cho-thue-can-2pn-gia-75tr-tai-lac-hong-west-lake-tay-ho', 'Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '95', '76', 7500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 76m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm ngay cạnh c&acirc;y cầu Nhật T&acirc;n l&agrave; c&acirc;y cầu ngoại giao hiện đại nhất Việt Nam, nằm cạnh trục đường V&otilde; Ch&iacute; C&ocirc;ng, đường &Acirc;u Cơ, đường An Dương Vương&hellip;. Với vị tr&iacute; nằm cạnh c&aacute;c điểm n&uacute;t giao th&ocirc;ng quan trọng tại cửa ng&otilde; ph&iacute;a đ&ocirc;ng H&agrave; Nội, khiến cho việc di chuyển đến c&aacute;c vị tr&iacute; trọng điểm trong địa b&agrave;n nội th&agrave;nh H&agrave; Nội v&agrave; c&aacute;c tỉnh ph&iacute;a đ&ocirc;ng trở n&ecirc;n cực kỳ thuận tiện.&nbsp;<br />\r\n+ C&aacute;ch Hồ T&acirc;y chỉ 1.5 km, 20 ph&uacute;t l&aacute;i xe ra s&acirc;n bay Nội B&agrave;i, 15 ph&uacute;t l&aacute;i xe v&agrave;o trung t&acirc;m TP H&agrave; Nội<br />\r\n+ Kết nối dễ d&agrave;ng với c&aacute;c khu đ&ocirc; thị lớn: KĐT Cipu- tra, KĐT Xu&acirc;n La, KĐT T&acirc;y Hồ T&acirc;y&hellip;<br />\r\nChung cư Lạc Hồng Westlake được trang bị đầy đủ c&aacute;c dịch vụ tiện &iacute;ch phục vụ nhu cầu sống h&agrave;ng ng&agrave;y của cư d&acirc;n. Với 2 tầng thương mại v&agrave; dịch vụ, cư d&acirc;n c&oacute; thể thoải m&aacute;i vui chơi, mua sắm v&agrave; giải tr&iacute; như: nh&agrave; h&agrave;ng ẩm thực, ph&ograve;ng tập gym, si&ecirc;u thị, nh&agrave; trẻ&hellip; ngay dưới ch&acirc;n t&ograve;a nh&agrave; Lạc Hồng l&agrave; khu vui chơi v&agrave; đường dạo bộ ngập tr&agrave;n c&acirc;y xanh v&agrave; vườn hoa.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 7.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1599627378_3.jpg', '1599627378_1.jpg|1599627378_2.jpg|1599627378_4.jpg|1599627378_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 04:56:18', '2020-09-26 07:54:24'),
(223, 'Cho thuê căn 3PN full nội thất giá 13.5tr tại An Bình City', 'cho-thue-can-3pn-full-noi-that-gia-135tr-tai-an-binh-city', '234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '5', '1', 13500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 100m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư An B&igrave;nh City được x&acirc;y dựng dựa theo &yacute; tưởng về một khu đ&ocirc; thị hiện đại với phong c&aacute;ch kiến tr&uacute;c sinh th&aacute;i th&acirc;n thiện với thi&ecirc;n nhi&ecirc;n v&agrave; m&ocirc;i trường.</p>\r\n\r\n<p>Dự &aacute;n An B&igrave;nh City c&oacute; vị tr&iacute; địa l&yacute; trắc địa tại số 234 Phạm Văn Đồng &nbsp;nằm trong địa giới h&agrave;nh ch&iacute;nh giữa phường Cổ Nhuế 1 Quận Bắc Từ Li&ecirc;m v&agrave; phường Mai Dịch quận Cầu Giấy.An B&igrave;nh city c&ograve;n t&iacute;ch hợp nhiều tiện &iacute;ch vượt trội so với c&aacute;c chung cư kh&aacute;c như: C&ocirc;ng vi&ecirc;n sinh th&aacute;i, hồ điều h&ograve;a rộng 15 ha, tuyến phố thương mại với h&agrave;ng trăm thương hiệu uy t&iacute;n, trường mầm non đạt chuẩn quốc gia,02 bể bơi ngo&agrave;i trời rộng 1200 m2. C&aacute;c c&ocirc;ng tr&igrave;nh tiện &iacute;ch đẳng cấp: Quảng trường c&aacute;c vị thần, quảng trường nhạc nước, quảng trường m&ugrave;a hạ, vườn treo&hellip;<br />\r\nVới lợi thế l&agrave; nơi giao thoa của nhiều tuyến đường giao th&ocirc;ng quan trọng: Đường V&agrave;nh đai 3, đường Ho&agrave;ng Quốc Việt k&eacute;o d&agrave;i, đường quy hoạch 40 m kết nối với khu đ&ocirc; thị T&acirc;y Hồ T&acirc;y, từ An B&igrave;nh city cư d&acirc;n c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực h&agrave;nh ch&iacute;nh v&agrave; vui chơi như: nằm ngay mặt đường Phạm Văn Đồng, di chuyển đến s&acirc;n bay Nội B&agrave;i,bến xe Nam Thăng Long chỉ mất 25 ph&uacute;t; gần C&ocirc;ng vi&ecirc;n Th&agrave;nh phố Giao lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh; gần c&aacute;c si&ecirc;u thị lớn như HC, Mega market...</p>\r\n\r\n<p>Nằm trong l&ograve;ng Khu đ&ocirc; thị Th&agrave;nh phố Giao lưu &ndash; l&agrave; khu đ&ocirc; thị mới được biết đến với hệ thống thảm thực vật xanh, sạch c&ugrave;ng với hệ thống tiện &iacute;ch cao cấp v&agrave; cơ sở hạ tầng ho&agrave;n chỉnh. Khu đ&ocirc; thị An B&igrave;nh thực sự sẽ tỏa s&aacute;ng tr&ecirc;n bầu trời ph&iacute;a T&acirc;y Bắc của trung t&acirc;m thủ đ&ocirc; H&agrave; Nội.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601278350_7.jpg', '1601278351_1.jpg|1601278351_2.jpg|1601278351_3.jpg|1601278351_4.jpg|1601278351_5.jpg|1601278351_6.jpg|1601278351_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 07:42:56', '2020-09-28 07:32:31'),
(224, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT GIÁ 10TR TẠI MỸ SƠN TOWER - NGUYỄN HUY TƯỞNG', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-my-son-tower-nguyen-huy-tuong', 'Số 62 Nguyễn Huy Tưởng, Thanh Xuân, Hà Nội', 2, '96', '70', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Tthiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Mỹ sơn tọa lạc tại 62 Nguyễn Huy Tưởng, nằm ở trung t&acirc;m Quận Thanh Xu&acirc;n, Mỹ Sơn Tower nằm trong khu d&acirc;n cư với hệ thống hạ tầng hiện đại đồng bộ v&agrave; c&oacute; c&aacute;c tiện &iacute;ch c&ocirc;ng cộng như gi&aacute;o dục, thể thao, văn h&oacute;a v&agrave; h&agrave;nh ch&iacute;nh.</p>\r\n\r\n<p>T&ograve;a nh&agrave; kết nối giao th&ocirc;ng thuận lợi với c&aacute;c đường giao th&ocirc;ng ch&iacute;nh như L&ecirc; Văn Lương, Nguyễn Tr&atilde;i, L&aacute;ng v&agrave; Khuất Duy Tiến nhưng vẫn c&oacute; được kh&ocirc;ng kh&iacute; y&ecirc;n tĩnh. Tiểu khu c&oacute; m&ocirc;i trường gi&aacute;o dục cao với nhiều trường học tốt từ cấp nh&agrave; trẻ đến đại học.<br />\r\nNgo&agrave;i ra, chung cư Mỹ Sơn c&ograve;n tiếp gi&aacute;p nhiều trung t&acirc;m mua sắm lớn hiện đại, khu vui chơi giải tr&iacute;, c&aacute;c trung t&acirc;m h&agrave;nh ch&iacute;nh&hellip; C&ocirc;ng tr&igrave;nh c&oacute; yếu tố l&yacute; tưởng cho cuộc sống gia đ&igrave;nh hạnh ph&uacute;c v&agrave; th&agrave;nh c&ocirc;ng.<br />\r\nTừ dự &aacute;n bạn c&oacute; thể đi đến c&aacute;c khu thương mại, si&ecirc;u thị mua sắm kh&ocirc;ng c&ograve;n l&agrave; vấn đề quan ngại: C&aacute;ch tổ hợp Hapulico 100m, dự &aacute;n Mardarin Garden 500m, si&ecirc;u thị BigC 1km, trường Amsterdam 1km, Royal City 1km, Đại học Khoa học X&atilde; hội v&agrave; Nh&acirc;n văn 1km, trung t&acirc;m Hội nghị Quốc Gia , Bảo t&agrave;ng H&agrave; Nội 1, rạp chiều phim Quốc Gia 1.5km.&nbsp;<br />\r\nMỹ Sơn Tower kh&ocirc;ng chỉ được hưởng một tiện &iacute;ch khu vực hiện đại v&agrave; chất lượng cao, bản th&acirc;n Khu chung cư cao cấp Mỹ Sơn Tower c&ograve;n được bố tr&iacute; một kh&ocirc;ng gian sống v&agrave; l&agrave;m việc hết sức tiện nghi v&agrave; ho&agrave;n hảo, t&ograve;a nh&agrave; c&oacute; đầy đủ c&aacute;c hạng mục tiện &iacute;ch cho cư d&acirc;n sống tại đ&acirc;y.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600504818_12.jpg', '1601094279_5.jpg|1601094279_9.jpg|1601094279_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 08:23:58', '2020-09-26 04:24:39'),
(225, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT GIÁ 8TR TẠI CHUNG CƯ C1 C2 XUÂN ĐỈNH', 'cho-thue-can-2pn-full-noi-that-gia-8tr-tai-chung-cu-c1-c2-xuan-dinh', 'Số 323 Xuân Đỉnh, phường Xuân Đỉnh, quận Bắc Từ Liêm, TP. Hà Nội', 2, '97', '71', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 71m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư C1 C2 xu&acirc;n Đỉnh c&oacute; vị tr&iacute; v&ocirc; c&ugrave;ng thuận lợi: Mặt đường ng&otilde; 323 Xu&acirc;n Đỉnh được Chủ đầu tư dự &aacute;n mở rộng th&agrave;nh 17 m, 4 l&agrave;n xe thẳng ra c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh. Kết nối với KĐT Ngoại Giao Đo&agrave;n v&agrave; T&acirc;y Hồ T&acirc;y.<br />\r\nDự &aacute;n C1 &ndash; C2 Xu&acirc;n Đỉnh c&aacute;ch bến xe Nam Thăng Long chưa đầy 1 km bằng 5 ph&uacute;t chạy xe. Dọc theo đường Phạm Văn Đồng l&ecirc;n cầu Thăng Long rồi ra S&acirc;n Bay Nội B&agrave;i chỉ 15 ph&uacute;t chạy xe.</p>\r\n\r\n<p>&ndash; Dự &aacute;n C1 &ndash; C2 Xu&acirc;n Đỉnh dọc theo Xu&acirc;n Đỉnh &ndash; V&otilde; Nguy&ecirc;n Gi&aacute;p lại ra Hồ T&acirc;y, Cầu Nhật T&acirc;n v&agrave; S&acirc;n Bay Nội B&agrave;i.</p>\r\n\r\n<p>&ndash; Hướng Nguyễn Ho&agrave;ng T&ocirc;n &ndash; Bưởi kết nối với Quận Ba Đ&igrave;nh ở ph&iacute;a Đ&ocirc;ng.</p>\r\n\r\n<p>&ndash; Hướng Nguyễn Văn Huy&ecirc;n k&eacute;o d&agrave;i kết nối với Quận Cầu Giấy ở ph&iacute;a Nam chạy xuy&ecirc;n qua KĐT Ngoại Giao Đo&agrave;n.<br />\r\nTiện &iacute;ch theo s&aacute;t chuỗi nhu cầu thiết thực của mọi gia đ&igrave;nh. Kh&ocirc;ng xa hoa. Kh&ocirc;ng h&agrave;o nho&aacute;ng m&agrave; l&agrave; thiết thực. Kh&ocirc;ng chỉ đơn thuần điện, đường, trường, trạm như ph&acirc;n kh&uacute;c b&igrave;nh d&acirc;n hoặc c&aacute;c dự &aacute;n ở xa trung t&acirc;m: Khu vườn c&acirc;y xung quanh dự &aacute;n, khu TTTM lớn, si&ecirc;u thị, gym, yoga, ph&ograve;ng sinh hoạt cộng đồng, khu vui chơi trẻ em...V&igrave; tọa lạc ngay trung t&acirc;m quận sầm uất, n&ecirc;n mỗi căn hộ tại Dự &aacute;n C1 C2 Xu&acirc;n Đỉnh ch&iacute;nh l&agrave; nơi trở về đ&uacute;ng nghĩa sau một ng&agrave;y l&agrave;m việc.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599640325_1.jpg', '1599640325_2.jpg|1599640325_3.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 08:32:05', '2020-09-26 02:21:44'),
(226, 'CHO THUÊ CĂN 3PN FULL NỘI THẤT GIÁ 12.5TR TẠI GREEN STAR PHẠM VĂN ĐỒNG', 'cho-thue-can-3pn-full-noi-that-gia-125tr-tai-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '102', 12500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 102m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGreen Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;12.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599640732_1.jpg', '1599640732_2.jpg|1599640732_3.jpg|1599640732_4.jpg|1599640732_5.jpg|1599640732_6.jpg|1599640732_7.jpg|1599640732_8.jpg|1599640732_9.jpg|1599640732_10.jpg|1599640732_11.jpg|1599640732_12.jpg|1599640732_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-09 08:38:52', '2020-09-28 08:01:43'),
(227, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT GIÁ 10TR TẠI VIWASEEN TOWER TỐ HỮU', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-viwaseen-tower-to-huu', '48 P. Tố Hữu, Trung Văn, Từ Liêm, Hà Nội', 2, '88', '78', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 78m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, &nbsp;nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Viwaseen Tower nằm tr&ecirc;n mặt đường Tố Hữu (L&ecirc; Văn Lương k&eacute;o d&agrave;i), c&aacute;ch ng&atilde; tư Khuất Duy Tiến với L&ecirc; Văn Lương khoảng 300m, c&aacute;ch BigC khoảng 800m, giao th&ocirc;ng đi lại thuận tiện.&nbsp;Đ&acirc;y l&agrave; trục giao th&ocirc;ng cửa ng&otilde; của khu đ&ocirc; thị mới Ph&ugrave;ng Khoang đồng thời l&agrave; tuyến giao th&ocirc;ng huyết mạch kết nối chuỗi khu đ&ocirc; thị mới như Nam Cường, Văn Ph&uacute; &ndash; H&agrave; Đ&ocirc;ng.. với trung t&acirc;m th&agrave;nh phố H&agrave; Nội.</p>\r\n\r\n<p>Xung quanh l&agrave; hệ thống c&aacute;c trường ĐH lớn như : Trường ĐH Quốc Gia, Đại học Ngoại ngữ H&agrave; Nội, Đại học Thương Mại. Trường PTTH Amsterdam 800m. Trường THCS Việt Nam &ndash; Angieri, Trường TH Đặng Trần C&ocirc;n c&aacute;ch 400m. C&aacute;ch Trung t&acirc;m Hội Nghị Quốc Gia, si&ecirc;u thị BigC 1km, Chợ Nh&acirc;n Ch&iacute;nh, Thanh Xu&acirc;n Bắc, Ph&ugrave;ng Khoang&hellip; khoảng 1km. Tiệm cận hệ thống c&aacute;c bệnh viện lớn: Bệnh viện y học cổ truyền &ndash; Bộ C&ocirc;ng An, Bệnh viện quốc tế Nam Cường.</p>\r\n\r\n<p>Chung cư Viwaseen Tower Tố Hữu kh&ocirc;ng chỉ thừa hưởng to&agrave;n bộ c&aacute;c ti&ecirc;n &iacute;ch khu vực m&agrave; c&ograve;n c&oacute; nhiều dịch vụ, tiện &iacute;ch nội khu cao cấp đ&aacute;p ứng mọi nhu cầu thường nhật của qu&yacute; kh&aacute;ch h&agrave;ng ngay tại dự &aacute;n. 05 tầng dịch vụ thương mại tại chung cư Viwaseen Tower l&ecirc; văn lương bao gồm: Sảnh ch&iacute;nh, thang m&aacute;y, giếng trời, khu sinh hoạt chung, nh&agrave; trẻ, khu y tế, hệ thống trung t&acirc;m thương mại, si&ecirc;u thị, khu tập Gym, spa, chăm s&oacute;c sắc đẹp với c&aacute;c trang thiết bị hiện đại, s&acirc;n chơi trẻ em, khu vực s&acirc;n vườn cảnh quan,&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599703531_2.jpg', '1599703531_1.jpg|1599703531_3.jpg|1599703531_4.jpg|1599703531_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-10 02:05:31', '2020-09-26 03:20:29'),
(228, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT GIÁ 13TR TẠI RIVERA PARK - VŨ TRỌNG PHỤNG', 'cho-thue-can-2pn-full-noi-that-gia-13tr-tai-rivera-park-vu-trong-phung', 'Đường Vũ Trọng Phụng, Phường Thanh Xuân Trung, Thanh Xuân, Hà Nội', 2, '98', '75', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTọa lạc tại 69 Vũ Trọng Phụng, Thanh Xu&acirc;n &ndash; &nbsp; vị tr&iacute; đặc địa thuộc quận trung t&acirc;m cũ của Thủ đ&ocirc; H&agrave; Nội, cư d&acirc;n của Chung cư Rivera Park Hà N&ocirc;̣i c&oacute; thể tận hưởng tất cả c&aacute;c tiện &iacute;ch cần thiết cho cuộc sống tiện nghi h&agrave;ng ng&agrave;y trong v&ograve;ng b&aacute;n k&iacute;nh tối đa 3 Km như trường học, bệnh viện, si&ecirc;u thị, trung t&acirc;m thể thao, c&ocirc;ng tr&igrave;nh t&ocirc;n gi&aacute;o&hellip;</p>\r\n\r\n<p>Dự &aacute;n nằm trong khu vực d&acirc;n cư đ&ocirc;ng đ&uacute;c, hạ tầng x&atilde; hội v&agrave; hạ tầng kỹ thuật đầy đủ: ngay gần chợ, si&ecirc;u thị, bệnh viện, c&aacute;c trường học (gần nhiều trường đại học lớn: Đại học khoa học tự nhi&ecirc;n; X&atilde; hội v&agrave; nh&acirc;n văn; Kiến tr&uacute;c; H&agrave; Nội); tương đối gần c&aacute;c khu vui chơi giải tr&iacute;, rạp chiếu phim lớn như TT chiếu phim Quốc gia, TTTM Mipectower, Parkson, Big C, Cineplex, Lotte cinema. Rivera Park H&agrave; Nội gần c&aacute;c bệnh viện lớn như Bệnh Viện X&acirc;y Dựng, Trung t&acirc;m Y tế quận Thanh Xu&acirc;n, Bệnh viện 103...<br />\r\nTại Rivera Park Hà N&ocirc;̣i, Chủ đầu tư đ&atilde; đầu tư d&agrave;nh ri&ecirc;ng 01(một) tầng với đầy đủ c&aacute;c loại tiện &iacute;ch d&agrave;nh ri&ecirc;ng cho cư d&acirc;n như Bể bơi, ph&ograve;ng Gym, Nh&agrave; c&acirc;u lạc bộ (Club house), Khu vui chơi trẻ em (Kid corner) &hellip;</p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, Chủ đầu tư c&ograve;n đầu tư c&aacute;c loại tiện &iacute;ch kh&aacute;c m&agrave; cư d&acirc;n cần để c&oacute; thể đ&aacute;p ứng mọi nhu cầu trong cuộc sống h&agrave;ng ng&agrave;y như trung t&acirc;m thương mại, qu&aacute;n cafe, cửa h&agrave;ng tiện &iacute;ch...Khu vực vườn hoa c&acirc;y xanh rộng r&atilde;i xen lẫn kh&ocirc;ng gian khối nh&agrave; mang lại bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh, kh&ocirc;ng gian sinh hoạt cộng đồng văn minh, l&agrave;nh mạnh.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1599703941_6.jpg', '1599703942_1.jpg|1599703942_2.jpg|1599703942_3.jpg|1599703942_4.jpg|1599703942_5.jpg|1599703942_7.jpg|1599703942_8.jpg|1599703942_9.jpg|1599703942_10.jpg|1599703942_11.jpg|1599703942_13.jpg|1599703942_14.jpg|1599703942_15.jpg|1599703942_16.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-10 02:12:22', '2020-09-26 07:19:27'),
(229, 'CHO THUÊ CĂN 3PN GIÁ 16TR TẠI HINODE CITY - MINH KHAI', 'cho-thue-can-3pn-gia-16tr-tai-hinode-city-minh-khai', '201 Minh Khai, Phường Minh Khai, Hai Bà Trưng, Hà Nội', 2, '99', '110', 16000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 110m2 thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTọa lạc tại số 201 đường Minh Khai, quận Hai B&agrave; Trưng &ndash; nơi cửa ng&otilde; quan trọng ph&iacute;a Nam thủ đ&ocirc; H&agrave; nội, Hinode City kh&ocirc;ng những thuộc khu vực tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c với tr&igrave;nh độ d&acirc;n tr&iacute; cao, m&agrave; c&ograve;n nằm trong v&ugrave;ng được ưu ti&ecirc;n ph&aacute;t triển đồng bộ cơ sở hạ tầng hiện đại bậc nhất thủ đ&ocirc;. Bởi lẽ đ&oacute;, dự &aacute;n Hinode City Minh Khai lu&ocirc;n được qu&yacute; kh&aacute;ch h&agrave;ng cũng như c&aacute;c nh&agrave; đầu tư trong giới bất động sản kỳ vọng sẽ trở th&agrave;nh một biểu tượng sống mới - hiện đại hơn, l&yacute; tưởng hơn cho khu vực trong một tương lai kh&ocirc;ng xa bởi những hội tụ kết tinh ti&ecirc;u chuẩn sống vượt trội. Từ vị tr&iacute; dự &aacute;n 201 Minh Khai, qu&yacute; kh&aacute;ch c&ograve;n c&oacute; thể di chuyển dễ d&agrave;ng đến c&aacute;c địa điểm quan trọng kh&aacute;c trong th&agrave;nh phố cũng như kết nối đồng bộ với hệ thống giao th&ocirc;ng đi lại tới c&aacute;c tỉnh th&agrave;nh l&acirc;n cận xung quanh như: Hưng Y&ecirc;n, Hải Dương, Hải Ph&ograve;ng, Bắc Ninh,... Đặc biệt, bao bọc xung quanh dự &aacute;n 201 Minh Khai c&ograve;n phải kể đến đ&oacute; ch&iacute;nh l&agrave;:<br />\r\n- Khu trung t&acirc;m thương mại Time City &ndash; 0,5km<br />\r\n- Phố đi bộ Hồ Gươm &ndash; Phố Cổ H&agrave; Nội &ndash; 4km<br />\r\n- C&ocirc;ng vi&ecirc;n Tuổi Trẻ &ndash; 800m<br />\r\n- Hồ điều h&ograve;a Thanh Nh&agrave;n &ndash; 0,5km<br />\r\n- C&aacute;c bệnh viện lớn: BV Bạch Mai, BV Qu&acirc;n Y 1108, BV Việt Ph&aacute;p,... &ndash; 3km<br />\r\n- C&aacute;c trường ĐH trọng điểm: ĐH Kinh tế quốc d&acirc;n, ĐH Bạc Khoa, ĐH X&acirc;y dựng,... &ndash; 3,5km<br />\r\nĐược biết đến kh&ocirc;ng những l&agrave; si&ecirc;u dự &aacute;n chung cư cao cấp bậc nhất quận Hai B&agrave; Trung m&agrave; chung cư 201 Minh Khai c&ograve;n mang đến cho qu&yacute; kh&aacute;ch h&agrave;ng những căn hộ đẳng cấp, gi&aacute; trị bởi hệ thống tiện &iacute;ch h&agrave;ng đầu, đạt chuẩn quốc tế. V&igrave; vậy khi sinh sống tại nơi đ&acirc;y kh&aacute;ch h&agrave;ng sẽ được đắm m&igrave;nh trải nghiệm những điều l&iacute; th&uacute;, mới mẻ, tiện nghi nhất của cuộc sống hiện đại.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: &nbsp;tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1599704979_20.jpg', '1599704979_2.jpg|1599704979_3.jpg|1599704979_5.jpg|1599704979_7.jpg|1599704979_9.jpg|1599704979_10.jpg|1599704979_12.jpg|1599704979_16.jpg|1599704979_18.jpg|1599704979_19.jpg|1599704979_20.jpg|1599704979_22.jpg|1599704979_25.jpg|1599704979_26.jpg|1599704979_27.jpg|1599704979_28.jpg|1599704979_30.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-10 02:29:39', '2020-09-23 08:41:11');
INSERT INTO `products` (`id`, `name`, `alias`, `address`, `product_cate_id`, `project_id`, `acreage`, `price`, `price_type`, `description`, `witdh`, `land_witdh`, `home_direction`, `bacon_direction`, `floor_number`, `room_number`, `toilet_number`, `furniture`, `legality`, `image`, `gallerys`, `video_url`, `map`, `contact_name`, `contact_address`, `contact_phone`, `contact_mobile`, `contact_email`, `status`, `publish`, `created_at`, `updated_at`) VALUES
(230, 'Cho thuê căn 2PN giá 8.5tr tại KĐT Nghĩa Đô', 'cho-thue-can-2pn-gia-85tr-tai-kdt-nghia-do', 'Phố Trần Cung, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '35', '71', 8500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 71m2, t&ograve;a CT1B.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; với hạ tầng kỹ thuật đồng bộ, tạo cảnh quan đẹp cho khu vực sẽ l&agrave; trung t&acirc;m mới của Thủ đ&ocirc; trong tương lai.&nbsp;Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; kh&ocirc;ng chỉ c&oacute; gi&aacute; trị cao về kh&ocirc;ng gian kiến tr&uacute;c, chất lượng c&ocirc;ng tr&igrave;nh m&agrave; c&ograve;n c&ograve;n sở hữu vị tr&iacute; đắc địa v&agrave; n&eacute;t đặc trưng m&agrave; &iacute;t dự &aacute;n c&oacute; được.</p>\r\n\r\n<p>Khu đ&ocirc; thị Nghĩa Đ&ocirc; nằm trong mạng lưới giao th&ocirc;ng huyết mạch khu vực T&acirc;y Nam H&agrave; Nội, s&aacute;t tuyến đường v&agrave;nh đai 2 v&agrave; kh&ocirc;ng qu&aacute; xa so với đường v&agrave;nh đai 3, chỉ c&aacute;ch đường Ho&agrave;ng Quốc Việt khoảng 200m, c&aacute;ch chợ Bưởi hơn 1 km, gần c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc; v&agrave; gần 6 tuyến đường lớn như Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt, Phạm Văn Đồng, Nguyễn Ho&agrave;ng T&ocirc;n, Trần Cung, Lạc Long Qu&acirc;n.</p>\r\n\r\n<p>Khu đ&ocirc; thị c&oacute; thiết kế tho&aacute;ng, hệ thống c&acirc;y xanh v&agrave; đường dạo bộ, mật độ x&acirc;y dựng khoảng 30-32%, c&oacute; cơ sở hạ tầng đồng bộ. Ngo&agrave;i ra, Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; nằm cạnh trục đường 40m hiện đang thi c&ocirc;ng, đối diện với hồ điều h&ograve;a rộng 4,9ha của dự &aacute;n Starlake (dự &aacute;n T&acirc;y Hồ T&acirc;y cũ) n&ecirc;n cư d&acirc;n nơi đ&acirc;y sẽ được hưởng lợi chung hạ tầng n&agrave;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 8.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601286540_3.jpg', '1601286540_1.jpg|1601286540_2.jpg|1601286540_3.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-10 02:49:53', '2020-09-28 09:49:00'),
(232, 'Cho thuê căn 2PN full nội thất giá 12tr tại Vimeco II - Nguyễn Chánh', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-vimeco-ii-nguyen-chanh', 'Đường Nguyễn Chánh, Phường Trung Hòa, Cầu Giấy, Hà Nội', 2, '86', '94', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 94m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư CT4 Vimeco Nguyễn Ch&aacute;nh tọa lạc tại vị tr&iacute; v&agrave;ng phố Nguyễn Ch&aacute;nh, khu đ&ocirc; thị Trung H&ograve;a, được coi l&agrave; tuyến phố đẹp v&agrave; rộng r&atilde;i nhất quận Cầu Giấy, giao th&ocirc;ng cực k&igrave; thuận tiện. L&agrave; t&acirc;m điểm của những tuyến phố trọng điểm của thủ đ&ocirc; như: Phạm H&ugrave;ng, Trần Duy Hưng, Trung K&iacute;nh, đường L&aacute;ng&hellip;&nbsp;<br />\r\nVới vị tr&iacute; trung t&acirc;m: được bao bọc bởi c&aacute;c khu đ&ocirc; thị lớn như Trung H&ograve;a &ndash; Nh&acirc;n Ch&iacute;nh, Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Y&ecirc;n H&ograve;a&hellip;<br />\r\n&ndash; L&agrave; khu vực c&oacute; hạ tầng kĩ thuật đồng bộ, ho&agrave;n hảo. Xung quanh l&agrave; c&aacute;c si&ecirc;u thị, trung t&acirc;m thương mại sầm uất như BigC, Grand Plaza, KeangNam, The Garden&hellip;<br />\r\n&ndash; Vì nằm ở vị trí được coi là trung t&acirc;m b&acirc;̣c nh&acirc;́t thủ đ&ocirc; n&ecirc;n xung quanh chung cư CT4 Vimeco có đ&acirc;̀y đủ các ti&ecirc;̣n ích từ:<br />\r\n&ndash; H&ecirc;̣ th&ocirc;́ng các trường ti&ecirc;̉u học, c&acirc;́p 1, c&acirc;́p 2, c&acirc;́p 3 (Y&ecirc;n H&ograve;a, Nh&acirc;n Ch&iacute;nh, Amsterdams&hellip;)<br />\r\n&ndash; Hệ thống c&aacute;c trường đại học lớn: Lao Động &ndash; X&atilde; Hội, Ngoại Thương, Giao Th&ocirc;ng, Luật, C&ocirc;ng Đo&agrave;n&hellip;<br />\r\n&ndash; H&ecirc;̣ th&ocirc;́ng chợ, si&ecirc;u thị, b&ecirc;̣nh vi&ecirc;̣n&hellip;<br />\r\nTừ tầng 1 &ndash; 4 của dự &aacute;n CT4 Vimeco Nguyễn Ch&aacute;nh được d&agrave;nh l&agrave;m sảnh đ&oacute;n tiếp v&agrave; trung t&acirc;m thương mại hiện đại, đầy đủ vừa cung cấp c&aacute;c dịch vụ cao cấp cho cư d&acirc;n trong t&ograve;a nh&agrave; vừa cung cấp những dịch vụ h&agrave;ng đầu cho cả những người d&acirc;n ở khu vực l&acirc;n cận c&ugrave;ng được sử dụng: si&ecirc;u thị mini, khu vui chơi giải tr&iacute;, nh&agrave; h&agrave;ng ẩm thực,&hellip;.<br />\r\nNgo&agrave;i c&aacute;c tiện &iacute;ch nằm ở tầng 1 &ndash; 4 của dự &aacute;n, chung cư CT4 Vimeco Nguyễn Ch&aacute;nh c&ograve;n x&acirc;y dựng hệ thống c&ocirc;ng vi&ecirc;n c&acirc;y xanh v&agrave; đường tản bộ xung quanh dự &aacute;n để tăng kh&ocirc;ng gian xanh trong l&agrave;nh của dự &aacute;n v&agrave; cư d&acirc;n được hưởng trọn vẹn hơn cuộc sống trong l&agrave;nh ngay giữa thủ đ&ocirc;.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599713818_1.jpg', '1599713818_2.jpg|1599713818_3.jpg|1599713818_4.jpg|1599713818_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-10 04:56:58', '2020-09-26 09:36:13'),
(233, 'Cho thuê căn 2PN full nội thất giá 10tr tại Chung cư 789 Xuân Đỉnh', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-chung-cu-789-xuan-dinh', 'P. Xuân Đỉnh, Q. Bắc Từ Liêm, Hà Nội', 2, '20', '70', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, &nbsp;nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n chung cư 789 Xu&acirc;n Đỉnh nằm liền kề khu nh&agrave; ở Ngoại Giao Đo&agrave;n, mặt đường Nguyễn Văn Huy&ecirc;n k&eacute;o d&agrave;i nối liền từ khu đ&ocirc; thị &nbsp;T&acirc;y Hồ T&acirc;y ra Q. Cầu Giấy<br />\r\nPh&iacute;a nam: nh&igrave;n về khu Ngoại Giao Đo&agrave;n, c&aacute;ch c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a đ&atilde; h&igrave;nh th&agrave;nh 100 m<br />\r\nPh&iacute;a t&acirc;y: mặt đường nội bộ 17,5 m nối ra c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh ( chỉ 250 m )<br />\r\nPh&iacute;a bắc: tiếp gi&aacute;p mặt đường Xu&acirc;n Đỉnh<br />\r\nPh&iacute;a đ&ocirc;ng: View Hồ T&acirc;y v&agrave; cầu Nhật T&acirc;n, chưa đầy 1km<br />\r\nNgo&agrave;i ra từ dự &aacute;n, qu&yacute; kh&aacute;ch c&oacute; thể dễ d&agrave;ng di chuyển v&agrave;o trung t&acirc;m th&agrave;nh phố hay s&acirc;n bay Nội B&agrave;i qua trục đường lớn Phạm Văn Đồng, Nguyễn Văn Huy&ecirc;n v&agrave; đường cầu Nhật T&acirc;n &hellip;<br />\r\nDự &aacute;n 789 Xu&acirc;n Đỉnh c&oacute; một lợi thế lớn l&agrave; được sở hữu c&aacute;c tiện &iacute;ch sẵn c&oacute; của KĐT &nbsp;Ngoại Giao Đo&agrave;n v&agrave; KĐT T&acirc;y Hồ T&acirc;y như trường học quốc tế, c&aacute;c trường Đại học, bệnh viện, c&ocirc;ng vi&ecirc;n, khu vui chơi giải tr&iacute; &hellip;<br />\r\nC&aacute;c tiện &iacute;ch hiện đại kh&aacute;c như nh&agrave; h&agrave;ng, salon, cửa h&agrave;ng tiện lợi, shop rượu vang, c&agrave; ph&ecirc; &amp; b&aacute;nh ngọt, dịch vụ giặt l&agrave;, bưu điện, spa, ph&ograve;ng tập gym, lễ t&acirc;n v&agrave; an ninh &hellip; cũng gi&uacute;p bạn trải nghiệm cuộc sống trọn vẹn hơn.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599722922_1.jpg', '1601283798_1.jpg|1601283798_2.jpg|1601283798_3.jpg|1601283798_4.jpg|1601283798_5.jpg|1601283798_6.jpg|1601283798_7.jpg|1601283798_8.jpg|1601283798_9.jpg|1601283798_10.jpg|1601283798_11.jpg|1601283798_12.jpg|1601283798_13.jpg|1601283798_14.jpg|1601283798_15.jpg|1601283798_16.jpg|1601283798_17.jpg|1601283798_18.jpg|1601283798_19.jpg|1601283798_20.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-10 07:28:42', '2020-09-28 09:03:18'),
(234, 'Cho thuê căn 2PN giá 8tr tại KĐT Nam Cường - Cổ Nhuế', 'cho-thue-can-2pn-gia-8tr-tai-kdt-nam-cuong-co-nhue', 'KĐT Nam Cường, P. Cổ Nhuế, Q. Bắc Từ Liêm, Hà Nội', 2, '34', '83', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 83m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ,nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nĐ&acirc;y l&agrave; khu đ&ocirc; thị c&oacute; vị tr&iacute; kh&aacute; thuận lợi nằm ở ph&iacute;a t&acirc;y trung t&acirc;m TP H&agrave; Nội, ph&iacute;a Đ&ocirc;ng v&agrave; Đ&ocirc;ng bắc gi&aacute;p với khu d&acirc;n cư x&atilde; Cổ Nhuế, ph&iacute;a T&acirc;y s&aacute;t cạnh đường Phạm Văn Đồng (tuyến đường cao tốc Thăng long đi Nội B&agrave;i).</p>\r\n\r\n<p>Bao quanh KĐT Nam Cường l&agrave; 3 tuyến đường lớn Phạm Văn Đồng, Ho&agrave;ng Quốc Việt v&agrave; đường 69- đ&acirc;y l&agrave; khu vực hết sức thuận lợi về giao th&ocirc;ng đi lại v&agrave; hệ thống đường trong khu vực n&agrave;y phần lớn được x&acirc;y mới ho&agrave;n to&agrave;n n&ecirc;n đ&aacute;p ứng nhu cầu cần thiết của một Khu đ&ocirc; thị hiện đại.<br />\r\nƯu điểm nổi bật nhất l&agrave; vị tr&iacute; Khu đ&ocirc; thị Nam Cường nằm ngay mặt tiền đại lộ Phạm Văn Đồng rộng 60m, từ khu đ&ocirc; thị chỉ mất 30 ph&uacute;t xe chạy sẽ đến s&acirc;n bay Nội B&agrave;i v&agrave; 20 ph&uacute;t để v&agrave;o trung t&acirc;m th&agrave;nh phố.</p>\r\n\r\n<p>Ngo&agrave;i ra bao quanh KĐT Nam Cường l&agrave; si&ecirc;u thị Metro- 1 si&ecirc;u thị b&aacute;n bu&ocirc;n lớn của HN hiện nay, hệ thống c&aacute;c trường đại học, cao đẳng v&agrave; bệnh viện như viện E, bệnh viện y học cổ truyền &hellip; v&agrave; h&agrave;ng loạt c&aacute;c dự &aacute;n đ&ocirc; thị mới cận kề.<br />\r\nL&agrave; khu đ&ocirc; thị khang trang, hiện đại, đồng bộ về CSHT x&atilde; hội, hạ tầng kỹ thuật v&agrave; kiến tr&uacute;c cảnh quan m&ocirc;i trường.&nbsp;C&aacute;c c&ocirc;ng tr&igrave;nh thấp tầng bố tr&iacute; gần kh&ocirc;ng gian c&acirc;y xanh, trường học, nh&agrave; trẻ để h&agrave;i ho&agrave; với kh&ocirc;ng gian khu vực x&oacute;m l&agrave;ng hiện c&oacute; l&acirc;n cận.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601285162_11.jpg', '1601285162_1.jpg|1601285162_2.jpg|1601285162_3.jpg|1601285162_4.jpg|1601285162_5.jpg|1601285162_6.jpg|1601285162_7.jpg|1601285162_8.jpg|1601285162_9.jpg|1601285162_10.jpg|1601285162_11.jpg|1601285162_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-10 07:42:36', '2020-09-28 09:26:02'),
(235, 'Cho thuê căn 3PN giá 12tr tại Chung cư Trung Yên 1 - Cầu Giấy', 'cho-thue-can-3pn-gia-12tr-tai-chung-cu-trung-yen-1-cau-giay', 'Phường Yên Hòa, Cầu Giấy, Hà Nội', 2, '102', '96', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 90m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nT&ograve;a nh&agrave; nằm trong khu đ&ocirc; thị mới Trung y&ecirc;n với cơ sở hạ tầng đồng bộ v&agrave; chỉ c&aacute;ch trung t&acirc;m th&agrave;nh phố khoảng 06 km. Với c&aacute;c trung t&acirc;m thương mại lớn nằm gần ngay t&ograve;a nh&agrave; như Bourbon-Thăng Long...</p>\r\n\r\n<p>Hệ thống giao th&ocirc;ng thuận tiện, ph&iacute;a T&acirc;y Bắc gi&aacute;p đường đi v&agrave;nh đai 3 rộng 30m, ph&iacute;a Đ&ocirc;ng Bắc gi&aacute;p đường nội bộ khu đ&ocirc; thị Trung Y&ecirc;n rộng 13,5m v&agrave; ph&iacute;a Nam gi&aacute;p đường Trung K&iacute;nh.</p>\r\n\r\n<p>Căn hộ tại Chung cư Trung y&ecirc;n 1 được thiết kế kh&ocirc;ng gian nội thất hiện đại,sang trọng; C&aacute;c căn hộ đều được tiếp x&uacute;c trực tiếp với thi&ecirc;n nhi&ecirc;n, tạo sự th&ocirc;ng tho&aacute;ng; Ph&ograve;ng giặt phơi được thiết kế ri&ecirc;ng; S&agrave;n ph&ograve;ng ngủ được l&aacute;t gỗ c&ocirc;ng nghiệp, cửa ra v&agrave;o l&agrave;m bằng, gỗ lim, cửa mặt ngo&agrave;i sử dụng cửa uPVC c&otilde; l&otilde;i th&eacute;p gia cường k&iacute;nh an to&agrave;n; Nh&agrave; vệ sinh được bố tr&iacute; thuận tiện giữa c&aacute;c ph&ograve;ng, thiết bị được sử dụng l&agrave; thiết bị của h&atilde;ng Toto Việt Nam hoặc tương đương...<br />\r\nC&aacute;c dịch vụ tiện &iacute;ch cuả t&ograve;a nh&agrave; như: Tầng hầm d&ugrave;ng l&agrave;m nơi đỗ xe an to&agrave;n, tiện lợi; Trung t&acirc;m thương mại, si&ecirc;u thị dưới sảnh tầng 1 phục vụ nhu cầu mua sắm; Kh&ocirc;ng giam sinh hoạt cộng đồng l&agrave; nơi bạn giao lưu với l&aacute;ng ri&ecirc;ng th&acirc;n thiện; Ph&ograve;ng dịch vụ y tế, chăm s&oacute;c sức khỏe; Ban quản l&yacute; t&ograve;a nh&agrave; chuy&ecirc;n nghiệp, lịch sự.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1599730289_2.jpg', '1599730289_1.jpg|1599730289_3.jpg|1599730289_4.jpg|1599730289_5.jpg|1599730289_6.jpg|1599730289_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-10 09:31:29', '2020-09-26 09:44:14'),
(236, 'Cho thuê căn hộ 3PN giá 8tr tại Chung cư An Bình City', 'cho-thue-can-ho-3pn-gia-8tr-tai-chung-cu-an-binh-city', '232 – 234 Phạm Văn Đồng, Bắc Từ Liêm, Hà Nội (Thành phố giao lưu )', 2, '5', '95', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ&nbsp;tại t&ograve;a A5, rộng 95m2.</p>\r\n\r\n<p>Căn hộ&nbsp;thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ,nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n An B&igrave;nh City c&oacute; vị tr&iacute; địa l&yacute; trắc địa tại số 234 Phạm Văn Đồng nằm trong địa giới h&agrave;nh ch&iacute;nh giữa phường Cổ Nhuế 1 Quận Bắc Từ Li&ecirc;m v&agrave; phường Mai Dịch quận Cầu Giấy.</p>\r\n\r\n<p>An B&igrave;nh city c&ograve;n t&iacute;ch hợp nhiều tiện &iacute;ch vượt trội so với c&aacute;c chung cư kh&aacute;c như: C&ocirc;ng vi&ecirc;n sinh th&aacute;i, hồ điều h&ograve;a rộng 15 ha, tuyến phố thương mại với h&agrave;ng trăm thương hiệu uy t&iacute;n, trường mầm non đạt chuẩn quốc gia,02 bể bơi ngo&agrave;i trời rộng 1200 m2. C&aacute;c c&ocirc;ng tr&igrave;nh tiện &iacute;ch đẳng cấp: Quảng trường c&aacute;c vị thần, quảng trường nhạc nước, quảng trường m&ugrave;a hạ, vườn treo&hellip;<br />\r\nVới lợi thế l&agrave; nơi giao thoa của nhiều tuyến đường giao th&ocirc;ng quan trọng: Đường V&agrave;nh đai 3, đường Ho&agrave;ng Quốc Việt k&eacute;o d&agrave;i, đường quy hoạch 40 m kết nối với khu đ&ocirc; thị T&acirc;y Hồ T&acirc;y, từ An B&igrave;nh city cư d&acirc;n c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực h&agrave;nh ch&iacute;nh v&agrave; vui chơi như: nằm ngay mặt đường Phạm Văn Đồng, di chuyển đến s&acirc;n bay Nội B&agrave;i,bến xe Nam Thăng Long chỉ mất 25 ph&uacute;t; gần C&ocirc;ng vi&ecirc;n Th&agrave;nh phố Giao lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh; gần c&aacute;c si&ecirc;u thị lớn như HC, Mega market...</p>\r\n\r\n<p>Nằm trong l&ograve;ng Khu đ&ocirc; thị Th&agrave;nh phố Giao lưu &ndash; l&agrave; khu đ&ocirc; thị mới được biết đến với hệ thống thảm thực vật xanh, sạch c&ugrave;ng với hệ thống tiện &iacute;ch cao cấp v&agrave; cơ sở hạ tầng ho&agrave;n chỉnh. Khu đ&ocirc; thị An B&igrave;nh thực sự sẽ tỏa s&aacute;ng tr&ecirc;n bầu trời ph&iacute;a T&acirc;y Bắc của trung t&acirc;m thủ đ&ocirc; H&agrave; Nội.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Nội thất cơ bản', NULL, '1599753669_3.jpg', '1599753670_1.jpg|1599753670_2.jpg|1599753670_4.jpg', NULL, NULL, 'Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-10 16:01:10', '2020-09-28 07:24:54'),
