(245, 'Cho thuê căn 3PN full nội thất giá 20tr tại Vinhome Green Bay Mễ Trì', 'cho-thue-can-3pn-full-noi-that-gia-20tr-tai-vinhome-green-bay-me-tri', '7 ĐCT08, P. Mễ Trì, Q. Nam Từ Liêm, Hà Nội', 2, '45', '95', 20000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 95m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGọi Vinhomes Green Bay l&agrave; Vịnh Xanh trong l&ograve;ng phố bởi vị tr&iacute; trung t&acirc;m của đặc khu h&agrave;nh ch&iacute;nh mới của thủ đ&ocirc;.&nbsp;Sở hữu vị tr&iacute; v&agrave;ng tại cửa ng&otilde; ph&iacute;a T&acirc;y Thủ đ&ocirc;: 3 Ph&uacute;t tới Trung t&acirc;m Hội nghị Quốc gia, 5 Ph&uacute;t tới Trường THPT Hanoi &ndash; Amsterdam, si&ecirc;u thị Big C,7 Ph&uacute;t tới Bảo T&agrave;ng H&agrave; Nội, Bến xe Mỹ đ&igrave;nh, Tổ hợp Văn ph&ograve;ng &ndash; TTTM Vincom Nguyễn ch&iacute; Thanh, Keangnam Hanoi landmark Tower, 20 Ph&uacute;t tới s&acirc;n bay Quốc tế Nội B&agrave;i.<br />\r\nVinhomes Green Bay sở hữu hơn 100 tiện &iacute;ch, cảnh quan đa dạng, tinh tế v&agrave; được quy hoạch th&agrave;nh 17 cụm tiện &iacute;ch đan xen giữa kh&ocirc;ng gian sống xanh m&aacute;t. Đ&acirc;y l&agrave; nơi nơi mang đến những tiện &iacute;ch ho&agrave;n hảo mang ti&ecirc;u chuẩn 5 sao: Clubhouse, khu vui chơi trẻ em, đường chạy bộ ven hồ 3,6km, hồ bơi 5 sao, khu đ&aacute;nh cờ, khu dưỡng sinh, gym, thể thao, si&ecirc;u thị, nh&agrave; h&agrave;ng, trường học, thư viện,Ph&ograve;ng kh&aacute;m đa khoa quốc tế Vinmec, Trường li&ecirc;n cấp Vinschool, Si&ecirc;u thị Vinmart, Kh&ocirc;ng gian cảnh quan s&acirc;n vườn, khu vui chơi trẻ em, s&acirc;n thể thao ngo&agrave;i trời, khu đ&aacute;nh cờ, khu dưỡng sinh, vườn hoa, thảm cỏ,&hellip;<br />\r\nSống mỗi ng&agrave;y tại Vinhomes Green Bay được v&iacute; như sống mỗi ng&agrave;y tr&ecirc;n chiếc du thuyền sang trọng để kh&aacute;m ph&aacute; trọn vẹn bờ vịnh xanh tươi.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 20tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599789367_6.jpg', '1599789367_1.jpg|1599789367_2.jpg|1599789367_3.jpg|1599789367_4.jpg|1599789367_5.jpg|1599789367_7.jpg|1599789367_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 01:56:07', '2020-09-26 02:59:01'),
(246, 'Cho thuê căn 3PN full nội thất giá 12tr tại Chung cư D5C - Trần Thái Tông', 'cho-thue-can-3pn-full-noi-that-gia-12tr-tai-chung-cu-d5c-tran-thai-tong', 'Đường Trần Thái Tông, Q. Cầu Giấy, Tp. Hà Nội', 2, '103', '130', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 130m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 30 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm tr&ecirc;n mặt phố Trần Th&aacute;i T&ocirc;ng, con phố tập trung nhiều ng&acirc;n h&agrave;ng, nh&agrave; h&agrave;ng của quận Cầu Giấy. Đầu đường Trần Th&aacute;i T&ocirc;ng ph&iacute;a giao cắt với đường Xu&acirc;n Thủy, Nguyễn Phong Sắc: gần trường Học viện B&aacute;o ch&iacute; Tuy&ecirc;n truyền, Đại học Sư phạm H&agrave; Nội, Đại học Quốc gia...</p>\r\n\r\n<p>Cuối đường, ph&iacute;a giao cắt với đường Duy T&acirc;n - được mệnh danh l&agrave; &quot;thung lũng silicon&quot; nơi tập trung nhiều c&ocirc;ng ty, ng&acirc;n h&agrave;ng, tập đo&agrave;n t&agrave;i ch&iacute;nh, kinh tế&hellip; lớn mạnh trong cả nước như: FPT, CMC, Viettel, Samsung, PVI, Manulife, Prudeltial....</p>\r\n\r\n<p>Từ chung cư D5C dễ d&agrave;ng di chuyển tới c&aacute;c địa điểm như: đến c&ocirc;ng vi&ecirc;n Cầu Giấy chỉ mất 2 ph&uacute;t, đến chợ Dịch Vọng chỉ mất 2 ph&uacute;t, đến bến xe Mỹ Đ&igrave;nh chỉ mất 5 ph&uacute;t...Gần Viện huyết học, viện 19-8 v&agrave; nhiều trung t&acirc;m h&agrave;nh ch&iacute;nh, văn h&oacute;a, kinh tế kh&aacute;c của th&agrave;nh phố.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599791101_4.jpg', '1599791101_1.jpg|1599791101_2.jpg|1599791101_3.jpg|1599791101_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 02:25:01', '2020-09-26 09:45:43'),
(247, 'Cho thuê căn 2PN full nội thất giá 10.5tr tại KĐT Nghĩa Đô', 'cho-thue-can-2pn-full-noi-that-gia-105tr-tai-kdt-nghia-do', 'Phố Trần Cung, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '35', '75', 10500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 75m2, t&ograve;a CT2B. Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; với hạ tầng kỹ thuật đồng bộ, tạo cảnh quan đẹp cho khu vực sẽ l&agrave; trung t&acirc;m mới của Thủ đ&ocirc; trong tương lai.&nbsp;Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; kh&ocirc;ng chỉ c&oacute; gi&aacute; trị cao về kh&ocirc;ng gian kiến tr&uacute;c, chất lượng c&ocirc;ng tr&igrave;nh m&agrave; c&ograve;n c&ograve;n sở hữu vị tr&iacute; đắc địa v&agrave; n&eacute;t đặc trưng m&agrave; &iacute;t dự &aacute;n c&oacute; được.</p>\r\n\r\n<p>Khu đ&ocirc; thị Nghĩa Đ&ocirc; nằm trong mạng lưới giao th&ocirc;ng huyết mạch khu vực T&acirc;y Nam H&agrave; Nội, s&aacute;t tuyến đường v&agrave;nh đai 2 v&agrave; kh&ocirc;ng qu&aacute; xa so với đường v&agrave;nh đai 3, chỉ c&aacute;ch đường Ho&agrave;ng Quốc Việt khoảng 200m, c&aacute;ch chợ Bưởi hơn 1 km, gần c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc; v&agrave; gần 6 tuyến đường lớn như Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt, Phạm Văn Đồng, Nguyễn Ho&agrave;ng T&ocirc;n, Trần Cung, Lạc Long Qu&acirc;n.</p>\r\n\r\n<p>Khu đ&ocirc; thị c&oacute; thiết kế tho&aacute;ng, hệ thống c&acirc;y xanh v&agrave; đường dạo bộ, mật độ x&acirc;y dựng khoảng 30-32%, c&oacute; cơ sở hạ tầng đồng bộ. Ngo&agrave;i ra, Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; nằm cạnh trục đường 40m hiện đang thi c&ocirc;ng, đối diện với hồ điều h&ograve;a rộng 4,9ha của dự &aacute;n Starlake (dự &aacute;n T&acirc;y Hồ T&acirc;y cũ) n&ecirc;n cư d&acirc;n nơi đ&acirc;y sẽ được hưởng lợi chung hạ tầng n&agrave;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599791457_1.jpg', '1599791457_2.jpg|1599791457_3.jpg|1599791457_4.jpg|1599791457_5.jpg|1599791457_6.jpg|1599791457_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 02:30:57', '2020-09-28 09:42:17'),
(248, 'CHO THUÊ CĂN 3PN FULL NỘI THẤT GIÁ 13TR TẠI GREEN STAR PHẠM VĂN ĐỒNG', 'cho-thue-can-3pn-full-noi-that-gia-13tr-tai-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '102', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 102m2, tại t&ograve;a A1.</p>\r\n\r\n<p>Căn hộ&nbsp;thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Green Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601280207_-3023051497408595090.jpg', '1601280207_1.jpg|1601280207_2.jpg|1601280207_3.jpg|1601280207_4.jpg|1601280207_5.jpg|1601280207_-3023051497408595090.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 02:43:04', '2020-09-28 08:03:27'),
(250, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT GIÁ 10TR TẠI KHU ĐÔ THỊ MỸ ĐÌNH SÔNG ĐÀ - SUDICO', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-khu-do-thi-my-dinh-song-da-sudico', 'Đường Phạm Hùng, Phường Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '30', '85', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng&nbsp; 85m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; l&agrave; dự &aacute;n tổ hợp khu căn hộ chung cư Hà N&ocirc;̣i, biệt thự, nh&agrave; liền kề, trung t&acirc;m thương mại v&agrave; mặt bằng văn ph&ograve;ng hiện đại. Chung cư Mỹ Đ&igrave;nh - S&ocirc;ng Đ&agrave; nằm giữa khu vực đang được đ&ocirc; thị h&oacute;a với tốc độ cao. Đ&acirc;y l&agrave; dự &aacute;n c&oacute; vị tr&iacute; thuận lợi để ph&aacute;t triển một khu d&acirc;n cư mới phục vụ nhu cầu về nh&agrave; ở của cư d&acirc;n Thủ đ&ocirc;.<br />\r\nTừ đ&acirc;y d&acirc;n cư c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực trung t&acirc;m th&agrave;nh phố qua c&aacute;c tuyến đường huyết mạch c&ugrave;ng h&igrave;nh thức giao th&ocirc;ng đa dạng.&nbsp;Dự &aacute;n nằm gần với c&aacute;c tiện &iacute;ch như: Đại học kỹ thuật &ndash; Hậu cần c&ocirc;ng an nh&acirc;n d&acirc;n, Đại học d&acirc;n lập Phương Đ&ocirc;ng, Trường trung học cơ sở Mễ Tr&igrave;, Trường mầm non Mỹ Đ&igrave;nh, Trường THPT Đo&agrave;n Thị Điểm, Trường đại học FPT, Bệnh viện thể thao Việt Nam, Bệnh viện 19-8, Bệnh viện đa khoa y học cổ truyền,Viện huyết học v&agrave; truyền m&aacute;u trung ương, C&ocirc;ng vi&ecirc;n Cầu Giấy.</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; được c&aacute;c nh&agrave; đầu tư cũng như kh&aacute;ch h&agrave;ng đ&aacute;nh gi&aacute; cao về tiện &iacute;ch nội v&agrave; ngoại khu. Dự &aacute;n được Sudico đầu tư x&acirc;y dựng với c&aacute;c hạng mục tiện &iacute;ch phục vụ nhu cầu của d&acirc;n cư.Dự &aacute;n mang đến kh&ocirc;ng gian sống đ&aacute;ng mơ ước cho c&aacute;c hộ gia đ&igrave;nh với thiết kế th&ocirc;ng minh. Tại đ&acirc;y bạn v&agrave; c&aacute;c th&agrave;nh vi&ecirc;n trong gia đ&igrave;nh c&oacute; thể tận hưởng c&aacute;c tiện &iacute;ch sống ho&agrave;n thiện.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599793645_14.jpg', '1599793646_1.jpg|1599793646_2.jpg|1599793646_3.jpg|1599793646_4.jpg|1599793646_5.jpg|1599793646_6.jpg|1599793646_7.jpg|1599793646_8.jpg|1599793646_9.jpg|1599793646_10.jpg|1599793646_11.jpg|1599793646_12.jpg|1599793646_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 03:07:26', '2020-09-26 02:42:50');
