(251, 'CHO THUÊ CĂN 3PN FULL NỘI THẤT GIÁ 15TR TẠI KHU ĐÔ THỊ MỸ ĐÌNH SÔNG ĐÀ - SUDICO', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-khu-do-thi-my-dinh-song-da-sudico', 'Đường Phạm Hùng, Phường Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '30', '160', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 160m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ,02 nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; l&agrave; dự &aacute;n tổ hợp khu căn hộ chung cư Hà N&ocirc;̣i, biệt thự, nh&agrave; liền kề, trung t&acirc;m thương mại v&agrave; mặt bằng văn ph&ograve;ng hiện đại. Chung cư Mỹ Đ&igrave;nh - S&ocirc;ng Đ&agrave; nằm giữa khu vực đang được đ&ocirc; thị h&oacute;a với tốc độ cao. Đ&acirc;y l&agrave; dự &aacute;n c&oacute; vị tr&iacute; thuận lợi để ph&aacute;t triển một khu d&acirc;n cư mới phục vụ nhu cầu về nh&agrave; ở của cư d&acirc;n Thủ đ&ocirc;.<br />\r\nTừ đ&acirc;y d&acirc;n cư c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực trung t&acirc;m th&agrave;nh phố qua c&aacute;c tuyến đường huyết mạch c&ugrave;ng h&igrave;nh thức giao th&ocirc;ng đa dạng.&nbsp;Dự &aacute;n nằm gần với c&aacute;c tiện &iacute;ch như: Đại học kỹ thuật &ndash; Hậu cần c&ocirc;ng an nh&acirc;n d&acirc;n, Đại học d&acirc;n lập Phương Đ&ocirc;ng, Trường trung học cơ sở Mễ Tr&igrave;, Trường mầm non Mỹ Đ&igrave;nh, Trường THPT Đo&agrave;n Thị Điểm, Trường đại học FPT, Bệnh viện thể thao Việt Nam, Bệnh viện 19-8, Bệnh viện đa khoa y học cổ truyền,Viện huyết học v&agrave; truyền m&aacute;u trung ương, C&ocirc;ng vi&ecirc;n Cầu Giấy.</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; được c&aacute;c nh&agrave; đầu tư cũng như kh&aacute;ch h&agrave;ng đ&aacute;nh gi&aacute; cao về tiện &iacute;ch nội v&agrave; ngoại khu. Dự &aacute;n được Sudico đầu tư x&acirc;y dựng với c&aacute;c hạng mục tiện &iacute;ch phục vụ nhu cầu của d&acirc;n cư.Dự &aacute;n mang đến kh&ocirc;ng gian sống đ&aacute;ng mơ ước cho c&aacute;c hộ gia đ&igrave;nh với thiết kế th&ocirc;ng minh. Tại đ&acirc;y bạn v&agrave; c&aacute;c th&agrave;nh vi&ecirc;n trong gia đ&igrave;nh c&oacute; thể tận hưởng c&aacute;c tiện &iacute;ch sống ho&agrave;n thiện.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599794027_18.jpg', '1599794027_1.jpg|1599794027_2.jpg|1599794027_3.jpg|1599794027_4.jpg|1599794027_5.jpg|1599794027_8.jpg|1599794027_9.jpg|1599794027_11.jpg|1599794027_15.jpg|1599794027_16.jpg|1599794027_17.jpg|1599794027_20.jpg|1599794027_21.jpg|1599794027_22.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 03:13:47', '2020-09-26 02:42:14'),
