(254, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT GIÁ 11TR TẠI GREEN STAR PHẠM VĂN ĐỒNG', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '68', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ t&ograve;a A1, rộng 68m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGreen Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1601280326_1.jpg', '1601280326_1.jpg|1601280326_2.jpg|1601280326_3.jpg|1601280326_4.jpg|1601280326_5.jpg|1601280326_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 07:31:00', '2020-09-28 08:05:26'),
(255, 'Cho thuê căn 3PN giá 22tr tại Vinhomes West Point - Phạm Hùng', 'cho-thue-can-3pn-gia-22tr-tai-vinhomes-west-point-pham-hung', 'Ngã 3 Đỗ Đức Dục cắt Phạm Hùng, Quận Nam Từ Liêm, Hà Nội', 2, '105', '107', 22000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 107m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Vinhomes West Point sở hữu vị tr&iacute; đắt gi&aacute;, được đ&aacute;nh gi&aacute; l&agrave; đẹp v&agrave; hiện đại bậc nhất khu vực ph&iacute;a T&acirc;y H&agrave; Nội. Tọa lạc ngay tại điểm giao giữa 2 cung đường Đỗ Đức Dục v&agrave; Phạm H&ugrave;ng. Trong đ&oacute; những tuyến đường được coi l&agrave; huyết mạch của thủ đ&ocirc; như: Đường v&agrave;nh đai 3, Đường Cầu Giấy, Đường Trần Duy Hưng&hellip;</p>\r\n\r\n<p>C&aacute;c cư d&acirc;n chung cư dễ d&agrave;ng kết nối thuận tiện tới c&aacute;c khu vực l&acirc;n cận v&agrave; trung t&acirc;m th&agrave;nh phố. Gần bến xe Mỹ Đ&igrave;nh: Mất khoảng 10 ph&uacute;t di chuyển, S&acirc;n bay Nội B&agrave;i: Mất khoảng 25 ph&uacute;t di chuyển, Hồ T&acirc;y: 15 ph&uacute;t, Hồ Ho&agrave;n Kiếm: 20 ph&uacute;t<br />\r\nC&aacute;c tiện &iacute;ch nội khu nổi trội: Khu vực sinh hoạt cộng đồng Clubhouse đẳng cấp, Hệ thống bệnh viện Quốc tế Vinmec hiện đại, Trung t&acirc;m thương mại sầm uất, Khu thể thao, C&ocirc;ng vi&ecirc;n c&acirc;y xanh, Bể bơi trong nh&agrave; v&agrave; ngo&agrave;i trời, Khu văn ph&ograve;ng hiện đại, Nh&agrave; h&agrave;ng sang trọng, Hồ điều h&ograve;a 19 ha, Nh&agrave; h&aacute;t ngo&agrave;i trời, Khu quảng trường lễ hội, Khu vui chơi giải tr&iacute; cho trẻ em, Hệ thống trường học quốc tế, Khu tập thể dục thể thao, tập gym, yoga&hellip;<br />\r\nVới quy hoạch &quot;Trong th&agrave;nh phố l&agrave; một th&agrave;nh phố &quot; từ bệnh viện, trường học, TTTM, văn ph&ograve;ng, ... . Mọi nhu cầu của cư d&acirc;n từ chăm s&oacute;c sức khỏe đến gi&aacute;o dục v&agrave; vui chơi giải tr&iacute; đều được đ&aacute;p ứng to&agrave;n diện, cư d&acirc;n thỏa sức &quot; Sống - L&agrave;m việc - Hưởng thụ &quot;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 22tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1600422724_6.jpg', '1600422725_7.jpg|1600422725_8.jpg|1600422725_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 07:35:00', '2020-09-26 03:24:12'),
(256, 'Cho thuê căn 3PN giá 12tr tại Ecolife Capital Tố Hữu', 'cho-thue-can-3pn-gia-12tr-tai-ecolife-capital-to-huu', '58 Tố Hữu, P. Trung Văn, Q, Nam Từ Liêm, Hà Nội', 2, '40', '110', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 110m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, 02 nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nEcoLife Capital l&agrave; một tổ hợp bao gồm nh&agrave; ở, văn ph&ograve;ng cao cấp nằm tại ngay cửa ng&otilde; ph&iacute;a T&acirc;y thủ đ&ocirc; H&agrave; Nội với quy m&ocirc; 10.622 m2.&nbsp;Sở hữu vị tr&iacute; đắc địa tại số 58 Tố Hữu (đường L&ecirc; Văn Lương k&eacute;o d&agrave;i), Quận H&agrave; Đ&ocirc;ng&ndash; một trong những vị tr&iacute; đắc địa, c&oacute; vị thế đẹp của thủ đ&ocirc; H&agrave; Nội, trong tương lai sẽ l&agrave; khu vực trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế sầm uất nhất của H&agrave; Nội, dễ d&agrave;ng để kết nối tới Trung T&acirc;m H&agrave; Nội; hoặc đi ngoại th&agrave;nh, tới s&acirc;n bay v&agrave; kh&aacute; thuận tiện khi nằm rất gần tuyến đường v&agrave;nh đai 3 v&agrave; tuyến t&agrave;u cao tốc tr&ecirc;n cao C&aacute;t Linh&ndash; H&agrave; Đ&ocirc;ng.</p>\r\n\r\n<p>Gần c&aacute;c khu trung t&acirc;m kinh tế, t&agrave;i ch&iacute;nh lớn của H&agrave; Nội với c&aacute;c doanh nghiệp, đầy đủ c&aacute;c ng&acirc;n h&agrave;ng. Kết nối thuận tiện với c&aacute;c tuyến đường giao th&ocirc;ng quan trọng: L&ecirc; Văn Lương, đường Trần Duy Hưng, đường Khuất Duy Tiến...Trong b&aacute;n k&iacute;nh 1km l&agrave; c&aacute;c t&ograve;a văn ph&ograve;ng chuy&ecirc;n nghiệp: Nam Cường Building, H&agrave; Đ&ocirc;ng Complex Tower, Hồ Gươm Plaza.</p>\r\n\r\n<p>Thừa hưởng hệ thống 64 tiện &iacute;ch kh&eacute;p k&iacute;n như: s&acirc;n tennis, bể bơi kho&aacute;ng mặn trong nh&agrave;, ph&ograve;ng tập Gym, Spa sang trọng.... Nằm trong quần thể cảnh quan c&ocirc;ng vi&ecirc;n c&acirc;y xanh v&agrave; hồ nước, bao quanh bởi c&aacute;c địa điểm sang trọng trong th&agrave;nh phố, gồm c&aacute;c kh&aacute;ch sạn 5 sao, căn hộ cao cấp, trung t&acirc;m thương mại v&agrave; văn ph&ograve;ng cho thu&ecirc;. Kh&ocirc;ng gian văn ph&ograve;ng th&ocirc;ng tho&aacute;ng với ban c&ocirc;ng mở. Hệ thống c&aacute;c tiện &iacute;ch t&iacute;ch hợp trong c&ugrave;ng một khu sẽ mang đến cho c&aacute;n bộ, nh&acirc;n vi&ecirc;n l&agrave;m việc trong t&ograve;a nh&agrave; một m&ocirc;i trường l&agrave;m việc trẻ trung, năng động v&agrave; s&aacute;ng tạo, lựa chọn thu&ecirc; văn ph&ograve;ng quận H&agrave; Đ&ocirc;ng đ&aacute;ng quan t&acirc;m.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1599878387_1.jpg', '1599878387_2.jpg|1599878387_3.jpg|1599878387_4.jpg|1599878387_5.jpg|1599878387_6.jpg|1599878387_7.jpg|1599878387_8.jpg|1599878387_9.jpg|1599878387_10.jpg|1599878387_11.jpg|1599878387_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 07:38:22', '2020-09-26 02:50:44'),
(259, 'Cho thuê căn 2PN giá 7tr tại Packexim Tây Hồ', 'cho-thue-can-2pn-gia-7tr-tai-packexim-tay-ho', 'Ngõ 15 Đường An Dương Vương, Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '106', '86', 7000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 86m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nPackexim 2 tọa lạc tại ng&aacute;ch 6, ng&otilde; 15 đường An Dương &nbsp;Vương, phường Ph&uacute; Thượng, quận T&acirc;y Hồ, H&agrave; Nội. Từ đ&acirc;y, cư d&acirc;n c&oacute; thể nhanh ch&oacute;ng tiếp cận đến c&aacute;c tuyến đường lớn thuộc quận T&acirc;y Hồ v&agrave; Cầu Giấy như An Dương Vương, &Acirc;u Cơ, Lạc Long Qu&acirc;n, V&otilde; Ch&iacute; C&ocirc;ng, Nguyễn Ho&agrave;ng T&ocirc;n. Đặc biệt, Packexim 2 chỉ c&aacute;ch cầu Nhật T&acirc;n khoảng 500m, đ&acirc;y l&agrave; cửa ng&otilde; giao th&ocirc;ng quan trọng để kết nối tới s&acirc;n bay Nội B&agrave;i v&agrave; c&aacute;c tỉnh th&agrave;nh phố l&acirc;n cận.</p>\r\n\r\n<p>Dự &aacute;n Packexim 2 c&oacute; tầm nh&igrave;n tho&aacute;ng rộng tới c&aacute;c địa điểm trung t&acirc;m: Ph&iacute;a Bắc hướng s&ocirc;ng Hồng, ph&iacute;a Nam hướng Hồ T&acirc;y, ph&iacute;a T&acirc;y Nam hướng Khu đ&ocirc; thị Ciputra, ph&iacute;a Đ&ocirc;ng hướng cầu Nhật T&acirc;n. Nhờ vị tr&iacute; thuận lợi gần trục đường huyết mạch ph&iacute;a T&acirc;y H&agrave; Nội nhưng kh&ocirc;ng trực tiếp gi&aacute;p mặt đường lớn, bất cứ ai đến với Packexim 2 đều c&oacute; thể cảm nhận được sự y&ecirc;n tĩnh v&agrave; bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh ngay từ đường v&agrave;o dự &aacute;n.</p>\r\n\r\n<p>Quanh dự &aacute;n c&ograve;n l&agrave; một hệ thống c&aacute;c trường học cũng như trung t&acirc;m thương mại v&agrave; giải tr&iacute; như: Trường Quốc Tế Li&ecirc;n Hợp Quốc H&agrave; Nội, Trường H&agrave; Nội Academy, Trường ĐH Nội Vụ H&agrave; Nội 1,8 km, Bệnh viện Nam Thăng Long, Ciputra Shopping Mall: 800m, C&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y, C&ocirc;ng vi&ecirc;n Mặt Trời v&agrave; Đầm Sen&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 7tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1600848409_6.jpg', '1601106934_5.jpg|1601106934_7.jpg|1601106934_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 09:23:26', '2020-09-26 07:55:34'),
(260, 'CHO THUÊ CĂN 3PN GIÁ 10TR TẠI KHU ĐÔ THỊ MỸ ĐÌNH SÔNG ĐÀ - SUDICO', 'cho-thue-can-3pn-gia-10tr-tai-khu-do-thi-my-dinh-song-da-sudico', 'Đường Phạm Hùng, Phường Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '30', '100', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 100m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; l&agrave; dự &aacute;n tổ hợp khu căn hộ chung cư Hà N&ocirc;̣i, biệt thự, nh&agrave; liền kề, trung t&acirc;m thương mại v&agrave; mặt bằng văn ph&ograve;ng hiện đại. Chung cư Mỹ Đ&igrave;nh - S&ocirc;ng Đ&agrave; nằm giữa khu vực đang được đ&ocirc; thị h&oacute;a với tốc độ cao. Đ&acirc;y l&agrave; dự &aacute;n c&oacute; vị tr&iacute; thuận lợi để ph&aacute;t triển một khu d&acirc;n cư mới phục vụ nhu cầu về nh&agrave; ở của cư d&acirc;n Thủ đ&ocirc;.<br />\r\nTừ đ&acirc;y d&acirc;n cư c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực trung t&acirc;m th&agrave;nh phố qua c&aacute;c tuyến đường huyết mạch c&ugrave;ng h&igrave;nh thức giao th&ocirc;ng đa dạng.&nbsp;Dự &aacute;n nằm gần với c&aacute;c tiện &iacute;ch như: Đại học kỹ thuật &ndash; Hậu cần c&ocirc;ng an nh&acirc;n d&acirc;n, Đại học d&acirc;n lập Phương Đ&ocirc;ng, Trường trung học cơ sở Mễ Tr&igrave;, Trường mầm non Mỹ Đ&igrave;nh, Trường THPT Đo&agrave;n Thị Điểm, Trường đại học FPT, Bệnh viện thể thao Việt Nam, Bệnh viện 19-8, Bệnh viện đa khoa y học cổ truyền,Viện huyết học v&agrave; truyền m&aacute;u trung ương, C&ocirc;ng vi&ecirc;n Cầu Giấy.</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; được c&aacute;c nh&agrave; đầu tư cũng như kh&aacute;ch h&agrave;ng đ&aacute;nh gi&aacute; cao về tiện &iacute;ch nội v&agrave; ngoại khu. Dự &aacute;n được Sudico đầu tư x&acirc;y dựng với c&aacute;c hạng mục tiện &iacute;ch phục vụ nhu cầu của d&acirc;n cư.Dự &aacute;n mang đến kh&ocirc;ng gian sống đ&aacute;ng mơ ước cho c&aacute;c hộ gia đ&igrave;nh với thiết kế th&ocirc;ng minh. Tại đ&acirc;y bạn v&agrave; c&aacute;c th&agrave;nh vi&ecirc;n trong gia đ&igrave;nh c&oacute; thể tận hưởng c&aacute;c tiện &iacute;ch sống ho&agrave;n thiện.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản: giường, tủ, tủ bếp, điều hòa, nóng lạnh...', NULL, '1599816439_5.jpg', '1599816439_1.jpg|1599816439_2.jpg|1599816439_3.jpg|1599816439_4.jpg|1599816439_6.jpg|1599816439_7.jpg|1599816439_8.jpg|1599816439_9.jpg|1599816439_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 09:27:19', '2020-09-26 02:41:30'),
(262, 'Cho thuê căn 2PN full nội thất giá 12tr tại Sun Square Lê Đức Thọ', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-sun-square-le-duc-tho', '21 Đường Lê Đức Thọ, P. Mỹ Đình,Q. Từ Liêm, Hà Nội', 2, '46', '85', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 85m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Sun Square tọa lạc tại số 21 đường L&ecirc; Đức Thọ, Mỹ Đ&igrave;nh II, quận Nam Từ Li&ecirc;m &ndash; được coi l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh, văn h&oacute;a , kinh tế, x&atilde; hội của TP H&agrave; Nội v&agrave; cả nước. Hơn thế nữa đ&acirc;y c&ograve;n l&agrave; điểm nối giao th&ocirc;ng quan trọng tr&ecirc;n trục đường v&agrave;nh đai 3, Ho&agrave;ng Quốc Việt, L&aacute;ng H&ograve;a Lạc, đường 32&hellip; Nhờ vậy m&agrave; cư d&acirc;n của dự &aacute;n sẽ rất thuận lợi trong việc đi lại cũng như tiếp cận dễ d&agrave;ng với c&aacute;c tiện &iacute;ch của khu vực.</p>\r\n\r\n<p>Xung quanh dự &aacute;n cũng tập trung nhiều tổ hợp căn hộ, văn ph&ograve;ng cao cấp như Vinhomes Gardenia, Goldmark City, The Matrix One, HD Mon...C&aacute;c &ldquo;điểm đến&rdquo; trong b&aacute;n k&iacute;nh 1km như: S&acirc;n vận động Quốc gia Mỹ Đ&igrave;nh, Bảo t&agrave;ng H&agrave; Nội, Trung t&acirc;m Hội nghị Quốc gia, Trường ĐH Thương mại, Học Viện B&aacute;o Ch&iacute; V&agrave; Tuy&ecirc;n Truyền, Bệnh viện 198 &nbsp;&ndash; Bộ C&ocirc;ng an, bệnh viện Y học cổ truyền, bệnh viện thể dục thể thao.</p>\r\n\r\n<p>Dự &aacute;n là qu&acirc;̀n th&ecirc;̉ các c&ocirc;ng trình: Văn phòng và nhà ở cao c&acirc;́p,Trung t&acirc;m thương mại với các thương hi&ecirc;̣u hàng đ&acirc;̀u th&ecirc;́ giới, Khu Club House ti&ecirc;u chuẩn quốc tế với bể bơi bốn m&ugrave;a, yoga, gym, spa, caf&eacute;&hellip;Trường học ti&ecirc;u chuẩn quốc tế, Khu&ocirc;n vi&ecirc;n c&acirc;y xanh, đường đi dạo v&agrave; khu vui chơi giải tr&iacute; cho trẻ em, Hệ thống tầng hầm đỗ xe rộng r&atilde;i v&agrave; an to&agrave;n...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599817393_2.jpg', '1599817393_3.jpg|1599817393_4.jpg|1599817393_5.jpg|1599817393_6.jpg|1599817393_7.jpg|1599817393_8.jpg|1599817393_9.jpg|1599817393_10.jpg|1599817393_11.jpg|1599817393_12.jpg|1599817393_13.jpg|1599817393_14.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 09:43:13', '2020-09-26 03:01:32'),
(263, 'Cho thuê căn 2PN full nội thất giá 13tr tại CC Gold Season Nguyễn Tuân', 'cho-thue-can-2pn-full-noi-that-gia-13tr-tai-cc-gold-season-nguyen-tuan', '47 đường Nguyễn Tuân, Thanh Xuân Trung, Thanh Xuân, Hà Nội', 2, '49', '65', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Gold Season tọa lạc tại vị tr&iacute; đắc địa Q.Thanh Xuận, nơi c&oacute; giao th&ocirc;ng thuận lợi, cơ sở hạ tầng đồng bộ, hệ thống gi&aacute;o dục TOP đầu H&agrave; Nội. Mua sắm, vui chơi giải tr&iacute; v&agrave; di chuyển dễ d&agrave;ng bằng c&aacute;c con đường huyết mạch: L&ecirc; Văn Lương, Nguyễn Tr&atilde;i, Trần Duy Hưng, L&aacute;ng, V&agrave;nh đại 3.<br />\r\nNgo&agrave;i ra với lợi thế nằm tr&ecirc;n tuyến xe Bus nhanh BRT đ&atilde; đi v&agrave;o hoạt đồng, tuyến t&agrave;u điện tr&ecirc;n cao sắp đưa v&agrave;o vận h&agrave;nh.&nbsp;<br />\r\nSống tại Gold Season cư d&acirc;n được hưởng tới 99 tiện &iacute;ch kh&aacute;c nhau, với an ninh 3 lớp kh&eacute;p k&iacute;n an to&agrave;n tuyệt đối, hệ thống quản l&yacute; t&ograve;a nh&agrave; th&ocirc;ng minh, hệ thống ph&ograve;ng ch&aacute;y tự động, đơn vị quản l&yacute; t&ograve;a nh&agrave; chuy&ecirc;n nghiệp. Điểm nhấn của dự &aacute;n l&agrave; c&ocirc;ng vi&ecirc;n Manhattan, đ&acirc;y được v&iacute; như l&aacute; phổi xanh của dự &aacute;n. Nơi sẽ đ&acirc;y diễn ra mọi hoạt đồng ngo&agrave;i trời của cư d&acirc;n từ giải tr&iacute;, thể thao đến thư gi&atilde;n.</p>\r\n\r\n<p>Ngo&agrave;i ra dự &aacute;n Gold Season c&ograve;n được đầu tư ri&ecirc;ng một trường học mẫu gi&aacute;o chất lượng cao d&agrave;nh ri&ecirc;ng cho con em cư d&acirc;n, được kết nối trực tiếp với c&ocirc;ng vi&ecirc;n tạo m&ocirc;i trường mở trong c&aacute;c hoạt đồng ngo&agrave;i trời.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:13&nbsp;tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1599817965_thumb.jpg', '1599817966_1.jpg|1599817966_2.jpg|1599817966_3.jpg|1599817966_4.jpg|1599817966_5.jpg|1599817966_6.jpg|1599817966_7.jpg|1599817966_8.jpg|1599817966_9.jpg|1599817966_10.jpg|1599817966_11.jpg|1599817966_12.jpg|1599817966_13.jpg|1599817966_14.jpg|1599817966_15.jpg|1599817966_16.jpg|1599817966_17.jpg|1599817966_18.jpg|1599817966_19.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-11 09:52:46', '2020-09-26 03:58:06'),
(266, 'Cho thuê căn 2PN giá 10tr tại Chung cư Thái Hà BCA Phạm Văn Đồng', 'cho-thue-can-2pn-gia-10tr-tai-chung-cu-thai-ha-bca-pham-van-dong', '43 Phạm Văn Đồng, P. Cổ Nhuế 2, Bắc Từ Liêm, Hà Nội', 2, '39', '70', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Th&aacute;i H&agrave; &ndash; Bộ c&ocirc;ng an Cổ Nhuế 2 tọa lạc Số 43 Phạm Văn Đồng &ndash; Quận Bắc Từ Li&ecirc;m, H&agrave; Nội sở hữu một trong những vị tr&iacute; bậc nhất H&agrave; Nội:<br />\r\nĐ&acirc;y l&agrave; vị tr&iacute; huyết mạch kết nối giao th&ocirc;ng của Thủ Đ&ocirc; bằng c&aacute;c con đường như: Ho&agrave;ng Quốc Việt đi T&acirc;y Hồ ,Hồ T&ugrave;ng Mậu, Xu&acirc;n Thuỷ kết nối quận Cầu Giấy đi Sơn T&acirc;y, đường Phạm Văn Đồng.<br />\r\nTừ vị tr&iacute; dự &aacute;n bạn dễ d&agrave;ng di chuyển thuận tiện v&agrave; nhanh ch&oacute;ng đến S&acirc;n bay Quốc Tế Nội B&agrave;i,Khu c&ocirc;ng nghiệp Thăng Long, C&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y, KĐT&nbsp;Ngoại Giao đo&agrave;n.<br />\r\nGần c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Th&agrave;nh Phố Giao Lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Mai Dịch, c&ocirc;ng Nghĩa Đ&ocirc; v&agrave; C&ocirc;ng vi&ecirc;n Cầu Giấy,&hellip;.<br />\r\nC&aacute;c si&ecirc;u thị mua sắm lớn như Metro, Vinmart,&hellip;mua sắm thả ga.<br />\r\nGần nhiều bệnh viện lớn, nhỏ như Bệnh viện E, bệnh viện 198, bệnh viện Y học cổ truyền&hellip;.<br />\r\nGần nhiều trường Đại Hoc nổi tiếng nhất tại Việt Nam như ĐH Quốc Gia, Thương Mại, Ngoại ngữ, Sư phạm, học viện B&aacute;o ch&iacute; v&agrave; Tuy&ecirc;n Truyền,&hellip;<br />\r\nTại đ&acirc;y cư d&acirc;n c&oacute; thể tận hưởng dịch vụ tiện &iacute;ch v&ocirc; c&ugrave;ng nổi bật: Hệ thống trung t&acirc;m thương mại, mua sắm được x&acirc;y dựng đồng bộ ngay dưới sảnh t&ograve;a nh&agrave;; Trung t&acirc;m tập Gym, Spa...;Khu vui chơi giải tr&iacute; cho c&aacute;c bạn nhỏ trong to&agrave;n t&ograve;a nh&agrave;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1599900285_2.jpg', '1601286808_1.jpg|1601286808_2.jpg|1601286808_3.jpg|1601286808_4.jpg|1601286808_5.jpg|1601286808_6.jpg|1601286808_7.jpg|1601286808_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-12 08:44:45', '2020-09-28 09:53:28'),
(267, 'Cho thuê căn 3PN full nội thất giá 14tr tại Chung cư N02 Yên Hòa', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-chung-cu-n02-yen-hoa', 'Lô 60, ngõ 259, Yên Hòa, Cầu Giấy, Hà Nội', 2, '108', '80', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nT&ograve;a NO-02 nằm ở vị tr&iacute; trung t&acirc;m của c&aacute;c Khu đ&ocirc; thị đ&atilde; v&agrave; đang ho&agrave;n thiện như Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, Dịch Vọng,&hellip; nơi c&oacute; hệ thống hạ tầng kỹ thuật đồng bộ, ho&agrave;n hảo.</p>\r\n\r\n<p>Với b&aacute;n k&iacute;nh chỉ trong v&ograve;ng 1 km, t&ograve;a nh&agrave; Y&ecirc;n H&ograve;a Condominium c&ograve;n l&agrave; trung t&acirc;m của c&aacute;c địa điểm thương mại sầm uất như Big C, Grand Plaza, Kengnam, Fivimart,&hellip;Ngo&agrave;i ra Chung cư N02 Y&ecirc;n H&ograve;a được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch khu đ&ocirc; thị Y&ecirc;n H&ograve;a như: C&ocirc;ng vi&ecirc;n Cầu Giấy, trường tiểu học Y&ecirc;n H&ograve;a, trường THCS Y&ecirc;n H&ograve;a, nh&agrave; văn h&oacute;a Y&ecirc;n H&ograve;a, chợ Hợp Nhất Trung K&iacute;nh&hellip;<br />\r\nChung cư N02 Y&ecirc;n H&ograve;a được thừa hưởng tiện &iacute;ch v&agrave; dịch vụ từ c&aacute;c dự &aacute;n xung quanh như:<br />\r\n&bull; Nh&agrave; trẻ phường Y&ecirc;n H&ograve;a c&aacute;ch 350m&nbsp;<br />\r\n&bull; Trường tiểu học Trung H&ograve;a c&aacute;ch 470m&nbsp;<br />\r\n&bull; Trường tiểu học L&yacute; Th&aacute;i Tổ l&agrave; 1,19km<br />\r\n&bull; Trường tiểu học Nam Trung Y&ecirc;n c&aacute;ch 1,18km&nbsp;<br />\r\n&bull; Trường THCS Nam Trung Y&ecirc;n khoảng 1,07km<br />\r\n&nbsp;Trường PTTH d&acirc;n lập Nguyễn Si&ecirc;u 760m&nbsp;<br />\r\n&bull; Trường Quốc tế Global Y&ecirc;n H&ograve;a c&aacute;ch 40m&nbsp;<br />\r\n&bull; Trường chuy&ecirc;n H&agrave; Nội Amsterdam l&agrave; 1,3km&nbsp;<br />\r\n&bull; Đại học kỹ thuật hậu cần CAND khoảng 550m&nbsp;<br />\r\n&bull; Trường nội tr&uacute; Nguyễn Viết Xu&acirc;n c&aacute;ch 600m&nbsp;<br />\r\n&bull; Trường Đại học Lao động X&atilde; hội : 890m&nbsp;<br />\r\n&bull; Trường Đại học Ngoại thương H&agrave; Nội l&agrave; 1km&nbsp;<br />\r\n&bull; Hệ thống bệnh viện, ph&ograve;ng kh&aacute;m chăm s&oacute;c sức khỏe người d&acirc;n như:&nbsp;<br />\r\n&bull; Bệnh viện Giao th&ocirc;ng vận tải TW c&aacute;ch 1km,&nbsp;<br />\r\n&bull; Viện huyết học v&agrave; truyền m&aacute;u TW c&aacute;ch 1,14km&nbsp;<br />\r\n&bull; Bệnh viện Nhi TW c&aacute;ch 1,3km&nbsp;<br />\r\n&bull; Bệnh viện Phụ sản H&agrave; Nội c&aacute;ch 1,3km&nbsp;<br />\r\nC&ugrave;ng với đ&oacute; l&agrave; gần si&ecirc;u thị, trung t&acirc;m mua sắm, bến xe, s&acirc;n vận động, c&ocirc;ng vi&ecirc;n&hellip; như Big C, The Maner, Grand Plaza, c&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a rất đẹp, bến xe Mỹ Đ&igrave;nh&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1599900642_3.jpg', '1599900643_1.jpg|1599900643_2.jpg|1599900643_4.jpg|1599900643_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-12 08:50:43', '2020-09-26 09:46:30'),
(268, 'CHO THUÊ CĂN 3PN FULL NỘI THẤT GIÁ 12TR TẠI KHU ĐÔ THỊ MỸ ĐÌNH SÔNG ĐÀ - SUDICO', 'cho-thue-can-3pn-full-noi-that-gia-12tr-tai-khu-do-thi-my-dinh-song-da-sudico', 'Đường Phạm Hùng, Phường Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '30', '110', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 110m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nKhu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; l&agrave; dự &aacute;n tổ hợp khu căn hộ chung cư Hà N&ocirc;̣i, biệt thự, nh&agrave; liền kề, trung t&acirc;m thương mại v&agrave; mặt bằng văn ph&ograve;ng hiện đại. Chung cư Mỹ Đ&igrave;nh - S&ocirc;ng Đ&agrave; nằm giữa khu vực đang được đ&ocirc; thị h&oacute;a với tốc độ cao. Đ&acirc;y l&agrave; dự &aacute;n c&oacute; vị tr&iacute; thuận lợi để ph&aacute;t triển một khu d&acirc;n cư mới phục vụ nhu cầu về nh&agrave; ở của cư d&acirc;n Thủ đ&ocirc;.<br />\r\nTừ đ&acirc;y d&acirc;n cư c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực trung t&acirc;m th&agrave;nh phố qua c&aacute;c tuyến đường huyết mạch c&ugrave;ng h&igrave;nh thức giao th&ocirc;ng đa dạng.&nbsp;Dự &aacute;n nằm gần với c&aacute;c tiện &iacute;ch như: Đại học kỹ thuật &ndash; Hậu cần c&ocirc;ng an nh&acirc;n d&acirc;n, Đại học d&acirc;n lập Phương Đ&ocirc;ng, Trường trung học cơ sở Mễ Tr&igrave;, Trường mầm non Mỹ Đ&igrave;nh, Trường THPT Đo&agrave;n Thị Điểm, Trường đại học FPT, Bệnh viện thể thao Việt Nam, Bệnh viện 19-8, Bệnh viện đa khoa y học cổ truyền,Viện huyết học v&agrave; truyền m&aacute;u trung ương, C&ocirc;ng vi&ecirc;n Cầu Giấy.</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; được c&aacute;c nh&agrave; đầu tư cũng như kh&aacute;ch h&agrave;ng đ&aacute;nh gi&aacute; cao về tiện &iacute;ch nội v&agrave; ngoại khu. Dự &aacute;n được Sudico đầu tư x&acirc;y dựng với c&aacute;c hạng mục tiện &iacute;ch phục vụ nhu cầu của d&acirc;n cư.Dự &aacute;n mang đến kh&ocirc;ng gian sống đ&aacute;ng mơ ước cho c&aacute;c hộ gia đ&igrave;nh với thiết kế th&ocirc;ng minh. Tại đ&acirc;y bạn v&agrave; c&aacute;c th&agrave;nh vi&ecirc;n trong gia đ&igrave;nh c&oacute; thể tận hưởng c&aacute;c tiện &iacute;ch sống ho&agrave;n thiện.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1600395073_thumb.jpg', '1600395073_1.jpg|1600395073_2.jpg|1600395073_3.jpg|1600395073_4.jpg|1600395073_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-12 08:53:51', '2020-09-26 02:40:48'),
(270, 'CHO THUÊ CĂN 3PN FULL NỘI THẤT GIÁ 14TR TẠI ECOLIFE TÂY HỒ', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-ecolife-tay-ho', 'Lô đất O17 - HH1 Khu đô thị mới Tây Hồ Tây, quận Tây Hồ, Hà Nội', 2, '17', '106m2', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 106m2.<br />\r\nThiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Ecolife T&acirc;y Hồ được x&acirc;y dựng tr&ecirc;n &ocirc; đất O17 &ndash; HH1 trong quy hoạch chung của khu đ&ocirc; thị mới T&acirc;y Hồ T&acirc;y &ndash; T&acirc;y Hồ - H&agrave; Nội. Từ đ&acirc;y cư d&acirc;n c&oacute; thể kết nối đến h&agrave;ng loạt c&aacute;c tiện &iacute;ch hạ tầng x&atilde; hội bao quanh dự &aacute;n một c&aacute;ch dễ d&agrave;ng thuận tiện nhất.</p>\r\n\r\n<p>Đ&acirc;y l&agrave; một khu đ&ocirc; thị sầm uất tập trung nhiều cụm c&ocirc;ng tr&igrave;nh cao tầng v&agrave; l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh, thương mại, ng&acirc;n h&agrave;ng, dịch vụ... thu h&uacute;t được sự quan t&acirc;m của nhiều tập đo&agrave;n lớn, c&aacute;c c&ocirc;ng ty con trong nước v&agrave; ngo&agrave;i nước đến kinh doanh l&agrave;m việc.</p>\r\n\r\n<p>Từ dự &aacute;n Ecolife T&acirc;y Hồ kết nối dễ d&agrave;ng tới c&aacute;c điểm lớn của HN như:</p>\r\n\r\n<p>C&aacute;ch L&agrave;ng hoa đ&agrave;o Nhật T&acirc;n: 5.5km</p>\r\n\r\n<p>C&aacute;ch Lăng B&aacute;c: 6km</p>\r\n\r\n<p>C&aacute;ch Bảo t&agrave;ng D&acirc;n tộc học: 2.5 km</p>\r\n\r\n<p>C&aacute;ch si&ecirc;u thị Metro: 4km</p>\r\n\r\n<p>C&aacute;ch Bệnh Viện Thu C&uacute;c: 3km&nbsp;</p>\r\n\r\n<p>C&aacute;ch Hồ T&acirc;y: 1.5 km</p>\r\n\r\n<p>C&aacute;ch Chợ Bưởi: 2km</p>\r\n\r\n<p>C&aacute;ch c&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y: 5.5 Km</p>\r\n\r\n<p>Sự kết hợp h&agrave;i h&ograve;a giữa kiến tr&uacute;c đầy hiện đại v&agrave; kh&ocirc;ng gian xanh chung cư Ecolife T&acirc;y Hồ đ&atilde; l&agrave;m n&ecirc;n sự kh&aacute;c biệt cho dự &aacute;n n&agrave;y. Cư d&acirc;n c&oacute; thể thỏa sức mua sắm ở trung t&acirc;m thương mại v&agrave; si&ecirc;u thị sầm uất tại chung cư Ecolife T&acirc;y Hồ.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600049777_10.jpg', '1600049778_1.jpg|1600049778_2.jpg|1600049778_3.jpg|1600049778_4.jpg|1600049778_5.jpg|1600049778_6.jpg|1600049778_7.jpg|1600049778_8.jpg|1600049778_9.jpg|1600049778_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-14 02:16:18', '2020-09-26 07:24:27'),
