tr&uacute;c đầy hiện đại v&agrave; kh&ocirc;ng gian xanh chung cư Ecolife T&acirc;y Hồ đ&atilde; l&agrave;m n&ecirc;n sự kh&aacute;c biệt cho dự &aacute;n n&agrave;y. Cư d&acirc;n c&oacute; thể thỏa sức mua sắm ở trung t&acirc;m thương mại v&agrave; si&ecirc;u thị sầm uất tại chung cư Ecolife T&acirc;y Hồ.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1600050371_5.jpg', '1600050372_1.jpg|1600050372_2.jpg|1600050372_3.jpg|1600050372_4.jpg|1600050372_6.jpg|1600050372_7.jpg|1600050372_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-14 02:21:45', '2020-09-26 07:23:46'),
(272, 'Cho thuê căn 3PN full nội thất giá 13tr tại Hei Tower - Ngụy Như Kon Tum', 'cho-thue-can-3pn-full-noi-that-gia-13tr-tai-hei-tower-nguy-nhu-kon-tum', 'Số 1 Ngụy Như Kon Tum, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '109', '86.2m2', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 86.2m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTo&agrave; nh&agrave; Hei tower Nguỵ Như Kon Tum l&agrave; t&ograve;a nh&agrave; hỗn hợp được thiết kế theo ti&ecirc;u chuẩn &ldquo;T&ograve;a nh&agrave; xanh&rdquo;, bao gồm Trung t&acirc;m thương mại ti&ecirc;u chuẩn quốc tế, hệ thống văn ph&ograve;ng hạng A, c&aacute;c dịch vụ Bể bơi, chăm s&oacute;c sức khỏe, khu tổ hợp c&aacute;c căn hộ.&nbsp;</p>\r\n\r\n<p>Nằm tại số 1 Ngụy Như Kon Tum, HEI tower c&oacute; vị tr&iacute; địa l&yacute; thuận lợi, ngay tại ng&atilde; tư Ngụy Như Kon Tum v&agrave; Vũ Trọng Phụng, gần c&aacute;c trục đường ch&iacute;nh c&oacute; vị tr&iacute; quan trọng đối với chiến lược ph&aacute;t triển kinh tế &ndash; văn h&oacute;a &ndash; x&atilde; hội của Thủ đ&ocirc; như: L&ecirc; Văn Lương, Ho&agrave;ng Đạo Th&uacute;y, Khuất Duy Tiến, Nguyễn Tu&acirc;n&hellip;</p>\r\n\r\n<p>Từ vị tr&iacute; của t&ograve;a nh&agrave;, bạn c&oacute; thể dễ d&agrave;ng kết nối với c&aacute;c khu vực l&acirc;n cận v&agrave; c&aacute;c tỉnh bằng &ocirc; t&ocirc;, xe m&aacute;y, xe bu&yacute;t&hellip; c&aacute;c tuyến giao th&ocirc;ng hiện đại nhất Việt Nam như Đại lộ Thăng Long, đường v&agrave;nh đai 3, đường Nguyễn Tr&atilde;i,&hellip;Với vị tr&iacute; v&agrave; giao th&ocirc;ng thuận lợi, t&ograve;a nh&agrave; sẽ l&agrave; một trong những địa điểm l&agrave;m việc l&yacute; tưởng d&agrave;nh cho c&aacute;c cơ quan v&agrave; doanh nghiệp.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 13r/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600051697_thumb.jpg', '1600051697_1.jpg|1600051697_2.jpg|1600051697_3.jpg|1600051697_4.jpg|1600051697_5.jpg|1600051697_6.jpg|1600051697_7.jpg|1600051697_8.jpg|1600051697_9.jpg|1600051697_10.jpg|1600051697_11.jpg|1600051697_12.jpg|1600051697_13.jpg|1600051697_14.jpg|1600051697_15.jpg|1600051697_16.jpg|1600051697_17.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-14 02:48:17', '2020-09-26 07:20:36');
