(274, 'Cho thuê căn 2PN giá 6.5tr tại KĐT Thành phố Giao lưu - Cổ Nhuế', 'cho-thue-can-2pn-gia-65tr-tai-kdt-thanh-pho-giao-luu-co-nhue', 'Đường Phạm Văn Đồng, Phường Cổ Nhuế 2, Bắc Từ Liêm, Hà Nội', 2, '111', '76m2', 6500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 76m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\n&ldquo;Th&agrave;nh Phố Giao Lưu&rdquo; c&oacute; vị tr&iacute; đắc địa tr&ecirc;n mặt đường Phạm Văn Đồng, gần ng&atilde; tư với đường Ho&agrave;ng Quốc Việt, s&aacute;t với Bộ C&ocirc;ng An, c&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i chừng hơn 20km, kết nối với khu trung t&acirc;m Thủ đ&ocirc; chỉ khoảng tr&ecirc;n dưới 7km. Khu đ&ocirc; thị Th&agrave;nh Phố Giao Lưu được coi l&agrave; điểm s&aacute;ng tr&ecirc;n trục đường n&agrave;y.&nbsp;<br />\r\nĐiểm nhấn, được coi l&agrave; bộ mặt kiến tr&uacute;c KĐT &ldquo;Th&agrave;nh phố giao lưu&rdquo; l&agrave; quảng trường trung t&acirc;m v&agrave; đường đi bộ ch&iacute;nh. Kh&ocirc;ng gian c&acirc;y xanh, mặt nước được kết hợp h&agrave;i h&ograve;a để tổ chức c&aacute;c hoạt động văn h&oacute;a, thể thao, s&acirc;n khấu ngo&agrave;i trời. Ngo&agrave;i ra, trong KĐT &ldquo;Th&agrave;nh phố giao lưu&rdquo;, c&ograve;n c&oacute; trụ sở của Bộ C&ocirc;ng an, 1 trường tiểu học, 1 trường trung học cơ sở, 3 nh&agrave; trẻ, mẫu gi&aacute;o đ&aacute;p ứng quy m&ocirc; học tập của c&aacute;c ch&aacute;u học sinh trong KĐT.</p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, dự &aacute;n sẽ c&oacute; hệ thống trung t&acirc;m thương mại sẽ đem lại chơ cư d&acirc;n nơi đ&acirc;y mức sống đầy đủ với c&aacute;c loại h&igrave;nh dịch vụ tiện &iacute;ch như: si&ecirc;u thị mua sắm, chuỗi nh&agrave; h&agrave;ng, cafe, shop thời trang, mỹ phẩm, bể bơi bốn m&ugrave;a trong nh&agrave;, ph&ograve;ng tập gym, spa, ph&ograve;ng chăm s&oacute;c sức khỏe.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 6.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản: giường, tủ, tủ bếp, điều hòa, nóng lạnh...', NULL, '1600055445_5.jpg', '1600055445_1.jpg|1600055445_2.jpg|1600055445_3.jpg|1600055445_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-14 03:50:45', '2020-09-26 02:26:31'),
(275, 'Cho thuê căn 2PN full nội thất giá 9tr tại KĐT Mễ Trì Hạ', 'cho-thue-can-2pn-full-noi-that-gia-9tr-tai-kdt-me-tri-ha', 'KĐT Mễ Trì Hạ, P. Mễ Trì, Q. Nam Từ Liêm, Hà Nội', 2, '65', '75m2', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm tr&ecirc;n trục đường Phạm H&ugrave;ng - cửa ng&otilde; ph&iacute;a T&acirc;y thủ đ&ocirc;, KĐT Mễ Trị Hạ c&oacute; 1 vị thế đắc địa cho cư d&acirc;n ở đ&acirc;y sinh sống v&agrave; l&agrave;m việc.</p>\r\n\r\n<p>KĐT quy tụ nhiều t&iacute;ch &iacute;ch đa dạng như c&aacute;c nh&agrave; h&agrave;ng lớn, hệ thống ph&ograve;ng gym, rạp chiếu phim, khu vui chơi cho trẻ em, chuỗi c&agrave; ph&ecirc;...hệ thống c&acirc;y x&acirc;y bao phủ mang lại kh&ocirc;ng gian tho&aacute;ng m&aacute;t cho cư d&acirc;n sinh sống tại đ&acirc;y.</p>\r\n\r\n<p>Căn hộ Khu đ&ocirc; thị Mễ Tr&igrave; Hạ được quy hoạch nằm trong khu vực ph&aacute;t triển của Thủ đ&ocirc; H&agrave; Nội với hệ thống tiện &iacute;ch ngoại khu đầy đủ được thừa hưởng từ nhiều c&ocirc;ng tr&igrave;nh dự &aacute;n lớn như: Khu đ&ocirc; thị Mỹ Đ&igrave;nh, Khu đ&ocirc; thị Mỹ Đ&igrave;nh I, The Manor H&agrave; Nội...Gần c&aacute;c trung t&acirc;m thương mại lớn như BigC Thăng Long, The Garden, Vincom Trần Duy Hưng...</p>\r\n\r\n<p>Từ đ&acirc;y, c&oacute; thể dễ d&agrave;ng di chuyển ra ph&iacute;a ngoại th&agrave;nh H&agrave; Nội hướng về c&aacute;c tỉnh ph&iacute;a T&acirc;y như H&agrave; Nam, Nam Định, Th&aacute;i B&igrave;nh...KĐT Mễ Tr&igrave; Hạ l&agrave; sự lựa chọn l&yacute; tưởng để sinh sống v&agrave; l&agrave;m việc.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600057588_2.jpg', '1600057588_1.jpg|1600057588_3.jpg|1600057588_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-14 04:26:28', '2020-09-26 03:15:34'),
(276, 'Cho thuê căn 3PN full nội thất giá 12tr tại Chung cư 173 Xuân Thủy - Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-12tr-tai-chung-cu-173-xuan-thuy-cau-giay', 'Số 173 Xuân Thủy, Cầu Giấy, Hà Nội', 2, '113', '100m2', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 100m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\n<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm tr&ecirc;n mặt đường Xu&acirc;n Thủy, tầng 1 l&agrave; Trung t&acirc;m thương mại, c&aacute;c tầng tr&ecirc;n l&agrave; ph&ograve;ng ở cho cư d&acirc;n.&nbsp;<br />\r\nGần chợ nh&agrave; xanh, trường Đại học Sư phạm, Đại học Quốc Gia, Đại học Ngoại ngữ, Học viện B&aacute;o ch&iacute; Tuy&ecirc;n truyền, Đại học Thương Mại...<br />\r\nGần Bến xe Mỹ Đ&igrave;nh, bệnh viện 19-8, bệnh viện Y học Cổ truyền...<br />\r\nDi chuyển ra c&aacute;c tuyến đường lớn thuận tiện v&agrave; nhanh ch&oacute;ng: đến đường Phạm H&ugrave;ng, Phạm Văn Đồng, Cầu Giấy chỉ 1-2 ph&uacute;t; đường Trần Th&aacute;i T&ocirc;ng, Nguyễn Phong Sắc, Hồ T&ugrave;ng Mậu chỉ 3 ph&uacute;t l&aacute;i xe...<br />\r\nChung cư 173 Xu&acirc;n Thủy l&agrave; nới sống v&agrave; l&agrave;m việc l&yacute; tưởng cho mọi danh nghiệp v&agrave; gia đ&igrave;nh.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600072791_4.jpg', '1600072791_1.jpg|1600072791_2.jpg|1600072791_3.jpg|1600072791_5.jpg|1600072791_6.jpg|1600072791_7.jpg|1600072791_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-14 08:39:51', '2020-09-26 09:46:58'),
(277, 'Cho thuê căn 2PN full nội thất giá 12.5tr tại Star City Lê Văn Lương', 'cho-thue-can-2pn-full-noi-that-gia-125tr-tai-star-city-le-van-luong', '23 Lê Văn Lương, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '4', '80', 12500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Star City nằm tại đường L&ecirc; Văn Lương, Phường Nh&acirc;n Ch&iacute;nh, Quận Thanh Xu&acirc;n, một trong những trục đường huyết mạch v&agrave; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội.</p>\r\n\r\n<p>Từ vị tr&iacute; dự &aacute;n, c&oacute; thể dễ d&agrave;ng kết nối với c&aacute;c khu vực trong v&agrave; ngo&agrave;i th&agrave;nh phố th&ocirc;ng qua c&aacute;c tuyến đường: V&agrave;nh Đai 3, Đường L&aacute;ng, Nguyễn Ch&iacute; Thanh, L&aacute;ng Hạ&hellip; C&aacute;ch BigC Thăng Long chỉ 3 ph&uacute;t, về trung t&acirc;m Bờ Hồ 20 ph&uacute;t&hellip;Ngo&agrave;i ra, trong v&ograve;ng b&aacute;n k&iacute;nh 500m từ Star City l&agrave; hệ thống c&aacute;c si&ecirc;u thị, ng&acirc;n h&agrave;ng, trường học, trung t&acirc;m y tế, mua sắm&hellip;&nbsp; Tiếp gi&aacute;p c&aacute;c KĐTM ph&aacute;t triển, hạ tầng đồng bộ: Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, The Manor, Trung Y&ecirc;n,&hellip; Trung t&acirc;m hội nghị Quốc Gia, Si&ecirc;u thị BigC, Trung t&acirc;m thương mại Grand Plaza, Keangnam Landmark&hellip;</p>\r\n\r\n<p>Hệ thống dịch vụ, trường học, y tế đầy đủ. Star City L&ecirc; Văn Lương được đ&aacute;nh gi&aacute; l&agrave; một trong những vị tr&iacute; v&agrave;ng của thủ đ&ocirc; H&agrave; Nội, mang đến cho cư d&acirc;n nơi đ&acirc;y một cuộc sống tiện nghi v&agrave; đẳng cấp. Với những thiết kế vượt trội v&agrave; đẳng cấp của một kh&aacute;ch sạn 4 sao ti&ecirc;u chuẩn quốc tế, chung cư Star City L&ecirc; Văn Lương được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch hiện đại v&agrave; cao cấp trong khu vực: ph&ograve;ng đọc s&aacute;ch ph&ograve;ng tập thể thao, khu giải tr&iacute;, ph&ograve;ng đọc s&aacute;ch, chơi cờ, khu c&acirc;u lạc bộ người gi&agrave;, nh&agrave; trẻ, ph&ograve;ng xem phim, chơi game, khu mua sắm&hellip; ngay trong nh&agrave;. Đặc biệt, hệ thống bể bơi tr&ecirc;n tầng thượng một trong những sự kh&aacute;c biệt v&agrave; độc đ&aacute;o tại Star City.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600154877_2.jpg', '1600154877_1.jpg|1600154877_3.jpg|1600154877_4.jpg|1600154877_5.jpg|1600154877_6.jpg|1600154877_7.jpg|1600154877_8.jpg|1600154877_9.jpg|1600154877_10.jpg|1600154877_11.jpg|1600154877_12.jpg|1600154877_13.jpg|1600154877_14.jpg|1600154877_15.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, NULL, '0985622139', NULL, 0, 0, '2020-09-15 07:27:57', '2020-09-26 03:33:37'),
(278, 'Cho thuê căn 2PN full nội thất giá 10tr tại KĐT Nghĩa Đô', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-kdt-nghia-do', 'Phố Trần Cung, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '35', '50', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 50m2, t&ograve;a CT2. Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; với hạ tầng kỹ thuật đồng bộ, tạo cảnh quan đẹp cho khu vực sẽ l&agrave; trung t&acirc;m mới của Thủ đ&ocirc; trong tương lai.&nbsp;Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; kh&ocirc;ng chỉ c&oacute; gi&aacute; trị cao về kh&ocirc;ng gian kiến tr&uacute;c, chất lượng c&ocirc;ng tr&igrave;nh m&agrave; c&ograve;n c&ograve;n sở hữu vị tr&iacute; đắc địa v&agrave; n&eacute;t đặc trưng m&agrave; &iacute;t dự &aacute;n c&oacute; được.</p>\r\n\r\n<p>Khu đ&ocirc; thị Nghĩa Đ&ocirc; nằm trong mạng lưới giao th&ocirc;ng huyết mạch khu vực T&acirc;y Nam H&agrave; Nội, s&aacute;t tuyến đường v&agrave;nh đai 2 v&agrave; kh&ocirc;ng qu&aacute; xa so với đường v&agrave;nh đai 3, chỉ c&aacute;ch đường Ho&agrave;ng Quốc Việt khoảng 200m, c&aacute;ch chợ Bưởi hơn 1 km, gần c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc; v&agrave; gần 6 tuyến đường lớn như Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt, Phạm Văn Đồng, Nguyễn Ho&agrave;ng T&ocirc;n, Trần Cung, Lạc Long Qu&acirc;n.</p>\r\n\r\n<p>Khu đ&ocirc; thị c&oacute; thiết kế tho&aacute;ng, hệ thống c&acirc;y xanh v&agrave; đường dạo bộ, mật độ x&acirc;y dựng khoảng 30-32%, c&oacute; cơ sở hạ tầng đồng bộ. Ngo&agrave;i ra, Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; nằm cạnh trục đường 40m hiện đang thi c&ocirc;ng, đối diện với hồ điều h&ograve;a rộng 4,9ha của dự &aacute;n Starlake (dự &aacute;n T&acirc;y Hồ T&acirc;y cũ) n&ecirc;n cư d&acirc;n nơi đ&acirc;y sẽ được hưởng lợi chung hạ tầng n&agrave;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601286119_3.jpg', '1601286119_1.jpg|1601286119_2.jpg|1601286119_3.jpg|1601286119_4.jpg|1601286119_5.jpg|1601286119_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-15 07:31:45', '2020-09-28 09:41:59'),
(280, 'Cho thuê căn 3PN full nội thất giá 15tr tại Star City Lê Văn Lương', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-star-city-le-van-luong', '23 Lê Văn Lương, Phường Nhân Chính, Thanh Xuân, Hà Nội', 2, '4', '130', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 130m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Star City nằm tại đường L&ecirc; Văn Lương, Phường Nh&acirc;n Ch&iacute;nh, Quận Thanh Xu&acirc;n, một trong những trục đường huyết mạch v&agrave; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội.</p>\r\n\r\n<p>Từ vị tr&iacute; dự &aacute;n, c&oacute; thể dễ d&agrave;ng kết nối với c&aacute;c khu vực trong v&agrave; ngo&agrave;i th&agrave;nh phố th&ocirc;ng qua c&aacute;c tuyến đường: V&agrave;nh Đai 3, Đường L&aacute;ng, Nguyễn Ch&iacute; Thanh, L&aacute;ng Hạ&hellip; C&aacute;ch BigC Thăng Long chỉ 3 ph&uacute;t, về trung t&acirc;m Bờ Hồ 20 ph&uacute;t&hellip;Ngo&agrave;i ra, trong v&ograve;ng b&aacute;n k&iacute;nh 500m từ Star City l&agrave; hệ thống c&aacute;c si&ecirc;u thị, ng&acirc;n h&agrave;ng, trường học, trung t&acirc;m y tế, mua sắm&hellip;&nbsp; Tiếp gi&aacute;p c&aacute;c KĐTM ph&aacute;t triển, hạ tầng đồng bộ: Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, The Manor, Trung Y&ecirc;n,&hellip; Trung t&acirc;m hội nghị Quốc Gia, Si&ecirc;u thị BigC, Trung t&acirc;m thương mại Grand Plaza, Keangnam Landmark&hellip;</p>\r\n\r\n<p>Hệ thống dịch vụ, trường học, y tế đầy đủ. Star City L&ecirc; Văn Lương được đ&aacute;nh gi&aacute; l&agrave; một trong những vị tr&iacute; v&agrave;ng của thủ đ&ocirc; H&agrave; Nội, mang đến cho cư d&acirc;n nơi đ&acirc;y một cuộc sống tiện nghi v&agrave; đẳng cấp. Với những thiết kế vượt trội v&agrave; đẳng cấp của một kh&aacute;ch sạn 4 sao ti&ecirc;u chuẩn quốc tế, chung cư Star City L&ecirc; Văn Lương được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch hiện đại v&agrave; cao cấp trong khu vực: ph&ograve;ng đọc s&aacute;ch ph&ograve;ng tập thể thao, khu giải tr&iacute;, ph&ograve;ng đọc s&aacute;ch, chơi cờ, khu c&acirc;u lạc bộ người gi&agrave;, nh&agrave; trẻ, ph&ograve;ng xem phim, chơi game, khu mua sắm&hellip; ngay trong nh&agrave;. Đặc biệt, hệ thống bể bơi tr&ecirc;n tầng thượng một trong những sự kh&aacute;c biệt v&agrave; độc đ&aacute;o tại Star City.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601091192_3.jpg', '1601091192_10.jpg|1601091192_12.jpg|1601091192_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-15 07:38:42', '2020-09-26 03:33:12'),
(281, 'Cho thuê căn 4PN full nội thất giá 16tr tại Chung cư 789 Xuân Đỉnh', 'cho-thue-can-4pn-full-noi-that-gia-16tr-tai-chung-cu-789-xuan-dinh', 'P. Xuân Đỉnh, Q. Bắc Từ Liêm, Hà Nội', 2, '20', '135', 16000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 135m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 04 ph&ograve;ng ngủ, 02 nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất cao cấp gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, n&oacute;ng lạnh, giường, sopha, đệm, tủ bếp,h&uacute;t m&ugrave;i, b&agrave;n ăn..<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n chung cư 789 Xu&acirc;n Đỉnh nằm liền kề khu nh&agrave; ở Ngoại Giao Đo&agrave;n, mặt đường Nguyễn Văn Huy&ecirc;n k&eacute;o d&agrave;i nối liền từ khu đ&ocirc; thị &nbsp;T&acirc;y Hồ T&acirc;y ra Q. Cầu Giấy<br />\r\nPh&iacute;a nam: nh&igrave;n về khu Ngoại Giao Đo&agrave;n, c&aacute;ch c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a đ&atilde; h&igrave;nh th&agrave;nh 100 m<br />\r\nPh&iacute;a t&acirc;y: mặt đường nội bộ 17,5 m nối ra c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh ( chỉ 250 m )<br />\r\nPh&iacute;a bắc: tiếp gi&aacute;p mặt đường Xu&acirc;n Đỉnh<br />\r\nPh&iacute;a đ&ocirc;ng: View Hồ T&acirc;y v&agrave; cầu Nhật T&acirc;n, chưa đầy 1km<br />\r\nNgo&agrave;i ra từ dự &aacute;n, qu&yacute; kh&aacute;ch c&oacute; thể dễ d&agrave;ng di chuyển v&agrave;o trung t&acirc;m th&agrave;nh phố hay s&acirc;n bay Nội B&agrave;i qua trục đường lớn Phạm Văn Đồng, Nguyễn Văn Huy&ecirc;n v&agrave; đường cầu Nhật T&acirc;n &hellip;<br />\r\nDự &aacute;n 789 Xu&acirc;n Đỉnh c&oacute; một lợi thế lớn l&agrave; được sở hữu c&aacute;c tiện &iacute;ch sẵn c&oacute; của KĐT &nbsp;Ngoại Giao Đo&agrave;n v&agrave; KĐT T&acirc;y Hồ T&acirc;y như trường học quốc tế, c&aacute;c trường Đại học, bệnh viện, c&ocirc;ng vi&ecirc;n, khu vui chơi giải tr&iacute; &hellip;<br />\r\nC&aacute;c tiện &iacute;ch hiện đại kh&aacute;c như nh&agrave; h&agrave;ng, salon, cửa h&agrave;ng tiện lợi, shop rượu vang, c&agrave; ph&ecirc; &amp; b&aacute;nh ngọt, dịch vụ giặt l&agrave;, bưu điện, spa, ph&ograve;ng tập gym, lễ t&acirc;n v&agrave; an ninh &hellip; cũng gi&uacute;p bạn trải nghiệm cuộc sống trọn vẹn hơn.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 16tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 4, 2, 'Full nội thất cao cấp', NULL, '1600328752_3.jpg', '1600328752_1.jpg|1600328752_2.jpg|1600328752_4.jpg|1600328752_5.jpg|1600328752_6.jpg|1600328752_7.jpg|1600328752_8.jpg|1600328752_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-17 07:45:52', '2020-09-28 09:04:46'),
(282, 'Cho thuê căn 3PN giá 9tr tại KĐT mới Resco - Cổ Nhuế', 'cho-thue-can-3pn-gia-9tr-tai-kdt-moi-resco-co-nhue', 'Đường Phạm Văn Đồng, Phường Cổ Nhuế 2, Bắc Từ Liêm, Hà Nội', 2, '101', '100', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 100m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;</p>\r\n\r\n<p>2. Tiện &iacute;ch<br />\r\nChung cư Resco Cổ Nhuế tọa lạc tr&ecirc;n đường Phạm Văn Đồng, đối diện c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh. Chung cư Resco Cổ Nhuế nằm trong Khu đ&ocirc; thị Resco thuộc ph&iacute;a Bắc th&agrave;nh phố H&agrave; Nội tr&ecirc;n trục đường Phạm Văn Đồng - Khu vực đang c&oacute; tốc độ ph&aacute;t triển nhanh ch&oacute;ng của Thủ đ&ocirc; H&agrave; Nội.</p>\r\n\r\n<p>Ph&iacute;a T&acirc;y v&agrave; T&acirc;y - Nam gi&aacute;p với d&acirc;n cư x&atilde; Cổ Nhuế, ph&iacute;a Đ&ocirc;ng gi&aacute;p với đường Phạm Văn Đồng (tuyến v&agrave;nh đai 3 đường cao tốc Thăng Long đi Nội B&agrave;i), ph&iacute;a Nam v&agrave; ph&iacute;a Bắc gi&aacute;p đường dự kiến quy hoạch.</p>\r\n\r\n<p>Ưu điểm nổi bật nhất l&agrave; vị tr&iacute; khu Đ&ocirc; thị mới Cổ Nhuế - Xu&acirc;n Đỉnh nằm ngay tr&ecirc;n mặt đường đại lộ Phạm Văn Đồng rộng 60m, cạnh bến xe bu&yacute;t Nam Thăng Long, đối diện C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh với cảnh quan thơ mộng, kh&ocirc;ng kh&iacute; trong l&agrave;nh.</p>\r\n\r\n<p>Chung cư&nbsp;Resco Cổ Nhuế gần si&ecirc;u thị Metro nơi l&agrave; trung t&acirc;m mua sắm lớn nhất của khu vực ph&iacute; Bắc H&agrave; Nội, gần Trụ sở l&agrave;m việc của Bộ c&ocirc;ng an v&agrave; tuyến đường giao th&ocirc;ng huyết mạch Phạm Văn Đồng 200m, si&ecirc;u thị METRO 1,0km, Bệnh viện E 2,0km, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh 250m, S&acirc;n bay Nội B&agrave;i 18km. C&aacute;c tiện &iacute;ch ngay tại dự &aacute;n gi&uacute;p bạn tiết kiệm nhiều thời gian, c&ocirc;ng sức v&agrave; tiền bạc sẽ n&acirc;ng tầm cuộc sống cho bạn.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản: giường, tủ, tủ bếp, điều hòa, nóng lạnh...', NULL, '1600333193_3.jpg', '1600333193_1.jpg|1600333193_2.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-17 08:59:53', '2020-09-26 02:25:46'),
(283, 'Cho thuê căn 2PN full nội thất giá 11tr tại CC FLC Complex Phạm Hùng', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-cc-flc-complex-pham-hung', '36 Phạm Hùng, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '32', '65', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nVị tr&iacute; của dự &aacute;n FLC Complex được xem l&agrave; một những vị tr&iacute; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội. Nằm tr&ecirc;n mặt đường của một trong những n&uacute;t giao th&ocirc;ng huyết mạch tấp nập h&agrave;ng đầu thu đ&ocirc; H&agrave; Nội. Căn hộ nằm ngay cạnh hai c&ocirc;ng vi&ecirc;n lớn Cầu Giấy v&agrave; Nh&acirc;n Ch&iacute;nh. Dự &aacute;n cũng được bao quanh bởi c&aacute;c khu văn ph&ograve;ng cao cấp như phố Duy T&acirc;n, KeangNam, Indochina Plaza c&ugrave;ng với c&aacute;c trường học v&agrave; bệnh viện.</p>\r\n\r\n<p>Dự &aacute;n nằm tiếp gi&aacute;p ngay với tuyến đường sắt tr&ecirc;n cao sẽ tiết kiệm tối đa thời gian di chuyển của kh&aacute;ch h&agrave;ng. Dự &aacute;n nằm ngay cạnh bến xe Mỹ Đ&igrave;nh 1, 2 gi&uacute;p cho qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể đi c&ocirc;ng t&aacute;c cũng như về qu&ecirc; của m&igrave;nh nhanh ch&oacute;ng v&agrave; tiện lợi nhất. FLC Complex nằm tiếp gi&aacute;p với rất nhiều cơ quan kinh tế &ndash; ch&iacute;nh trị &ndash; văn h&oacute;a của thủ đ&ocirc; H&agrave; Nội thuận tiện cho việc c&ocirc;ng t&aacute;c cũng như n&acirc;ng cao chất lượng cuộc sống cho cư d&acirc;n : Trung t&acirc;m hội nghị quốc gia, kh&aacute;ch sạn Grand Palaza, BigC, Trường ĐH Sư Phạm , ĐH C&ocirc;ng Nghiệp, ĐH S&acirc;n Khấu Điện Ảnh, Trường Amsetdam H&agrave; Nội&hellip;</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch xung quanh t&ograve;a chung cư FLC Complex 36 Phạm H&ugrave;ng đều to&aacute;t l&ecirc;n một kh&ocirc;ng gian sống ti&ecirc;n nghi, thư gi&atilde;n nghỉ ngơi sau những giờ l&agrave;m việc căng thẳng. Tại đ&acirc;y cũng được x&acirc;y dựng c&aacute;c dịch vụ kh&aacute;c như khu tập thể thao, trung t&acirc;m thương mại, bể bơi, nh&agrave; trẻ, s&acirc;n đậu trực thăng.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất gồm: Tivi, tủ lạnh, máy giặt, điều hòa, giường, sopha, đệm, tủ bếp...', NULL, '1600396846_1.jpg', '1600396847_2.jpg|1600396847_3.jpg|1600396847_4.jpg|1600396847_5.jpg|1600396847_6.jpg|1600396847_7.jpg|1600396847_8.jpg|1600396847_9.jpg|1600396847_10.jpg|1600396847_11.jpg|1600396847_12.jpg|1600396847_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-18 02:40:47', '2020-09-26 02:47:46'),
(284, 'Cho thuê căn 3PN full nội thất giá 11tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-full-noi-that-gia-11tr-khu-ngoai-giao-doan', 'Đường Xuân Đỉnh, Xã Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '9', '80', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ nằm tại t&ograve;a N01T2, rộng 80m2.</p>\r\n\r\n<p>Căn hộ&nbsp;thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp.</p>\r\n\r\n<p>Full nội thất: giường, tủ, điều h&ograve;a, n&oacute;ng lạnh, sofa, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a,c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ&nbsp;</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601884987_20201001164057-36b7_wm.jpg', '1601884987_20201001164057-9ab2_wm.jpg|1601884987_20201001164057-23f7_wm.jpg|1601884987_20201001164057-36b7_wm.jpg|1601884987_20201001164057-94ac_wm.jpg|1601884987_20201001164057-556d_wm.jpg|1601884987_20201001164057-6306_wm.jpg|1601884987_20201001164057-bce4_wm.jpg|1601884987_20201001164057-e939_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-18 04:59:02', '2020-10-05 08:03:07'),
