(295, 'Cho thuê căn 2PN full nội thất giá 13tr tại CC Central Field Trung Kính', 'cho-thue-can-2pn-full-noi-that-gia-13tr-tai-cc-central-field-trung-kinh', 'Số 219 Trung Kính, Yên Hòa, quận Cầu Giấy, Hà Nội', 2, '24', '80', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự án 219 Trung Kính tọa lạc tại địa chỉ số 219 Trung K&iacute;nh phường Y&ecirc;n H&ograve;a, quận Cầu Giấy - trung t&acirc;m của kinh tế, x&atilde; hội, văn h&oacute;a, ch&iacute;nh trị v&agrave; gi&aacute;o dục của Thủ Đ&ocirc; H&agrave; Nội. Nơi đ&acirc;y kh&ocirc;ng chỉ sở hữu 1 mạng lưới giao th&ocirc;ng hiện đại, t&acirc;n tiến m&agrave; c&ograve;n l&agrave; khu vực tập trung nhiều cơ sở hạ tầng trọng điểm, c&aacute;c khu đ&ocirc; thị ph&aacute;t triển năng động của Quận Cầu Giấy. Chung cư 219 Trung K&iacute;nh c&oacute; ưu thế đặc biệt kh&ocirc;ng chỉ nhờ vị tr&iacute; đẳng cấp, cảnh quan m&ocirc;i trường c&acirc;y xanh, kh&iacute; hậu m&aacute;t mẻ ngay giữa trung t&acirc;m thủ đ&ocirc; H&agrave; Nội m&agrave; c&ograve;n được thừa hưởng hệ thống c&aacute;c tiện &iacute;ch ngoại khu vượt trội.<br />\r\n- Dự &aacute;n cũng gần ngay c&aacute;c trường học nổi tiếng H&agrave; Nội như: Trường Amsterdam, trường THPT Nguyễn Si&ecirc;u, Trường THPT Y&ecirc;n H&ograve;a, trường Lương Thế Vinh....<br />\r\n- C&aacute;c c&ocirc;ng tr&igrave;nh trọng điểm đầy cũng ch&iacute;nh l&agrave; điểm s&aacute;ng của dự &aacute;n: Chợ Trung K&iacute;nh, Viện Huyết Học, c&aacute;c trường Đại Học, Cao Đẳng trong b&aacute;n k&iacute;nh chưa đầy 2km.<br />\r\n- C&aacute;c cơ quan quan trọng của H&agrave; Nội v&agrave; ch&iacute;nh phủ như: Thanh Tra Ch&iacute;nh Phủ; Bộ Nội Vụ; Bộ T&agrave;i nguy&ecirc;n &amp; M&ocirc;i trường; Bộ Kế hoạch &amp; Đầu tư; Viện kiểm s&aacute;t nh&acirc;n d&acirc;n Tối Cao (đang x&acirc;y dựng); Tổng cục Hải Quan; Tổng cục đường bộ; Viện dầu kh&iacute; Việt Nam<br />\r\n- Nhiều bệnh viện lớn: Bệnh viện 19-8; Bệnh viện Giao Th&ocirc;ng Vận Tải TW; Bệnh viện Nhi; Bệnh viện Phụ Sản;&hellip;<br />\r\n- Chợ v&agrave; si&ecirc;u thị lớn như: Chợ Y&ecirc;n H&ograve;a, chợ Trung K&iacute;nh, Si&ecirc;u thị Fivimart, BigC Thăng Long, BigC Garden,&hellip;<br />\r\n- Khu hội nghị, vui chơi giải tr&iacute;: Trung t&acirc;m Hội nghị Quốc Gia, Bảo t&agrave;ng H&agrave; Nội, C&ocirc;ng vi&ecirc;n Cầu Giấy, C&ocirc;ng vi&ecirc;n mini Khu đ&ocirc; thị mới Y&ecirc;n H&ograve;a, Rạp chiếu phim Lotte Cinema; nhiều s&acirc;n b&oacute;ng đ&aacute; xung quanh dự &aacute;n;&hellip;<br />\r\n<br />\r\nThiết kế khu&ocirc;n vi&ecirc;n với c&aacute;c c&ocirc;ng vi&ecirc;n c&acirc;y xanh lớn kết hợp với nhiều tiện &iacute;ch gi&uacute;p cho cư d&acirc;n c&oacute; một kh&ocirc;ng gian thư gi&atilde;n ho&agrave;n hảo, đẳng cấp b&ecirc;n gia đ&igrave;nh. Trung t&acirc;m thương mại nằm từ tầng 1 tới tầng 6 của t&ograve;a nh&agrave;, bao gồm c&aacute;c thương hiệu h&agrave;ng đầu trong nước v&agrave; thế giới, c&aacute;c dịch vụ ẩm thực, spa tiện nghi, khu thể thao, khu vui chơi, khu tiện &iacute;ch c&ocirc;ng cộng như: ph&ograve;ng sinh hoạt chung, bể bơi, spa, gym, yoga, thể dục thẩm mỹ, si&ecirc;u thị, trung t&acirc;m mua sắm, nh&agrave; h&agrave;ng hay c&aacute;c dịch vụ tại nh&agrave; s&acirc;n chơi ngo&agrave;i trời tại tầng 6&hellip;..Bể bơi bốn m&ugrave;a được bố tr&iacute; tr&ecirc;n tầng 17 to&agrave; văn ph&ograve;ng l&agrave; điểm nhấn của dự &aacute;n.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600764972_2.jpg', '1600764972_1.jpg|1600764972_3.jpg|1600764972_4.jpg|1600764972_5.jpg|1600764972_6.jpg|1600764972_7.jpg|1600764972_8.jpg|1600764972_9.jpg|1600764972_10.jpg|1600764972_11.jpg|1600764972_12.jpg|1600764972_13.jpg|1600764972_14.jpg|1600764972_15.jpg|1600764972_16.jpg|1600764972_17.jpg|1600764972_18.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-22 08:56:12', '2020-09-26 08:51:54'),
(296, 'Cho thuê căn 2PN full nội thất giá 9.5tr tại Lạc Hồng West Lake - Tây Hồ', 'cho-thue-can-2pn-full-noi-that-gia-95tr-tai-lac-hong-west-lake-tay-ho', 'Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '95', '80', 9500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm ngay cạnh c&acirc;y cầu Nhật T&acirc;n l&agrave; c&acirc;y cầu ngoại giao hiện đại nhất Việt Nam, nằm cạnh trục đường V&otilde; Ch&iacute; C&ocirc;ng, đường &Acirc;u Cơ, đường An Dương Vương&hellip;. Với vị tr&iacute; nằm cạnh c&aacute;c điểm n&uacute;t giao th&ocirc;ng quan trọng tại cửa ng&otilde; ph&iacute;a đ&ocirc;ng H&agrave; Nội, khiến cho việc di chuyển đến c&aacute;c vị tr&iacute; trọng điểm trong địa b&agrave;n nội th&agrave;nh H&agrave; Nội v&agrave; c&aacute;c tỉnh ph&iacute;a đ&ocirc;ng trở n&ecirc;n cực kỳ thuận tiện.&nbsp;<br />\r\n+ C&aacute;ch Hồ T&acirc;y chỉ 1.5 km, 20 ph&uacute;t l&aacute;i xe ra s&acirc;n bay Nội B&agrave;i, 15 ph&uacute;t l&aacute;i xe v&agrave;o trung t&acirc;m TP H&agrave; Nội<br />\r\n+ Kết nối dễ d&agrave;ng với c&aacute;c khu đ&ocirc; thị lớn: KĐT Cipu- tra, KĐT Xu&acirc;n La, KĐT T&acirc;y Hồ T&acirc;y&hellip;<br />\r\nChung cư Lạc Hồng Westlake được trang bị đầy đủ c&aacute;c dịch vụ tiện &iacute;ch phục vụ nhu cầu sống h&agrave;ng ng&agrave;y của cư d&acirc;n. Với 2 tầng thương mại v&agrave; dịch vụ, cư d&acirc;n c&oacute; thể thoải m&aacute;i vui chơi, mua sắm v&agrave; giải tr&iacute; như: nh&agrave; h&agrave;ng ẩm thực, ph&ograve;ng tập gym, si&ecirc;u thị, nh&agrave; trẻ&hellip; ngay dưới ch&acirc;n t&ograve;a nh&agrave; Lạc Hồng l&agrave; khu vui chơi v&agrave; đường dạo bộ ngập tr&agrave;n c&acirc;y xanh v&agrave; vườn hoa.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600847813_5.jpg', '1600847813_1.jpg|1600847813_2.jpg|1600847813_3.jpg|1600847813_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-23 07:56:53', '2020-09-26 07:54:13'),
(297, 'Cho thuê căn 2PN full nội thất giá 10tr tại Lạc Hồng West Lake - Tây Hồ', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-lac-hong-west-lake-tay-ho', 'Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '95', '85', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 85m2.</p>\r\n\r\n<p>thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm ngay cạnh c&acirc;y cầu Nhật T&acirc;n l&agrave; c&acirc;y cầu ngoại giao hiện đại nhất Việt Nam, nằm cạnh trục đường V&otilde; Ch&iacute; C&ocirc;ng, đường &Acirc;u Cơ, đường An Dương Vương&hellip;. Với vị tr&iacute; nằm cạnh c&aacute;c điểm n&uacute;t giao th&ocirc;ng quan trọng tại cửa ng&otilde; ph&iacute;a đ&ocirc;ng H&agrave; Nội, khiến cho việc di chuyển đến c&aacute;c vị tr&iacute; trọng điểm trong địa b&agrave;n nội th&agrave;nh H&agrave; Nội v&agrave; c&aacute;c tỉnh ph&iacute;a đ&ocirc;ng trở n&ecirc;n cực kỳ thuận tiện.&nbsp;<br />\r\n+ C&aacute;ch Hồ T&acirc;y chỉ 1.5 km, 20 ph&uacute;t l&aacute;i xe ra s&acirc;n bay Nội B&agrave;i, 15 ph&uacute;t l&aacute;i xe v&agrave;o trung t&acirc;m TP H&agrave; Nội<br />\r\n+ Kết nối dễ d&agrave;ng với c&aacute;c khu đ&ocirc; thị lớn: KĐT Cipu- tra, KĐT Xu&acirc;n La, KĐT T&acirc;y Hồ T&acirc;y&hellip;<br />\r\nChung cư Lạc Hồng Westlake được trang bị đầy đủ c&aacute;c dịch vụ tiện &iacute;ch phục vụ nhu cầu sống h&agrave;ng ng&agrave;y của cư d&acirc;n. Với 2 tầng thương mại v&agrave; dịch vụ, cư d&acirc;n c&oacute; thể thoải m&aacute;i vui chơi, mua sắm v&agrave; giải tr&iacute; như: nh&agrave; h&agrave;ng ẩm thực, ph&ograve;ng tập gym, si&ecirc;u thị, nh&agrave; trẻ&hellip; ngay dưới ch&acirc;n t&ograve;a nh&agrave; Lạc Hồng l&agrave; khu vui chơi v&agrave; đường dạo bộ ngập tr&agrave;n c&acirc;y xanh v&agrave; vườn hoa.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600847988_1.jpg', '1600847988_2.jpg|1600847988_3.jpg|1600847988_4.jpg|1600847988_5.jpg|1600847988_6.jpg|1600847988_7.jpg|1600847988_8.jpg|1600847988_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-23 07:59:48', '2020-09-26 07:53:56'),
(298, 'Cho thuê căn 2PN full nội thất giá 12tr tại Sunshine Riverside Tây Hồ', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-sunshine-riverside-tay-ho', 'Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '116', '65', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng&nbsp;65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Tại địa b&agrave;n Th&agrave;nh phố H&agrave; Nội, c&oacute; rất &iacute;t dự &aacute;n c&oacute; được một vị thế đặc biệt mang t&iacute;nh biểu tượng như Sunshine Riverside: nằm s&aacute;t ngay ch&acirc;n cầu Nhật T&acirc;n ở ph&iacute;a bờ Nam s&ocirc;ng Hồng, tr&ecirc;n mảnh đất Ph&uacute; Thượng, được coi l&agrave; v&ugrave;ng địa linh thi&ecirc;n cổ của Thủ đ&ocirc; văn hiến ngh&igrave;n năm.</p>\r\n\r\n<p>Ngo&agrave;i ra tại dự &aacute;n Sunshine Riverside c&oacute; một lợi thế về yếu tố giao th&ocirc;ng, dự &aacute;n nằm ngay s&aacute;t bờ s&ocirc;ng Hồng, cạnh với đường V&otilde; Ch&iacute; C&ocirc;ng l&agrave; trục giao th&ocirc;ng huyết mạch đối nội v&agrave; đối ngoại của cửa ng&otilde; ph&iacute;a Đ&ocirc;ng Bắc H&agrave; Nội, cung đường c&oacute; 10 l&agrave;n xe chạy nối thẳng ra cầu Nhật T&acirc;n. Từ dự &aacute;n Sunshine Riverside, bạn c&oacute; thể dễ d&agrave;ng di chuyển v&agrave;o trung t&acirc;m hay ra ngoại &ocirc; th&agrave;nh phố, hoặc chạy thẳng đến s&acirc;n bay quốc tế Nội B&agrave;i chỉ sau 15 ph&uacute;t di chuyển.</p>\r\n\r\n<p>Với phương ch&acirc;m hoạt động &ldquo;Tất cả cho cuộc sống tiện nghi&rdquo;, ở Sunshine Riverside, to&agrave;n bộ c&aacute;c tiện &iacute;ch v&agrave; dịch vụ được trang bị những vật liệu cao cấp nhất nhằm phục vụ đời sống cư d&acirc;n v&agrave; tất cả đều được t&iacute;ch hợp hết sức th&ocirc;ng minh v&agrave; hiệu quả.&nbsp;Điểm nhấn độc đ&aacute;o nhất tại chung cư Sunshine Riverside l&agrave; trường học quốc tế li&ecirc;n cấp ti&ecirc;u chuẩn 5 sao được x&acirc;y dựng ngay trong khu&ocirc;n vi&ecirc;n dự &aacute;n. Với lứa tuổi mầm non, tại khối đế của c&aacute;c t&ograve;a chung cư được bố tr&iacute; nh&agrave; tr&ocirc;ng trẻ, b&ecirc;n cạnh c&aacute;c dịch vụ, tiện &iacute;ch sinh hoạt như shophouse, nh&agrave; h&agrave;ng&hellip;</p>\r\n\r\n<p>Khu phố mua sắm v&ocirc; c&ugrave;ng nhộn nhịp với c&aacute;c loại h&igrave;nh shophouse l&agrave; một trong những điểm nhấn hấp dẫn của dự &aacute;n, vừa tạo ra t&iacute;nh đa dạng v&agrave; linh hoạt trong việc cung cấp c&aacute;c loại h&igrave;nh dịch vụ cho cộng đồng cư d&acirc;n, v&agrave; đặc biệt tạo ra gi&aacute; trị gia tăng t&agrave;i sản cho ch&iacute;nh những &quot;nh&agrave; đầu tư&quot; l&agrave; cư d&acirc;n đang sinh sống tại Sunshine Riverside.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1600851316_1.jpg', '1600851316_2.jpg|1600851316_3.jpg|1600851316_4.jpg|1600851316_5.mp4|1600851316_6.jpg|1600851316_7.jpg|1600851316_8.jpg|1600851316_9.jpg|1600851316_10.jpg|1600851316_11.jpg|1600851316_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-23 08:55:16', '2020-09-26 07:58:16'),
(299, 'Cho thuê căn 2PN full nội thất giá 12tr tại Mỹ Đình Pearl', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-my-dinh-pearl', 'Số 1 đường Châu Văn Liêm, P. Phú Đô, Q. Nam Từ Liêm, Hà Nội', 2, '117', '80', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nMỹ Đ&igrave;nh Pearl sở hữu vị tr&iacute; tuyệt đẹp v&agrave; cực kỳ đắc địa, s&aacute;t c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a 14ha rộng lớn, gần Đại lộ Thăng Long, đối điện với Trụ sở Bộ Ngoại giao mới...</p>\r\n\r\n<p>Thuộc khu vực trung t&acirc;m ph&iacute;a T&acirc;y Thủ Đ&ocirc;, nơi tập trung của nhiều khu đ&ocirc; thị mới c&oacute; tốc độ ph&aacute;t triển nhanh nhất H&agrave; Nội, được quy hoạch sẽ l&agrave; Trung t&acirc;m ch&iacute;nh trị mới của Thủ đ&ocirc; trong tương lại với hệ thống y tế, gi&aacute;o dục đồng bộ, trung t&acirc;m thương mại... đem lại cho cư d&acirc;n Mỹ Đ&igrave;nh Pearl cuộc sống tiện nghi ho&agrave;n hảo. Mỹ Đ&igrave;nh Pearl mang tới chốn an cư l&yacute; tưởng với tiện &iacute;ch đạt chuẩn 5 sao.</p>\r\n\r\n<p>Phần lớn quỹ đất được chủ đầu tư d&agrave;nh x&acirc;y dựng hệ thống tiện t&iacute;ch nội khu hiện đại với: bể bơi ngo&agrave;i trời, 2 s&acirc;n tennis, s&acirc;n tập golf, khu vui chơi cho trẻ em, đường dạo bộ, khu vực vườn treo, BBQ ngo&agrave;i trời, khu tập thể thao đa năng&hellip; đ&aacute;p ứng tối đa nhu cầu của cư d&acirc;n về cuộc sống năng động, hiện đại.<br />\r\nMỹ Đ&igrave;nh Pearl mang lại m&ocirc;i trường sống tiện nghi, trong l&agrave;nh, gi&uacute;p cư d&acirc;n tận hưởng cuộc sống sang trọng, b&igrave;nh y&ecirc;n v&agrave; hạnh ph&uacute;c c&ugrave;ng những người th&acirc;n thương.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1600852540_6.jpg', '1600852540_2.jpg|1600852540_3.jpg|1600852540_4.jpg|1600852540_5.jpg|1600852540_6.jpg|1600852540_8.jpg|1600852540_9.jpg|1600852540_11.jpg|1600852540_12.jpg|1600852540_13.jpg|1600852540_15.jpg|1600852540_16.jpg|1600852540_17.jpg|1600852540_20.jpg|1600852540_22.jpg|1600852540_23.jpg|1600852540_25.jpg|1600852540_26.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-23 09:15:40', '2020-09-26 03:26:10'),
(300, 'Cho thuê căn 3PN full nội thất giá 11tr tại KĐT Nam Thăng Long - Ciputra', 'cho-thue-can-3pn-full-noi-that-gia-11tr-tai-kdt-nam-thang-long-ciputra', 'Đường Lạc Long Quân, Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '21', '92', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 92m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n khu đ&ocirc; thị Nam Thăng Long nằm ở ph&iacute;a T&acirc;y Bắc của H&agrave; Nội, c&aacute;ch trung t&acirc;m th&agrave;nh phố khoảng 10km, toạ lạc tr&ecirc;n đường Lạc Long Qu&acirc;n, thuộc phường Xu&acirc;n La v&agrave; Ph&uacute; Thượng, quận T&acirc;y Hồ, ph&iacute;a &ETH;&ocirc;ng gi&aacute;p đường v&agrave;nh đai 2, bao quanh bởi s&ocirc;ng Hồng v&agrave; Hồ T&acirc;y. Cổng ch&iacute;nh ph&iacute;a T&acirc;y, gi&aacute;p đường v&agrave;nh đai 3, s&aacute;t ch&acirc;n cầu Thăng Long v&agrave; hướng đi s&acirc;n bay quốc tế Nội B&agrave;i.</p>\r\n\r\n<p>Trong khu đ&ocirc; thị, trường học, nh&agrave; trẻ mẫu gi&aacute;o được bố tr&iacute; đảm bảo an to&agrave;n thuận tiện, linh động, tiện lợi cho trẻ em học tập, vui chơi, cơ quan h&agrave;nh ch&iacute;nh, y tế được bố tr&iacute; ở trung t&acirc;m mỗi đơn vị ở để thuận tiện cho sử dụng v&agrave; quản l&yacute;. Ph&iacute;a T&acirc;y l&agrave; khu dịch vụ t&agrave;i ch&iacute;nh, thương mại, văn ho&aacute;, văn ph&ograve;ng giao dịch, kh&aacute;ch sạn cao cấp.<br />\r\nTrung t&acirc;m mua sắm Ciputra Mall bao gồm bốn tầng nổi v&agrave; một tầng hầm, được coi l&agrave; trung t&acirc;m thương mại đa năng lớn nhất H&agrave; Nội, rộng khoảng 130.000m2. C&aacute;c kh&ocirc;ng gian được bố tr&iacute; trong trung t&acirc;m gồm c&oacute; khu vực b&aacute;n lẻ, với 1.200 cửa h&agrave;ng, 48 nh&agrave; h&agrave;ng, qu&aacute;n cafe, si&ecirc;u thị rộng khoảng 8.500m2, với sự xuất hiện của nhiều t&ecirc;n tuổi lớn trong v&agrave; ngo&agrave;i nước, khu vui chơi giải tr&iacute; 71.000m2 tầm hầm d&agrave;nh cho nơi để xe. Ngo&agrave;i ra, nơi đ&acirc;y c&ograve;n c&oacute; một trung t&acirc;m chiếu phim đa năng với 12 rạp m&agrave;n h&igrave;nh rộng.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600852906_12.jpg', '1600852906_1.jpg|1600852906_2.jpg|1600852906_3.jpg|1600852906_4.jpg|1600852906_5.jpg|1600852906_6.jpg|1600852906_7.jpg|1600852906_8.jpg|1600852906_9.jpg|1600852906_10.jpg|1600852906_11.jpg|1600852906_13.jpg|1600852906_14.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-23 09:21:46', '2020-09-26 07:29:15'),
(301, 'Cho thuê căn 2PN full nội thất giá 12tr tại Home City Trung Kính', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-home-city-trung-kinh', '177 Trung Kính, Tổ 51, Phường Yên Hòa, Cầu Giấy, Hà Nội', 2, '22', '73', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 73m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm cạnh dự &aacute;n c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Nam Trung Y&ecirc;n rộng tới 12ha, tr&ecirc;n con phố Trung K&iacute;nh đang mở rộng 42m với những h&agrave;ng c&acirc;y tỏa b&oacute;ng hai b&ecirc;n đường phố, Home City 177 Trung K&iacute;nh c&oacute; ưu thế đặc biệt về cảnh quan, m&ocirc;i trường v&agrave; kh&iacute; hậu m&aacute;t mẻ trong l&agrave;nh ngay giữa trung t&acirc;m Thủ đ&ocirc; H&agrave; Nội. Với vị tr&iacute; trung t&acirc;m, được bao bọc xung quanh bởi c&aacute;c khu đ&ocirc; thị như Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Trung H&ograve;a với những c&ocirc;ng vi&ecirc;n c&acirc;y xanh, những ng&ocirc;i nh&agrave; biệt thự, nh&agrave; vườn thanh b&igrave;nh dọc c&aacute;c tuyến phố &ocirc; b&agrave;n cờ; Xung quanh dự &aacute;n l&agrave; trung t&acirc;m thương mại sầm uất như Big C, Grand Plaza, Keangnam, Fivimart&hellip;</p>\r\n\r\n<p>Home City 177 Trung K&iacute;nh được thừa hưởng ngay một hệ thống dịch vụ tiện &iacute;ch v&agrave; hạ tầng đ&ocirc; thị đồng bộ. Chung cư Home City l&agrave; sự tổng h&ograve;a của những thiết kế th&ocirc;ng minh, kh&ocirc;ng gian cảnh quan lu&ocirc;n mở v&agrave; hệ thống dịch vụ tiện &iacute;ch, chu đ&aacute;o. Khối đế của c&aacute;c t&ograve;a nh&agrave; li&ecirc;n th&ocirc;ng nhau tạo ra một khoảng kh&ocirc;ng gian rộng lớn, nơi sẽ được bố tr&iacute; c&aacute;c dịch vụ như cửa h&agrave;ng thời trang, ăn uống, giải kh&aacute;t, si&ecirc;u thị, spa, nh&agrave; trẻ, văn ph&ograve;ng&hellip; nhằm mang đến cho cư d&acirc;n cuộc sống tiện nghi v&agrave; h&ograve;a nhập c&ugrave;ng cộng đồng.</p>\r\n\r\n<p>Phần khối đế ph&iacute;a trong khu đất được thiết kế th&ocirc;ng tầng để sử dụng l&agrave;m s&acirc;n chơi, đường dạo kết hợp c&acirc;y xanh cho c&aacute;c t&ograve;a nh&agrave;. Tại đ&acirc;y được bố tr&iacute; một trường tiểu học cao 5 tầng với diện t&iacute;ch s&agrave;n 2200 m2, kết hợp với diện t&iacute;ch s&agrave;n d&agrave;nh cho nh&agrave; trẻ trong c&aacute;c t&ograve;a cao tầng sẽ g&oacute;p phần tạo điều kiện thuận lợi cho cư d&acirc;n trong việc chăm s&oacute;c, gi&aacute;o dục những thế hệ tương lai.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1600853155_6.jpg', '1600853155_1.jpg|1600853155_2.jpg|1600853155_3.jpg|1600853155_4.jpg|1600853155_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-23 09:25:55', '2020-09-26 08:03:26'),
(302, 'Cho thuê căn 2PN full nội thất giá 12tr tại Sunshine Riverside Tây Hồ', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-sunshine-riverside-tay-ho', 'Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '116', '65', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng&nbsp;65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Tại địa b&agrave;n Th&agrave;nh phố H&agrave; Nội, c&oacute; rất &iacute;t dự &aacute;n c&oacute; được một vị thế đặc biệt mang t&iacute;nh biểu tượng như Sunshine Riverside: nằm s&aacute;t ngay ch&acirc;n cầu Nhật T&acirc;n ở ph&iacute;a bờ Nam s&ocirc;ng Hồng, tr&ecirc;n mảnh đất Ph&uacute; Thượng, được coi l&agrave; v&ugrave;ng địa linh thi&ecirc;n cổ của Thủ đ&ocirc; văn hiến ngh&igrave;n năm.</p>\r\n\r\n<p>Ngo&agrave;i ra tại dự &aacute;n Sunshine Riverside c&oacute; một lợi thế về yếu tố giao th&ocirc;ng, dự &aacute;n nằm ngay s&aacute;t bờ s&ocirc;ng Hồng, cạnh với đường V&otilde; Ch&iacute; C&ocirc;ng l&agrave; trục giao th&ocirc;ng huyết mạch đối nội v&agrave; đối ngoại của cửa ng&otilde; ph&iacute;a Đ&ocirc;ng Bắc H&agrave; Nội, cung đường c&oacute; 10 l&agrave;n xe chạy nối thẳng ra cầu Nhật T&acirc;n. Từ dự &aacute;n Sunshine Riverside, bạn c&oacute; thể dễ d&agrave;ng di chuyển v&agrave;o trung t&acirc;m hay ra ngoại &ocirc; th&agrave;nh phố, hoặc chạy thẳng đến s&acirc;n bay quốc tế Nội B&agrave;i chỉ sau 15 ph&uacute;t di chuyển.</p>\r\n\r\n<p>Với phương ch&acirc;m hoạt động &ldquo;Tất cả cho cuộc sống tiện nghi&rdquo;, ở Sunshine Riverside, to&agrave;n bộ c&aacute;c tiện &iacute;ch v&agrave; dịch vụ được trang bị những vật liệu cao cấp nhất nhằm phục vụ đời sống cư d&acirc;n v&agrave; tất cả đều được t&iacute;ch hợp hết sức th&ocirc;ng minh v&agrave; hiệu quả.&nbsp;Điểm nhấn độc đ&aacute;o nhất tại chung cư Sunshine Riverside l&agrave; trường học quốc tế li&ecirc;n cấp ti&ecirc;u chuẩn 5 sao được x&acirc;y dựng ngay trong khu&ocirc;n vi&ecirc;n dự &aacute;n. Với lứa tuổi mầm non, tại khối đế của c&aacute;c t&ograve;a chung cư được bố tr&iacute; nh&agrave; tr&ocirc;ng trẻ, b&ecirc;n cạnh c&aacute;c dịch vụ, tiện &iacute;ch sinh hoạt như shophouse, nh&agrave; h&agrave;ng&hellip;</p>\r\n\r\n<p>Khu phố mua sắm v&ocirc; c&ugrave;ng nhộn nhịp với c&aacute;c loại h&igrave;nh shophouse l&agrave; một trong những điểm nhấn hấp dẫn của dự &aacute;n, vừa tạo ra t&iacute;nh đa dạng v&agrave; linh hoạt trong việc cung cấp c&aacute;c loại h&igrave;nh dịch vụ cho cộng đồng cư d&acirc;n, v&agrave; đặc biệt tạo ra gi&aacute; trị gia tăng t&agrave;i sản cho ch&iacute;nh những &quot;nh&agrave; đầu tư&quot; l&agrave; cư d&acirc;n đang sinh sống tại Sunshine Riverside.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1600853484_9.jpg', '1600853484_1.jpg|1600853484_2.jpg|1600853484_3.jpg|1600853484_4.jpg|1600853484_5.jpg|1600853484_6.jpg|1600853484_7.jpg|1600853484_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-23 09:31:24', '2020-09-26 07:57:45'),
(303, 'Cho thuê căn 2PN full nội thất giá 14tr tại Center Point Lê Văn Lương', 'cho-thue-can-2pn-full-noi-that-gia-14tr-tai-center-point-le-van-luong', '27 Lê Văn Lương, P. Nhân Chính, Q. Thanh Xuân, Hà Nội', 2, '33', '67', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 67m2.<br />\r\nThiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nHanoi Center Point tọa lạc ngay ng&atilde; tư hai mặt tiền L&ecirc; Văn Lương giao với Ho&agrave;ng Đạo Th&uacute;y. Chung cư H&agrave; Nội CenterPoint l&agrave; ng&ocirc;i sao s&aacute;ng trong l&ograve;ng đ&ocirc; thị Trung H&ograve;a Nh&acirc;n Ch&iacute;nh với đầy đủ c&aacute;c ti&ecirc;u ch&iacute; dịch vụ tốt, nhiều tiện &iacute;ch.&nbsp;</p>\r\n\r\n<p>Nằm tại tuyến đường huyết mạch nơi nối liền quận Thanh Xu&acirc;n &ndash; Cầu Giấy, Quận Thanh Xu&acirc;n &ndash; Đống Đa v&agrave; quận Thanh Xu&acirc;n &ndash; H&agrave; Đ&ocirc;ng. Gần c&aacute;c trường nổi tiếng như: Trường Mầm non Họa Mi, Trường tiểu học quốc tế Brendon, Trường THPT Nh&acirc;n Ch&iacute;nh, Trường Chuy&ecirc;n H&agrave; Nội Amsterdam, Trường ĐH Ph&ograve;ng ch&aacute;y Chữa ch&aacute;y, Trường ĐH Khoa học x&atilde; hội v&agrave; Nh&acirc;n Văn.</p>\r\n\r\n<p>Tiện &iacute;ch chung cư H&agrave; nội CenterPoint L&ecirc; Văn Lương gồm đầy đủ trung t&acirc;m thương mại hiện đại đ&aacute;p ứng nhu cầu mua sắm, nh&agrave; trẻ, rạp chiếu phim ti&ecirc;u chuẩn, Trung t&acirc;m thẩm mỹ, Spa, GYM r&egrave;n luyện sức khỏe v&agrave; tận hưởng từng ph&uacute;t gi&acirc;y thư gi&atilde;n&hellip; Dự &aacute;n với nhiều tiện &iacute;ch của một chung cư cao cấp như Trung t&acirc;m TM với c&aacute;c của h&agrave;ng, qu&aacute;n ẩm thực, khu vui chơi giải tr&iacute;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600915734_8.jpg', '1600915734_1.jpg|1600915734_2.jpg|1600915734_3.jpg|1600915734_4.jpg|1600915734_5.jpg|1600915734_6.jpg|1600915734_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 02:48:54', '2020-09-26 03:39:44'),
(304, 'Cho thuê căn 2PN full nội thất giá 7.5tr tại Chung cư N04 Trần Quý Kiên', 'cho-thue-can-2pn-full-noi-that-gia-75tr-tai-chung-cu-n04-tran-quy-kien', 'Phố Trần Quý Kiên, P. Dịch Vọng, Q. Cầu Giấy, Hà Nội', 2, '118', '70', 7500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tr&ecirc;n mặt phố Trần Qu&yacute; Ki&ecirc;n, thuộc quận Cầu Giấy - trung t&acirc;m h&agrave;nh ch&iacute;nh mới của Thủ đ&ocirc;, Chung cư N04 c&oacute; vị tr&iacute; thuận lợi cho cư d&acirc;n sinh sống v&agrave; l&agrave;m việc.</p>\r\n\r\n<p>Gần c&aacute;c trường học lớn như: Học viện B&aacute;o ch&iacute; Tuy&ecirc;n truyền, Đại học Sư phạm, Đại học Quốc gia, Đại học Ngoại ngữ, THPT Dịch Vọng...</p>\r\n\r\n<p>Gần c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;, C&ocirc;ng an Quận Cầu Giấy, Bảo t&agrave;ng D&acirc;n tộc học, Bưu điện Cầu Giấy...v&agrave; nhiều trung t&acirc;m h&agrave;nh ch&iacute;nh, văn h&oacute;a kh&aacute;c.&nbsp;</p>\r\n\r\n<p>Từ chung cư N04 dễ d&agrave;ng di chuyển ra c&aacute;c tuyến đường lớn như đường Cầu Giấy, Ho&agrave;ng Quốc Việt, Phạm Văn Đồng, Xu&acirc;n Thủy...</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 7.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1600916778_5.jpg', '1600916778_1.jpg|1600916778_2.jpg|1600916778_3.jpg|1600916778_4.jpg|1600916778_5.jpg|1600916778_6.jpg|1600916778_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 03:06:18', '2020-09-26 09:47:25'),
(305, 'Cho thuê căn 1PN full nội thất giá 8tr tại KĐT Nghĩa Đô', 'cho-thue-can-1pn-full-noi-that-gia-8tr-tai-kdt-nghia-do', 'Phố Trần Cung, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '35', '48', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 48m2, t&ograve;a CT2C.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 01&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; với hạ tầng kỹ thuật đồng bộ, tạo cảnh quan đẹp cho khu vực sẽ l&agrave; trung t&acirc;m mới của Thủ đ&ocirc; trong tương lai.&nbsp;Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; kh&ocirc;ng chỉ c&oacute; gi&aacute; trị cao về kh&ocirc;ng gian kiến tr&uacute;c, chất lượng c&ocirc;ng tr&igrave;nh m&agrave; c&ograve;n c&ograve;n sở hữu vị tr&iacute; đắc địa v&agrave; n&eacute;t đặc trưng m&agrave; &iacute;t dự &aacute;n c&oacute; được.</p>\r\n\r\n<p>Khu đ&ocirc; thị Nghĩa Đ&ocirc; nằm trong mạng lưới giao th&ocirc;ng huyết mạch khu vực T&acirc;y Nam H&agrave; Nội, s&aacute;t tuyến đường v&agrave;nh đai 2 v&agrave; kh&ocirc;ng qu&aacute; xa so với đường v&agrave;nh đai 3, chỉ c&aacute;ch đường Ho&agrave;ng Quốc Việt khoảng 200m, c&aacute;ch chợ Bưởi hơn 1 km, gần c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc; v&agrave; gần 6 tuyến đường lớn như Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt, Phạm Văn Đồng, Nguyễn Ho&agrave;ng T&ocirc;n, Trần Cung, Lạc Long Qu&acirc;n.</p>\r\n\r\n<p>Khu đ&ocirc; thị c&oacute; thiết kế tho&aacute;ng, hệ thống c&acirc;y xanh v&agrave; đường dạo bộ, mật độ x&acirc;y dựng khoảng 30-32%, c&oacute; cơ sở hạ tầng đồng bộ. Ngo&agrave;i ra, Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; nằm cạnh trục đường 40m hiện đang thi c&ocirc;ng, đối diện với hồ điều h&ograve;a rộng 4,9ha của dự &aacute;n Starlake (dự &aacute;n T&acirc;y Hồ T&acirc;y cũ) n&ecirc;n cư d&acirc;n nơi đ&acirc;y sẽ được hưởng lợi chung hạ tầng n&agrave;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 1, 1, 'Full nội thất', NULL, '1600917472_2.jpg', '1600917472_1.jpg|1600917472_2.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 03:17:52', '2020-09-25 08:04:57'),
(306, 'Cho thuê căn 2PN full nội thất giá 8tr tại Chung cư E3B Trung Hòa Nhân Chính', 'cho-thue-can-2pn-full-noi-that-gia-8tr-tai-chung-cu-e3b-trung-hoa-nhan-chinh', 'Đường Vũ Phạm Hàm, P. Yen Hòa, Q. Cầu Giấy, Hà Nội', 2, '119', '60', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 60m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tr&ecirc;n mặt phố Vũ Phạm H&agrave;m, chung cư E3B c&oacute; vị tr&iacute; thuận lợi cho cư d&acirc;n sinh sống v&agrave; l&agrave;m việc.&nbsp;</p>\r\n\r\n<p>Gần c&aacute;c trường đại học lớn như Đại học Luật H&agrave; Nội, Đại học Ngoại thương, Đại học Giao th&ocirc;ng Vận tải, Học viện Phụ nữ Việt Nam...; c&aacute;c c&ocirc;ng vi&ecirc;n lớn của H&agrave; Nội như c&ocirc;ng vi&ecirc;n Cầu Giấy, c&ocirc;ng vi&ecirc;n Thủ Lệ...</p>\r\n\r\n<p>Gần Trung t&acirc;m Hội nghị Quốc gia, Kangnam HN Landmark tower...</p>\r\n\r\n<p>Từ chung cư E3B dễ d&agrave;ng di chuyển ra đường L&aacute;ng, Nguyễn Khang, Ho&agrave;ng Đạo Th&uacute;y chỉ 3-4 ph&uacute;t l&aacute;i xe, đến đường L&ecirc; Văn Lương, Nguyễn Ch&iacute; Thanh chỉ 2-3 ph&uacute;t l&aacute;i xe. Xung quanh l&agrave; c&aacute;c TTTM v&agrave; si&ecirc;u thị lớn phục vụ nhu cầu sinh hoạt của cư d&acirc;n tại đ&acirc;y.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'full nội thất', NULL, '1600918745_4.jpg', '1600918745_1.jpg|1600918745_2.jpg|1600918745_3.jpg|1600918745_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 03:39:05', '2020-09-26 09:48:08'),
