(308, 'Cho thuê căn 3PN giá12tr tại Iris Garden Mỹ Đình', 'cho-thue-can-3pn-gia12tr-tai-iris-garden-my-dinh', 'Số 30 Trần Hữu Dực, Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '10', '115', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 115m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Iris Garden l&agrave; tổ hợp căn hộ cao cấp, kết hợp thương mại dịch vụ, nhưng vẫn bảo đảm c&aacute;c điều kiện chặt chẽ về d&ograve;ng sản phẩm &quot;căn hộ sức khỏe&quot; của Tập đo&agrave;n Vimefulland.</p>\r\n\r\n<p>C&ocirc;ng tr&igrave;nh nằm tr&ecirc;n đường Trần Hữu Dực, trục đường huyết mạch của quận Nam Từ Li&ecirc;m, H&agrave; Nội. Chung cư c&oacute; hạ tầng đồng bộ, tầm nh&igrave;n kho&aacute;ng đạt, đối diện ngay Cung Điền kinh Thể thao Quốc gia. C&aacute;ch S&acirc;n vận động Mỹ Đ&igrave;nh 2 ph&uacute;t đi xe, c&aacute;ch bến xe Mỹ Đ&igrave;nh v&agrave; đường Phạm H&ugrave;ng 3 ph&uacute;t, đi bộ ra đường Hồ T&ugrave;ng Mậu khoảng 2 ph&uacute;t, gần c&aacute;c trường đại học như Đại học Thương Mại, Đại học Quốc Gia, Đại học Ngoại ngữ.</p>\r\n\r\n<p>Xung quanh l&agrave; c&aacute;c chung cư cao cấp như Mon City, Sun Square với đầy đủ c&aacute;c tiện &iacute;ch: nh&agrave; h&agrave;ng, ph&ograve;ng gym, s&acirc;n b&oacute;ng, rạp chiếu phim, bể bơi&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1601872584_20200923100528-2701_wm.jpg', '1601872584_20200923100528-2701_wm.jpg|1601872584_20200923100531-639e_wm.jpg|1601872584_20200923100531-a29e_wm.jpg|1601872584_20200923100531-a918_wm.jpg|1601872584_20200923100531-e8a6_wm.jpg|1601872584_20200923100532-2479_wm.jpg|1601872584_20200923100532-dade_wm.jpg|1601872584_20200923100532-e2be_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 03:55:42', '2020-10-05 04:36:24'),
(309, 'Cho thuê căn 2PN giá 7.5tr tại CC Green Star Phạm Văn Đồng', 'cho-thue-can-2pn-gia-75tr-tai-cc-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '60', 7500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 160m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Green Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 7.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Nội thất cơ bản', NULL, '1600929693_1.jpg', '1600929694_1.jpg|1600929694_2.jpg|1600929694_3.jpg|1600929694_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 06:41:34', '2020-09-28 08:05:44'),
(310, 'Cho thuê căn 3PN full nội thất giá 11tr tại Chung cư C6 Nguyễn Cơ Thạch', 'cho-thue-can-3pn-full-noi-that-gia-11tr-tai-chung-cu-c6-nguyen-co-thach', 'Đường Nguyễn Cơ Thạch, P. Mỹ Đình, Nam Từ Liêm, Hà Nội', 2, '120', '105', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng&nbsp;105m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư C6 Nguyễn Cơ Thạch&nbsp;nằm ở vị tr&iacute; trung t&acirc;m khu vực h&agrave;nh ch&iacute;nh Mỹ Đ&igrave;nh, dự &aacute;n được thừa hưởng lợi thế từ những c&ocirc;ng tr&igrave;nh tiện &iacute;ch, hạ tầng đồng bộ, hiện đại của c&aacute;c dự &aacute;n, c&ocirc;ng tr&igrave;nh liền kề, từ c&ocirc;ng vi&ecirc;n c&acirc;y xanh, cho đến c&aacute;c tiện &iacute;ch trường học, bệnh viện, kh&aacute;ch sạn, bến xe.</p>\r\n\r\n<p>B&ecirc;n cạnh c&aacute;c tiện &iacute;ch nội khu, cư d&acirc;n của dự &aacute;n&nbsp;c&ograve;n được hưởng c&aacute;c tiện &iacute;ch b&ecirc;n ngo&agrave;i dự &aacute;n: như trường học (gần c&aacute;c trường đại học Thương Mại, đại học Quốc gia H&agrave; Nội, Đại học Ngoại ngữ&hellip;), bệnh viện (bệnh viện Thể thao, bệnh viện 19 &ndash; 8)...</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600930849_1.jpg', '1600930849_2.jpg|1600930849_3.jpg|1600930849_4.jpg|1600930849_5.jpg|1600930849_6.jpg|1600930849_7.jpg|1600930849_8.jpg|1600930849_9.jpg|1600930849_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', 