(311, 'Cho thuê căn 3PN full nội thất giá 10tr tại Chung cư CT3 Đỗ Nhuận - Xuân Đỉnh', 'cho-thue-can-3pn-full-noi-that-gia-10tr-tai-chung-cu-ct3-do-nhuan-xuan-dinh', 'Phố Đỗ Nhuận, Phường Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '121', '92', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 92m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tr&ecirc;n mặt phố Đỗ Nhuận, Chung cư CT3 c&oacute; vị tr&iacute; đắc địa, thuận tiện di chuyển đến nhiều địa điểm lớn của th&agrave;nh phố như: ra Hồ T&acirc;y chỉ 4-5 ph&uacute;t, đến đường V&otilde; Ch&iacute; C&ocirc;ng, Xu&acirc;n Đỉnh, Nguyễn Ho&agrave;ng T&ocirc;n chỉ 2-3 ph&uacute;t...Gần c&aacute;c c&ocirc;ng vi&ecirc;n lớn như C&ocirc;ng vi&ecirc;n Ngoại giao đo&agrave;n, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, Nh&agrave; thi đấu T&acirc;y Hồ...Tọa lạc gần Hồ T&acirc;y, cư d&acirc;n nơi đ&acirc;y cũng được hưởng kh&ocirc;ng kh&iacute; m&aacute;t mẻ v&agrave; c&aacute;c tiện &iacute;ch ngoại khu ở đ&acirc;y.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600933342_1.jpg', '1600933342_2.jpg|1600933342_3.jpg|1600933342_4.jpg|1600933342_5.jpg|1600933342_6.jpg|1600933342_7.jpg|1600933342_8.jpg|1600933342_9.jpg|1600933342_10.jpg|1600933342_11.jpg|1600933342_12.jpg|1600933342_13.jpg|1600933342_14.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 07:42:22', '2020-09-26 02:27:05'),
(312, 'Cho thuê căn 3PN full nội thất giá 12tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-full-noi-that-gia-12tr-khu-ngoai-giao-doan', 'P. Xuân Đỉnh, Q. Bắc Từ Liêm, Hà Nội', 2, '9', '96m', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 96m2, nằm tại t&ograve;a N01T2.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601885190_20190123093424-397c_wm.jpg', '1601885190_20190123093419-225b_wm.jpg|1601885190_20190123093424-397c_wm.jpg|1601885190_20190123093429-7491_wm.jpg|1601885190_20190123093432-7e96_wm.jpg|1601885190_20190123093436-1b9c_wm.jpg|1601885190_20190123093442-201b_wm.jpg|1601885190_20190123093446-1783_wm.jpg|1601885190_20190123093450-b8e1_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 07:48:45', '2020-10-05 08:06:30');
