(313, 'Cho thuê căn 3PN full nội thất giá 14tr tại CC Vinaconex 1 - Khuất Duy Tiến', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-cc-vinaconex-1-khuat-duy-tien', 'Số 289A Khuất Duy Tiến, Phường Trung Hoà, Quận Cầu Giấy, Hà Nội', 2, '122', '146', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 146m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n căn hộ T&ograve;a nh&agrave; Vinaconex 1 tọa lạc tr&ecirc;n khu đất rộng 1,33 ha tại số 289A Khuất Duy Tiến, nằm ở vị tr&iacute; trung t&acirc;m của hai quận Cầu Giấy v&agrave; Thanh Xu&acirc;n, tr&ecirc;n trục đường V&agrave;nh đai 3 được quy hoạch trong quần thể c&aacute;c c&ocirc;ng tr&igrave;nh văn ho&aacute;, thể thao, văn ph&ograve;ng v&agrave; kh&aacute;ch sạn cao cấp tạo n&ecirc;n một khu đ&ocirc; thị mới với phong c&aacute;ch hiện đại, cảnh quan kiến tr&uacute;c đẹp v&agrave; đa dụng, hạ tầng kỹ thuật đồng bộ g&oacute;p phần l&agrave;m thay đổi bộ mặt kiến tr&uacute;c của Thủ đ&ocirc;.<br />\r\nNằm s&aacute;t đường Khuất Duy Tiến (Trung H&ograve;a, Cầu Giấy, H&agrave; Nội), trong quần thể kiến tr&uacute;c ho&agrave;n chỉnh nhất th&agrave;nh phố H&agrave; Nội gồm: khu Trung t&acirc;m Hội nghị Quốc gia, Bảo t&agrave;ng H&agrave; Nội, khu văn ph&ograve;ng đại diện của UBND c&aacute;c tỉnh, th&agrave;nh phố trực thuộc T.W, khu thương mại si&ecirc;u thị Big C, kh&aacute;ch sạn 5 sao như KeangNam, Charmvit,... Vinaconex 1 thuận lợi về mặt giao th&ocirc;ng, đi lại v&agrave; c&aacute;c nhu cầu thiết yếu của đời sống như mua sắm, giải tr&iacute;&hellip;<br />\r\nVinaconex 1 c&oacute; hệ thống hạ tầng kỹ thuật, c&acirc;y xanh bao phủ xung quanh, hiện hữu tr&ecirc;n khắp c&aacute;c tầng, kh&ocirc;ng gian vui chơi, bể bơi, ph&ograve;ng tập thể thao, s&acirc;n chơi cho trẻ nhỏ, tầng hầm để xe...C&aacute;c khối nh&agrave; tầng sử dụng để kinh doanh dịch vụ c&ocirc;ng cộng, văn ph&ograve;ng cho thu&ecirc;, khu thể thao, nh&agrave; trẻ v&agrave; sinh hoạt cộng đồng&hellip;khiến Vinaconex giống như 1 thế giới thu nhỏ ho&agrave;n hảo cho c&aacute;c hộ gia đ&igrave;nh hiện đại bận rộn.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600934445_5.jpg', '1600934445_1.jpg|1600934445_2.jpg|1600934445_3.jpg|1600934445_4.jpg|1600934445_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 08:00:45', '2020-09-26 09:48:45'),
(314, 'Cho thuê căn 3PN full nội thất giá 17tr tại Vinhome Green Bay - Mễ Trì', 'cho-thue-can-3pn-full-noi-that-gia-17tr-tai-vinhome-green-bay-me-tri', '7 ĐCT08, P. Mễ Trì, Q. Nam Từ Liêm, Hà Nội', 2, '45', '94', 17000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 94m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGọi Vinhomes Green Bay l&agrave; Vịnh Xanh trong l&ograve;ng phố bởi vị tr&iacute; trung t&acirc;m của đặc khu h&agrave;nh ch&iacute;nh mới của thủ đ&ocirc;.&nbsp;Sở hữu vị tr&iacute; v&agrave;ng tại cửa ng&otilde; ph&iacute;a T&acirc;y Thủ đ&ocirc;: 3 Ph&uacute;t tới Trung t&acirc;m Hội nghị Quốc gia, 5 Ph&uacute;t tới Trường THPT Hanoi &ndash; Amsterdam, si&ecirc;u thị Big C,7 Ph&uacute;t tới Bảo T&agrave;ng H&agrave; Nội, Bến xe Mỹ đ&igrave;nh, Tổ hợp Văn ph&ograve;ng &ndash; TTTM Vincom Nguyễn ch&iacute; Thanh, Keangnam Hanoi landmark Tower, 20 Ph&uacute;t tới s&acirc;n bay Quốc tế Nội B&agrave;i.<br />\r\nVinhomes Green Bay sở hữu hơn 100 tiện &iacute;ch, cảnh quan đa dạng, tinh tế v&agrave; được quy hoạch th&agrave;nh 17 cụm tiện &iacute;ch đan xen giữa kh&ocirc;ng gian sống xanh m&aacute;t. Đ&acirc;y l&agrave; nơi nơi mang đến những tiện &iacute;ch ho&agrave;n hảo mang ti&ecirc;u chuẩn 5 sao: Clubhouse, khu vui chơi trẻ em, đường chạy bộ ven hồ 3,6km, hồ bơi 5 sao, khu đ&aacute;nh cờ, khu dưỡng sinh, gym, thể thao, si&ecirc;u thị, nh&agrave; h&agrave;ng, trường học, thư viện,Ph&ograve;ng kh&aacute;m đa khoa quốc tế Vinmec, Trường li&ecirc;n cấp Vinschool, Si&ecirc;u thị Vinmart, Kh&ocirc;ng gian cảnh quan s&acirc;n vườn, khu vui chơi trẻ em, s&acirc;n thể thao ngo&agrave;i trời, khu đ&aacute;nh cờ, khu dưỡng sinh, vườn hoa, thảm cỏ,&hellip;<br />\r\nSống mỗi ng&agrave;y tại Vinhomes Green Bay được v&iacute; như sống mỗi ng&agrave;y tr&ecirc;n chiếc du thuyền sang trọng để kh&aacute;m ph&aacute; trọn vẹn bờ vịnh xanh tươi.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 17tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600934969_1.jpg', '1600934969_2.jpg|1600934969_3.jpg|1600934969_4.jpg|1600934969_5.jpg|1600934969_6.jpg|1600934969_7.jpg|1600934969_8.jpg|1600934969_9.jpg|1600934969_10.jpg|1600934969_11.jpg|1600934969_12.jpg|1600934969_13.jpg|1600934969_14.jpg|1600934969_15.jpg|1600934969_16.jpg|1600934969_17.jpg|1600934969_18.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 08:09:29', '2020-09-26 02:58:25'),
(315, 'Cho thuê căn 2PN giá 8tr tại Cowa Tower Hồ Tùng Mậu', 'cho-thue-can-2pn-gia-8tr-tai-cowa-tower-ho-tung-mau', '199 Hồ Tùng Mậu, Q. Nam Từ Liêm, Hà Nội', 2, '58', '70', 7500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Tọa lạc tại vị tr&iacute; đắc địa, nơi sẽ l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế của Thủ đ&ocirc; trong tương lai, đầu mối trung t&acirc;m kết nối c&aacute;c trục đường lớn. Cowa Tower&nbsp;&ndash; nằm ngay tr&ecirc;n mặt đường Hồ T&ugrave;ng Mậu,gần&nbsp;khu c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a Mai Dịch gần 2 ha đ&atilde; được quy hoạch.<br />\r\nĐặc biệt, đ&acirc;y cũng l&agrave; nơi tập trung tất cả c&aacute;c tuyến xe li&ecirc;n tỉnh, đặc biệt l&agrave; c&aacute;c tỉnh ph&iacute;a Đ&ocirc;ng, ph&iacute;a Nam Thủ đ&ocirc; như Bắc Ninh, Hưng Y&ecirc;n, Hải Dương, H&agrave; Nam, Ninh B&igrave;nh, Th&aacute;i B&igrave;nh, Nam Định, Thanh H&oacute;a, Nghệ An&hellip;<br />\r\nDễ d&agrave;ng di chuyển đến c&aacute;c địa điểm bệnh viện, trường đại học, bến xe: C&aacute;ch Đại học Thương Mại, Đại học S&acirc;n khấu Điện ảnh, Đại học Quốc Gia, Đại học Ngoại ngữ 0.3km; C&aacute;ch bệnh viện 198 0.9km; đi xe m&aacute;y đến S&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3p;gần c&aacute;c si&ecirc;u thị Fivimart, Pico Plaza, Media mart&hellip;&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 7.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1600936436_1.jpg', '1600936436_2.jpg|1600936436_3.jpg|1600936436_4.jpg|1600936436_5.jpg|1600936436_6.jpg|1600936436_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 08:33:56', '2020-10-02 02:09:41'),
(316, 'Cho thuê căn 3PN full nội thất giá 15tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-full-noi-that-gia-15tr-khu-ngoai-giao-doan', 'P. Xuân Đỉnh, Q. Bắc Từ Liêm, Hà Nội', 2, '9', '131', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 131m2, nằm tại t&ograve;a N03T4.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600936802_4.jpg', '1600936803_1.jpg|1600936803_2.jpg|1600936803_3.jpg|1600936803_5.jpg|1600936803_7.jpg|1600936803_8.jpg|1600936803_9.jpg|1600936803_10.jpg|1600936803_12.jpg|1600936803_13.jpg|1600936803_14.jpg|1600936803_15.jpg|1600936803_16.jpg|1600936803_17.jpg|1600936803_18.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 08:40:03', '2020-09-25 02:56:42'),
(317, 'Cho thuê căn 2PN full nội thất giá 13tr tại Sunshine Riverside Tây Hồ', 'cho-thue-can-2pn-full-noi-that-gia-13tr-tai-sunshine-riverside-tay-ho', 'Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '116', '100', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 100m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTại địa b&agrave;n Th&agrave;nh phố H&agrave; Nội, c&oacute; rất &iacute;t dự &aacute;n c&oacute; được một vị thế đặc biệt mang t&iacute;nh biểu tượng như Sunshine Riverside: nằm s&aacute;t ngay ch&acirc;n cầu Nhật T&acirc;n ở ph&iacute;a bờ Nam s&ocirc;ng Hồng, tr&ecirc;n mảnh đất Ph&uacute; Thượng, được coi l&agrave; v&ugrave;ng địa linh thi&ecirc;n cổ của Thủ đ&ocirc; văn hiến ngh&igrave;n năm.</p>\r\n\r\n<p>Ngo&agrave;i ra tại dự &aacute;n Sunshine Riverside c&oacute; một lợi thế về yếu tố giao th&ocirc;ng, dự &aacute;n nằm ngay s&aacute;t bờ s&ocirc;ng Hồng, cạnh với đường V&otilde; Ch&iacute; C&ocirc;ng l&agrave; trục giao th&ocirc;ng huyết mạch đối nội v&agrave; đối ngoại của cửa ng&otilde; ph&iacute;a Đ&ocirc;ng Bắc H&agrave; Nội, cung đường c&oacute; 10 l&agrave;n xe chạy nối thẳng ra cầu Nhật T&acirc;n. Từ dự &aacute;n Sunshine Riverside, bạn c&oacute; thể dễ d&agrave;ng di chuyển v&agrave;o trung t&acirc;m hay ra ngoại &ocirc; th&agrave;nh phố, hoặc chạy thẳng đến s&acirc;n bay quốc tế Nội B&agrave;i chỉ sau 15 ph&uacute;t di chuyển.</p>\r\n\r\n<p>Với phương ch&acirc;m hoạt động &ldquo;Tất cả cho cuộc sống tiện nghi&rdquo;, ở Sunshine Riverside, to&agrave;n bộ c&aacute;c tiện &iacute;ch v&agrave; dịch vụ được trang bị những vật liệu cao cấp nhất nhằm phục vụ đời sống cư d&acirc;n v&agrave; tất cả đều được t&iacute;ch hợp hết sức th&ocirc;ng minh v&agrave; hiệu quả.&nbsp;Điểm nhấn độc đ&aacute;o nhất tại chung cư Sunshine Riverside l&agrave; trường học quốc tế li&ecirc;n cấp ti&ecirc;u chuẩn 5 sao được x&acirc;y dựng ngay trong khu&ocirc;n vi&ecirc;n dự &aacute;n. Với lứa tuổi mầm non, tại khối đế của c&aacute;c t&ograve;a chung cư được bố tr&iacute; nh&agrave; tr&ocirc;ng trẻ, b&ecirc;n cạnh c&aacute;c dịch vụ, tiện &iacute;ch sinh hoạt như shophouse, nh&agrave; h&agrave;ng&hellip;</p>\r\n\r\n<p>Khu phố mua sắm v&ocirc; c&ugrave;ng nhộn nhịp với c&aacute;c loại h&igrave;nh shophouse l&agrave; một trong những điểm nhấn hấp dẫn của dự &aacute;n, vừa tạo ra t&iacute;nh đa dạng v&agrave; linh hoạt trong việc cung cấp c&aacute;c loại h&igrave;nh dịch vụ cho cộng đồng cư d&acirc;n, v&agrave; đặc biệt tạo ra gi&aacute; trị gia tăng t&agrave;i sản cho ch&iacute;nh những &quot;nh&agrave; đầu tư&quot; l&agrave; cư d&acirc;n đang sinh sống tại Sunshine Riverside.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600937129_11.jpg', '1600937129_1.jpg|1600937129_2.jpg|1600937129_3.jpg|1600937129_4.jpg|1600937129_5.jpg|1600937129_6.jpg|1600937129_7.jpg|1600937129_8.jpg|1600937129_9.jpg|1600937129_10.jpg|1600937129_11.jpg|1600937129_12.jpg|1600937129_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-24 08:45:29', '2020-09-26 07:57:18'),
(318, 'Cho thuê căn 3PN full nội thất giá 13.5tr tại CC Green Star Phạm Văn Đồng', 'cho-thue-can-3pn-full-noi-that-gia-135tr-tai-cc-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '102', 13500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 102m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Green Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c. C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu.</p>\r\n\r\n<p>Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t. Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600999402_8.jpg', '1600999402_1.jpg|1600999402_2.jpg|1600999402_3.jpg|1600999402_4.jpg|1600999402_5.jpg|1600999402_6.jpg|1600999402_7.jpg|1600999402_9.jpg|1600999402_10.jpg|1600999402_11.jpg|1600999402_12.jpg|1600999402_13.jpg|1600999402_14.jpg|1600999402_15.jpg|1600999402_16.jpg|1600999402_17.jpg|1600999402_18.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 02:03:22', '2020-09-25 04:05:13'),
(319, 'Cho thuê căn 3PN full nội thất giá 14tr tại The Garden Hill Mỹ Đình', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-the-garden-hill-my-dinh', '99 Trần Bình, P. Mỹ Đình 1,Q. Nam Từ Liêm, Hà Nội', 2, '56', '92', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 92m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư The Garden Hill tọa lạc tại 99 Trần B&igrave;nh. Tọa độ trung t&acirc;m đắc địa giao thoa 2 quận sầm uất l&agrave; Cầu Giấy v&agrave; Nam Từ Li&ecirc;m. Dự &aacute;n cạnh ngay bến xe Mỹ Đ&igrave;nh, đường v&agrave;nh đai 3 cao tốc đ&ocirc; thị. Bao quanh The Garden Hill l&agrave; những con đường lớn, huyết mạch của thủ đ&ocirc; như V&agrave;nh đai 3 cao tốc đ&ocirc; thị &ndash; Phạm H&ugrave;ng, quốc lộ 32 &ndash; Xu&acirc;n Thủy, Trục Nguyễn Ho&agrave;ng &ndash; T&ocirc;n Thất Thuyết, Trục L&ecirc; Đức Thọ &ndash; L&ecirc; Quang Đạo&hellip;</p>\r\n\r\n<p>Ngo&agrave;i ra chung cư 99 Trần B&igrave;nh c&ograve;n l&agrave; Trung t&acirc;m gi&aacute;o dục của Thủ đ&ocirc;. Nơi gần rất nhiều c&aacute;c trường đại học lớn như Đại Học Thương Mại, Đại Học Quốc Gia, Đại Học Sư Phạm, Đại Học FPT.., v&agrave; thuận tiện về cả hệ thống c&aacute;c cơ sở y tế uy t&iacute;n như Bệnh viện 19-8, bệnh viện Y Học Cổ Truyền, gần t&ograve;a nh&agrave; chung cư cao cấp Dolphin Plaza&hellip;</p>\r\n\r\n<p>Dự &aacute;n hưởng trọn bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh của 3 c&ocirc;ng vi&ecirc;n hồ nước lớn: C&ocirc;ng vi&ecirc;n Cầu Giấy, C&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Trung t&acirc;m, C&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a. Cư d&acirc;n The Garden Hill Trần B&igrave;nh được hưởng đầy đủ c&aacute;c dịch vụ tiện &iacute;ch như khu trung t&acirc;m thương mại, k&egrave;m theo l&agrave; ph&ograve;ng tập gym, vườn dạo, qu&aacute;n c&agrave; ph&ecirc; tr&ecirc;n tầng 6, khu vui chơi giải tr&iacute; trẻ em&hellip; Xung quanh căn hộ được bố tr&iacute; c&acirc;y xanh hợp l&yacute; mang đến một bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh, gi&uacute;p ph&aacute;t triển cả thể chất lẫn tinh thần cho c&aacute;c thế hệ sinh sống tại đ&acirc;y.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1600999720_5.jpg', '1600999721_1.jpg|1600999721_2.jpg|1600999721_3.jpg|1600999721_4.jpg|1600999721_6.jpg|1600999721_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 02:08:41', '2020-09-26 03:12:55'),
(320, 'Cho thuê căn 3PN full nội thất giá 13tr tại Mon City Mỹ Đình', 'cho-thue-can-3pn-full-noi-that-gia-13tr-tai-mon-city-my-dinh', 'Đường Hàm Nghi, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '26', '86', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 86m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n quy hoạch th&agrave;nh một khu phố nhỏ sầm uất giữa mảnh đất v&agrave;ng, tiện lợi cho việc sinh sống v&agrave; kinh doanh. Gồm c&aacute;c c&ocirc;ng tr&igrave;nh hỗn hợp cao tầng với tầng hầm li&ecirc;n th&ocirc;ng, c&aacute;c tầng thương mại đẳng cấp, c&aacute;c khu vực dịch vụ, vui chơi phong ph&uacute;.</p>\r\n\r\n<p>Dự &aacute;n Mon City sở hữu vị tr&iacute; v&agrave;ng đắc địa với 03 mặt tiền tiếp gi&aacute;p với những con đường đẹp nhất Mỹ Đ&igrave;nh &ndash; v&ugrave;ng đất c&oacute; nhiều tiềm năng ph&aacute;t triển v&agrave; đang ng&agrave;y c&agrave;ng trở n&ecirc;n thịnh vượng.</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Nam l&agrave; đường L&ecirc; Đức Thọ</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Nam l&agrave; đường H&agrave;m Nghi</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Bắc l&agrave; đường Nguyễn Cơ Thạch</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Bắc l&agrave; c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Mai Dịch rộng 17ha</p>\r\n\r\n<p>HD Mon City nằm ở vị tr&iacute; trung t&acirc;m khu vực h&agrave;nh ch&iacute;nh nơi Mỹ Đ&igrave;nh, dự &aacute;n được thừa hưởng lợi thế từ những c&ocirc;ng tr&igrave;nh tiện &iacute;ch, hạ tầng đồng bộ, hiện đại của c&aacute;c dự &aacute;n, c&ocirc;ng tr&igrave;nh liền kề, từ c&ocirc;ng vi&ecirc;n c&acirc;y xanh, cho đến c&aacute;c tiện &iacute;ch trường học, bệnh viện, kh&aacute;ch sạn, bến xe. B&ecirc;n cạnh c&aacute;c tiện &iacute;ch nội khu, cư d&acirc;n của dự &aacute;n HD Mon City c&ograve;n được hưởng c&aacute;c tiện &iacute;ch b&ecirc;n ngo&agrave;i dự &aacute;n: như trường học (gần c&aacute;c trường đại học Thương Mại, đại học Quốc gia H&agrave; Nội, Đại học Ngoại ngữ&hellip;), bệnh viện (bệnh viện Thể thao, bệnh viện 19 &ndash; 8,&hellip;),&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601883320_20191118110559-4ecd_wm.jpg', '1601883320_20191118110559-3d35_wm.jpg|1601883320_20191118110559-4c5a_wm.jpg|1601883320_20191118110559-4ecd_wm.jpg|1601883320_20191118110559-71d3_wm.jpg|1601883320_20191118110559-979a_wm.jpg|1601883320_20191118110559-2435_wm.jpg|1601883320_20191118110559-3385_wm.jpg|1601883320_20191118110559-8628_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 02:14:50', '2020-10-05 07:35:20'),
(321, 'Cho thuê căn 2PN full nội thất giá 15tr tại Sky Park Tôn Thất Thuyết', 'cho-thue-can-2pn-full-noi-that-gia-15tr-tai-sky-park-ton-that-thuyet', 'Số 3 Tôn Thất Thuyết – Cầu Giấy – Hà Nội.', 2, '123', '72', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 72m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nSky Park Residence mang đến kh&ocirc;ng gian sống tr&agrave;n đầy năng lượng v&agrave; cảm hứng với kh&ocirc;ng gian xanh bất tận trải dọc từ tầng một đến tầng thượng t&ograve;a nh&agrave; v&agrave; chuỗi tiện &iacute;ch đẳng cấp, phục vụ mọi nhu cầu l&agrave;m việc, vui chơi, giải tr&iacute;, ăn uống của cư d&acirc;n.&nbsp;<br />\r\nL&agrave; kh&ocirc;ng gian thư gi&atilde;n mang đến những trải nghiệm th&uacute; vị v&agrave; độc đ&aacute;o, bể bơi 4 m&ugrave;a tại chung cư Sky Park gồm 2 khu: khu trẻ em với cầu trượt v&agrave; c&aacute;c tr&ograve; chơi dưới nước, khu người lớn d&agrave;i 20m với 8 l&agrave;n bơi.<br />\r\nTầng 1 của t&ograve;a nh&agrave; được d&agrave;nh một phần diện t&iacute;ch để l&agrave;m kh&ocirc;ng gian vui chơi, giải tr&iacute; ngo&agrave;i trời với khu&ocirc;n vi&ecirc;n rộng r&atilde;i, tho&aacute;ng m&aacute;t c&ugrave;ng c&aacute;c tiện &iacute;ch được thiết kế d&agrave;nh ri&ecirc;ng cho cư d&acirc;n nh&iacute; Sky Park số 3 T&ocirc;n Thất Thuyết.<br />\r\nDự &aacute;n Sky Park Residence c&aacute;ch khu li&ecirc;n hợp thể thao quốc gia Mỹ Đ&igrave;nh 2 km, n&ecirc;n bạn c&oacute; thể c&oacute; nhiều sự lựa chọn về vui chơi giải tr&iacute;, đặc biệt l&agrave; kh&ocirc;ng gian sống rất thoải m&aacute;i.<br />\r\nGần ngay si&ecirc;u thị BigC, Mediamart, Pico&hellip;<br />\r\nC&aacute;ch trường Đại học Quốc Gia, Đại học Sư Phạm v&agrave; Thương Mại c&oacute; 1 km, c&aacute;ch trường Học Viện B&aacute;o ch&iacute; Tuy&ecirc;n truyền 1 km.<br />\r\nC&aacute;ch Bến xe Mỹ Đ&igrave;nh chỉ 500 m, thuận tiện cho việc đi lại.<br />\r\nC&aacute;ch bệnh viện 198 c&oacute; 1 km, Bệnh viện Y học Cổ Truyền 0.5 km.<br />\r\nC&aacute;ch trường cấp 1,2,3 chất lượng cao Đo&agrave;n Thị Điểm, L&ecirc; Q&uacute;y Đ&ocirc;n 1.1 km.<br />\r\nCạnh khu Trung t&acirc;m Văn ph&ograve;ng Thương Mại sầm uất phố Duy T&acirc;n, nơi tập trung rất nhiều C&ocirc;ng ty, Văn ph&ograve;ng đại diện của c&aacute;c Ng&acirc;n h&agrave;ng, Tổ chức t&agrave;i ch&iacute;nh,&hellip;<br />\r\nGần ngay mặt đường Cầu Giấy tuyến đường huyết mạch trung t&acirc;m H&agrave; Nội, thuận tiện cho việc đi lại. Dọc tuyến Xu&acirc;n Thủy &ndash; Cầu Giấy sắp kh&aacute;nh th&agrave;nh đường sắt tr&ecirc;n cao Nhổn &ndash; Ga H&agrave; Nội.<br />\r\nDự &aacute;n chung cư Sky Park Residence T&ocirc;n Thất Thuyết được x&acirc;y dựng tại vị tr&iacute; hết sức đắc địa. Một vị tr&iacute; v&agrave;ng của 3 quận ph&aacute;t triển mạnh nhất l&agrave;: Cầu Giấy, Bắc Từ Li&ecirc;m v&agrave; Nam Từ Li&ecirc;m.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601001075_5.jpg', '1601001075_1.jpg|1601001075_2.jpg|1601001075_3.jpg|1601001075_4.jpg|1601001075_5.jpg|1601001075_7.jpg|1601001075_8.jpg|1601001075_9.jpg|1601001075_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 02:31:15', '2020-09-26 09:50:13'),
(322, 'Cho thuê căn 2PN giá 8tr khu Ngoại Giao Đoàn', 'cho-thue-can-2pn-gia-8tr-khu-ngoai-giao-doan', 'Đường Xuân Đỉnh, Xã Xuân Đỉnh, Bắc Từ Liêm, Hà Nội', 2, '9', '65', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 65m2, nằm tại t&ograve;a N01T5.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601262214_2.jpg', '1601262214_1.jpg|1601262214_2.jpg|1601262214_3.jpg|1601262214_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 02:51:05', '2020-09-28 03:03:34'),
