(326, 'Cho thuê căn 2PN giá 9tr tại CC An bình City', 'cho-thue-can-2pn-gia-9tr-tai-cc-an-binh-city', 'Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '5', '75', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ&nbsp;tại t&ograve;a A8, rộng 75m2.</p>\r\n\r\n<p>Căn hộ&nbsp;thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ,nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản.<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n An B&igrave;nh City c&oacute; vị tr&iacute; địa l&yacute; trắc địa tại số 234 Phạm Văn Đồng nằm trong địa giới h&agrave;nh ch&iacute;nh giữa phường Cổ Nhuế 1 Quận Bắc Từ Li&ecirc;m v&agrave; phường Mai Dịch quận Cầu Giấy.</p>\r\n\r\n<p>An B&igrave;nh city c&ograve;n t&iacute;ch hợp nhiều tiện &iacute;ch vượt trội so với c&aacute;c chung cư kh&aacute;c như: C&ocirc;ng vi&ecirc;n sinh th&aacute;i, hồ điều h&ograve;a rộng 15 ha, tuyến phố thương mại với h&agrave;ng trăm thương hiệu uy t&iacute;n, trường mầm non đạt chuẩn quốc gia,02 bể bơi ngo&agrave;i trời rộng 1200 m2. C&aacute;c c&ocirc;ng tr&igrave;nh tiện &iacute;ch đẳng cấp: Quảng trường c&aacute;c vị thần, quảng trường nhạc nước, quảng trường m&ugrave;a hạ, vườn treo&hellip;<br />\r\nVới lợi thế l&agrave; nơi giao thoa của nhiều tuyến đường giao th&ocirc;ng quan trọng: Đường V&agrave;nh đai 3, đường Ho&agrave;ng Quốc Việt k&eacute;o d&agrave;i, đường quy hoạch 40 m kết nối với khu đ&ocirc; thị T&acirc;y Hồ T&acirc;y, từ An B&igrave;nh city cư d&acirc;n c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực h&agrave;nh ch&iacute;nh v&agrave; vui chơi như: nằm ngay mặt đường Phạm Văn Đồng, di chuyển đến s&acirc;n bay Nội B&agrave;i,bến xe Nam Thăng Long chỉ mất 25 ph&uacute;t; gần C&ocirc;ng vi&ecirc;n Th&agrave;nh phố Giao lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh; gần c&aacute;c si&ecirc;u thị lớn như HC, Mega market...</p>\r\n\r\n<p>Nằm trong l&ograve;ng Khu đ&ocirc; thị Th&agrave;nh phố Giao lưu &ndash; l&agrave; khu đ&ocirc; thị mới được biết đến với hệ thống thảm thực vật xanh, sạch c&ugrave;ng với hệ thống tiện &iacute;ch cao cấp v&agrave; cơ sở hạ tầng ho&agrave;n chỉnh. Khu đ&ocirc; thị An B&igrave;nh thực sự sẽ tỏa s&aacute;ng tr&ecirc;n bầu trời ph&iacute;a T&acirc;y Bắc của trung t&acirc;m thủ đ&ocirc; H&agrave; Nội.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601277378_2.jpg', '1601277378_0.jpg|1601277378_1.jpg|1601277378_2.jpg|1601277378_3.jpg|1601277378_4.jpg|1601277378_5.jpg|1601277378_6.jpg|1601277378_7.jpg|1601277378_8.jpg|1601277378_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 03:58:55', '2020-09-28 07:16:18'),
(327, 'Cho thuê căn 2PN giá 7tr tại Green Star Phạm Văn Đồng', 'cho-thue-can-2pn-gia-7tr-tai-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '65', 7000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2, tại t&ograve;a B3.</p>\r\n\r\n<p>Căn hộ&nbsp;thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất nguy&ecirc;n bản.<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGreen Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 7tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất nguyên bản.', NULL, '1601280626_3.jpg', '1601280626_3.jpg|1601280626_5.jpg|1601280626_9.jpg|1601280626_10.jpg|1601280626_14.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 04:14:53', '2020-09-28 08:10:26'),
(328, 'Cho thuê căn 2PN giá 8tr tại Green Star Phạm Văn Đồng', 'cho-thue-can-2pn-gia-8tr-tai-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '68', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2, tại t&ograve;a B4.</p>\r\n\r\n<p>Căn hộ&nbsp;thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản.<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGreen Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản.', NULL, '1601280654_3.jpg', '1601280654_1.jpg|1601280654_2.jpg|1601280654_3.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 04:17:32', '2020-09-28 08:10:54'),
(329, 'Cho thuê căn 2PN full nội thất giá 9tr tại KĐT Nam Cường - Cổ Nhuế', 'cho-thue-can-2pn-full-noi-that-gia-9tr-tai-kdt-nam-cuong-co-nhue', 'KĐT Nam Cường, P. Cổ Nhuế 1. Q. Bắc Từ Liêm, Hà Nội', 2, '34', '75', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ,nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nĐ&acirc;y l&agrave; khu đ&ocirc; thị c&oacute; vị tr&iacute; kh&aacute; thuận lợi nằm ở ph&iacute;a t&acirc;y trung t&acirc;m TP H&agrave; Nội, ph&iacute;a Đ&ocirc;ng v&agrave; Đ&ocirc;ng bắc gi&aacute;p với khu d&acirc;n cư x&atilde; Cổ Nhuế, ph&iacute;a T&acirc;y s&aacute;t cạnh đường Phạm Văn Đồng (tuyến đường cao tốc Thăng long đi Nội B&agrave;i).</p>\r\n\r\n<p>Bao quanh KĐT Nam Cường l&agrave; 3 tuyến đường lớn Phạm Văn Đồng, Ho&agrave;ng Quốc Việt v&agrave; đường 69- đ&acirc;y l&agrave; khu vực hết sức thuận lợi về giao th&ocirc;ng đi lại v&agrave; hệ thống đường trong khu vực n&agrave;y phần lớn được x&acirc;y mới ho&agrave;n to&agrave;n n&ecirc;n đ&aacute;p ứng nhu cầu cần thiết của một Khu đ&ocirc; thị hiện đại.<br />\r\nƯu điểm nổi bật nhất l&agrave; vị tr&iacute; Khu đ&ocirc; thị Nam Cường nằm ngay mặt tiền đại lộ Phạm Văn Đồng rộng 60m, từ khu đ&ocirc; thị chỉ mất 30 ph&uacute;t xe chạy sẽ đến s&acirc;n bay Nội B&agrave;i v&agrave; 20 ph&uacute;t để v&agrave;o trung t&acirc;m th&agrave;nh phố.</p>\r\n\r\n<p>Ngo&agrave;i ra bao quanh KĐT Nam Cường l&agrave; si&ecirc;u thị Metro- 1 si&ecirc;u thị b&aacute;n bu&ocirc;n lớn của HN hiện nay, hệ thống c&aacute;c trường đại học, cao đẳng v&agrave; bệnh viện như viện E, bệnh viện y học cổ truyền &hellip; v&agrave; h&agrave;ng loạt c&aacute;c dự &aacute;n đ&ocirc; thị mới cận kề.<br />\r\nL&agrave; khu đ&ocirc; thị khang trang, hiện đại, đồng bộ về CSHT x&atilde; hội, hạ tầng kỹ thuật v&agrave; kiến tr&uacute;c cảnh quan m&ocirc;i trường.&nbsp;C&aacute;c c&ocirc;ng tr&igrave;nh thấp tầng bố tr&iacute; gần kh&ocirc;ng gian c&acirc;y xanh, trường học, nh&agrave; trẻ để h&agrave;i ho&agrave; với kh&ocirc;ng gian khu vực x&oacute;m l&agrave;ng hiện c&oacute; l&acirc;n cận.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601285522_3.jpg', '1601285522_1.jpg|1601285522_2.jpg|1601285522_3.jpg|1601285522_4.jpg|1601285522_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 04:52:20', '2020-09-28 09:32:02');
