(330, 'Cho thuê căn 2PN giá 9tr tại CC Kosmo Tây Hồ', 'cho-thue-can-2pn-gia-9tr-tai-cc-kosmo-tay-ho', '101 Đường Xuân La, Phường Xuân Tảo, Bắc Từ Liêm, Hà Nội', 2, '19', '72', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 72m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm ngay giữa trung t&acirc;m Quận T&acirc;y Hồ, số 101 Xu&acirc;n La, thuộc phường Xu&acirc;n Tảo, T&acirc;y Hồ, đ&acirc;y được xem l&agrave; trọng đi&ecirc;̉m trong chi&ecirc;́n lược quy hoạch phát tri&ecirc;̉n của thủ đ&ocirc; cả v&ecirc;̀ giao th&ocirc;ng và kh&ocirc;ng gian đ&ocirc; thị.</p>\r\n\r\n<p>Dự &aacute;n Kosmo T&acirc;y Hồ là sự k&ecirc;́t hợp hoàn hảo giữa vị trí đắc địa, h&ecirc;̣ th&ocirc;́ng ti&ecirc;̣n ích đẳng c&acirc;́p, thi&ecirc;́t k&ecirc;́ hi&ecirc;̣n đại, kh&ocirc;ng gian s&ocirc;́ng xanh cùng góc nhìn lý tưởng v&ecirc;̀ phía H&ocirc;̀ T&acirc;y phong cảnh hữu tình.<br />\r\nDự &aacute;n c&oacute; vị tr&iacute; đắc địa, gần c&aacute;c bệnh viện lớn như: Bệnh viện E, Bệnh viện Tim H&agrave; Nội, B&ecirc;nh viện quốc tế Thu C&uacute;c, Bệnh viện Giao Th&ocirc;ng Vận Tải, bệnh viện Lao Phổi TW&hellip;</p>\r\n\r\n<p>Về gi&aacute;o dục gần c&aacute;c trường nổi tiếng: C1, C2, C3 Xu&acirc;n Đỉnh, Trường Song Ngữ H&agrave; Nội Academy, United Nations International School, Trường Chu Văn An, Đại học Nội Vụ.<br />\r\nC&aacute;c điểm Vui chơi, giải tr&iacute; lớn như Si&ecirc;u thi Metro, C&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, C&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;, trung t&acirc;m thể thao quận T&acirc;y Hồ, trung t&acirc;m tiện &iacute;ch c&ocirc;ng cộng (Ngoại giao đo&agrave;n)<br />\r\nDự &aacute;n Kosmo T&acirc;y Hồ l&agrave; dự &aacute;n đầu ti&ecirc;n c&oacute; rạp chiếu phim 5* tại khu vực T&acirc;y Hồ T&acirc;y. Ngo&agrave;i ra, với 03 tầng trung t&acirc;m thương mại kết hợp văn ph&ograve;ng c&ugrave;ng với c&aacute;c tiện &iacute;ch phục vụ ri&ecirc;ng cho cư d&acirc;n Kosmo T&acirc;y Hồ như : si&ecirc;u thị, trường mần non đạt ti&ecirc;u chuẩn quốc tế, ph&ograve;ng tập Gym , Spa, khu ẩm thực , khu thời trang ; khu vui chơi ngo&agrave;i trời cho trẻ em, s&acirc;n vườn dạo bộ , vườn nướng BBQ , bể bơi bốn m&ugrave;a trong nh&agrave; , bể bơi ngo&agrave;i trời&hellip;&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601281705_4.jpg', '1601281705_1.jpg|1601281705_2.jpg|1601281705_3.jpg|1601281705_4.jpg|1601281705_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 07:34:21', '2020-09-28 08:28:25'),
(331, 'Cho thuê căn 2PN full nội thất giá 9.5tr tại KĐT Nam Cường - Cổ Nhuế', 'cho-thue-can-2pn-full-noi-that-gia-95tr-tai-kdt-nam-cuong-co-nhue', 'KĐT Nam Cường, P. Cổ Nhuế 1. Q. Bắc Từ Liêm, Hà Nội', 2, '34', '70', 9500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ,&nbsp;nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Đ&acirc;y l&agrave; khu đ&ocirc; thị c&oacute; vị tr&iacute; kh&aacute; thuận lợi nằm ở ph&iacute;a t&acirc;y trung t&acirc;m TP H&agrave; Nội, ph&iacute;a Đ&ocirc;ng v&agrave; Đ&ocirc;ng bắc gi&aacute;p với khu d&acirc;n cư x&atilde; Cổ Nhuế, ph&iacute;a T&acirc;y s&aacute;t cạnh đường Phạm Văn Đồng (tuyến đường cao tốc Thăng long đi Nội B&agrave;i).</p>\r\n\r\n<p>Bao quanh KĐT Nam Cường l&agrave; 3 tuyến đường lớn Phạm Văn Đồng, Ho&agrave;ng Quốc Việt v&agrave; đường 69- đ&acirc;y l&agrave; khu vực hết sức thuận lợi về giao th&ocirc;ng đi lại v&agrave; hệ thống đường trong khu vực n&agrave;y phần lớn được x&acirc;y mới ho&agrave;n to&agrave;n n&ecirc;n đ&aacute;p ứng nhu cầu cần thiết của một Khu đ&ocirc; thị hiện đại.<br />\r\nƯu điểm nổi bật nhất l&agrave; vị tr&iacute; Khu đ&ocirc; thị Nam Cường nằm ngay mặt tiền đại lộ Phạm Văn Đồng rộng 60m, từ khu đ&ocirc; thị chỉ mất 30 ph&uacute;t xe chạy sẽ đến s&acirc;n bay Nội B&agrave;i v&agrave; 20 ph&uacute;t để v&agrave;o trung t&acirc;m th&agrave;nh phố.</p>\r\n\r\n<p>Ngo&agrave;i ra bao quanh KĐT Nam Cường l&agrave; si&ecirc;u thị Metro- 1 si&ecirc;u thị b&aacute;n bu&ocirc;n lớn của HN hiện nay, hệ thống c&aacute;c trường đại học, cao đẳng v&agrave; bệnh viện như viện E, bệnh viện y học cổ truyền &hellip; v&agrave; h&agrave;ng loạt c&aacute;c dự &aacute;n đ&ocirc; thị mới cận kề.<br />\r\nL&agrave; khu đ&ocirc; thị khang trang, hiện đại, đồng bộ về CSHT x&atilde; hội, hạ tầng kỹ thuật v&agrave; kiến tr&uacute;c cảnh quan m&ocirc;i trường.&nbsp;C&aacute;c c&ocirc;ng tr&igrave;nh thấp tầng bố tr&iacute; gần kh&ocirc;ng gian c&acirc;y xanh, trường học, nh&agrave; trẻ để h&agrave;i ho&agrave; với kh&ocirc;ng gian khu vực x&oacute;m l&agrave;ng hiện c&oacute; l&acirc;n cận.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601285699_7.jpg', '1601285699_1.jpg|1601285699_2.jpg|1601285699_3.jpg|1601285699_4.jpg|1601285699_5.jpg|1601285699_6.jpg|1601285699_7.jpg|1601285699_8.jpg|1601285699_9.jpg|1601285699_10.jpg|1601285699_11.jpg|1601285699_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 08:01:41', '2020-09-28 09:34:59'),
(332, 'Cho thuê căn 2PN giá 8tr tại KĐT Nghĩa Đô', 'cho-thue-can-2pn-gia-8tr-tai-kdt-nghia-do', 'Phố Trần Cung, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '35', '65', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 65m2, t&ograve;a CT2C.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, b&agrave;n, ghế, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; với hạ tầng kỹ thuật đồng bộ, tạo cảnh quan đẹp cho khu vực sẽ l&agrave; trung t&acirc;m mới của Thủ đ&ocirc; trong tương lai.&nbsp;Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; kh&ocirc;ng chỉ c&oacute; gi&aacute; trị cao về kh&ocirc;ng gian kiến tr&uacute;c, chất lượng c&ocirc;ng tr&igrave;nh m&agrave; c&ograve;n c&ograve;n sở hữu vị tr&iacute; đắc địa v&agrave; n&eacute;t đặc trưng m&agrave; &iacute;t dự &aacute;n c&oacute; được.</p>\r\n\r\n<p>Khu đ&ocirc; thị Nghĩa Đ&ocirc; nằm trong mạng lưới giao th&ocirc;ng huyết mạch khu vực T&acirc;y Nam H&agrave; Nội, s&aacute;t tuyến đường v&agrave;nh đai 2 v&agrave; kh&ocirc;ng qu&aacute; xa so với đường v&agrave;nh đai 3, chỉ c&aacute;ch đường Ho&agrave;ng Quốc Việt khoảng 200m, c&aacute;ch chợ Bưởi hơn 1 km, gần c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc; v&agrave; gần 6 tuyến đường lớn như Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt, Phạm Văn Đồng, Nguyễn Ho&agrave;ng T&ocirc;n, Trần Cung, Lạc Long Qu&acirc;n.</p>\r\n\r\n<p>Khu đ&ocirc; thị c&oacute; thiết kế tho&aacute;ng, hệ thống c&acirc;y xanh v&agrave; đường dạo bộ, mật độ x&acirc;y dựng khoảng 30-32%, c&oacute; cơ sở hạ tầng đồng bộ. Ngo&agrave;i ra, Khu đ&ocirc; thị mới Nghĩa Đ&ocirc; nằm cạnh trục đường 40m hiện đang thi c&ocirc;ng, đối diện với hồ điều h&ograve;a rộng 4,9ha của dự &aacute;n Starlake (dự &aacute;n T&acirc;y Hồ T&acirc;y cũ) n&ecirc;n cư d&acirc;n nơi đ&acirc;y sẽ được hưởng lợi chung hạ tầng n&agrave;y.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601285818_12.jpg', '1601285818_1.jpg|1601285818_6.jpg|1601285818_7.jpg|1601285818_12.jpg|1601285818_14.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 08:11:27', '2020-09-28 09:36:58'),
(333, 'Cho thuê căn 2PN giá 9tr tại Chung cư Thái Hà BCA Phạm Văn Đồng', 'cho-thue-can-2pn-gia-9tr-tai-chung-cu-thai-ha-bca-pham-van-dong', '43 Phạm Văn Đồng, P. Cổ Nhuế 2, Bắc Từ Liêm, Hà Nội', 2, '39', '65', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Th&aacute;i H&agrave; &ndash; Bộ c&ocirc;ng an Cổ Nhuế 2 tọa lạc Số 43 Phạm Văn Đồng &ndash; Quận Bắc Từ Li&ecirc;m, H&agrave; Nội sở hữu một trong những vị tr&iacute; bậc nhất H&agrave; Nội:<br />\r\nĐ&acirc;y l&agrave; vị tr&iacute; huyết mạch kết nối giao th&ocirc;ng của Thủ Đ&ocirc; bằng c&aacute;c con đường như: Ho&agrave;ng Quốc Việt đi T&acirc;y Hồ ,Hồ T&ugrave;ng Mậu, Xu&acirc;n Thuỷ kết nối quận Cầu Giấy đi Sơn T&acirc;y, đường Phạm Văn Đồng.<br />\r\nTừ vị tr&iacute; dự &aacute;n bạn dễ d&agrave;ng di chuyển thuận tiện v&agrave; nhanh ch&oacute;ng đến S&acirc;n bay Quốc Tế Nội B&agrave;i,Khu c&ocirc;ng nghiệp Thăng Long, C&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y, KĐT&nbsp;Ngoại Giao đo&agrave;n.<br />\r\nGần c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Th&agrave;nh Phố Giao Lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Mai Dịch, c&ocirc;ng Nghĩa Đ&ocirc; v&agrave; C&ocirc;ng vi&ecirc;n Cầu Giấy,&hellip;.<br />\r\nC&aacute;c si&ecirc;u thị mua sắm lớn như Metro, Vinmart,&hellip;mua sắm thả ga.<br />\r\nGần nhiều bệnh viện lớn, nhỏ như Bệnh viện E, bệnh viện 198, bệnh viện Y học cổ truyền&hellip;.<br />\r\nGần nhiều trường Đại Hoc nổi tiếng nhất tại Việt Nam như ĐH Quốc Gia, Thương Mại, Ngoại ngữ, Sư phạm, học viện B&aacute;o ch&iacute; v&agrave; Tuy&ecirc;n Truyền,&hellip;<br />\r\nTại đ&acirc;y cư d&acirc;n c&oacute; thể tận hưởng dịch vụ tiện &iacute;ch v&ocirc; c&ugrave;ng nổi bật: Hệ thống trung t&acirc;m thương mại, mua sắm được x&acirc;y dựng đồng bộ ngay dưới sảnh t&ograve;a nh&agrave;; Trung t&acirc;m tập Gym, Spa...;Khu vui chơi giải tr&iacute; cho c&aacute;c bạn nhỏ trong to&agrave;n t&ograve;a nh&agrave;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601286722_5.jpg', '1601286722_1.jpg|1601286722_2.jpg|1601286722_3.jpg|1601286722_4.jpg|1601286722_5.jpg|1601286722_7.jpg|1601286722_8.jpg|1601286722_9.jpg|1601286722_21.jpg|1601286722_66.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 08:22:45', '2020-09-28 09:52:02'),
(334, 'Cho thuê căn 2PN giá 9tr tại CC Iris Garden Mỹ Đình', 'cho-thue-can-2pn-gia-9tr-tai-cc-iris-garden-my-dinh', 'Số 30 Trần Hữu Dực, Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '10', '65', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 65m2 nằm tại t&ograve;a CT3 .</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Iris Garden l&agrave; tổ hợp căn hộ cao cấp, kết hợp thương mại dịch vụ, nhưng vẫn bảo đảm c&aacute;c điều kiện chặt chẽ về d&ograve;ng sản phẩm &quot;căn hộ sức khỏe&quot; của Tập đo&agrave;n Vimefulland.</p>\r\n\r\n<p>C&ocirc;ng tr&igrave;nh nằm tr&ecirc;n đường Trần Hữu Dực, trục đường huyết mạch của quận Nam Từ Li&ecirc;m, H&agrave; Nội. Chung cư c&oacute; hạ tầng đồng bộ, tầm nh&igrave;n kho&aacute;ng đạt, đối diện ngay Cung Điền kinh Thể thao Quốc gia. C&aacute;ch S&acirc;n vận động Mỹ Đ&igrave;nh 2 ph&uacute;t đi xe, c&aacute;ch bến xe Mỹ Đ&igrave;nh v&agrave; đường Phạm H&ugrave;ng 3 ph&uacute;t, đi bộ ra đường Hồ T&ugrave;ng Mậu khoảng 2 ph&uacute;t, gần c&aacute;c trường đại học như Đại học Thương Mại, Đại học Quốc Gia, Đại học Ngoại ngữ.</p>\r\n\r\n<p>Xung quanh l&agrave; c&aacute;c chung cư cao cấp như Mon City, Sun Square với đầy đủ c&aacute;c tiện &iacute;ch: nh&agrave; h&agrave;ng, ph&ograve;ng gym, s&acirc;n b&oacute;ng, rạp chiếu phim, bể bơi&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601872455_20200520111942-8b52_wm.jpg', '1601872455_20200520111942-2c6a_wm.jpg|1601872455_20200520111942-2edd_wm.jpg|1601872455_20200520111942-8b52_wm.jpg|1601872455_20200520111942-6481_wm.jpg|1601872455_20200520111942-aef6_wm.jpg|1601872455_20200520111942-d082_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 08:28:39', '2020-10-05 04:34:15'),
(335, 'Cho thuê căn 2PN full nội thất giá 10tr tại CC Iris Garden Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-cc-iris-garden-my-dinh', 'Số 30 Trần Hữu Dực, Mỹ Đình 1, Nam Từ Liêm, Hà Nội', 2, '10', '70', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 70m2 nằm tại t&ograve;a CT2&nbsp;.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Iris Garden l&agrave; tổ hợp căn hộ cao cấp, kết hợp thương mại dịch vụ, nhưng vẫn bảo đảm c&aacute;c điều kiện chặt chẽ về d&ograve;ng sản phẩm &quot;căn hộ sức khỏe&quot; của Tập đo&agrave;n Vimefulland.</p>\r\n\r\n<p>C&ocirc;ng tr&igrave;nh nằm tr&ecirc;n đường Trần Hữu Dực, trục đường huyết mạch của quận Nam Từ Li&ecirc;m, H&agrave; Nội. Chung cư c&oacute; hạ tầng đồng bộ, tầm nh&igrave;n kho&aacute;ng đạt, đối diện ngay Cung Điền kinh Thể thao Quốc gia. C&aacute;ch S&acirc;n vận động Mỹ Đ&igrave;nh 2 ph&uacute;t đi xe, c&aacute;ch bến xe Mỹ Đ&igrave;nh v&agrave; đường Phạm H&ugrave;ng 3 ph&uacute;t, đi bộ ra đường Hồ T&ugrave;ng Mậu khoảng 2 ph&uacute;t, gần c&aacute;c trường đại học như Đại học Thương Mại, Đại học Quốc Gia, Đại học Ngoại ngữ.</p>\r\n\r\n<p>Xung quanh l&agrave; c&aacute;c chung cư cao cấp như Mon City, Sun Square với đầy đủ c&aacute;c tiện &iacute;ch: nh&agrave; h&agrave;ng, ph&ograve;ng gym, s&acirc;n b&oacute;ng, rạp chiếu phim, bể bơi&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601872318_20201003140622-37b1_wm.jpg', '1601872318_20201003140622-3bfb_wm.jpg|1601872318_20201003140622-37b1_wm.jpg|1601872318_20201003140622-55c0_wm.jpg|1601872318_20201003140639-77b9_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 08:31:55', '2020-10-05 04:31:58'),
(336, 'Cho thuê căn 2PN giá 9.5tr tại Mon City Mỹ Đình', 'cho-thue-can-2pn-gia-95tr-tai-mon-city-my-dinh', 'Đường Hàm Nghi, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '26', '70', 9500000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ t&ograve;a B,&nbsp;rộng 62m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n quy hoạch th&agrave;nh một khu phố nhỏ sầm uất giữa mảnh đất v&agrave;ng, tiện lợi cho việc sinh sống v&agrave; kinh doanh. Gồm c&aacute;c c&ocirc;ng tr&igrave;nh hỗn hợp cao tầng với tầng hầm li&ecirc;n th&ocirc;ng, c&aacute;c tầng thương mại đẳng cấp, c&aacute;c khu vực dịch vụ, vui chơi phong ph&uacute;.</p>\r\n\r\n<p>Dự &aacute;n Mon City sở hữu vị tr&iacute; v&agrave;ng đắc địa với 03 mặt tiền tiếp gi&aacute;p với những con đường đẹp nhất Mỹ Đ&igrave;nh &ndash; v&ugrave;ng đất c&oacute; nhiều tiềm năng ph&aacute;t triển v&agrave; đang ng&agrave;y c&agrave;ng trở n&ecirc;n thịnh vượng.</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Nam l&agrave; đường L&ecirc; Đức Thọ</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Nam l&agrave; đường H&agrave;m Nghi</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Bắc l&agrave; đường Nguyễn Cơ Thạch</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Bắc l&agrave; c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Mai Dịch rộng 17ha</p>\r\n\r\n<p>HD Mon City nằm ở vị tr&iacute; trung t&acirc;m khu vực h&agrave;nh ch&iacute;nh nơi Mỹ Đ&igrave;nh, dự &aacute;n được thừa hưởng lợi thế từ những c&ocirc;ng tr&igrave;nh tiện &iacute;ch, hạ tầng đồng bộ, hiện đại của c&aacute;c dự &aacute;n, c&ocirc;ng tr&igrave;nh liền kề, từ c&ocirc;ng vi&ecirc;n c&acirc;y xanh, cho đến c&aacute;c tiện &iacute;ch trường học, bệnh viện, kh&aacute;ch sạn, bến xe. B&ecirc;n cạnh c&aacute;c tiện &iacute;ch nội khu, cư d&acirc;n của dự &aacute;n HD Mon City c&ograve;n được hưởng c&aacute;c tiện &iacute;ch b&ecirc;n ngo&agrave;i dự &aacute;n: như trường học (gần c&aacute;c trường đại học Thương Mại, đại học Quốc gia H&agrave; Nội, Đại học Ngoại ngữ&hellip;), bệnh viện (bệnh viện Thể thao, bệnh viện 19 &ndash; 8,&hellip;),&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 9.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601883154_20190911110958-b102_wm.jpg', '1601883154_20190911110958-2cf3_wm.jpg|1601883154_20190911110958-1739_wm.jpg|1601883154_20190911110958-5427_wm.jpg|1601883154_20190911110958-b102_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-25 08:39:17', '2020-10-05 07:32:34'),
