(338, 'Cho thuê căn 2PN full nội thất giá 10tr tại Mỹ Đình Plaza', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-my-dinh-plaza', '140 Trần Bình, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '27', '65', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm trong khu vực ph&aacute;t triển bậc nhất quận Cầu Giấy &ndash; Mỹ Đ&igrave;nh, dự &aacute;n Mỹ Đ&igrave;nh Plaza 2 hứa hẹn sẽ đem đến cho cư d&acirc;n cuộc sống vi&ecirc;n m&atilde;n, tiện nghi, hiện đại với hệ thống tiện &iacute;ch đa dạng, c&aacute;c căn hộ thiết kế hợp l&yacute;, tinh tế.<br />\r\nTọa lạc ngay tại trung t&acirc;m Mỹ Đ&igrave;nh, Mỹ Đ&igrave;nh Plaza 2 sở hữu một vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, nơi thuận tiện kết nối giao th&ocirc;ng với c&aacute;c tuyến đường huyết mạch của th&agrave;nh phố: Phạm H&ugrave;ng &ndash; Phạm Văn Đồng, Hồ T&ugrave;ng Mậu &ndash; Xu&acirc;n Thủy &ndash; Cầu Giấy, tuyến Metro Nhổn &ndash; Ga H&agrave; Nội. Từ dự &aacute;n, c&aacute;c cư d&acirc;n cũng c&oacute; thể dễ d&agrave;ng tiếp cận đến c&aacute;c tiện &iacute;ch h&agrave;ng đầu của khu vực như TTTM The Garden, đại si&ecirc;u thị Metro, bệnh viện 198, Trung t&acirc;m Hội nghị Quốc gia, SVĐ Mỹ Đ&igrave;nh, Đại học Quốc Gia, Đại học FPT...</p>\r\n\r\n<p>Với 3 tầng hầm v&agrave; 4 tầng khối đế d&agrave;nh cho văn ph&ograve;ng, thương mại dịch vụ, dự &aacute;n hội tụ hệ thống tiện &iacute;ch cao cấp cho cư d&acirc;n: hầm để xe, trung t&acirc;m thương mại, nh&agrave; trẻ, nh&agrave; h&agrave;ng, caf&eacute;, ph&ograve;ng sinh hoạt cộng đồng. Khu&ocirc;n vi&ecirc;n tho&aacute;ng rộng, nhiều c&acirc;y xanh c&ugrave;ng với hệ thống s&acirc;n vườn, đi dạo tr&ecirc;n m&aacute;i của t&ograve;a nh&agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601087424_5.jpg', '1601087424_1.jpg|1601087424_7.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-26 02:30:24', '2020-09-26 02:30:24'),
(339, 'Cho thuê căn 2PN  giá  9tr tại Mỹ Đình Plaza', 'cho-thue-can-2pn-gia-9tr-tai-my-dinh-plaza', '140 Trần Bình, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '27', '65', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm trong khu vực ph&aacute;t triển bậc nhất quận Cầu Giấy &ndash; Mỹ Đ&igrave;nh, dự &aacute;n Mỹ Đ&igrave;nh Plaza 2 hứa hẹn sẽ đem đến cho cư d&acirc;n cuộc sống vi&ecirc;n m&atilde;n, tiện nghi, hiện đại với hệ thống tiện &iacute;ch đa dạng, c&aacute;c căn hộ thiết kế hợp l&yacute;, tinh tế.<br />\r\nTọa lạc ngay tại trung t&acirc;m Mỹ Đ&igrave;nh, Mỹ Đ&igrave;nh Plaza 2 sở hữu một vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, nơi thuận tiện kết nối giao th&ocirc;ng với c&aacute;c tuyến đường huyết mạch của th&agrave;nh phố: Phạm H&ugrave;ng &ndash; Phạm Văn Đồng, Hồ T&ugrave;ng Mậu &ndash; Xu&acirc;n Thủy &ndash; Cầu Giấy, tuyến Metro Nhổn &ndash; Ga H&agrave; Nội. Từ dự &aacute;n, c&aacute;c cư d&acirc;n cũng c&oacute; thể dễ d&agrave;ng tiếp cận đến c&aacute;c tiện &iacute;ch h&agrave;ng đầu của khu vực như TTTM The Garden, đại si&ecirc;u thị Metro, bệnh viện 198, Trung t&acirc;m Hội nghị Quốc gia, SVĐ Mỹ Đ&igrave;nh, Đại học Quốc Gia, Đại học FPT...</p>\r\n\r\n<p>Với 3 tầng hầm v&agrave; 4 tầng khối đế d&agrave;nh cho văn ph&ograve;ng, thương mại dịch vụ, dự &aacute;n hội tụ hệ thống tiện &iacute;ch cao cấp cho cư d&acirc;n: hầm để xe, trung t&acirc;m thương mại, nh&agrave; trẻ, nh&agrave; h&agrave;ng, caf&eacute;, ph&ograve;ng sinh hoạt cộng đồng. Khu&ocirc;n vi&ecirc;n tho&aacute;ng rộng, nhiều c&acirc;y xanh c&ugrave;ng với hệ thống s&acirc;n vườn, đi dạo tr&ecirc;n m&aacute;i của t&ograve;a nh&agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601087582_2.jpg', '1601087582_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-26 02:33:02', '2020-09-26 02:33:02'),
(340, 'Cho thuê căn 2PN full nội thất giá 8.5tr tại KĐT Nam Thăng Long - Ciputra', 'cho-thue-can-2pn-full-noi-that-gia-85tr-tai-kdt-nam-thang-long-ciputra', 'Đường Lạc Long Quân, Phường Phú Thượng, Tây Hồ, Hà Nội', 2, '21', '92', 8500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 92m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n khu đ&ocirc; thị Nam Thăng Long nằm ở ph&iacute;a T&acirc;y Bắc của H&agrave; Nội, c&aacute;ch trung t&acirc;m th&agrave;nh phố khoảng 10km, toạ lạc tr&ecirc;n đường Lạc Long Qu&acirc;n, thuộc phường Xu&acirc;n La v&agrave; Ph&uacute; Thượng, quận T&acirc;y Hồ, ph&iacute;a &ETH;&ocirc;ng gi&aacute;p đường v&agrave;nh đai 2, bao quanh bởi s&ocirc;ng Hồng v&agrave; Hồ T&acirc;y. Cổng ch&iacute;nh ph&iacute;a T&acirc;y, gi&aacute;p đường v&agrave;nh đai 3, s&aacute;t ch&acirc;n cầu Thăng Long v&agrave; hướng đi s&acirc;n bay quốc tế Nội B&agrave;i.</p>\r\n\r\n<p>Trong khu đ&ocirc; thị, trường học, nh&agrave; trẻ mẫu gi&aacute;o được bố tr&iacute; đảm bảo an to&agrave;n thuận tiện, linh động, tiện lợi cho trẻ em học tập, vui chơi, cơ quan h&agrave;nh ch&iacute;nh, y tế được bố tr&iacute; ở trung t&acirc;m mỗi đơn vị ở để thuận tiện cho sử dụng v&agrave; quản l&yacute;. Ph&iacute;a T&acirc;y l&agrave; khu dịch vụ t&agrave;i ch&iacute;nh, thương mại, văn ho&aacute;, văn ph&ograve;ng giao dịch, kh&aacute;ch sạn cao cấp.<br />\r\nTrung t&acirc;m mua sắm Ciputra Mall bao gồm bốn tầng nổi v&agrave; một tầng hầm, được coi l&agrave; trung t&acirc;m thương mại đa năng lớn nhất H&agrave; Nội, rộng khoảng 130.000m2.&nbsp;Ngo&agrave;i ra, nơi đ&acirc;y c&ograve;n c&oacute; một trung t&acirc;m chiếu phim đa năng với 12 rạp m&agrave;n h&igrave;nh rộng.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601106084_5.jpg', '1601106084_4.jpg|1601106084_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-26 07:41:24', '2020-09-26 07:41:24'),
