ạp m&agrave;n h&igrave;nh rộng.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601106297_2.jpg', '1601106298_12.jpg|1601106298_15.jpg|1601106298_16.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-26 07:44:58', '2020-09-26 07:44:58'),
(342, 'Cho thuê căn 2PN full nội thất giá 11tr khu Ngoại Giao Đoàn', 'cho-thue-can-2pn-full-noi-that-gia-11tr-khu-ngoai-giao-doan', 'P. Xuân Đỉnh, Q. Bắc Từ Liêm, Hà Nội', 2, '9', '70', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 70m2, nằm tại t&ograve;a N04T1.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601284847_10.jpg', '1601284847_1.jpg|1601284847_2.jpg|1601284847_3.jpg|1601284847_4.jpg|1601284847_5.jpg|1601284847_6.jpg|1601284847_7.jpg|1601284847_8.jpg|1601284847_9.jpg|1601284847_10.jpg|1601284847_11.jpg|1601284847_12.jpg|1601284847_13.jpg|1601284847_14.jpg|1601284847_15.jpg|1601284847_16.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-28 09:20:47', '2020-09-28 09:20:47'),
(343, 'Cho thuê căn 2PN full nội thất giá 12tr tại Home City Trung Kính - Quận Cầu Giấy', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-home-city-trung-kinh-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '73', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 73m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm cạnh dự &aacute;n c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Nam Trung Y&ecirc;n rộng tới 12ha, tr&ecirc;n con phố Trung K&iacute;nh đang mở rộng 42m với những h&agrave;ng c&acirc;y tỏa b&oacute;ng hai b&ecirc;n đường phố, Home City 177 Trung K&iacute;nh c&oacute; ưu thế đặc biệt về cảnh quan, m&ocirc;i trường v&agrave; kh&iacute; hậu m&aacute;t mẻ trong l&agrave;nh ngay giữa trung t&acirc;m Thủ đ&ocirc; H&agrave; Nội. Với vị tr&iacute; trung t&acirc;m, được bao bọc xung quanh bởi c&aacute;c khu đ&ocirc; thị như Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Trung H&ograve;a với những c&ocirc;ng vi&ecirc;n c&acirc;y xanh, những ng&ocirc;i nh&agrave; biệt thự, nh&agrave; vườn thanh b&igrave;nh dọc c&aacute;c tuyến phố &ocirc; b&agrave;n cờ; Xung quanh dự &aacute;n l&agrave; trung t&acirc;m thương mại sầm uất như Big C, Grand Plaza, Keangnam, Fivimart&hellip;</p>\r\n\r\n<p>Home City 177 Trung K&iacute;nh được thừa hưởng ngay một hệ thống dịch vụ tiện &iacute;ch v&agrave; hạ tầng đ&ocirc; thị đồng bộ. Chung cư Home City l&agrave; sự tổng h&ograve;a của những thiết kế th&ocirc;ng minh, kh&ocirc;ng gian cảnh quan lu&ocirc;n mở v&agrave; hệ thống dịch vụ tiện &iacute;ch, chu đ&aacute;o. Khối đế của c&aacute;c t&ograve;a nh&agrave; li&ecirc;n th&ocirc;ng nhau tạo ra một khoảng kh&ocirc;ng gian rộng lớn, nơi sẽ được bố tr&iacute; c&aacute;c dịch vụ như cửa h&agrave;ng thời trang, ăn uống, giải kh&aacute;t, si&ecirc;u thị, spa, nh&agrave; trẻ, văn ph&ograve;ng&hellip; nhằm mang đến cho cư d&acirc;n cuộc sống tiện nghi v&agrave; h&ograve;a nhập c&ugrave;ng cộng đồng.</p>\r\n\r\n<p>Phần khối đế ph&iacute;a trong khu đất được thiết kế th&ocirc;ng tầng để sử dụng l&agrave;m s&acirc;n chơi, đường dạo kết hợp c&acirc;y xanh cho c&aacute;c t&ograve;a nh&agrave;. Tại đ&acirc;y được bố tr&iacute; một trường tiểu học cao 5 tầng với diện t&iacute;ch s&agrave;n 2200 m2, kết hợp với diện t&iacute;ch s&agrave;n d&agrave;nh cho nh&agrave; trẻ trong c&aacute;c t&ograve;a cao tầng sẽ g&oacute;p phần tạo điều kiện thuận lợi cho cư d&acirc;n trong việc chăm s&oacute;c, gi&aacute;o dục những thế hệ tương lai.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601345430_1.jpg', '1601345430_1.jpg|1601345430_2.jpg|1601345430_3.jpg|1601345430_4.jpg|1601345430_5.jpg|1601345430_6.jpg|1601345430_7.jpg|1601345430_8.jpg|1601345430_9.jpg|1601345430_10.jpg|1601345430_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 02:10:30', '2020-09-29 02:10:30'),
