(357, 'Cho thuê căn 3PN full nội thất giá 16.5tr tại FLC Twin Tower Cầu Giấy - Quận Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-165tr-tai-flc-twin-tower-cau-giay-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '120', 16500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 120m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nVị tr&iacute; FLC Twin Towers tọa lạc tại 265 Cầu Giấy, tiếp gi&aacute;p với phố Trần Đăng Ninh v&agrave; phố Ch&ugrave;a H&agrave;, nằm trong vị tr&iacute; trung t&acirc;m của tam gi&aacute;c c&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a, Nghĩa T&acirc;n v&agrave; Thủ Lệ, dự &aacute;n FLC Twin Towers sở hữu vị tr&iacute; đẹp nhất khu vực trung t&acirc;m quận Cầu Giấy.</p>\r\n\r\n<p>Tuyến đường sắt tr&ecirc;n kh&ocirc;ng đầu ti&ecirc;n tại Việt Nam kết nối trực tiếp ga số 7 từ nhiều điểm kh&aacute;c nhau trong th&agrave;nh phố. Tuyến đường sắt tr&ecirc;n cao của th&agrave;nh phố (chạy từ Nhổn về Ga H&agrave; Nội) được kết nối với dự &aacute;n tại tầng 2 của Trung t&acirc;m thương mại l&agrave; một lợi thế to lớn so với c&aacute;c dự &aacute;n kh&aacute;c, đem lại sự thuận tiện trong giao th&ocirc;ng, sự đ&ocirc;ng đ&uacute;c &amp; nhộn nhịp của nhu cầu mua sắm, l&agrave; tiền đề cho sự th&agrave;nh c&ocirc;ng của Trung t&acirc;m thương mại.</p>\r\n\r\n<p>FLC Twin Towers hứa hẹn sẽ l&agrave; đ&iacute;ch đến của những thương hiệu mua sắm h&agrave;ng đầu trong khu vực v&agrave; thế giới.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 16.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601349191_11.jpg', '1601349191_1.jpg|1601349191_2.jpg|1601349191_3.jpg|1601349191_4.jpg|1601349191_5.jpg|1601349191_6.jpg|1601349191_7.jpg|1601349191_8.jpg|1601349191_9.jpg|1601349191_10.jpg|1601349191_11.jpg|1601349191_12.jpg|1601349191_13.jpg|1601349191_be4127ff-9fd3-4ba9-9bbe-658242f0e700.jpg|1601349191_ok.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 03:13:11', '2020-09-29 03:13:11'),
