n v&agrave; nh&acirc;m nhi li c&agrave; ph&ecirc; ngắm nh&igrave;n th&agrave;nh phố m&agrave; kh&ocirc;ng phải đi xa.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1601351153_20200702152330-d024_wm.jpg', '1601351153_20200702152327-111c_wm.jpg|1601351153_20200702152330-49ff_wm.jpg|1601351153_20200702152330-b81d_wm.jpg|1601351153_20200702152330-d024_wm.jpg|1601351153_20200702152332-39c6_wm.jpg|1601351153_20200702152333-4b0f_wm.jpg|1601351153_20200909105809-8d86_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 03:45:53', '2020-09-29 03:45:53'),
