(368, 'Cho thuê căn 3PN full nội thất giá 15tr tại Dreamland Bonanza Duy Tân - Quận Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-dreamland-bonanza-duy-tan-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '98', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 98m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Dreamland Bonanza tọa lạc tại vị tr&iacute; đắc địa trung t&acirc;m phố Duy T&acirc;n, quận Cầu Giấy &ndash; khu vực được v&iacute; như Khu t&agrave;i ch&iacute;nh Phố Wall của Việt Nam. Nơi đ&acirc;y tập trung nhiều tập đo&agrave;n c&ocirc;ng nghệ - t&agrave;i ch&iacute;nh, trụ sở c&ocirc;ng ty lớn như FPT, Viettel, CMC, Samsung, Manulife, Prudential, 16 chi nh&aacute;nh - ph&ograve;ng giao dịch ng&acirc;n h&agrave;ng thương mại&hellip;<br />\r\nĐ&acirc;y l&agrave; dự &aacute;n chung cư cao cấp hiếm hoi thuộc &ldquo;thủ phủ văn ph&ograve;ng&rdquo; Duy T&acirc;n, được bao quanh bởi những tuyến đường huyết mạch như: Phạm H&ugrave;ng - V&agrave;nh đai 3, Trần Th&aacute;i T&ocirc;ng &ndash; Xu&acirc;n Thủy. Dreamland Bonanza chỉ c&aacute;ch mặt đường Phạm H&ugrave;ng 20m, bến xe Mỹ Đ&igrave;nh khoảng 1km, đường Trần Th&aacute;i T&ocirc;ng 500m, c&ocirc;ng vi&ecirc;n Cầu Giấy 1 km, s&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3km, Hồ T&acirc;y 4,5km&hellip;Từ nơi đ&acirc;y, cư d&acirc;n sẽ dễ d&agrave;ng tiếp cận tới c&aacute;c địa điểm trọng yếu, những tiện &iacute;ch ngoại khu h&agrave;ng đầu như:<br />\r\n+ C&aacute;c bệnh viện uy t&iacute;n: Bệnh viện 198, Bệnh viện Y học cổ truyền H&agrave; Nội, Viện Huyết học v&agrave; Truyền m&aacute;u Trung ương...<br />\r\n+ Hệ thống c&aacute;c trường học chất lượng cao: Đại học FPT, ĐH Quốc gia H&agrave; Nội, ĐH Thương mại, ĐH Sư phạm, THCS Đo&agrave;n Thị Điểm, THCS Dịch Vọng Hậu, THCS Cầu Giấy...<br />\r\n+ Trụ sở c&aacute;c Bộ ban ng&agrave;nh: Bộ C&ocirc;ng an, Bộ T&agrave;i nguy&ecirc;n M&ocirc;i trường, Bộ Ngoại giao, Tổng cục Hải quan, Viện Kiểm s&aacute;t Nh&acirc;n d&acirc;n Tối cao&hellip;<br />\r\n+ Gần c&aacute;c trung t&acirc;m thương mại, khu vui chơi giải tr&iacute; lớn: Indochina Plaza Hanoi, Keangnam Landmark Tower, The Garden, C&ocirc;ng vi&ecirc;n Cầu Giấy&hellip;<br />\r\nChung cư Dreamland 23 Duy T&acirc;n được CĐT chăm ch&uacute;t, d&agrave;nh tới cho cư d&acirc;n những tiện &iacute;ch hiện đại, đa dạng &amp; đẳng cấp bậc nhất nhằm mang tới cuộc sống thịnh vượng, đủ đầy &amp; vi&ecirc;n m&atilde;n: S&acirc;n tập Golf trong nh&agrave;, s&acirc;n tập Tennis tự động, s&acirc;n tập b&oacute;ng rổ, Khu vui chơi trẻ em ngo&agrave;i trời, Khu tập thể thao ngo&agrave;i trời...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601352121_1.jpg', '1601352121_1.jpg|1601352121_2.jpg|1601352121_3.jpg|1601352121_4.jpg|1601352121_5.jpg|1601352121_6.jpg|1601352121_7.jpg|1601352121_8.jpg|1601352121_9.jpg|1601352121_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 04:02:01', '2020-09-29 04:02:01'),
(369, 'Cho thuê căn 3PN full nội thất giá 14tr tại The Garden Hill Mỹ Đình', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-the-garden-hill-my-dinh', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '92', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 92m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư The Garden Hill tọa lạc tại 99 Trần B&igrave;nh. Tọa độ trung t&acirc;m đắc địa giao thoa 2 quận sầm uất l&agrave; Cầu Giấy v&agrave; Nam Từ Li&ecirc;m. Dự &aacute;n cạnh ngay bến xe Mỹ Đ&igrave;nh, đường v&agrave;nh đai 3 cao tốc đ&ocirc; thị. Bao quanh The Garden Hill l&agrave; những con đường lớn, huyết mạch của thủ đ&ocirc; như V&agrave;nh đai 3 cao tốc đ&ocirc; thị &ndash; Phạm H&ugrave;ng, quốc lộ 32 &ndash; Xu&acirc;n Thủy, Trục Nguyễn Ho&agrave;ng &ndash; T&ocirc;n Thất Thuyết, Trục L&ecirc; Đức Thọ &ndash; L&ecirc; Quang Đạo&hellip;</p>\r\n\r\n<p>Ngo&agrave;i ra chung cư 99 Trần B&igrave;nh c&ograve;n l&agrave; Trung t&acirc;m gi&aacute;o dục của Thủ đ&ocirc;. Nơi gần rất nhiều c&aacute;c trường đại học lớn như Đại Học Thương Mại, Đại Học Quốc Gia, Đại Học Sư Phạm, Đại Học FPT.., v&agrave; thuận tiện về cả hệ thống c&aacute;c cơ sở y tế uy t&iacute;n như Bệnh viện 19-8, bệnh viện Y Học Cổ Truyền, gần t&ograve;a nh&agrave; chung cư cao cấp Dolphin Plaza&hellip;</p>\r\n\r\n<p>Dự &aacute;n hưởng trọn bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh của 3 c&ocirc;ng vi&ecirc;n hồ nước lớn: C&ocirc;ng vi&ecirc;n Cầu Giấy, C&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Trung t&acirc;m, C&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a. Cư d&acirc;n The Garden Hill Trần B&igrave;nh được hưởng đầy đủ c&aacute;c dịch vụ tiện &iacute;ch như khu trung t&acirc;m thương mại, k&egrave;m theo l&agrave; ph&ograve;ng tập gym, vườn dạo, qu&aacute;n c&agrave; ph&ecirc; tr&ecirc;n tầng 6, khu vui chơi giải tr&iacute; trẻ em&hellip; Xung quanh căn hộ được bố tr&iacute; c&acirc;y xanh hợp l&yacute; mang đến một bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh, gi&uacute;p ph&aacute;t triển cả thể chất lẫn tinh thần cho c&aacute;c thế hệ sinh sống tại đ&acirc;y.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601352268_2.jpg', '1601352268_1.jpg|1601352268_2.jpg|1601352268_3.jpg|1601352268_4.jpg|1601352268_5.jpg|1601352268_6.jpg', NULL, NULL, 'Mr.Hoàng', NULL, NULL, '0969856985', NULL, 0, 0, '2020-09-29 04:04:28', '2020-09-30 02:33:08'),
(370, 'Cho thuê căn 2PN full nội thất giá 12tr tại Dreamland Bonanza Duy Tân - Quận Cầu Giấy', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-dreamland-bonanza-duy-tan-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '80', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Dreamland Bonanza tọa lạc tại vị tr&iacute; đắc địa trung t&acirc;m phố Duy T&acirc;n, quận Cầu Giấy &ndash; khu vực được v&iacute; như Khu t&agrave;i ch&iacute;nh Phố Wall của Việt Nam. Nơi đ&acirc;y tập trung nhiều tập đo&agrave;n c&ocirc;ng nghệ - t&agrave;i ch&iacute;nh, trụ sở c&ocirc;ng ty lớn như FPT, Viettel, CMC, Samsung, Manulife, Prudential, 16 chi nh&aacute;nh - ph&ograve;ng giao dịch ng&acirc;n h&agrave;ng thương mại&hellip;<br />\r\nĐ&acirc;y l&agrave; dự &aacute;n chung cư cao cấp hiếm hoi thuộc &ldquo;thủ phủ văn ph&ograve;ng&rdquo; Duy T&acirc;n, được bao quanh bởi những tuyến đường huyết mạch như: Phạm H&ugrave;ng - V&agrave;nh đai 3, Trần Th&aacute;i T&ocirc;ng &ndash; Xu&acirc;n Thủy. Dreamland Bonanza chỉ c&aacute;ch mặt đường Phạm H&ugrave;ng 20m, bến xe Mỹ Đ&igrave;nh khoảng 1km, đường Trần Th&aacute;i T&ocirc;ng 500m, c&ocirc;ng vi&ecirc;n Cầu Giấy 1 km, s&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3km, Hồ T&acirc;y 4,5km&hellip;Từ nơi đ&acirc;y, cư d&acirc;n sẽ dễ d&agrave;ng tiếp cận tới c&aacute;c địa điểm trọng yếu, những tiện &iacute;ch ngoại khu h&agrave;ng đầu như:<br />\r\n+ C&aacute;c bệnh viện uy t&iacute;n: Bệnh viện 198, Bệnh viện Y học cổ truyền H&agrave; Nội, Viện Huyết học v&agrave; Truyền m&aacute;u Trung ương...<br />\r\n+ Hệ thống c&aacute;c trường học chất lượng cao: Đại học FPT, ĐH Quốc gia H&agrave; Nội, ĐH Thương mại, ĐH Sư phạm, THCS Đo&agrave;n Thị Điểm, THCS Dịch Vọng Hậu, THCS Cầu Giấy...<br />\r\n+ Trụ sở c&aacute;c Bộ ban ng&agrave;nh: Bộ C&ocirc;ng an, Bộ T&agrave;i nguy&ecirc;n M&ocirc;i trường, Bộ Ngoại giao, Tổng cục Hải quan, Viện Kiểm s&aacute;t Nh&acirc;n d&acirc;n Tối cao&hellip;<br />\r\n+ Gần c&aacute;c trung t&acirc;m thương mại, khu vui chơi giải tr&iacute; lớn: Indochina Plaza Hanoi, Keangnam Landmark Tower, The Garden, C&ocirc;ng vi&ecirc;n Cầu Giấy&hellip;<br />\r\nChung cư Dreamland 23 Duy T&acirc;n được CĐT chăm ch&uacute;t, d&agrave;nh tới cho cư d&acirc;n những tiện &iacute;ch hiện đại, đa dạng &amp; đẳng cấp bậc nhất nhằm mang tới cuộc sống thịnh vượng, đủ đầy &amp; vi&ecirc;n m&atilde;n: S&acirc;n tập Golf trong nh&agrave;, s&acirc;n tập Tennis tự động, s&acirc;n tập b&oacute;ng rổ, Khu vui chơi trẻ em ngo&agrave;i trời, Khu tập thể thao ngo&agrave;i trời...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601352375_20200916105903-e623_wm.jpg', '1601352376_20200916105903-5a92_wm.jpg|1601352376_20200916105903-8a53_wm.jpg|1601352376_20200916105903-e148_wm.jpg|1601352376_20200916105903-e623_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 04:06:16', '2020-09-29 04:06:16'),
