 Nội, ĐH Thương mại, ĐH Sư phạm, THCS Đo&agrave;n Thị Điểm, THCS Dịch Vọng Hậu, THCS Cầu Giấy...<br />\r\n+ Trụ sở c&aacute;c Bộ ban ng&agrave;nh: Bộ C&ocirc;ng an, Bộ T&agrave;i nguy&ecirc;n M&ocirc;i trường, Bộ Ngoại giao, Tổng cục Hải quan, Viện Kiểm s&aacute;t Nh&acirc;n d&acirc;n Tối cao&hellip;<br />\r\n+ Gần c&aacute;c trung t&acirc;m thương mại, khu vui chơi giải tr&iacute; lớn: Indochina Plaza Hanoi, Keangnam Landmark Tower, The Garden, C&ocirc;ng vi&ecirc;n Cầu Giấy&hellip;<br />\r\nChung cư Dreamland 23 Duy T&acirc;n được CĐT chăm ch&uacute;t, d&agrave;nh tới cho cư d&acirc;n những tiện &iacute;ch hiện đại, đa dạng &amp; đẳng cấp bậc nhất nhằm mang tới cuộc sống thịnh vượng, đủ đầy &amp; vi&ecirc;n m&atilde;n: S&acirc;n tập Golf trong nh&agrave;, s&acirc;n tập Tennis tự động, s&acirc;n tập b&oacute;ng rổ, Khu vui chơi trẻ em ngo&agrave;i trời, Khu tập thể thao ngo&agrave;i trời...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601352898_2.jpg', '1601352899_1.jpg|1601352899_2.jpg|1601352899_6.jpg|1601352899_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 04:14:59', '2020-09-29 04:14:59'),
(373, 'Cho thuê căn 2PN full nội thất giá 12tr tại Luxury Park View - Quận Cầu Giấy', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-luxury-park-view-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '70', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Luxury Park Views sở hữu vị tr&iacute; đắc địa tại KĐT mới Cầu Giấy, từ đ&acirc;y, cư d&acirc;n chỉ mất 2 ph&uacute;t di chuyển đến bến xe Mỹ Đ&igrave;nh, đường v&agrave;nh đai 3; 5 ph&uacute;t đến trung t&acirc;m Hội nghị Quốc gia, si&ecirc;u thị BigC Thăng Long...Hướng T&acirc;y Bắc dự &aacute;n đối diện Đại sứ qu&aacute;n Mỹ, hướng Bắc view trọn c&ocirc;ng vi&ecirc;n Cầu Giấy. Hướng T&acirc;y Nam nh&igrave;n ra đường Phạm Văn Bạch v&agrave; Viện Huyết học truyền m&aacute;u Trung ương. Hướng Đ&ocirc;ng Bắc nh&igrave;n ra trường Mầm non Vietkids...<br />\r\nNhờ vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, những cư d&acirc;n tương lai của Luxury Park Views được hưởng trọn một cuộc sống tiện nghi v&agrave; chất lượng.<br />\r\nChung cư Luxury Park Views c&oacute; hệ thống tiện &iacute;ch hiện đại, đẳng cấp: 03 tầng hầm để xe, Hệ thống an ninh 24/7, Khu vui chơi trẻ em, trường mầm non, Ph&ograve;ng gym, yoga, spa, Khu trung t&acirc;m thương mại, Bể bơi v&ocirc; cực, Sky garden...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601353171_7.jpg', '1601353171_1.jpg|1601353171_2.jpg|16013531