(377, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT GIÁ 8TR TẠI KHU ĐÔ THỊ MỸ ĐÌNH SÔNG ĐÀ - SUDICO', 'cho-thue-can-2pn-full-noi-that-gia-8tr-tai-khu-do-thi-my-dinh-song-da-sudico', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '65', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nKhu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; l&agrave; dự &aacute;n tổ hợp khu căn hộ chung cư Hà N&ocirc;̣i, biệt thự, nh&agrave; liền kề, trung t&acirc;m thương mại v&agrave; mặt bằng văn ph&ograve;ng hiện đại. Chung cư Mỹ Đ&igrave;nh - S&ocirc;ng Đ&agrave; nằm giữa khu vực đang được đ&ocirc; thị h&oacute;a với tốc độ cao. Đ&acirc;y l&agrave; dự &aacute;n c&oacute; vị tr&iacute; thuận lợi để ph&aacute;t triển một khu d&acirc;n cư mới phục vụ nhu cầu về nh&agrave; ở của cư d&acirc;n Thủ đ&ocirc;.<br />\r\nTừ đ&acirc;y d&acirc;n cư c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực trung t&acirc;m th&agrave;nh phố qua c&aacute;c tuyến đường huyết mạch c&ugrave;ng h&igrave;nh thức giao th&ocirc;ng đa dạng.&nbsp;Dự &aacute;n nằm gần với c&aacute;c tiện &iacute;ch như: Đại học kỹ thuật &ndash; Hậu cần c&ocirc;ng an nh&acirc;n d&acirc;n, Đại học d&acirc;n lập Phương Đ&ocirc;ng, Trường trung học cơ sở Mễ Tr&igrave;, Trường mầm non Mỹ Đ&igrave;nh, Trường THPT Đo&agrave;n Thị Điểm, Trường đại học FPT, Bệnh viện thể thao Việt Nam, Bệnh viện 19-8, Bệnh viện đa khoa y học cổ truyền,Viện huyết học v&agrave; truyền m&aacute;u trung ương, C&ocirc;ng vi&ecirc;n Cầu Giấy.</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; được c&aacute;c nh&agrave; đầu tư cũng như kh&aacute;ch h&agrave;ng đ&aacute;nh gi&aacute; cao về tiện &iacute;ch nội v&agrave; ngoại khu. Dự &aacute;n được Sudico đầu tư x&acirc;y dựng với c&aacute;c hạng mục tiện &iacute;ch phục vụ nhu cầu của d&acirc;n cư.Dự &aacute;n mang đến kh&ocirc;ng gian sống đ&aacute;ng mơ ước cho c&aacute;c hộ gia đ&igrave;nh với thiết kế th&ocirc;ng minh. Tại đ&acirc;y bạn v&agrave; c&aacute;c th&agrave;nh vi&ecirc;n trong gia đ&igrave;nh c&oacute; thể tận hưởng c&aacute;c tiện &iacute;ch sống ho&agrave;n thiện.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601357506_1.jpg', '1601357507_1.jpg|1601357507_2.jpg|1601357507_3.jpg|1601357507_4.jpg|1601357507_5.jpg|1601357507_6.jpg|1601357507_7.jpg', NULL, NULL, 'Mr.Hoàng', NULL, NULL, '0969856985', NULL, 0, 0, '2020-09-29 05:31:47', '2020-09-30 02:30:49'),
(378, 'Cho thuê căn 2PN full nội thất giá 12tr tại Vinhome D\'Capitale Trần Duy Hưng - Quận Cầu Giấy', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-vinhome-dcapitale-tran-duy-hung-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 4, '124', '70', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh, b&agrave;n ghế...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n chung cư D&rsquo;. Capitale Trần Duy Hưng của T&acirc;n Ho&agrave;ng Minh tọa lạc tại khu đất v&agrave;ng tr&ecirc;n đường Trần Duy Hưng nơi c&oacute; hạ tầng cơ sở đồng bộ v&agrave; hiện đại bậc nhất của thủ đ&ocirc;. Tổ hợp dự &aacute;n sở hữu cả 4 mặt tiền tho&aacute;ng đ&atilde;ng, tiếp gi&aacute;p với c&aacute;c trục đường huyết mạch cửa ng&otilde; ph&iacute;a T&acirc;y như Khuất Duy Tiến, Ho&agrave;ng Minh Gi&aacute;m, Trần Duy Hưng. &nbsp;</p>\r\n\r\n<p>Hồ điều h&ograve;a C&ocirc;ng vi&ecirc;n Nh&acirc;n Ch&iacute;nh l&agrave; điểm nhấn nổi bật của to&agrave;n dự &aacute;n &ndash; vừa đ&oacute;ng vai tr&ograve; &ldquo;l&aacute; phổi xanh&rdquo; điều h&ograve;a kh&ocirc;ng kh&iacute; &ndash; mang đến kh&ocirc;ng gian sống trong l&agrave;nh cho Qu&yacute; cư d&acirc;n, vừa tượng trưng cho yếu tố &ldquo;thịnh vượng&rdquo; &ndash; phong thủy hanh th&ocirc;ng cho gia chủ. Từ vị tr&iacute; dự &aacute;n, Qu&yacute; cư d&acirc;n tương lai dễ d&agrave;ng kết nối đến c&aacute;c cơ quan h&agrave;nh ch&iacute;nh, trung t&acirc;m thương mại &ndash; giải tr&iacute;, bệnh viện, trường học &hellip; trong &nbsp;th&agrave;nh phố:<br />\r\n+ C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i: 25 ph&uacute;t l&aacute;i xe<br />\r\n+ C&aacute;ch trung t&acirc;m H&agrave; Nội &ndash; Hồ Gươm, Ga H&agrave; Nội: 15 ph&uacute;t l&aacute;i xe</p>\r\n\r\n<p>+ C&aacute;ch TT Hội nghị Quốc Gia: 01km<br />\r\n&nbsp;<br />\r\n+ C&aacute;ch s&acirc;n Vận động Quốc Gia Mỹ Đ&igrave;nh: 1.5km</p>\r\n\r\n<p>+ Gần hệ thống trường học c&aacute;c cấp: Trường Chuy&ecirc;n H&agrave; Nội &ndash; Amsterdam, trường Đại Học Quốc Gia, Trường ĐH Thương Mại, Trường THPT Lương Thế Vinh &hellip;</p>\r\n\r\n<p>+ Gần hệ thống TTTM &ndash; si&ecirc;u thị: Big C Thăng Long, Grand Plaza, The Garden, &hellip;</p>\r\n\r\n<p>+ Gần hệ thống bệnh viện: Bệnh viện 198, Viện Huyết Học Truyền M&aacute;u Trung ương, BV Giao Th&ocirc;ng Vận Tải &hellip;<br />\r\nNằm trong Trung t&acirc;m thương mại Vincom, si&ecirc;u thị VinMart sẽ mang đến cả một thế giới h&agrave;ng ti&ecirc;u d&ugrave;ng đa dạng, phong ph&uacute;, thỏa m&atilde;n mọi nhu cầu cho cuộc sống h&agrave;ng ng&agrave;y của cư d&acirc;n DCapitale Trần Duy Hưng.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601363167_20200911103911-2eea_wm.jpg', '1601363167_248428661.jpg|1601363167_251972970.jpg|1601363167_251972971.jpg|1601363167_251973118.jpg|1601363167_253722840.jpg|1601363167_20200911103911-1e30_wm.jpg|1601363167_20200911103911-2eea_wm.jpg|1601363167_20200911103911-20f9_wm.jpg|1601363167_20200911103911-27a6_wm.jpg|1601363167_20200911103911-323d_wm.jpg|1601363167_20200911103911-dcfb_wm.jpg|1601363167_20200911103911-f452_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 07:06:07', '2020-09-29 07:09:45'),
