h&uacute;t l&aacute;i xe</p>\r\n\r\n<p>+ C&aacute;ch TT Hội nghị Quốc Gia: 01km<br />\r\n&nbsp;<br />\r\n+ C&aacute;ch s&acirc;n Vận động Quốc Gia Mỹ Đ&igrave;nh: 1.5km</p>\r\n\r\n<p>+ Gần hệ thống trường học c&aacute;c cấp: Trường Chuy&ecirc;n H&agrave; Nội &ndash; Amsterdam, trường Đại Học Quốc Gia, Trường ĐH Thương Mại, Trường THPT Lương Thế Vinh &hellip;</p>\r\n\r\n<p>+ Gần hệ thống TTTM &ndash; si&ecirc;u thị: Big C Thăng Long, Grand Plaza, The Garden, &hellip;</p>\r\n\r\n<p>+ Gần hệ thống bệnh viện: Bệnh viện 198, Viện Huyết Học Truyền M&aacute;u Trung ương, BV Giao Th&ocirc;ng Vận Tải &hellip;<br />\r\nNằm trong Trung t&acirc;m thương mại Vincom, si&ecirc;u thị VinMart sẽ mang đến cả một thế giới h&agrave;ng ti&ecirc;u d&ugrave;ng đa dạng, phong ph&uacute;, thỏa m&atilde;n mọi nhu cầu cho cuộc sống h&agrave;ng ng&agrave;y của cư d&acirc;n DCapitale Trần Duy Hưng.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601363411_20200911104949-15be_wm.jpg', '1601363411_248428661.jpg|1601363411_251972970.jpg|1601363411_251972971.jpg|1601363411_251973118.jpg|1601363411_253722840.jpg|1601363411_20200911104914-b5f4_wm.jpg|1601363411_20200911104949-4b5b_wm.jpg|1601363411_20200911104949-15be_wm.jpg|1601363411_20200911104949-c3fd_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 07:10:11', '2020-09-29 07:18:54'),
