(382, 'Cho thuê căn 2PN giá 8tr tại Chung cư N02 Yên Hòa - Quận Cầu Giấy', 'cho-thue-can-2pn-gia-8tr-tai-chung-cu-n02-yen-hoa-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '70', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản gồm:&nbsp;tủ, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nT&ograve;a NO-02 nằm ở vị tr&iacute; trung t&acirc;m của c&aacute;c Khu đ&ocirc; thị đ&atilde; v&agrave; đang ho&agrave;n thiện như Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, Dịch Vọng,&hellip; nơi c&oacute; hệ thống hạ tầng kỹ thuật đồng bộ, ho&agrave;n hảo.</p>\r\n\r\n<p>Với b&aacute;n k&iacute;nh chỉ trong v&ograve;ng 1 km, t&ograve;a nh&agrave; Y&ecirc;n H&ograve;a Condominium c&ograve;n l&agrave; trung t&acirc;m của c&aacute;c địa điểm thương mại sầm uất như Big C, Grand Plaza, Kengnam, Fivimart,&hellip;Ngo&agrave;i ra Chung cư N02 Y&ecirc;n H&ograve;a được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch khu đ&ocirc; thị Y&ecirc;n H&ograve;a như: C&ocirc;ng vi&ecirc;n Cầu Giấy, trường tiểu học Y&ecirc;n H&ograve;a, trường THCS Y&ecirc;n H&ograve;a, nh&agrave; văn h&oacute;a Y&ecirc;n H&ograve;a, chợ Hợp Nhất Trung K&iacute;nh&hellip;<br />\r\nChung cư N02 Y&ecirc;n H&ograve;a được thừa hưởng tiện &iacute;ch v&agrave; dịch vụ từ c&aacute;c dự &aacute;n xung quanh như:<br />\r\n&bull; Nh&agrave; trẻ phường Y&ecirc;n H&ograve;a c&aacute;ch 350m&nbsp;<br />\r\n&bull; Trường tiểu học Trung H&ograve;a c&aacute;ch 470m&nbsp;<br />\r\n&bull; Trường tiểu học L&yacute; Th&aacute;i Tổ l&agrave; 1,19km<br />\r\n&bull; Trường tiểu học Nam Trung Y&ecirc;n c&aacute;ch 1,18km&nbsp;<br />\r\n&bull; Trường THCS Nam Trung Y&ecirc;n khoảng 1,07km<br />\r\n&nbsp;Trường PTTH d&acirc;n lập Nguyễn Si&ecirc;u 760m&nbsp;<br />\r\n&bull; Trường Quốc tế Global Y&ecirc;n H&ograve;a c&aacute;ch 40m&nbsp;<br />\r\n&bull; Trường chuy&ecirc;n H&agrave; Nội Amsterdam l&agrave; 1,3km&nbsp;<br />\r\n&bull; Đại học kỹ thuật hậu cần CAND khoảng 550m&nbsp;<br />\r\n&bull; Trường nội tr&uacute; Nguyễn Viết Xu&acirc;n c&aacute;ch 600m&nbsp;<br />\r\n&bull; Trường Đại học Lao động X&atilde; hội : 890m&nbsp;<br />\r\n&bull; Trường Đại học Ngoại thương H&agrave; Nội l&agrave; 1km&nbsp;<br />\r\n&bull; Hệ thống bệnh viện, ph&ograve;ng kh&aacute;m chăm s&oacute;c sức khỏe người d&acirc;n như:&nbsp;<br />\r\n&bull; Bệnh viện Giao th&ocirc;ng vận tải TW c&aacute;ch 1km,&nbsp;<br />\r\n&bull; Viện huyết học v&agrave; truyền m&aacute;u TW c&aacute;ch 1,14km&nbsp;<br />\r\n&bull; Bệnh viện Nhi TW c&aacute;ch 1,3km&nbsp;<br />\r\n&bull; Bệnh viện Phụ sản H&agrave; Nội c&aacute;ch 1,3km&nbsp;<br />\r\nC&ugrave;ng với đ&oacute; l&agrave; gần si&ecirc;u thị, trung t&acirc;m mua sắm, bến xe, s&acirc;n vận động, c&ocirc;ng vi&ecirc;n&hellip; như Big C, The Maner, Grand Plaza, c&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a rất đẹp, bến xe Mỹ Đ&igrave;nh&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601364606_2.jpg', '1601364606_1.jpg|1601364606_2.jpg|1601364606_3.jpg|1601364606_4.jpg|1601364606_5.jpg|1601364606_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 07:30:06', '2020-09-29 07:30:50');
