(387, 'Cho thuê căn 2PN giá 8tr tại Vimeco II Nguyễn Chánh - Quận Cầu Giấy', 'cho-thue-can-2pn-gia-8tr-tai-vimeco-ii-nguyen-chanh-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '75', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản&nbsp;gồm: giường, tủ, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư CT4 Vimeco Nguyễn Ch&aacute;nh tọa lạc tại vị tr&iacute; v&agrave;ng phố Nguyễn Ch&aacute;nh, khu đ&ocirc; thị Trung H&ograve;a, được coi l&agrave; tuyến phố đẹp v&agrave; rộng r&atilde;i nhất quận Cầu Giấy, giao th&ocirc;ng cực k&igrave; thuận tiện. L&agrave; t&acirc;m điểm của những tuyến phố trọng điểm của thủ đ&ocirc; như: Phạm H&ugrave;ng, Trần Duy Hưng, Trung K&iacute;nh, đường L&aacute;ng&hellip;&nbsp;<br />\r\nVới vị tr&iacute; trung t&acirc;m: được bao bọc bởi c&aacute;c khu đ&ocirc; thị lớn như Trung H&ograve;a &ndash; Nh&acirc;n Ch&iacute;nh, Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Y&ecirc;n H&ograve;a&hellip;<br />\r\n&ndash; L&agrave; khu vực c&oacute; hạ tầng kĩ thuật đồng bộ, ho&agrave;n hảo. Xung quanh l&agrave; c&aacute;c si&ecirc;u thị, trung t&acirc;m thương mại sầm uất như BigC, Grand Plaza, KeangNam, The Garden&hellip;<br />\r\n&ndash; Vì nằm ở vị trí được coi là trung t&acirc;m b&acirc;̣c nh&acirc;́t thủ đ&ocirc; n&ecirc;n xung quanh chung cư CT4 Vimeco có đ&acirc;̀y đủ các ti&ecirc;̣n ích từ:<br />\r\n&ndash; H&ecirc;̣ th&ocirc;́ng các trường ti&ecirc;̉u học, c&acirc;́p 1, c&acirc;́p 2, c&acirc;́p 3 (Y&ecirc;n H&ograve;a, Nh&acirc;n Ch&iacute;nh, Amsterdams&hellip;)<br />\r\n&ndash; Hệ thống c&aacute;c trường đại học lớn: Lao Động &ndash; X&atilde; Hội, Ngoại Thương, Giao Th&ocirc;ng, Luật, C&ocirc;ng Đo&agrave;n&hellip;<br />\r\n&ndash; H&ecirc;̣ th&ocirc;́ng chợ, si&ecirc;u thị, b&ecirc;̣nh vi&ecirc;̣n&hellip;<br />\r\nTừ tầng 1 &ndash; 4 của dự &aacute;n CT4 Vimeco Nguyễn Ch&aacute;nh được d&agrave;nh l&agrave;m sảnh đ&oacute;n tiếp v&agrave; trung t&acirc;m thương mại hiện đại, đầy đủ vừa cung cấp c&aacute;c dịch vụ cao cấp cho cư d&acirc;n trong t&ograve;a nh&agrave; vừa cung cấp những dịch vụ h&agrave;ng đầu cho cả những người d&acirc;n ở khu vực l&acirc;n cận c&ugrave;ng được sử dụng: si&ecirc;u thị mini, khu vui chơi giải tr&iacute;, nh&agrave; h&agrave;ng ẩm thực,&hellip;.<br />\r\nNgo&agrave;i c&aacute;c tiện &iacute;ch nằm ở tầng 1 &ndash; 4 của dự &aacute;n, chung cư CT4 Vimeco Nguyễn Ch&aacute;nh c&ograve;n x&acirc;y dựng hệ thống c&ocirc;ng vi&ecirc;n c&acirc;y xanh v&agrave; đường tản bộ xung quanh dự &aacute;n để tăng kh&ocirc;ng gian xanh trong l&agrave;nh của dự &aacute;n v&agrave; cư d&acirc;n được hưởng trọn vẹn hơn cuộc sống trong l&agrave;nh ngay giữa thủ đ&ocirc;.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601365777_2.jpg', '1601365777_1.jpg|1601365777_2.jpg|1601365777_5.jpg|1601365777_6.jpg|1601365777_-885654029049023177.jpg|1601365777_-6206322595282193017.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 07:49:37', '2020-09-29 07:49:37'),
(388, 'Cho thuê căn 3PN full nội thất giá 14tr tại Chung cư N02 Yên Hòa - Quận Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-chung-cu-n02-yen-hoa-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '110', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 110m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nT&ograve;a NO-02 nằm ở vị tr&iacute; trung t&acirc;m của c&aacute;c Khu đ&ocirc; thị đ&atilde; v&agrave; đang ho&agrave;n thiện như Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, Dịch Vọng,&hellip; nơi c&oacute; hệ thống hạ tầng kỹ thuật đồng bộ, ho&agrave;n hảo.</p>\r\n\r\n<p>Với b&aacute;n k&iacute;nh chỉ trong v&ograve;ng 1 km, t&ograve;a nh&agrave; Y&ecirc;n H&ograve;a Condominium c&ograve;n l&agrave; trung t&acirc;m của c&aacute;c địa điểm thương mại sầm uất như Big C, Grand Plaza, Kengnam, Fivimart,&hellip;Ngo&agrave;i ra Chung cư N02 Y&ecirc;n H&ograve;a được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch khu đ&ocirc; thị Y&ecirc;n H&ograve;a như: C&ocirc;ng vi&ecirc;n Cầu Giấy, trường tiểu học Y&ecirc;n H&ograve;a, trường THCS Y&ecirc;n H&ograve;a, nh&agrave; văn h&oacute;a Y&ecirc;n H&ograve;a, chợ Hợp Nhất Trung K&iacute;nh&hellip;<br />\r\nChung cư N02 Y&ecirc;n H&ograve;a được thừa hưởng tiện &iacute;ch v&agrave; dịch vụ từ c&aacute;c dự &aacute;n xung quanh như:<br />\r\n&bull; Nh&agrave; trẻ phường Y&ecirc;n H&ograve;a c&aacute;ch 350m&nbsp;<br />\r\n&bull; Trường tiểu học Trung H&ograve;a c&aacute;ch 470m&nbsp;<br />\r\n&bull; Trường tiểu học L&yacute; Th&aacute;i Tổ l&agrave; 1,19km<br />\r\n&bull; Trường tiểu học Nam Trung Y&ecirc;n c&aacute;ch 1,18km&nbsp;<br />\r\n&bull; Trường THCS Nam Trung Y&ecirc;n khoảng 1,07km<br />\r\n&nbsp;Trường PTTH d&acirc;n lập Nguyễn Si&ecirc;u 760m&nbsp;<br />\r\n&bull; Trường Quốc tế Global Y&ecirc;n H&ograve;a c&aacute;ch 40m&nbsp;<br />\r\n&bull; Trường chuy&ecirc;n H&agrave; Nội Amsterdam l&agrave; 1,3km&nbsp;<br />\r\n&bull; Đại học kỹ thuật hậu cần CAND khoảng 550m&nbsp;<br />\r\n&bull; Trường nội tr&uacute; Nguyễn Viết Xu&acirc;n c&aacute;ch 600m&nbsp;<br />\r\n&bull; Trường Đại học Lao động X&atilde; hội : 890m&nbsp;<br />\r\n&bull; Trường Đại học Ngoại thương H&agrave; Nội l&agrave; 1km&nbsp;<br />\r\n&bull; Hệ thống bệnh viện, ph&ograve;ng kh&aacute;m chăm s&oacute;c sức khỏe người d&acirc;n như:&nbsp;<br />\r\n&bull; Bệnh viện Giao th&ocirc;ng vận tải TW c&aacute;ch 1km,&nbsp;<br />\r\n&bull; Viện huyết học v&agrave; truyền m&aacute;u TW c&aacute;ch 1,14km&nbsp;<br />\r\n&bull; Bệnh viện Nhi TW c&aacute;ch 1,3km&nbsp;<br />\r\n&bull; Bệnh viện Phụ sản H&agrave; Nội c&aacute;ch 1,3km&nbsp;<br />\r\nC&ugrave;ng với đ&oacute; l&agrave; gần si&ecirc;u thị, trung t&acirc;m mua sắm, bến xe, s&acirc;n vận động, c&ocirc;ng vi&ecirc;n&hellip; như Big C, The Maner, Grand Plaza, c&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a rất đẹp, bến xe Mỹ Đ&igrave;nh&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601365950_3.jpg', '1601365950_1.jpg|1601365950_2.jpg|1601365950_3.jpg|1601365950_4.jpg|1601365950_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 07:52:30', '2020-09-29 07:52:30'),
(389, 'Cho thuê căn 2PN giá 8.5tr tại Chung cư N02 Yên Hòa - Quận Cầu Giấy', 'cho-thue-can-2pn-gia-85tr-tai-chung-cu-n02-yen-hoa-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '70', 8500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội&nbsp;thất cơ bản&nbsp;gồm: điều h&ograve;a, giường, tủ bếp, tủ, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nT&ograve;a NO-02 nằm ở vị tr&iacute; trung t&acirc;m của c&aacute;c Khu đ&ocirc; thị đ&atilde; v&agrave; đang ho&agrave;n thiện như Trung Y&ecirc;n, Nam Trung Y&ecirc;n, Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, Dịch Vọng,&hellip; nơi c&oacute; hệ thống hạ tầng kỹ thuật đồng bộ, ho&agrave;n hảo.</p>\r\n\r\n<p>Với b&aacute;n k&iacute;nh chỉ trong v&ograve;ng 1 km, t&ograve;a nh&agrave; Y&ecirc;n H&ograve;a Condominium c&ograve;n l&agrave; trung t&acirc;m của c&aacute;c địa điểm thương mại sầm uất như Big C, Grand Plaza, Kengnam, Fivimart,&hellip;Ngo&agrave;i ra Chung cư N02 Y&ecirc;n H&ograve;a được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch khu đ&ocirc; thị Y&ecirc;n H&ograve;a như: C&ocirc;ng vi&ecirc;n Cầu Giấy, trường tiểu học Y&ecirc;n H&ograve;a, trường THCS Y&ecirc;n H&ograve;a, nh&agrave; văn h&oacute;a Y&ecirc;n H&ograve;a, chợ Hợp Nhất Trung K&iacute;nh&hellip;<br />\r\nChung cư N02 Y&ecirc;n H&ograve;a được thừa hưởng tiện &iacute;ch v&agrave; dịch vụ từ c&aacute;c dự &aacute;n xung quanh như:<br />\r\n&bull; Nh&agrave; trẻ phường Y&ecirc;n H&ograve;a c&aacute;ch 350m&nbsp;<br />\r\n&bull; Trường tiểu học Trung H&ograve;a c&aacute;ch 470m&nbsp;<br />\r\n&bull; Trường tiểu học L&yacute; Th&aacute;i Tổ l&agrave; 1,19km<br />\r\n&bull; Trường tiểu học Nam Trung Y&ecirc;n c&aacute;ch 1,18km&nbsp;<br />\r\n&bull; Trường THCS Nam Trung Y&ecirc;n khoảng 1,07km<br />\r\n&nbsp;Trường PTTH d&acirc;n lập Nguyễn Si&ecirc;u 760m&nbsp;<br />\r\n&bull; Trường Quốc tế Global Y&ecirc;n H&ograve;a c&aacute;ch 40m&nbsp;<br />\r\n&bull; Trường chuy&ecirc;n H&agrave; Nội Amsterdam l&agrave; 1,3km&nbsp;<br />\r\n&bull; Đại học kỹ thuật hậu cần CAND khoảng 550m&nbsp;<br />\r\n&bull; Trường nội tr&uacute; Nguyễn Viết Xu&acirc;n c&aacute;ch 600m&nbsp;<br />\r\n&bull; Trường Đại học Lao động X&atilde; hội : 890m&nbsp;<br />\r\n&bull; Trường Đại học Ngoại thương H&agrave; Nội l&agrave; 1km&nbsp;<br />\r\n&bull; Hệ thống bệnh viện, ph&ograve;ng kh&aacute;m chăm s&oacute;c sức khỏe người d&acirc;n như:&nbsp;<br />\r\n&bull; Bệnh viện Giao th&ocirc;ng vận tải TW c&aacute;ch 1km,&nbsp;<br />\r\n&bull; Viện huyết học v&agrave; truyền m&aacute;u TW c&aacute;ch 1,14km&nbsp;<br />\r\n&bull; Bệnh viện Nhi TW c&aacute;ch 1,3km&nbsp;<br />\r\n&bull; Bệnh viện Phụ sản H&agrave; Nội c&aacute;ch 1,3km&nbsp;<br />\r\nC&ugrave;ng với đ&oacute; l&agrave; gần si&ecirc;u thị, trung t&acirc;m mua sắm, bến xe, s&acirc;n vận động, c&ocirc;ng vi&ecirc;n&hellip; như Big C, The Maner, Grand Plaza, c&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a rất đẹp, bến xe Mỹ Đ&igrave;nh&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601366229_3.jpg', '1601366229_1.jpg|1601366229_2.jpg|1601366229_3.jpg|1601366229_4.jpg|1601366229_5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 07:57:09', '2020-09-29 07:57:09'),
(390, 'Cho thuê căn 2PN giá 9tr tại Chung cư E3B Trung Hòa Nhân Chính - Quận Cầu Giấy', 'cho-thue-can-2pn-gia-9tr-tai-chung-cu-e3b-trung-hoa-nhan-chinh-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '80', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tr&ecirc;n mặt phố Vũ Phạm H&agrave;m, chung cư E3B c&oacute; vị tr&iacute; thuận lợi cho cư d&acirc;n sinh sống v&agrave; l&agrave;m việc.&nbsp;</p>\r\n\r\n<p>Gần c&aacute;c trường đại học lớn như Đại học Luật H&agrave; Nội, Đại học Ngoại thương, Đại học Giao th&ocirc;ng Vận tải, Học viện Phụ nữ Việt Nam...; c&aacute;c c&ocirc;ng vi&ecirc;n lớn của H&agrave; Nội như c&ocirc;ng vi&ecirc;n Cầu Giấy, c&ocirc;ng vi&ecirc;n Thủ Lệ...</p>\r\n\r\n<p>Gần Trung t&acirc;m Hội nghị Quốc gia, Kangnam HN Landmark tower...</p>\r\n\r\n<p>Từ chung cư E3B dễ d&agrave;ng di chuyển ra đường L&aacute;ng, Nguyễn Khang, Ho&agrave;ng Đạo Th&uacute;y chỉ 3-4 ph&uacute;t l&aacute;i xe, đến đường L&ecirc; Văn Lương, Nguyễn Ch&iacute; Thanh chỉ 2-3 ph&uacute;t l&aacute;i xe. Xung quanh l&agrave; c&aacute;c TTTM v&agrave; si&ecirc;u thị lớn phục vụ nhu cầu sinh hoạt của cư d&acirc;n tại đ&acirc;y.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601366409_4.jpg', '1601366409_1.jpg|1601366409_2.jpg|1601366409_3.jpg|1601366409_4.jpg|1601366409_5.jpg|1601366409_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 08:00:09', '2020-09-29 08:00:09'),
(391, 'Cho thuê căn 2PN full nội thất giá 8tr tại Chung cư E3B Trung Hòa Nhân Chính - Quận Cầu Giấy', 'cho-thue-can-2pn-full-noi-that-gia-8tr-tai-chung-cu-e3b-trung-hoa-nhan-chinh-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '60', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 60m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm tr&ecirc;n mặt phố Vũ Phạm H&agrave;m, chung cư E3B c&oacute; vị tr&iacute; thuận lợi cho cư d&acirc;n sinh sống v&agrave; l&agrave;m việc.&nbsp;</p>\r\n\r\n<p>Gần c&aacute;c trường đại học lớn như Đại học Luật H&agrave; Nội, Đại học Ngoại thương, Đại học Giao th&ocirc;ng Vận tải, Học viện Phụ nữ Việt Nam...; c&aacute;c c&ocirc;ng vi&ecirc;n lớn của H&agrave; Nội như c&ocirc;ng vi&ecirc;n Cầu Giấy, c&ocirc;ng vi&ecirc;n Thủ Lệ...</p>\r\n\r\n<p>Gần Trung t&acirc;m Hội nghị Quốc gia, Kangnam HN Landmark tower...</p>\r\n\r\n<p>Từ chung cư E3B dễ d&agrave;ng di chuyển ra đường L&aacute;ng, Nguyễn Khang, Ho&agrave;ng Đạo Th&uacute;y chỉ 3-4 ph&uacute;t l&aacute;i xe, đến đường L&ecirc; Văn Lương, Nguyễn Ch&iacute; Thanh chỉ 2-3 ph&uacute;t l&aacute;i xe. Xung quanh l&agrave; c&aacute;c TTTM v&agrave; si&ecirc;u thị lớn phục vụ nhu cầu sinh hoạt của cư d&acirc;n tại đ&acirc;y.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601366505_3.jpg', '1601366505_1.jpg|1601366505_2.jpg|1601366505_3.jpg|1601366505_4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 08:01:45', '2020-09-29 08:01:45'),
(392, 'Cho thuê căn 2PN giá 8tr tại N04-B1 Thành Thái - Quận Cầu Giấy', 'cho-thue-can-2pn-gia-8tr-tai-n04-b1-thanh-thai-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '60', 8000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 60m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Chung Cư N04 B1 - Tọa lạc Tr&ecirc;n đường Th&agrave;nh Th&aacute;i, khu đ&ocirc; thị Dịch Vọng, Cầu Giấy, H&agrave; Nội. Chung Cư N04 B1 nằm trong quần thể khu đ&ocirc; thị mới Dịch Vọng bao gồm c&aacute;c t&ograve;a nh&agrave; như: Chung cư H&agrave; Đ&ocirc; Park View, Chung cư N04B2, chung cư N06, Chung cư N07B1, Chung cư N07B2, Chung cư N07B3, Chung Cư N09B1, Chung cư N09B2, Chung cư CC1...<br />\r\nVị tr&iacute; đắc địa cạnh c&ocirc;ng vi&ecirc;n Cầu Giấy bao gồm khu hồ nước ,c&acirc;y xanh , s&acirc;n chơi &hellip; l&agrave; nơi giải tr&iacute; , thể dục thể thao l&yacute; tưởng của dư d&acirc;n chung cư N04 B1.&nbsp;<br />\r\nC&ocirc;ng vi&ecirc;n Cầu Giấy đ&oacute;ng vai tr&ograve; l&aacute; phổi xanh cho to&agrave;n khu vực, sống tại đ&acirc;y sẽ được hưởng kh&ocirc;ng kh&iacute; trong l&agrave;nh v&agrave; tho&aacute;ng m&aacute;t, rất tốt cho việc thư gi&atilde;n chạy bộ trong c&ocirc;ng vi&ecirc;n. Chung cư N04 B1 nắm trọn cả kh&ocirc;ng gian trong tầm mắt, tầm nh&igrave;n kh&ocirc;ng giới hạn với hướng nh&igrave;n về ph&iacute;a c&ocirc;ng vi&ecirc;n.</p>\r\n\r\n<p>Với phương ch&acirc;m đem đến cho kh&aacute;ch h&agrave;ng một cuộc sống thoải m&aacute;i v&agrave; tiện nghi, c&aacute;c nh&agrave; l&agrave;m N04B1 Dịch Vọng - Cầu Giấy kh&ocirc;ng những ch&uacute; trọng đặc biệt đến thiết kế c&aacute;c căn hộ cho ph&ugrave; hợp với phong thủy m&agrave; c&ograve;n đem đến cho c&aacute;c kh&aacute;ch h&agrave;ng của m&igrave;nh một cuộc sống đầy đủ ngay ch&iacute;nh tại nơi đ&acirc;y m&agrave; kh&ocirc;ng phải đi bất cứ đ&acirc;u như: mua sắm, giải tr&iacute;, chăm s&oacute;c sức khỏe, l&agrave;m đẹp, tập luyện thể thao... C&aacute;c tiện &iacute;ch ngay tại dự &aacute;n gi&uacute;p bạn tiết kiệm nhiều thời gian, c&ocirc;ng sức v&agrave; tiền bạc sẽ n&acirc;ng tầm cuộc sống cho bạn.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601367217_3.jpg', '1601367217_1.jpg|1601367217_2.jpg|1601367217_3.jpg|1601367217_4.jpg|1601367217_5.jpg|1601367217_6.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 08:13:37', '2020-09-29 08:13:37'),
