r\n<p>C&aacute;c tiện &iacute;ch ngay tại dự &aacute;n gi&uacute;p bạn tiết kiệm nhiều thời gian, c&ocirc;ng sức v&agrave; tiền bạc sẽ n&acirc;ng tầm cuộc sống cho bạn.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601367908_thumb.jpg', '1601367908_2.jpg|1601367908_3.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 08:25:08', '2020-09-29 08:25:08'),
(395, 'Cho thuê căn 3PN full nội thất giá 12tr tại Chung cư Trung Yên 1 - Quận Cầu Giấy', 'cho-thue-can-3pn-full-noi-that-gia-12tr-tai-chung-cu-trung-yen-1-quan-cau-giay', 'Phường Dịch Vọng, Quận Cầu Giấy, TP Hà Nội', 2, '124', '96m', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 90m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh, sofa..<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nT&ograve;a nh&agrave; nằm trong khu đ&ocirc; thị mới Trung y&ecirc;n với cơ sở hạ tầng đồng bộ v&agrave; chỉ c&aacute;ch trung t&acirc;m th&agrave;nh phố khoảng 06 km. Với c&aacute;c trung t&acirc;m thương mại lớn nằm gần ngay t&ograve;a nh&agrave; như Bourbon-Thăng Long...</p>\r\n\r\n<p>Hệ thống giao th&ocirc;ng thuận tiện, ph&iacute;a T&acirc;y Bắc gi&aacute;p đường đi v&agrave;nh đai 3 rộng 30m, ph&iacute;a Đ&ocirc;ng Bắc gi&aacute;p đường nội bộ khu đ&ocirc; thị Trung Y&ecirc;n rộng 13,5m v&agrave; ph&iacute;a Nam gi&aacute;p đường Trung K&iacute;nh.</p>\r\n\r\n<p>Căn hộ tại Chung cư Trung y&ecirc;n 1 được thiết kế kh&ocirc;ng gian nội thất hiện đại,sang trọng; C&aacute;c căn hộ đều được tiếp x&uacute;c trực tiếp với thi&ecirc;n nhi&ecirc;n, tạo sự th&ocirc;ng tho&aacute;ng; Ph&ograve;ng giặt phơi được thiết kế ri&ecirc;ng; S&agrave;n ph&ograve;ng ngủ được l&aacute;t gỗ c&ocirc;ng nghiệp, cửa ra v&agrave;o l&agrave;m bằng, gỗ lim, cửa mặt ngo&agrave;i sử dụng cửa uPVC c&otilde; l&otilde;i th&eacute;p gia cường k&iacute;nh an to&agrave;n; Nh&agrave; vệ sinh được bố tr&iacute; thuận tiện giữa c&aacute;c ph&ograve;ng, thiết bị được sử dụng l&agrave; thiết bị của h&atilde;ng Toto Việt Nam hoặc tương đương...<br />\r\nC&aacute;c dịch vụ tiện &iacute;ch cuả t&ograve;a nh&agrave; như: Tầng hầm d&ugrave;ng l&agrave;m nơi đỗ xe an to&agrave;n, tiện lợi; Trung t&acirc;m thương mại, si&ecirc;u thị dưới sảnh tầng 1 phục vụ nhu cầu mua sắm; Kh&ocirc;ng giam sinh hoạt cộng đồng l&agrave; nơi bạn giao lưu với l&aacute;ng ri&ecirc;ng th&acirc;n thiện; Ph&ograve;ng dịch vụ y tế, chăm s&oacute;c sức khỏe; Ban quản l&yacute; t&ograve;a nh&agrave; chuy&ecirc;n nghiệp, lịch sự.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601368271_20200627202424-89a2_wm.jpg', '1601368271_20200627202422-bdc7_wm.jpg|1601368271_20200627202424-89a2_wm.jpg|1601368271_20200627202426-e7bb_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 08:31:11', '2020-09-29 08:31:11'),
