. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601370882_20200905170749-999d_wm.jpg', '1601370882_20200905170749-999d_wm.jpg|1601370882_20200905170756-8fa7_wm.jpg|1601370882_20200905170756-9f82_wm.jpg|1601370882_20200905170756-38e3_wm.jpg|1601370882_20200905170756-9075_wm.jpg|1601370882_20200905170757-0f7c_wm.jpg|1601370882_20200905170757-79c7_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 09:14:42', '2020-09-29 09:14:42'),
(400, 'Cho thuê căn 2PN full nội thất giá 12tr tại Mỹ Đình Plaza', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-my-dinh-plaza', '140 Trần Bình, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '27', '70', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh, sofa...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm trong khu vực ph&aacute;t triển bậc nhất quận Cầu Giấy &ndash; Mỹ Đ&igrave;nh, dự &aacute;n Mỹ Đ&igrave;nh Plaza 2 hứa hẹn sẽ đem đến cho cư d&acirc;n cuộc sống vi&ecirc;n m&atilde;n, tiện nghi, hiện đại với hệ thống tiện &iacute;ch đa dạng, c&aacute;c căn hộ thiết kế hợp l&yacute;, tinh tế.<br />\r\nTọa lạc ngay tại trung t&acirc;m Mỹ Đ&igrave;nh, Mỹ Đ&igrave;nh Plaza 2 sở hữu một vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, nơi thuận tiện kết nối giao th&ocirc;ng với c&aacute;c tuyến đường huyết mạch của th&agrave;nh phố: Phạm H&ugrave;ng &ndash; Phạm Văn Đồng, Hồ T&ugrave;ng Mậu &ndash; Xu&acirc;n Thủy &ndash; Cầu Giấy, tuyến Metro Nhổn &ndash; Ga H&agrave; Nội. Từ dự &aacute;n, c&aacute;c cư d&acirc;n cũng c&oacute; thể dễ d&agrave;ng tiếp cận đến c&aacute;c tiện &iacute;ch h&agrave;ng đầu của khu vực như TTTM The Garden, đại si&ecirc;u thị Metro, bệnh viện 198, Trung t&acirc;m Hội nghị Quốc gia, SVĐ Mỹ Đ&igrave;nh, Đại học Quốc Gia, Đại học FPT...</p>\r\n\r\n<p>Với 3 tầng hầm v&agrave; 4 tầng khối đế d&agrave;nh cho văn ph&ograve;ng, thương mại dịch vụ, dự &aacute;n hội tụ hệ thống tiện &iacute;ch cao cấp cho cư d&acirc;n: hầm để xe, trung t&acirc;m thương mại, nh&agrave; trẻ, nh&agrave; h&agrave;ng, caf&eacute;, ph&ograve;ng sinh hoạt cộng đồng. Khu&ocirc;n vi&ecirc;n tho&aacute;ng rộng, nhiều c&acirc;y xanh c&ugrave;ng với hệ thống s&acirc;n vườn, đi dạo tr&ecirc;n m&aacute;i của t&ograve;a nh&agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601371315_8.jpg', '1601371315_1.jpg|1601371315_2.jpg|1601371315_3.jpg|1601371315_4.jpg|1601371315_5.jpg|1601371315_6.jpg|1601371315_7.jpg|1601371315_8.jpg|1601371315_9.jpg|1601371315_10.jpg|1601371315_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 09:21:55', '2020-09-29 09:21:55'),
(401, 'Cho thuê căn 2PN giá 11tr tại Mỹ Đình Plaza', 'cho-thue-can-2pn-gia-11tr-tai-my-dinh-plaza', '140 Trần Bình, Phường Mỹ Đình 2, Nam Từ Liêm, Hà Nội', 2, '27', '70', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh,...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm trong khu vực ph&aacute;t triển bậc nhất quận Cầu Giấy &ndash; Mỹ Đ&igrave;nh, dự &aacute;n Mỹ Đ&igrave;nh Plaza 2 hứa hẹn sẽ đem đến cho cư d&acirc;n cuộc sống vi&ecirc;n m&atilde;n, tiện nghi, hiện đại với hệ thống tiện &iacute;ch đa dạng, c&aacute;c căn hộ thiết kế hợp l&yacute;, tinh tế.<br />\r\nTọa lạc ngay tại trung t&acirc;m Mỹ Đ&igrave;nh, Mỹ Đ&igrave;nh Plaza 2 sở hữu một vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, nơi thuận tiện kết nối giao th&ocirc;ng với c&aacute;c tuyến đường huyết mạch của th&agrave;nh phố: Phạm H&ugrave;ng &ndash; Phạm Văn Đồng, Hồ T&ugrave;ng Mậu &ndash; Xu&acirc;n Thủy &ndash; Cầu Giấy, tuyến Metro Nhổn &ndash; Ga H&agrave; Nội. Từ dự &aacute;n, c&aacute;c cư d&acirc;n cũng c&oacute; thể dễ d&agrave;ng tiếp cận đến c&aacute;c tiện &iacute;ch h&agrave;ng đầu của khu vực như TTTM The Garden, đại si&ecirc;u thị Metro, bệnh viện 198, Trung t&acirc;m Hội nghị Quốc gia, SVĐ Mỹ Đ&igrave;nh, Đại học Quốc Gia, Đại học FPT...</p>\r\n\r\n<p>Với 3 tầng hầm v&agrave; 4 tầng khối đế d&agrave;nh cho văn ph&ograve;ng, thương mại dịch vụ, dự &aacute;n hội tụ hệ thống tiện &iacute;ch cao cấp cho cư d&acirc;n: hầm để xe, trung t&acirc;m thương mại, nh&agrave; trẻ, nh&agrave; h&agrave;ng, caf&eacute;, ph&ograve;ng sinh hoạt cộng đồng. Khu&ocirc;n vi&ecirc;n tho&aacute;ng rộng, nhiều c&acirc;y xanh c&ugrave;ng với hệ thống s&acirc;n vườn, đi dạo tr&ecirc;n m&aacute;i của t&ograve;a nh&agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601371587_thumb.jpg', '1601371587_1.jpg|1601371587_2.jpg|1601371587_3.jpg|1601371587_4.jpg|1601371587_5.jpg|1601371587_6.jpg|1601371587_7.jpg|1601371587_8.jpg|1601371587_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 09:26:27', '2020-09-29 09:26:27'),
