agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601371781_z2099357338156_15063462e3d25912e24b4a2ae3de7f51.jpg', '1601371781_z2099357336978_4bb79a7a8ac3f9e8deb90ac030ee24ef.jpg|1601371781_z2099357336981_25fc3c68904c760a9bdf3aa473499b68.jpg|1601371781_z2099357336985_4c9506c4d83c31b8d8abb8c9333e51f5.jpg|1601371781_z2099357336989_138eaddece2db337a4dc588206cc6d77.jpg|1601371781_z2099357336997_304b151bd436d10e0db27e0689ec0fbf.jpg|1601371781_z2099357338150_3579991415917cd0ef40125c4cada096.jpg|1601371781_z2099357338156_15063462e3d25912e24b4a2ae3de7f51.jpg|1601371781_z2099357338162_27f89187fff25d1b3df9f22ed4d7089f.jpg|1601371781_z2099357338167_e3e0f00edcc69476e2077e3d756dd116.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-29 09:29:41', '2020-09-29 09:29:41'),
(403, 'Cho thuê căn 3PN giá 12tr tại Goldmark City Hồ Tùng Mậu', 'cho-thue-can-3pn-gia-12tr-tai-goldmark-city-ho-tung-mau', '136 Hồ Tùng Mậu, Phường Phú Diễn, Bắc Từ Liêm, Hà Nội', 2, '8', '110', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 110m2, t&ograve;a R1.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ&nbsp;bản: giường, tủ, điều h&ograve;a, n&oacute;ng lạnh, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Tọa lạc tại vị tr&iacute; đắc địa, nơi sẽ l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế của Thủ đ&ocirc; trong tương lai, đầu mối trung t&acirc;m kết nối c&aacute;c trục đường lớn. GoldMark City &ndash; nằm ngay tr&ecirc;n mặt đường Nguyễn Cơ Thạch k&eacute;o d&agrave;i, đối diện khu c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a Mai Dịch gần 2 ha đ&atilde; được quy hoạch. Một vị tr&iacute; đắc địa, một điểm cộng vượt trội cho Goldmark City.</p>\r\n\r\n<p>Đặc biệt, đ&acirc;y cũng l&agrave; nơi tập trung tất cả c&aacute;c tuyến xe li&ecirc;n tỉnh, đặc biệt l&agrave; c&aacute;c tỉnh ph&iacute;a Đ&ocirc;ng, ph&iacute;a Nam Thủ đ&ocirc; như Bắc Ninh, Hưng Y&ecirc;n, Hải Dương, H&agrave; Nam, Ninh B&igrave;nh, Th&aacute;i B&igrave;nh, Nam Định, Thanh H&oacute;a, Nghệ An&hellip;</p>\r\n\r\n<p>Dễ d&agrave;ng di chuyển đến c&aacute;c địa điểm bệnh viện, trường đại học, bến xe: C&aacute;ch Đại học Thương Mại, Đại học S&acirc;n khấu Điện ảnh, Đại học Quốc Gia, Đại học Ngoại ngữ 0.3km; C&aacute;ch bệnh viện 198 0.9km; đi xe m&aacute;y đến S&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3p;gần c&aacute;c si&ecirc;u thị Fivimart, Pico Plaza, Media mart&hellip; Chung cư TNR GoldMark City t&iacute;ch hợp hơn 20 tiện &iacute;ch đẳng cấp như: Khu vui chơi trẻ em, Trung t&acirc;m thương mại hiện đại, Bar &ndash; Caf&eacute;, Vườn BBQ ngo&agrave;i trời, Spa thư gi&atilde;n &ndash; X&ocirc;ng hơi, Ph&ograve;ng tập Gym hiện đại&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1601430655_f93028a3360bc955901a.jpg', '1601430655_0b9e110a0fa2f0fca9b3.jpg|1601430655_4ee0c87ed6d6298870c7.jpg|1601430655_5b7070fb6e53910dc842.jpg|1601430655_6efdf668e8c0179e4ed1.jpg|1601430655_83c8f456eafe15a04cef.jpg|1601430655_8435bbaaa5025a5c0313.jpg|1601430655_603144a65a0ea550fc1f.jpg|1601430655_65097994673c9862c12d.jpg|1601430655_c29a6d1273ba8ce4d5ab.jpg|1601430655_ce6ebcfba2535d0d0442.jpg|1601430655_d01af38aed22127c4b33.jpg|1601430655_e85966cb7863873dde72.jpg|1601430655_f7fd787466dc9982c0cd.jpg|1601430655_f93028a3360bc955901a.jpg|1601430655_z2100985630084_bfe197036f21abafe662fce18ff4b54e.jpg|1601430655_z2100985633147_9a7d2ee4ed9a424c6e37995234f64a8b.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 01:50:55', '2020-09-30 01:50:55'),
(404, 'CHO THUÊ CĂN 3PN FULL NỘI THẤT GIÁ 12TR TẠI KHU ĐÔ THỊ MỸ ĐÌNH SÔNG ĐÀ - SUDICO', 'cho-thue-can-3pn-full-noi-that-gia-12tr-tai-khu-do-thi-my-dinh-song-da-sudico', 'CHO THUÊ CĂN 3PN FULL NỘI THẤT GIÁ 12TR TẠI KHU ĐÔ THỊ MỸ ĐÌNH SÔNG ĐÀ - SUDICO', 2, '30', '118', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 118m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nKhu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; l&agrave; dự &aacute;n tổ hợp khu căn hộ chung cư Hà N&ocirc;̣i, biệt thự, nh&agrave; liền kề, trung t&acirc;m thương mại v&agrave; mặt bằng văn ph&ograve;ng hiện đại. Chung cư Mỹ Đ&igrave;nh - S&ocirc;ng Đ&agrave; nằm giữa khu vực đang được đ&ocirc; thị h&oacute;a với tốc độ cao. Đ&acirc;y l&agrave; dự &aacute;n c&oacute; vị tr&iacute; thuận lợi để ph&aacute;t triển một khu d&acirc;n cư mới phục vụ nhu cầu về nh&agrave; ở của cư d&acirc;n Thủ đ&ocirc;.<br />\r\nTừ đ&acirc;y d&acirc;n cư c&oacute; thể dễ d&agrave;ng di chuyển đến c&aacute;c khu vực trung t&acirc;m th&agrave;nh phố qua c&aacute;c tuyến đường huyết mạch c&ugrave;ng h&igrave;nh thức giao th&ocirc;ng đa dạng.&nbsp;Dự &aacute;n nằm gần với c&aacute;c tiện &iacute;ch như: Đại học kỹ thuật &ndash; Hậu cần c&ocirc;ng an nh&acirc;n d&acirc;n, Đại học d&acirc;n lập Phương Đ&ocirc;ng, Trường trung học cơ sở Mễ Tr&igrave;, Trường mầm non Mỹ Đ&igrave;nh, Trường THPT Đo&agrave;n Thị Điểm, Trường đại học FPT, Bệnh viện thể thao Việt Nam, Bệnh viện 19-8, Bệnh viện đa khoa y học cổ truyền,Viện huyết học v&agrave; truyền m&aacute;u trung ương, C&ocirc;ng vi&ecirc;n Cầu Giấy.</p>\r\n\r\n<p>Khu đ&ocirc; thị Mỹ Đ&igrave;nh S&ocirc;ng Đ&agrave; được c&aacute;c nh&agrave; đầu tư cũng như kh&aacute;ch h&agrave;ng đ&aacute;nh gi&aacute; cao về tiện &iacute;ch nội v&agrave; ngoại khu. Dự &aacute;n được Sudico đầu tư x&acirc;y dựng với c&aacute;c hạng mục tiện &iacute;ch phục vụ nhu cầu của d&acirc;n cư.Dự &aacute;n mang đến kh&ocirc;ng gian sống đ&aacute;ng mơ ước cho c&aacute;c hộ gia đ&igrave;nh với thiết kế th&ocirc;ng minh. Tại đ&acirc;y bạn v&agrave; c&aacute;c th&agrave;nh vi&ecirc;n trong gia đ&igrave;nh c&oacute; thể tận hưởng c&aacute;c tiện &iacute;ch sống ho&agrave;n thiện.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601430905_17d38cf4145ceb02b24d.jpg', '1601430905_0ac689cd1165ee3bb774.jpg|1601430905_17d38cf4145ceb02b24d.jpg|1601430905_0999cd5f56f7a9a9f0e6.jpg|1601430905_8297e5737edb8185d8ca.jpg|1601430905_abe22627bc8f43d11a9e.jpg|1601430905_b2daef1174b98be7d2a8.jpg|1601430905_b59fc0645bcca492fddd.jpg|1601430905_c76b347facd753890ac6.jpg|1601430905_c2613ab8a0105f4e0601.jpg|1601430905_d537cc92573aa864f12b.jpg|1601430905_e4a8951d0eb5f1eba8a4.jpg|1601430905_f74cfebe64169b48c207.jpg|1601430905_z2101146368153_355f3c593f6d60872ed3341d0fca8f4b.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 01:55:05', '2020-09-30 01:55:05'),
(405, 'Cho thuê căn 3PN full nội thất giá 18tr tại Imperia Garden Nguyễn Huy Tưởng', 'cho-thue-can-3pn-full-noi-that-gia-18tr-tai-imperia-garden-nguyen-huy-tuong', '115 Nguyễn Huy Tưởng, P. Thanh Xuân Trung,Q. Thanh Xuân, Hà Nội', 2, '43', '95', 18000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 95m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nToạ lạc tr&ecirc;n trục đường Nguyễn Huy Tưởng thuộc Quận Thanh Xu&acirc;n &ndash; H&agrave; Nội, thuộc khu vực trung t&acirc;m kinh tế mới tại quận Thanh Xu&acirc;n &ndash; Cầu Giấy, Chung cư Imperia được hưởng trọn vẹn những li&ecirc;n kết v&ugrave;ng đầy đủ tiện &iacute;ch nhất, trường mẫu gi&aacute;o , tiểu học, trung học, đại học chỉ c&aacute;ch c&oacute; v&agrave;i chục đến v&agrave;i trăm m&eacute;t, chợ Nh&acirc;n Ch&iacute;nh, Big C&hellip;<br />\r\nTừ vị tr&iacute; của t&ograve;a nh&agrave; c&oacute; thể dễ d&agrave;ng kết nối với h&agrave;ng loạt c&aacute;c t&ograve;a chung cư cao cấp, hiện đại l&acirc;n cận như: Thăng Long Number One, Hapulico Complex, Royal City Nguyễn Tr&atilde;i, Golden Land Nguyễn Tr&atilde;i .Đặc biệt vị tr&iacute; chung cư Imperia Garden rất gần với điểm bắt t&agrave;u điện tr&ecirc;n kh&ocirc;ng dọc đường Nguyễn Tr&atilde;i, chắc chắn sẽ l&agrave;m tăng gi&aacute; trị của khu căn hộ hạng sang v&agrave; đồng bộ nhất quận Thanh Xu&acirc;n. Chỉ mất &iacute;t ph&uacute;t để đi tới c&aacute;c trục đường lớn: Đường Nguyễn Tr&atilde;i, Đường V&agrave;nh đai 3. C&aacute;c địa điểm lớn như: Si&ecirc;u thị BigC, Bến Xe Mỹ Đ&igrave;nh, S&acirc;n vận động quốc gia Mỹ Đ&igrave;nh, chung cư Grand Plaza, Chung cư 88 L&aacute;ng Hạ,&hellip;</p>\r\n\r\n<p>Được x&acirc;y dựng như một đ&ocirc; thị kiểu mẫu, Imperia Garden 203 Nguyễn Huy Tưởng mang đến cho cư d&acirc;n một hệ thống hạ tầng tiện &iacute;ch v&agrave; dịch vụ đồng bộ, kh&eacute;p k&iacute;n bao gồm: bể bơi 4 m&ugrave;a, bể bơi ngo&agrave;i trời, khu tập gym, khu vui chơi trẻ em, khu dưỡng sinh,chuỗi tiện &iacute;ch thương mại, hầm đỗ xe th&ocirc;ng minh, an ninh 3 lớp&hellip; tất cả nhằm tạo n&ecirc;n m&ocirc;i trường sống chất lượng cho cư d&acirc;n.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 18tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601431460_z2100297249939_2de3027d495aaebdd1f4c87b84e8a761.jpg', '1601431460_4ded785604f9fba7a2e8.jpg|1601431460_5ce9645418fbe7a5beea.jpg|1601431460_5e07cdbdb1124e4c1703.jpg|1601431460_849eb422c88d37d36e9c.jpg|1601431460_z2100297249939_2de3027d495aaebdd1f4c87b84e8a761.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 02:04:20', '2020-09-30 02:07:57'),
