(432, 'Cho thuê căn 3PN full nội thất giá 11tr tại Chung cư C6 Nguyễn Cơ Thạch - Mỹ Đình', 'cho-thue-can-3pn-full-noi-that-gia-11tr-tai-chung-cu-c6-nguyen-co-thach-my-dinh', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '105', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng&nbsp;105m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư C6 Nguyễn Cơ Thạch&nbsp;nằm ở vị tr&iacute; trung t&acirc;m khu vực h&agrave;nh ch&iacute;nh Mỹ Đ&igrave;nh, dự &aacute;n được thừa hưởng lợi thế từ những c&ocirc;ng tr&igrave;nh tiện &iacute;ch, hạ tầng đồng bộ, hiện đại của c&aacute;c dự &aacute;n, c&ocirc;ng tr&igrave;nh liền kề, từ c&ocirc;ng vi&ecirc;n c&acirc;y xanh, cho đến c&aacute;c tiện &iacute;ch trường học, bệnh viện, kh&aacute;ch sạn, bến xe.</p>\r\n\r\n<p>B&ecirc;n cạnh c&aacute;c tiện &iacute;ch nội khu, cư d&acirc;n của dự &aacute;n&nbsp;c&ograve;n được hưởng c&aacute;c tiện &iacute;ch b&ecirc;n ngo&agrave;i dự &aacute;n: như trường học (gần c&aacute;c trường đại học Thương Mại, đại học Quốc gia H&agrave; Nội, Đại học Ngoại ngữ&hellip;), bệnh viện (bệnh viện Thể thao, bệnh viện 19 &ndash; 8)...</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601440740_1.jpg', '1601440740_1.jpg|1601440740_2.jpg|1601440740_3.jpg|1601440740_4.jpg|1601440740_5.jpg|1601440740_6.jpg|1601440740_7.jpg|1601440740_8.jpg|1601440740_9.jpg|1601440740_10.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 04:39:00', '2020-09-30 04:39:00');
