(433, 'Cho thuê căn 2PN giá 9tr tại Mon City Mỹ Đình', 'cho-thue-can-2pn-gia-9tr-tai-mon-city-my-dinh', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '65', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ t&ograve;a B,&nbsp;rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Nội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Dự &aacute;n quy hoạch th&agrave;nh một khu phố nhỏ sầm uất giữa mảnh đất v&agrave;ng, tiện lợi cho việc sinh sống v&agrave; kinh doanh. Gồm c&aacute;c c&ocirc;ng tr&igrave;nh hỗn hợp cao tầng với tầng hầm li&ecirc;n th&ocirc;ng, c&aacute;c tầng thương mại đẳng cấp, c&aacute;c khu vực dịch vụ, vui chơi phong ph&uacute;.</p>\r\n\r\n<p>Dự &aacute;n Mon City sở hữu vị tr&iacute; v&agrave;ng đắc địa với 03 mặt tiền tiếp gi&aacute;p với những con đường đẹp nhất Mỹ Đ&igrave;nh &ndash; v&ugrave;ng đất c&oacute; nhiều tiềm năng ph&aacute;t triển v&agrave; đang ng&agrave;y c&agrave;ng trở n&ecirc;n thịnh vượng.</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Nam l&agrave; đường L&ecirc; Đức Thọ</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Nam l&agrave; đường H&agrave;m Nghi</p>\r\n\r\n<p>&bull; Ph&iacute;a T&acirc;y Bắc l&agrave; đường Nguyễn Cơ Thạch</p>\r\n\r\n<p>&bull; Ph&iacute;a Đ&ocirc;ng Bắc l&agrave; c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Mai Dịch rộng 17ha</p>\r\n\r\n<p>HD Mon City nằm ở vị tr&iacute; trung t&acirc;m khu vực h&agrave;nh ch&iacute;nh nơi Mỹ Đ&igrave;nh, dự &aacute;n được thừa hưởng lợi thế từ những c&ocirc;ng tr&igrave;nh tiện &iacute;ch, hạ tầng đồng bộ, hiện đại của c&aacute;c dự &aacute;n, c&ocirc;ng tr&igrave;nh liền kề, từ c&ocirc;ng vi&ecirc;n c&acirc;y xanh, cho đến c&aacute;c tiện &iacute;ch trường học, bệnh viện, kh&aacute;ch sạn, bến xe. B&ecirc;n cạnh c&aacute;c tiện &iacute;ch nội khu, cư d&acirc;n của dự &aacute;n HD Mon City c&ograve;n được hưởng c&aacute;c tiện &iacute;ch b&ecirc;n ngo&agrave;i dự &aacute;n: như trường học (gần c&aacute;c trường đại học Thương Mại, đại học Quốc gia H&agrave; Nội, Đại học Ngoại ngữ&hellip;), bệnh viện (bệnh viện Thể thao, bệnh viện 19 &ndash; 8,&hellip;),&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601441043_55cf3ab54ae07d0276b465fe5b2748b9-2686510941312414171.jpg', '1601441043_55cf3ab54ae07d0276b465fe5b2748b9-2686510941312414171.jpg|1601441043_8846409c88b5d1b3cd3bce69f0a195fc-2686510941045570756.jpg|1601441043_edb485ad7793c586adb2f5c258209e63-2686510940592520388.jpg|1601441043_f87365c5b187966a02b2bffe88f9170f-2686510940746774111.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 04:44:03', '2020-09-30 04:44:03'),
