B&ecirc;n cạnh c&aacute;c tiện &iacute;ch nội khu, cư d&acirc;n của dự &aacute;n HD Mon City c&ograve;n được hưởng c&aacute;c tiện &iacute;ch b&ecirc;n ngo&agrave;i dự &aacute;n: như trường học (gần c&aacute;c trường đại học Thương Mại, đại học Quốc gia H&agrave; Nội, Đại học Ngoại ngữ&hellip;), bệnh viện (bệnh viện Thể thao, bệnh viện 19 &ndash; 8,&hellip;),&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 8.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601451858_20190904153929-c7ae_wm.jpg', '1601451859_20190904153929-b3a7_wm.jpg|1601451859_20190904153929-c7ae_wm.jpg|1601451859_20190904153929-eaf9_wm.jpg|1601451859_20190904153930-8d8b_wm.jpg|1601451859_20190904153930-9090_wm.jpg|1601451859_20190904153930-a83a_wm.jpg|1601451859_20190904153930-e8a0_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 07:44:19', '2020-09-30 07:44:19'),
(441, 'Cho thuê căn 2PN full nội thất giá 11tr tại Mỹ Đình Plaza', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-my-dinh-plaza', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '70', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm trong khu vực ph&aacute;t triển bậc nhất quận Cầu Giấy &ndash; Mỹ Đ&igrave;nh, dự &aacute;n Mỹ Đ&igrave;nh Plaza 2 hứa hẹn sẽ đem đến cho cư d&acirc;n cuộc sống vi&ecirc;n m&atilde;n, tiện nghi, hiện đại với hệ thống tiện &iacute;ch đa dạng, c&aacute;c căn hộ thiết kế hợp l&yacute;, tinh tế.<br />\r\nTọa lạc ngay tại trung t&acirc;m Mỹ Đ&igrave;nh, Mỹ Đ&igrave;nh Plaza 2 sở hữu một vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, nơi thuận tiện kết nối giao th&ocirc;ng với c&aacute;c tuyến đường huyết mạch của th&agrave;nh phố: Phạm H&ugrave;ng &ndash; Phạm Văn Đồng, Hồ T&ugrave;ng Mậu &ndash; Xu&acirc;n Thủy &ndash; Cầu Giấy, tuyến Metro Nhổn &ndash; Ga H&agrave; Nội. Từ dự &aacute;n, c&aacute;c cư d&acirc;n cũng c&oacute; thể dễ d&agrave;ng tiếp cận đến c&aacute;c tiện &iacute;ch h&agrave;ng đầu của khu vực như TTTM The Garden, đại si&ecirc;u thị Metro, bệnh viện 198, Trung t&acirc;m Hội nghị Quốc gia, SVĐ Mỹ Đ&igrave;nh, Đại học Quốc Gia, Đại học FPT...</p>\r\n\r\n<p>Với 3 tầng hầm v&agrave; 4 tầng khối đế d&agrave;nh cho văn ph&ograve;ng, thương mại dịch vụ, dự &aacute;n hội tụ hệ thống tiện &iacute;ch cao cấp cho cư d&acirc;n: hầm để xe, trung t&acirc;m thương mại, nh&agrave; trẻ, nh&agrave; h&agrave;ng, caf&eacute;, ph&ograve;ng sinh hoạt cộng đồng. Khu&ocirc;n vi&ecirc;n tho&aacute;ng rộng, nhiều c&acirc;y xanh c&ugrave;ng với hệ thống s&acirc;n vườn, đi dạo tr&ecirc;n m&aacute;i của t&ograve;a nh&agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601452093_z2099357338156_15063462e3d25912e24b4a2ae3de7f51.jpg', '1601452093_z2099357336978_4bb79a7a8ac3f9e8deb90ac030ee24ef.jpg|1601452093_z2099357336981_25fc3c68904c760a9bdf3aa473499b68.jpg|1601452093_z2099357336985_4c9506c4d83c31b8d8abb8c9333e51f5.jpg|1601452093_z2099357336989_138eaddece2db337a4dc588206cc6d77.jpg|1601452093_z2099357336997_304b151bd436d10e0db27e0689ec0fbf.jpg|1601452093_z2099357338150_3579991415917cd0ef40125c4cada096.jpg|1601452093_z2099357338156_15063462e3d25912e24b4a2ae3de7f51.jpg|1601452093_z2099357338162_27f89187fff25d1b3df9f22ed4d7089f.jpg|1601452093_z2099357338167_e3e0f00edcc69476e2077e3d756dd116.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 07:48:13', '2020-09-30 07:48:13'),
(442, 'Cho thuê căn 2PN giá 9tr tại Mỹ Đình Plaza', 'cho-thue-can-2pn-gia-9tr-tai-my-dinh-plaza', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '65', 9000000, 0, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm trong khu vực ph&aacute;t triển bậc nhất quận Cầu Giấy &ndash; Mỹ Đ&igrave;nh, dự &aacute;n Mỹ Đ&igrave;nh Plaza 2 hứa hẹn sẽ đem đến cho cư d&acirc;n cuộc sống vi&ecirc;n m&atilde;n, tiện nghi, hiện đại với hệ thống tiện &iacute;ch đa dạng, c&aacute;c căn hộ thiết kế hợp l&yacute;, tinh tế.<br />\r\nTọa lạc ngay tại trung t&acirc;m Mỹ Đ&igrave;nh, Mỹ Đ&igrave;nh Plaza 2 sở hữu một vị tr&iacute; &ldquo;v&agrave;ng&rdquo;, nơi thuận tiện kết nối giao th&ocirc;ng với c&aacute;c tuyến đường huyết mạch của th&agrave;nh phố: Phạm H&ugrave;ng &ndash; Phạm Văn Đồng, Hồ T&ugrave;ng Mậu &ndash; Xu&acirc;n Thủy &ndash; Cầu Giấy, tuyến Metro Nhổn &ndash; Ga H&agrave; Nội. Từ dự &aacute;n, c&aacute;c cư d&acirc;n cũng c&oacute; thể dễ d&agrave;ng tiếp cận đến c&aacute;c tiện &iacute;ch h&agrave;ng đầu của khu vực như TTTM The Garden, đại si&ecirc;u thị Metro, bệnh viện 198, Trung t&acirc;m Hội nghị Quốc gia, SVĐ Mỹ Đ&igrave;nh, Đại học Quốc Gia, Đại học FPT...</p>\r\n\r\n<p>Với 3 tầng hầm v&agrave; 4 tầng khối đế d&agrave;nh cho văn ph&ograve;ng, thương mại dịch vụ, dự &aacute;n hội tụ hệ thống tiện &iacute;ch cao cấp cho cư d&acirc;n: hầm để xe, trung t&acirc;m thương mại, nh&agrave; trẻ, nh&agrave; h&agrave;ng, caf&eacute;, ph&ograve;ng sinh hoạt cộng đồng. Khu&ocirc;n vi&ecirc;n tho&aacute;ng rộng, nhiều c&acirc;y xanh c&ugrave;ng với hệ thống s&acirc;n vườn, đi dạo tr&ecirc;n m&aacute;i của t&ograve;a nh&agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601452297_20190413093504-960d_wm.jpg', '1601452297_20190413093458-8324_wm.jpg|1601452297_20190413093504-1c33_wm.jpg|1601452297_20190413093504-960d_wm.jpg|1601452297_20190413093504-be6e_wm.jpg|1601452297_20190413093505-71e8_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 07:51:37', '2020-09-30 07:51:37'),
