irc;n m&aacute;i của t&ograve;a nh&agrave; sẽ tạo kh&ocirc;ng gian l&yacute; tưởng để mỗi cư d&acirc;n c&oacute; thể vui chơi, tập thể dục hay thư gi&atilde;n sau mỗi ng&agrave;y d&agrave;i l&agrave;m việc vất vả.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601452526_20200702140735-4cc5_wm.jpg', '1601452526_20200702140734-5a94_wm.jpg|1601452526_20200702140735-3bfd_wm.jpg|1601452526_20200702140735-4cc5_wm.jpg|1601452526_20200702140735-92d6_wm.jpg|1601452526_20200702140735-98e9_wm.jpg|1601452526_20200702140735-eccf_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 07:55:26', '2020-09-30 07:55:26'),
(444, 'Cho thuê căn 2PN full nội thất giá 9tr tại Chung cư MHDI Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-9tr-tai-chung-cu-mhdi-my-dinh', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '70', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư MHDI 1 Mỹ Đ&igrave;nh tọa lạc tại ng&atilde; tư L&ecirc; Đức Thọ - Trần Hữu Dực thuộc Phường Mỹ Đ&igrave;nh II, Quận Nam Từ Li&ecirc;m, Th&agrave;nh Phố H&agrave; Nội.&nbsp;Nơi tập trung nhiều vận động vi&ecirc;n cấp cao, trường học quốc tế, gần khu d&acirc;n cư đ&atilde; ph&aacute;t triển v&agrave; h&igrave;nh th&agrave;nh từ l&acirc;u, tập trung nhiều văn ph&ograve;ng v&agrave; trung t&acirc;m thương mại, dịch vụ lớn như: kh&aacute;ch sạn Crown Plaza Complex, Trụ sở tập đo&agrave;n Viettel, Vạn Hoa club, si&ecirc;u thị Fivimax.&nbsp;</p>\r\n\r\n<p>Hệ thống tiện &iacute;ch được ho&agrave;n thiện đồng bộ, Chung cư MHDI Mỹ Đ&igrave;nh đ&aacute;p ứng đầy đủ cho kh&aacute;ch h&agrave;ng hệ thống tiện &iacute;ch: hệ thống trung t&acirc;m thương mại, hệ thống bể bơi bốn m&ugrave;a, khu&ocirc;n vi&ecirc;n c&acirc;y xanh, kh&ocirc;ng gian xanh rộng r&atilde;i ph&iacute;a dưới dự &aacute;n sẽ l&agrave; nơi vui chơi v&agrave; sinh hoạt cộng đồng&hellip;</p>\r\n\r\n<p>Khu trung t&acirc;m thương mại tại MHDI L&ecirc; Đức Thọ được thiết kế với kh&ocirc;ng gian rộng r&atilde;i, tho&aacute;ng m&aacute;t với nhiều thương hiệu nổi tiếng trong nước cũng như quốc tế, khu trung t&acirc;m thương mại sẽ đ&aacute;p ứng được nhu cầu mua sắm của mọi gia đ&igrave;nh.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601452707_2.jpg', '1601452707_1.jpg|1601452707_2.jpg|1601452707_3.jpg|1601452707_4.jpg|1601452707_5.jpg|1601452707_6.jpg|1601452707_7.jpg|1601452707_8.jpg|1601452707_9.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 07:58:27', '2020-09-30 07:58:27'),
