/>\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601453079_20200829150817-a56a_wm.jpg', '1601453079_20200829150817-a56a_wm.jpg|1601453079_20200829150819-4652_wm.jpg|1601453079_20200829150823-6f09_wm.jpg|1601453079_20200829150826-8e26_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 08:04:39', '2020-09-30 08:04:39'),
