(452, 'Cho thuê căn 3PN giá 10.5tr tại CC FLC Green Apartment 18 Phạm Hùng - Mỹ Đình', 'cho-thue-can-3pn-gia-105tr-tai-cc-flc-green-apartment-18-pham-hung-my-dinh', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '80', 10500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, 02&nbsp;nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư FLC Green Home tọa lạc tại một trong những vị tr&iacute; đẹp nhất khu vực ph&iacute;a T&acirc;y H&agrave; Nội. Nằm tr&ecirc;n mặt đường của một trong những tuyến giao th&ocirc;ng huyết mạch v&agrave; tấp nập bậc nhất Thủ đ&ocirc;, cạnh hai c&ocirc;ng vi&ecirc;n lớn Cầu Giấy v&agrave; hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh.&nbsp;</p>\r\n\r\n<p>Từ dự &aacute;n qu&yacute; kh&aacute;ch di chuyển theo đường Xu&acirc;n Thủy Cầu Giấy để đi v&agrave;o nội th&agrave;nh c&aacute;c quận l&acirc;n cận như &ndash; Cầu Giấy &ndash; Đống Đa &ndash; Ba Đ&igrave;nh &ndash; Thanh Xu&acirc;n&hellip;Dự &aacute;n nằm tiếp gi&aacute;p ngay với tuyến đường sắt tr&ecirc;n cao sẽ tiết kiệm tối đa thời gian di chuyển của kh&aacute;ch h&agrave;ng.</p>\r\n\r\n<p>FLC Green Home nằm tiếp gi&aacute;p với rất nhiều cơ quan kinh tế &ndash; ch&iacute;nh trị &ndash; văn h&oacute;a của thủ đ&ocirc; H&agrave; Nội thuận tiện cho việc c&ocirc;ng t&aacute;c cũng như n&acirc;ng cao chất lượng cuộc sống cho cư d&acirc;n : Trung t&acirc;m hội nghị quốc gia, kh&aacute;ch sạn Grand Palaza, BigC, Trường ĐH Sư Phạm , ĐH C&ocirc;ng Nghiệp, ĐH S&acirc;n Khấu Điện Ảnh, Trường Amsetdam H&agrave; Nội&hellip; Dự &aacute;n nằm ngay cạnh bến xe Mỹ Đ&igrave;nh 1, 2 gi&uacute;p cho qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể đi c&ocirc;ng t&aacute;c cũng như về qu&ecirc; của m&igrave;nh nhanh ch&oacute;ng v&agrave; tiện lợi nhất.</p>\r\n\r\n<p>Dự &aacute;n chung cư FLC Green Home 18 Phạm H&ugrave;ng được chủ đầu tư t&iacute;ch hợp v&agrave; bố tr&iacute; những tiện &iacute;ch cực kỳ th&ocirc;ng minh v&agrave; hiện đại với mong muốn đem lại cho cư d&acirc;n tương lai một cuộc sống tiện nghi đầy đủ mang sắc th&aacute;i tận hưởng cuộc sống cho kh&aacute;ch h&agrave;ng. Tiện &iacute;ch m&agrave; những cư d&acirc;n khi về ở tại chung cư FLC Green Home được tận hưởng sẽ thật đẳng cấp với bể bơi, ph&ograve;ng kh&aacute;m cao cấp, si&ecirc;u thị, ng&acirc;n h&agrave;ng, spa, trường mầm non,&hellip;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;10.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1601455746_20200728081035-9501_wm.jpg', '1601455746_20200728081035-70a1_wm.jpg|1601455746_20200728081035-9501_wm.jpg|1601455746_20200728081036-dcfc_wm.jpg|1601455746_20200728081048-d2f2_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 08:49:06', '2020-09-30 08:52:46'),
