(456, 'Cho thuê căn 2PN full nội thất giá 11tr tại CC FLC Complex 36 Phạm Hùng - Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-cc-flc-complex-36-pham-hung-my-dinh', 'Phường Mỹ Đình 1 - Mỹ Đình 2, Q. Nam Từ Liêm, Hà Nội', 2, '125', '65', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nVị tr&iacute; của dự &aacute;n FLC Complex được xem l&agrave; một những vị tr&iacute; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội. Nằm tr&ecirc;n mặt đường của một trong những n&uacute;t giao th&ocirc;ng huyết mạch tấp nập h&agrave;ng đầu thu đ&ocirc; H&agrave; Nội. Căn hộ nằm ngay cạnh hai c&ocirc;ng vi&ecirc;n lớn Cầu Giấy v&agrave; Nh&acirc;n Ch&iacute;nh. Dự &aacute;n cũng được bao quanh bởi c&aacute;c khu văn ph&ograve;ng cao cấp như phố Duy T&acirc;n, KeangNam, Indochina Plaza c&ugrave;ng với c&aacute;c trường học v&agrave; bệnh viện.</p>\r\n\r\n<p>Dự &aacute;n nằm tiếp gi&aacute;p ngay với tuyến đường sắt tr&ecirc;n cao sẽ tiết kiệm tối đa thời gian di chuyển của kh&aacute;ch h&agrave;ng. Dự &aacute;n nằm ngay cạnh bến xe Mỹ Đ&igrave;nh 1, 2 gi&uacute;p cho qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể đi c&ocirc;ng t&aacute;c cũng như về qu&ecirc; của m&igrave;nh nhanh ch&oacute;ng v&agrave; tiện lợi nhất. FLC Complex nằm tiếp gi&aacute;p với rất nhiều cơ quan kinh tế &ndash; ch&iacute;nh trị &ndash; văn h&oacute;a của thủ đ&ocirc; H&agrave; Nội thuận tiện cho việc c&ocirc;ng t&aacute;c cũng như n&acirc;ng cao chất lượng cuộc sống cho cư d&acirc;n : Trung t&acirc;m hội nghị quốc gia, kh&aacute;ch sạn Grand Palaza, BigC, Trường ĐH Sư Phạm , ĐH C&ocirc;ng Nghiệp, ĐH S&acirc;n Khấu Điện Ảnh, Trường Amsetdam H&agrave; Nội&hellip;</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch xung quanh t&ograve;a chung cư FLC Complex 36 Phạm H&ugrave;ng đều to&aacute;t l&ecirc;n một kh&ocirc;ng gian sống ti&ecirc;n nghi, thư gi&atilde;n nghỉ ngơi sau những giờ l&agrave;m việc căng thẳng. Tại đ&acirc;y cũng được x&acirc;y dựng c&aacute;c dịch vụ kh&aacute;c như khu tập thể thao, trung t&acirc;m thương mại, bể bơi, nh&agrave; trẻ, s&acirc;n đậu trực thăng.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601457036_1.jpg', '1601457037_1.jpg|1601457037_2.jpg|1601457037_3.jpg|1601457037_4.jpg|1601457037_5.jpg|1601457037_6.jpg|1601457037_7.jpg|1601457037_8.jpg|1601457037_9.jpg|1601457037_10.jpg|1601457037_11.jpg|1601457037_12.jpg|1601457037_13.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-09-30 09:10:37', '2020-09-30 09:14:55'),
