(460, 'CHO THUÊ CĂN 2PN FULL NỘI THẤT GIÁ 10TR TẠI GREEN STAR PHẠM VĂN ĐỒNG', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-green-star-pham-van-dong', 'Số 234 Phạm Văn Đồng, Phường Cổ Nhuế 1, Bắc Từ Liêm, Hà Nội', 2, '11', '68.8', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ t&ograve;a A1, rộng 68.8m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nGreen Stars tọa lạc tại số 234 Phạm Văn Đồng, Từ Li&ecirc;m, được mệnh danh l&agrave; cửa ng&otilde; T&acirc;y Bắc của thủ đ&ocirc; H&agrave; Nội, nơi đ&acirc;y tập trung d&acirc;n cư đ&ocirc;ng đ&uacute;c.</p>\r\n\r\n<p>C&aacute;ch s&acirc;n bay Quốc tế Nội B&agrave;i 20km, nằm giao thoa giữa c&aacute;c tuyến đường lớn như: Phạm Văn Đồng, Ho&agrave;ng Quốc Việt, Cầu Giấy, Phạm H&ugrave;ng, Hồ T&ugrave;ng Mậu. Với vị tr&iacute; đắc địa thuận tiện n&agrave;y, d&acirc;n cư nơi đ&acirc;y c&oacute; thể thuận tiện đi lại v&agrave;o nội th&agrave;nh chỉ mất 15 ph&uacute;t.</p>\r\n\r\n<p>Dự &aacute;n Green Stars nằm ngay trong l&ograve;ng một khu đ&ocirc; thị mới đại diện cho m&ocirc;i trường sống chất lượng cao của tương lai. L&agrave; hạt nh&acirc;n của th&agrave;nh phố giao lưu, nơi đ&acirc;y được thiết kế đặc biệt để t&ocirc;n l&ecirc;n m&agrave;u xanh của thi&ecirc;n nhi&ecirc;n, đất trời.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nổi bật của dự &aacute;n Th&agrave;nh Phố Giao Lưu &ndash; Chung cư Green Stars: Trường li&ecirc;n cấp từ mẫu gi&aacute;o đến cấp 3, 3 tầng TTTM v&agrave; c&aacute;c dịch vụ tiện &iacute;ch, Si&ecirc;u thị Metro. Điểm nhấn của khu đ&ocirc; thị n&agrave;y l&agrave; c&oacute; hồ điều h&ograve;a rộng 18ha, được thiết kế m&ecirc; cung, th&aacute;c nước, bể bơi, c&ocirc;ng vi&ecirc;n c&acirc;y xanh, tạo một kh&ocirc;ng gian tho&aacute;ng m&aacute;t v&agrave; l&agrave;m dịu những ng&agrave;y h&egrave; n&oacute;ng bức cho cả khu d&acirc;n cư sinh sống tại đ&acirc;y.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601604325_b664fae01559ea07b348.jpg', '1601604325_04ec0f6fe0d61f8846c7.jpg|1601604325_34ddb2595de0a2befbf1.jpg|1601604325_71cc4b4ea4f75ba902e6.jpg|1601604325_889f061fe9a616f84fb7.jpg|1601604325_b664fae01559ea07b348.jpg|1601604325_dbc46b4784fe7ba022ef.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 02:05:25', '2020-10-02 02:05:25'),
(461, 'Cho thuê căn 2PN full nội thất giá 11tr tại Vinhome Gardenia Hàm Nghi - Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-vinhome-gardenia-ham-nghi-my-dinh', 'Đường Hàm Nghi, P. Mỹ Đình, Q. Nam Từ Liêm, Hà Nội', 2, '126', '55', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 55m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nVinhome Gardenia sở hữu vị tr&iacute; v&agrave;ng &quot;tam lộc - ngũ ph&uacute;c&quot; m&agrave; hiếm dự &aacute;n n&agrave;o c&oacute; được:<br />\r\n&ndash; &ldquo;Nhất cận thị&rdquo;: c&aacute;c trung t&acirc;m mua sắm Vinmart v&agrave; cửa h&agrave;ng Vinmart + ở ngay gần nh&agrave;;<br />\r\n&ndash; &ldquo;Nhị cận giang&rdquo;: Vinhomes Gardenia c&oacute; 1 mặt nh&igrave;n thẳng ra s&ocirc;ng Nhuệ lu&ocirc;n xanh thẫm 4 m&ugrave;a;<br />\r\n&ndash; &ldquo;Tam cận lộ&rdquo;: Với việc nằm ngay gần trục đường Phạm H&ugrave;ng v&agrave; ngay ph&iacute;a sau bến xe Mỹ Đ&igrave;nh, bạn ho&agrave;n to&agrave;n c&oacute; thể đi đến mọi nơi trong v&agrave; ngo&agrave;i H&agrave; Nội một c&aacute;ch nhanh ch&oacute;ng v&agrave; dễ d&agrave;ng bằng nhiều phương tiện v&agrave; cung đường kh&aacute;c nhau;<br />\r\n&ndash; Thứ tư gần trường: Trường học Vinschool ngay trong nội khu dự &aacute;n trong m&ocirc;i trường hiện đại, ti&ecirc;n tiến, được đ&agrave;o tạo, r&egrave;n luyện để trở th&agrave;nh những chủ nh&acirc;n tương lai của đất nước;<br />\r\n&ndash; Thứ năm gần bệnh viện: Ph&ograve;ng kh&aacute;m Vinmec với những trang thiết bị tối t&acirc;n c&ugrave;ng đội ngũ y b&aacute;c sỹ c&oacute; chuy&ecirc;n m&ocirc;n cao sẽ l&agrave; địa chỉ tin cậy chăm s&oacute;c sức khỏe cho cư d&acirc;n 24/7.<br />\r\nVới 66 tiện