(463, 'Cho thuê căn 2PN full nội thất giá 10tr tại Chung cư 671 Hoàng Hoa Thám - Ba Đình', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-chung-cu-671-hoang-hoa-tham-ba-dinh', 'Số 671 Hoàng Hoa Thám, Phường Vĩnh Phúc, Quận Ba Đình, Hà Nội', 2, '128', '75', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.<br />\r\nThiết kế hợp l&yacute; bao gồm 0 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n 671 Ho&agrave;ng Hoa Th&aacute;m c&oacute; thiết kế hiện đại theo c&aacute;c ti&ecirc;u chuẩn cao cấp về x&acirc;y dựng thẩm mỹ, đem lại cho cư d&acirc;n một kh&ocirc;ng gian sống tiện nghi, tho&aacute;ng đ&atilde;ng, th&iacute;ch hợp với cuộc sống hiện đại. C&ugrave;ng với sự ph&aacute;t triển của th&agrave;nh phố, dự &aacute;n sẽ nằm tại khu d&acirc;n cư c&oacute; quy hoạch ho&agrave;n chỉnh, c&oacute; c&aacute;c tiện &iacute;ch c&ocirc;ng cộng đầy đủ. Dự &aacute;n sẽ l&agrave; m&ocirc;i trường sống l&yacute; tưởng cho việc học h&agrave;nh, sinh hoạt cũng như l&agrave;m việc của c&aacute;c th&agrave;nh vi&ecirc;n mỗi gia đ&igrave;nh sống trong khu chung cư.<br />\r\nTổ hợp 671 Ho&agrave;ng Hoa Th&aacute;m bao gồm: Khối nh&agrave; chung cư cao 18 tầng, khối văn ph&ograve;ng cao 21 tầng, khối trung t&acirc;m thương mại, khu nh&agrave; vườn 3 tầng v&agrave; c&aacute;c c&ocirc;ng tr&igrave;nh tiện &iacute;ch c&ocirc;ng cộng như: S&acirc;n vườn, đ&agrave;i phun nước, b&atilde;i đỗ xe, trạm bơm ga... Đ&acirc;y l&agrave; một tổ hợp c&aacute;c c&ocirc;ng tr&igrave;nh được x&acirc;y dựng với quy m&ocirc; lớn, c&oacute; t&iacute;nh năng độc lập li&ecirc;n ho&agrave;n, thể hiện t&iacute;nh hiện đại ti&ecirc;n tiến với khối ở ti&ecirc;u chuẩn cao cấp, khối văn ph&ograve;ng hiện đại v&agrave; khối dịch vụ thương mại tiện nghi. Dự &aacute;n tận dụng tối đa quỹ đất m&agrave; vẫn đảm bảo sự h&agrave;i ho&agrave; giữa c&aacute;c c&ocirc;ng tr&igrave;nh v&agrave; cảnh quan xung quanh.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601606603_21619a5795eb6ab533fa.jpg', '1601606603_3c52da64d5d82a8673c9.jpg|1601606603_9cb7d480db3c24627d2d.jpg|1601606603_70fe0ac90575fa2ba364.jpg|1601606603_84d5f4e2fb5e04005d4f.jpg|1601606603_740c1d3b1287edd9b496.jpg|1601606603_21619a5795eb6ab533fa.jpg|1601606603_a48825be2a02d55c8c13.jpg|1601606603_aa532a6525d9da8783c8.jpg|1601606603_c8cbc2fdcd41321f6b50.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 02:43:23', '2020-10-02 02:43:23'),
(464, 'Cho thuê căn 3PN full nội thất giá 15tr tại Goldmark City Hồ Tùng Mậu', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-goldmark-city-ho-tung-mau', '136 Hồ Tùng Mậu, Phường Phú Diễn, Bắc Từ Liêm, Hà Nội', 2, '8', '121', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 121m2..</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Tọa lạc tại vị tr&iacute; đắc địa, nơi sẽ l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế của Thủ đ&ocirc; trong tương lai, đầu mối trung t&acirc;m kết nối c&aacute;c trục đường lớn. GoldMark City &ndash; nằm ngay tr&ecirc;n mặt đường Nguyễn Cơ Thạch k&eacute;o d&agrave;i, đối diện khu c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a Mai Dịch gần 2 ha đ&atilde; được quy hoạch. Một vị tr&iacute; đắc địa, một điểm cộng vượt trội cho Goldmark City.</p>\r\n\r\n<p>Đặc biệt, đ&acirc;y cũng l&agrave; nơi tập trung tất cả c&aacute;c tuyến xe li&ecirc;n tỉnh, đặc biệt l&agrave; c&aacute;c tỉnh ph&iacute;a Đ&ocirc;ng, ph&iacute;a Nam Thủ đ&ocirc; như Bắc Ninh, Hưng Y&ecirc;n, Hải Dương, H&agrave; Nam, Ninh B&igrave;nh, Th&aacute;i B&igrave;nh, Nam Định, Thanh H&oacute;a, Nghệ An&hellip;</p>\r\n\r\n<p>Dễ d&agrave;ng di chuyển đến c&aacute;c địa điểm bệnh viện, trường đại học, bến xe: C&aacute;ch Đại học Thương Mại, Đại học S&acirc;n khấu Điện ảnh, Đại học Quốc Gia, Đại học Ngoại ngữ 0.3km; C&aacute;ch bệnh viện 198 0.9km; đi xe m&aacute;y đến S&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3p;gần c&aacute;c si&ecirc;u thị Fivimart, Pico Plaza, Media mart&hellip; Chung cư TNR GoldMark City t&iacute;ch hợp hơn 20 tiện &iacute;ch đẳng cấp như: Khu vui chơi trẻ em, Trung t&acirc;m thương mại hiện đại, Bar &ndash; Caf&eacute;, Vườn BBQ ngo&agrave;i trời, Spa thư gi&atilde;n &ndash; X&ocirc;ng hơi, Ph&ograve;ng tập Gym hiện đại&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601607005_c56ba5acfd21007f593064.jpg', '1601607006_0a0eb5cbed461018495770.jpg|1601607006_61d4ad1af59708c9518673.jpg|1601607006_79efea28b2a54ffb16b466.jpg|1601607006_92efcd2895a568fb31b467.jpg|1601607006_172202e55a68a736fe7968.jpg|1601607006_831188dad0572d09744674.jpg|1601607006_a9cce806b08b4dd5149a69.jpg|1601607006_c56ba5acfd21007f593064.jpg|1601607006_ca1328d7705a8d04d44b65.jpg|1601607006_d8378bf0d37d2e23776c71.jpg|1601607006_f74c9c8bc4063958601772 (1).jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 02:50:06', '2020-10-02 02:50:06'),
(465, 'CHO THUÊ CĂN 2PN GIÁ 9TR TẠI ECOLIFE TÂY HỒ', 'cho-thue-can-2pn-gia-9tr-tai-ecolife-tay-ho', 'Lô đất O17 - HH1 Khu đô thị mới Tây Hồ Tây, quận Tây Hồ, Hà Nội', 2, '17', '88', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 88m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Ecolife T&acirc;y Hồ được x&acirc;y dựng tr&ecirc;n &ocirc; đất O17 &ndash; HH1 trong quy hoạch chung của khu đ&ocirc; thị mới T&acirc;y Hồ T&acirc;y &ndash; T&acirc;y Hồ - H&agrave; Nội. Từ đ&acirc;y cư d&acirc;n c&oacute; thể kết nối đến h&agrave;ng loạt c&aacute;c tiện &iacute;ch hạ tầng x&atilde; hội bao quanh dự &aacute;n một c&aacute;ch dễ d&agrave;ng thuận tiện nhất.</p>\r\n\r\n<p>Đ&acirc;y l&agrave; một khu đ&ocirc; thị sầm uất tập trung nhiều cụm c&ocirc;ng tr&igrave;nh cao tầng v&agrave; l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh, thương mại, ng&acirc;n h&agrave;ng, dịch vụ... thu h&uacute;t được sự quan t&acirc;m của nhiều tập đo&agrave;n lớn, c&aacute;c c&ocirc;ng ty con trong nước v&agrave; ngo&agrave;i nước đến kinh doanh l&agrave;m việc.</p>\r\n\r\n<p>Từ dự &aacute;n Ecolife T&acirc;y Hồ kết nối dễ d&agrave;ng tới c&aacute;c điểm lớn của HN như:</p>\r\n\r\n<p>C&aacute;ch L&agrave;ng hoa đ&agrave;o Nhật T&acirc;n: 5.5km</p>\r\n\r\n<p>C&aacute;ch Lăng B&aacute;c: 6km</p>\r\n\r\n<p>C&aacute;ch Bảo t&agrave;ng D&acirc;n tộc học: 2.5 km</p>\r\n\r\n<p>C&aacute;ch si&ecirc;u thị Metro: 4km</p>\r\n\r\n<p>C&aacute;ch Bệnh Viện Thu C&uacute;c: 3km&nbsp;</p>\r\n\r\n<p>C&aacute;ch Hồ T&acirc;y: 1.5 km</p>\r\n\r\n<p>C&aacute;ch Chợ Bưởi: 2km</p>\r\n\r\n<p>C&aacute;ch c&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y: 5.5 Km</p>\r\n\r\n<p>Sự kết hợp h&agrave;i h&ograve;a giữa kiến tr&uacute;c đầy hiện đại v&agrave; kh&ocirc;ng gian xanh chung cư Ecolife T&acirc;y Hồ đ&atilde; l&agrave;m n&ecirc;n sự kh&aacute;c biệt cho dự &aacute;n n&agrave;y. Cư d&acirc;n c&oacute; thể thỏa sức mua sắm ở trung t&acirc;m thương mại v&agrave; si&ecirc;u thị sầm uất tại chung cư Ecolife T&acirc;y Hồ.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601607338_00c9dfb7fc6903375a78.jpg', '1601607338_00c9dfb7fc6903375a78.jpg|1601607338_2ae5a99b8a45751b2c54.jpg|1601607338_29b7dad5f90b06555f1a.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 02:55:38', '2020-10-02 02:55:38');
