(466, 'Cho thuê căn 2PN full nội thất giá 9tr tại Làng Quốc tế Thăng Long - Trần Đăng Ninh', 'cho-thue-can-2pn-full-noi-that-gia-9tr-tai-lang-quoc-te-thang-long-tran-dang-ninh', 'Làng Quốc tế Thăng Long, Trần Đăng Ninh, P. Dịch Vọng, Q. Cầu Giấy, Tp. Hà Nội', 2, '129', '75', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quần thể đ&ocirc; thị L&agrave;ng Quốc Tế Thăng Long, đằng sau l&agrave; C&ocirc;ng Vi&ecirc;n Nghĩa Đ&ocirc; n&ecirc;n được hưởng hầu hết c&aacute;c tiện &iacute;ch v&agrave; cơ sở vật chất của quần thể đ&ocirc; thị mang lại.<br />\r\nC&oacute; vị tr&iacute; đắc địa, giao cắt giữa đường Trần Đăng Ninh v&agrave; đường Nguyễn Kh&aacute;nh To&agrave;n, Cầu Giấy.<br />\r\nTiếp gi&aacute;p đường Xu&acirc;n Thủy, Phạm H&ugrave;ng, đường QL32...<br />\r\nTiếp gi&aacute;p c&aacute;c trường Đại học lớn: Đại học Quốc gia, Đại học Thương Mại, Đại học Sư phạm, Đại học Ngoại ngữ v&agrave; c&aacute;c trường Cấp 2, Cấp 3 lớn của quận Cầu Giấy.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601608261_20200921140102-4861_wm.jpg', '1601608261_20200921140101-6ab8_wm.jpg|1601608261_20200921140101-54f9_wm.jpg|1601608261_20200921140101-676b_wm.jpg|1601608261_20200921140101-6705_wm.jpg|1601608261_20200921140101-b6b6_wm.jpg|1601608261_20200921140101-e39f_wm.jpg|1601608261_20200921140102-560d_wm.jpg|1601608261_20200921140102-4861_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 03:11:01', '2020-10-02 03:11:01'),
(467, 'Cho thuê căn 3PN full nội thất giá 13tr tại Golden West Complex Lê Văn Thiêm', 'cho-thue-can-3pn-full-noi-that-gia-13tr-tai-golden-west-complex-le-van-thiem', 'Số 2 Lê Văn Thiêm, P. Nhân Chính, Q. Thanh Xuân, Hà Nội', 2, '42', '96m', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 96m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n tọa lạc tại KĐT mới &quot;Trung H&ograve;a - Nh&acirc;n Ch&iacute;nh&quot; thuộc quận Thanh Xu&acirc;n, HN, nơi đ&acirc;y giao th&ocirc;ng thuận lợi, giao thương ph&aacute;t triển, l&agrave; đầu mối giao th&ocirc;ng giữa c&aacute;c con đường V&agrave;nh đai 3 với khu C&aacute;t Linh - Giảng V&otilde;.&nbsp;</p>\r\n\r\n<p>Nằm gần c&aacute;c trung t&acirc;m đạo tạo, gi&aacute;o dục lớn, c&aacute;c trường Đại học lớn của HN như: Đại học H&agrave; Nội, Đại học Kiến Tr&uacute;c, ĐH KHXH v&agrave; Nh&acirc;n Văn, ĐH An Ninh, ĐH SP Nghệ Thuật trung ương, Đại Học Khoa Học Tự nhi&ecirc;n, HV C&ocirc;ng Nghệ Bưu Ch&iacute;nh Viễn Th&ocirc;ng, Đại Học X&acirc;y Dựng ...Nằm gần c&aacute;c trường tiểu học, trung học, phổ th&ocirc;ng như: Trường Mầm non Họa My, Trường tiểu học QT Bredon, Trường Cở Sở Phan Đ&Igrave;nh Gi&oacute;t, Trường Phổ Th&ocirc;ng Nh&acirc;n Ch&iacute;nh, Trường trung cấp Achimedes, trường PT chuy&ecirc;n Amsterdam ...</p>\r\n\r\n<p>Gần c&aacute;c bệnh viện: Bệnh viện x&acirc;y dựng, Bệnh viện Y cổ truyền (198 - BCA), Bệnh Viện Y Học Tuệ Tĩnh (Đường Nguyễn Tr&atilde;i), Bệnh viện 103 (H&agrave; Đ&ocirc;ng), Bệnh Viện Đa Khoa H&agrave; Đ&ocirc;ng, Gần viện y học h&agrave;ng kh&ocirc;ng, v&agrave; c&aacute;c t&ograve;a nh&agrave; chung cư lớn: Royal City Nguyễn Tr&atilde;i, T&ograve;a nh&agrave; KeangNam . Đồng thời nằm ngay tổ hợp c&aacute;c t&ograve;a nh&agrave; lớn như: T&ograve;a nh&agrave; Hapulico Center Building Vũ trọng phụng, T&ograve;a nh&agrave; Mandarin Garden ...<br />\r\nĐến với Golden West bạn sẽ cảm nhận được một cuộc sống ho&agrave;n mỹ nhất.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601608726_676e7d975d2aa274fb3b.jpg', '1601608726_6e765b8e7b33846ddd22.jpg|1601608726_7a6fdc95fc2803765a39.jpg|1601608726_676e7d975d2aa274fb3b.jpg|1601608726_b5b3ff46dffb20a579ea.jpg|1601608726_e40bd2f0f24d0d13545c.jpg|1601608726_ec688892a82f57710e3e.jpg|1601608726_f40637f81745e81bb154.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 03:18:46', '2020-10-02 03:18:46'),
(468, 'Cho thuê căn 2PN full nội thất giá 9.5tr tại KĐT Nam Cường - Cổ Nhuế', 'cho-thue-can-2pn-full-noi-that-gia-95tr-tai-kdt-nam-cuong-co-nhue', 'KĐT Nam Cường, P. Cổ Nhuế 1. Q. Bắc Từ Liêm, Hà Nội', 2, '34', '75', 9500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ,&nbsp;nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Đ&acirc;y l&agrave; khu đ&ocirc; thị c&oacute; vị tr&iacute; kh&aacute; thuận lợi nằm ở ph&iacute;a t&acirc;y trung t&acirc;m TP H&agrave; Nội, ph&iacute;a Đ&ocirc;ng v&agrave; Đ&ocirc;ng bắc gi&aacute;p với khu d&acirc;n cư x&atilde; Cổ Nhuế, ph&iacute;a T&acirc;y s&aacute;t cạnh đường Phạm Văn Đồng (tuyến đường cao tốc Thăng long đi Nội B&agrave;i).</p>\r\n\r\n<p>Bao quanh KĐT Nam Cường l&agrave; 3 tuyến đường lớn Phạm Văn Đồng, Ho&agrave;ng Quốc Việt v&agrave; đường 69- đ&acirc;y l&agrave; khu vực hết sức thuận lợi về giao th&ocirc;ng đi lại v&agrave; hệ thống đường trong khu vực n&agrave;y phần lớn được x&acirc;y mới ho&agrave;n to&agrave;n n&ecirc;n đ&aacute;p ứng nhu cầu cần thiết của một Khu đ&ocirc; thị hiện đại.<br />\r\nƯu điểm nổi bật nhất l&agrave; vị tr&iacute; Khu đ&ocirc; thị Nam Cường nằm ngay mặt tiền đại lộ Phạm Văn Đồng rộng 60m, từ khu đ&ocirc; thị chỉ mất 30 ph&uacute;t xe chạy sẽ đến s&acirc;n bay Nội B&agrave;i v&agrave; 20 ph&uacute;t để v&agrave;o trung t&acirc;m th&agrave;nh phố.</p>\r\n\r\n<p>Ngo&agrave;i ra bao quanh KĐT Nam Cường l&agrave; si&ecirc;u thị Metro- 1 si&ecirc;u thị b&aacute;n bu&ocirc;n lớn của HN hiện nay, hệ thống c&aacute;c trường đại học, cao đẳng v&agrave; bệnh viện như viện E, bệnh viện y học cổ truyền &hellip; v&agrave; h&agrave;ng loạt c&aacute;c dự &aacute;n đ&ocirc; thị mới cận kề.<br />\r\nL&agrave; khu đ&ocirc; thị khang trang, hiện đại, đồng bộ về CSHT x&atilde; hội, hạ tầng kỹ thuật v&agrave; kiến tr&uacute;c cảnh quan m&ocirc;i trường.&nbsp;C&aacute;c c&ocirc;ng tr&igrave;nh thấp tầng bố tr&iacute; gần kh&ocirc;ng gian c&acirc;y xanh, trường học, nh&agrave; trẻ để h&agrave;i ho&agrave; với kh&ocirc;ng gian khu vực x&oacute;m l&agrave;ng hiện c&oacute; l&acirc;n cận.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601608940_13c00ee10753f80da142.jpg', '1601608940_13c00ee10753f80da142.jpg|1601608940_573cfc1cf5ae0af053bf.jpg|1601608940_c446006709d5f68bafc4.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 03:22:20', '2020-10-02 03:22:20'),
(469, 'Cho thuê căn 2PN full nội thất giá 12tr tại The Garden Hill Mỹ Đình', 'cho-thue-can-2pn-full-noi-that-gia-12tr-tai-the-garden-hill-my-dinh', '99 Trần Bình, P. Mỹ Đình 1,Q. Nam Từ Liêm, Hà Nội', 2, '56', '80', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 80m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư The Garden Hill tọa lạc tại 99 Trần B&igrave;nh. Tọa độ trung t&acirc;m đắc địa giao thoa 2 quận sầm uất l&agrave; Cầu Giấy v&agrave; Nam Từ Li&ecirc;m. Dự &aacute;n cạnh ngay bến xe Mỹ Đ&igrave;nh, đường v&agrave;nh đai 3 cao tốc đ&ocirc; thị. Bao quanh The Garden Hill l&agrave; những con đường lớn, huyết mạch của thủ đ&ocirc; như V&agrave;nh đai 3 cao tốc đ&ocirc; thị &ndash; Phạm H&ugrave;ng, quốc lộ 32 &ndash; Xu&acirc;n Thủy, Trục Nguyễn Ho&agrave;ng &ndash; T&ocirc;n Thất Thuyết, Trục L&ecirc; Đức Thọ &ndash; L&ecirc; Quang Đạo&hellip;</p>\r\n\r\n<p>Ngo&agrave;i ra chung cư 99 Trần B&igrave;nh c&ograve;n l&agrave; Trung t&acirc;m gi&aacute;o dục của Thủ đ&ocirc;. Nơi gần rất nhiều c&aacute;c trường đại học lớn như Đại Học Thương Mại, Đại Học Quốc Gia, Đại Học Sư Phạm, Đại Học FPT.., v&agrave; thuận tiện về cả hệ thống c&aacute;c cơ sở y tế uy t&iacute;n như Bệnh viện 19-8, bệnh viện Y Học Cổ Truyền, gần t&ograve;a nh&agrave; chung cư cao cấp Dolphin Plaza&hellip;</p>\r\n\r\n<p>Dự &aacute;n hưởng trọn bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh của 3 c&ocirc;ng vi&ecirc;n hồ nước lớn: C&ocirc;ng vi&ecirc;n Cầu Giấy, C&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Trung t&acirc;m, C&ocirc;ng vi&ecirc;n Y&ecirc;n H&ograve;a. Cư d&acirc;n The Garden Hill Trần B&igrave;nh được hưởng đầy đủ c&aacute;c dịch vụ tiện &iacute;ch như khu trung t&acirc;m thương mại, k&egrave;m theo l&agrave; ph&ograve;ng tập gym, vườn dạo, qu&aacute;n c&agrave; ph&ecirc; tr&ecirc;n tầng 6, khu vui chơi giải tr&iacute; trẻ em&hellip; Xung quanh căn hộ được bố tr&iacute; c&acirc;y xanh hợp l&yacute; mang đến một bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh, gi&uacute;p ph&aacute;t triển cả thể chất lẫn tinh thần cho c&aacute;c thế hệ sinh sống tại đ&acirc;y.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601609265_9bb636f0eb43141d4d52.jpg', '1601609265_8d306b76b6c5499b10d4.jpg|1601609265_9bb636f0eb43141d4d52.jpg|1601609265_76c5d7830a30f56eac21.jpg|1601609265_1362d8240597fac9a386.jpg|1601609265_1517a45179e286bcdff3.jpg|1601609265_280491424cf1b3afeae0.jpg|1601609265_b7942bd2f661093f5070.jpg|1601609265_d8c519b9c40a3b54621b.jpg|1601609265_d3107c56a1e55ebb07f4.jpg|1601609265_e5a918efc55c3a02634d.jpg|1601609265_ee73593584867bd82297.jpg|1601609265_f90d4d4b90f86fa636e9.jpg|1601609265_f6513117eca413fa4ab5.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 03:27:45', '2020-10-02 03:27:45'),
(470, 'Cho thuê căn 2PN full nội thất giá 18tr tại Royal City - Nguyễn Trãi', 'cho-thue-can-2pn-full-noi-that-gia-18tr-tai-royal-city-nguyen-trai', 'Số 72A đường Nguyễn Trãi, P. Thượng Đình, Q. Thanh Xuân, Hà Nội', 2, '130', '110', 18000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 110m2.<br />\r\nThiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Royal City được thiết kế theo m&ocirc; h&igrave;nh tổ hợp đ&ocirc; thị phức hợp, lấy điểm nhấn l&agrave; khu c&ocirc;ng vi&ecirc;n c&acirc;y xanh rộng 70.000m2.&nbsp;<br />\r\nVị tr&iacute; chiến lược tại thủ đ&ocirc; H&agrave; Nội: Chung cư Royal City được x&acirc;y dựng tr&ecirc;n vị tr&iacute; đắc địa, tập trung nhiều đầu mối giao th&ocirc;ng huyết mạch, hướng v&agrave;o cửa ng&otilde; ch&iacute;nh ph&iacute;a T&acirc;y Nam thủ đ&ocirc; H&agrave; Nội vị tr&iacute; giao th&ocirc;ng thuận tiện nằm tr&ecirc;n tục đường Nguyễn Tr&atilde;i đi tới đường tr&ecirc;n cao thuận tiện việc đi lại c&aacute;c tỉnh l&acirc;n cận H&agrave; Nội. Đ&acirc;y l&agrave; vị tr&iacute; c&oacute; &yacute; nghĩa chiến lược trong định hướng ph&aacute;t triển H&agrave; Nội trở th&agrave;nh một trung t&acirc;m kinh tế - ch&iacute;nh trị v&agrave; văn h&oacute;a của Việt Nam v&agrave; khu vực.<br />\r\nRoyal City Nguyễn Tr&atilde;i cung cấp cho bạn những điều kiện tốt nhất cho một cuộc sống tiện nghi v&agrave; ho&agrave;n hảo. Với tổ hợp gồm kh&aacute;ch sạn cao cấp, văn ph&ograve;ng cho thu&ecirc;, trung t&acirc;m thương mại, c&aacute;c khu nh&agrave; ở chung cư cao cấp v&agrave; trường học, nh&agrave; trẻ mẫu gi&aacute;o, vườn hoa c&acirc;y xanh c&ocirc;ng vi&ecirc;n c&ugrave;ng nhiều c&ocirc;ng tr&igrave;nh đầu ti&ecirc;n v&agrave; lớn nhất Việt Nam như: s&acirc;n trượt băng, c&ocirc;ng vi&ecirc;n nước trong nh&agrave;, khu Gym &amp; Spa, quần thể rạp chiếu phim, b&atilde;i để xe ngầm&hellip;, Sống tại căn hộ Royal City hứa hẹn đem đến một kh&ocirc;ng gian sảng kho&aacute;i, gi&uacute;p c&acirc;n bằng cuộc sống, đem sức khỏe c&ugrave;ng niềm say m&ecirc; trở lại với bạn.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 18tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601610119_aecacc5b3ae8c5b69cf9.jpg', '1601610119_0ba2d61f20acdff286bd.jpg|1601610119_2a4b52f8a44b5b15025a.jpg|1601610119_3e0252c9a47a5b24026b.jpg|1601610119_4f02bd7c4bcfb491edde.jpg|1601610119_6a09527ba4c85b9602d9.jpg|1601610119_36ca30afc61c3942600d.jpg|1601610119_68f13a7accc933976ad8.jpg|1601610119_416fdf212992d6cc8f83.jpg|1601610119_aecacc5b3ae8c5b69cf9.jpg|1601610119_d72ae4fb1248ed16b459.jpg|1601610119_d319c3863535ca6b9324.jpg|1601610119_e67e2d24db9724c97d86.jpg|1601610119_f0581985ef3610684927.jpg|1601610119_z2103494818343_7b4961ae83b9d912d74bb79e4e85d892.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 03:41:59', '2020-10-02 03:41:59'),
(471, 'Cho thuê căn 3PN full nội thất giá 11tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-full-noi-that-gia-11tr-khu-ngoai-giao-doan', 'P. Xuân Đỉnh, Q. Bắc Từ Liêm, Hà Nội', 2, '9', '110', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 110m2, nằm tại t&ograve;a N04T1.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601610537_11171322a89157cf0e80.jpg', '1601610537_2fd3c232788187dfde90.jpg|1601610537_3a01f5084ebbb1e5e8aa.jpg|1601610537_5d22abf8114bee15b75a.jpg|1601610537_7b19e8275394accaf585.jpg|1601610537_47be4762fdd1028f5bc0.jpg|1601610537_63c37ae8c15b3e05674a.jpg|1601610537_91850e7bb4c84b9612d9.jpg|1601610537_11171322a89157cf0e80.jpg|1601610537_a4fd24139ea061fe38b1.jpg|1601610537_ab8c098bb2384d661429.jpg|1601610537_b64b735ac8e937b76ef8.jpg|1601610537_ce7c71b3cb00345e6d11.jpg|1601610537_z2103422841605_0a04e03d098ddd015c1f647f9ba34a6b.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 03:48:57', '2020-10-02 03:48:57'),
(472, 'Cho thuê căn 2PN full nội thất giá 18tr tại Vinhome Sky Lake - Phạm Hùng', 'cho-thue-can-2pn-full-noi-that-gia-18tr-tai-vinhome-sky-lake-pham-hung', 'Đường Phạm Hùng, P. Mỹ Đình, Nam Từ Liêm, Hà Nội', 2, '131', '70', 18000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ tại t&ograve;a S1 rộng 70m2.<br />\r\nThiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nVị tr&iacute; mặt đường Phạm H&ugrave;ng l&agrave; tuyến đường huyết mạch ph&iacute;a T&acirc;y H&agrave; Nội, rất thuận tiện cho việc đi lại, gần C&ocirc;ng vi&ecirc;n Cầu Giấy l&agrave; một trong những c&ocirc;ng vi&ecirc;n đẹp nhất H&agrave; Nội hiện nay v&agrave; hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh.<br />\r\nNằm trong quần thể khu d&acirc;n tr&iacute; cao, nhiều khu văn ph&ograve;ng cao cấp như phố Duy T&acirc;n, KeangNam, Indochina Plaza, gần một loạt c&aacute;c trụ sở bộ ng&agrave;nh, gần bệnh viện 198 v&agrave; hệ thống c&aacute;c trường học c&oacute; uy t&iacute;n như Đại học Quốc gia, Đại học Thương mại, Học viện b&aacute;o tr&iacute; tuy&ecirc;n truyền&hellip;<br />\r\nC&aacute;ch c&aacute;c trường cấp I, cấp II, cấp III chất lượng cao Đo&agrave;n Thị Điểm, L&ecirc; Qu&yacute; Đ&ocirc;n, Lomonxop 1km, rất thuận tiện cho việc con em qu&yacute; kh&aacute;ch h&agrave;ng được học trong c&aacute;c trường tốt nhất thủ đ&ocirc;.<br />\r\nTừ căn hộ Vinhomes Skylake Phạm H&ugrave;ng dễ d&agrave;ng di chuyển đến c&aacute;c tuyến đường quan trọng: tuyến Cầu Giấy &ndash; Kim M&atilde; dẫn v&agrave;o trung t&acirc;m: đường Phạm H&ugrave;ng kết nối Nam &ndash; Bắc th&agrave;nh phố; s&acirc;n bay quốc &nbsp;tế Nội B&agrave;i; đường V&agrave;nh đai 3 xuy&ecirc;n suốt S&oacute;c Sơn, Từ Li&ecirc;m, Cầu Giấy.<br />\r\nVới c&aacute;c tiện &iacute;ch v&agrave; dịch vụ đẳng cấp, bạn c&oacute; thể tự thưởng cho m&igrave;nh những ph&uacute;t gi&acirc;y sảng kho&aacute;i tại hồ bơi tr&agrave;n bờ skypool, mua sắm thỏa th&iacute;ch trong trung t&acirc;m thương mại Vincom Plaza, s&ocirc;i động so t&agrave;i tr&ecirc;n s&acirc;n thể thao đa năng, hay sum vầy c&ugrave;ng người th&acirc;n tại khu nh&agrave; h&agrave;ng ẩm thực.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 18tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601625998_19f8c0da8f6970372978.jpg', '1601625998_5e61791c36afc9f190be.jpg|1601625998_07a864e02b53d40d8d42.jpg|1601625998_8b9561c52e76d1288867.jpg|1601625998_19f8c0da8f6970372978.jpg|1601625998_41b6e7faa84957170e58.jpg|1601625998_8631c4488bfb74a52dea.jpg|1601625998_48281a6355d0aa8ef3c1.jpg|1601625998_a2c8609c2f2fd071893e.jpg|1601625998_b14f6f0f20bcdfe286ad.jpg|1601625998_b983b7a6f815074b5e04.jpg|1601625998_dbdfd8f4974768193156.jpg|1601625998_f27f190956baa9e4f0ab.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 08:06:38', '2020-10-02 08:07:30'),
