(476, 'Cho thuê căn 2PN full nội thất giá 10tr tại Chung cư Hoàng Sâm - Hoàng Quốc Việt', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-chung-cu-hoang-sam-hoang-quoc-viet', '151 Hoàng Quốc Việt, Q. Cầu Giấy, Hà Nội', 2, '133', '70', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.<br />\r\nThiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Ho&agrave;ng S&acirc;m tọa lạc tại ng&otilde; 151 Ho&agrave;ng Quốc Việt, phường Nghĩa Đ&ocirc;, Cầu Giấy, Hà N&ocirc;̣i. Chung cư Ho&agrave;ng S&acirc;m được đầu tư x&acirc;y dựng hệ thống hạ tầng, tiện &iacute;ch ho&agrave;n thiện, đồng bộ.&nbsp;<br />\r\nCăn hộ nằm trong KĐT, mật độ x&acirc;y dựng chỉ 20 %, nhiều c&acirc;y xanh, hồ nước lớn, m&ocirc;i trường trong l&agrave;nh m&aacute;t mẻ an sinh tuyệt vời.<br />\r\nGần nhiều trường đại học: ĐH Sư Phạm, ĐH Thương Mại, S&acirc;n Khấu Điện Ảnh, B&aacute;o Ch&iacute;, ĐH Y Tế Cộng Đồng, c&aacute;c trường học nổi tiếng về chất lượng gi&aacute;o dục: Cầu Giấy, Nguyễn Tất Th&agrave;nh, Y&ecirc;n H&ograve;a, Sư Phạm, Nguy&ecirc;n Thị Minh Khai.<br />\r\nGần nhiều trung t&acirc;m thương mại: Metro Vincom, Pico; Bệnh viện: Viện E Cầu Giấy, Thu C&uacute;c T&acirc;y Hồ, Bệnh viện 354 Ba Đ&igrave;nh, bệnh viện quốc tế.<br />\r\nGần c&ocirc;ng vi&ecirc;n, c&aacute;c khu đ&ocirc; thị lớn: Đ&ocirc; thị T&acirc;y hồ t&acirc;y (thủ đ&ocirc; của c&aacute;c bộ, ng&agrave;nh, c&aacute;c cơ quan ch&iacute;nh phủ), Goldmark City, Mỹ Đ&igrave;nh. C&ocirc;ng vi&ecirc;n Thủ Lệ, c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;.<br />\r\nNgay cạnh Bộ C&ocirc;ng An - 232 Phạm Văn Đồng; giao th&ocirc;ng thuận tiện đi c&aacute;c nơi bằng c&aacute;c trục lớn của th&agrave;nh phố: Đi s&acirc;n bay, c&aacute;c tỉnh ph&iacute;a bắc, bằng đường Phạm Văn Đồng; Sơn T&acirc;y, H&ograve;a B&igrave;nh bằng Đại Lộ Thăng Long v&agrave; Quốc Lộ 32. Đi c&aacute;c Tỉnh ph&iacute;a Nam v&agrave; ph&iacute;a Đ&ocirc;ng bằng đường v&agrave;nh đai 3...<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601629569_20200925100931-25b1.jpg', '1601629569_20200925100927-82fa (1).jpg|1601629569_20200925100928-5048.jpg|1601629569_20200925100930-4809.jpg|1601629569_20200925100931-25b1.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-02 09:06:09', '2020-10-02 09:06:09'),
(477, 'Cho thuê căn 3PN full nội thất giá 15tr tại Star City Lê Văn Lương - Quận Thanh Xuân', 'cho-thue-can-3pn-full-noi-that-gia-15tr-tai-star-city-le-van-luong-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '130', 15000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 130m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Star City nằm tại đường L&ecirc; Văn Lương, Phường Nh&acirc;n Ch&iacute;nh, Quận Thanh Xu&acirc;n, một trong những trục đường huyết mạch v&agrave; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội.</p>\r\n\r\n<p>Từ vị tr&iacute; dự &aacute;n, c&oacute; thể dễ d&agrave;ng kết nối với c&aacute;c khu vực trong v&agrave; ngo&agrave;i th&agrave;nh phố th&ocirc;ng qua c&aacute;c tuyến đường: V&agrave;nh Đai 3, Đường L&aacute;ng, Nguyễn Ch&iacute; Thanh, L&aacute;ng Hạ&hellip; C&aacute;ch BigC Thăng Long chỉ 3 ph&uacute;t, về trung t&acirc;m Bờ Hồ 20 ph&uacute;t&hellip;Ngo&agrave;i ra, trong v&ograve;ng b&aacute;n k&iacute;nh 500m từ Star City l&agrave; hệ thống c&aacute;c si&ecirc;u thị, ng&acirc;n h&agrave;ng, trường học, trung t&acirc;m y tế, mua sắm&hellip;&nbsp; Tiếp gi&aacute;p c&aacute;c KĐTM ph&aacute;t triển, hạ tầng đồng bộ: Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, The Manor, Trung Y&ecirc;n,&hellip; Trung t&acirc;m hội nghị Quốc Gia, Si&ecirc;u thị BigC, Trung t&acirc;m thương mại Grand Plaza, Keangnam Landmark&hellip;</p>\r\n\r\n<p>Hệ thống dịch vụ, trường học, y tế đầy đủ. Star City L&ecirc; Văn Lương được đ&aacute;nh gi&aacute; l&agrave; một trong những vị tr&iacute; v&agrave;ng của thủ đ&ocirc; H&agrave; Nội, mang đến cho cư d&acirc;n nơi đ&acirc;y một cuộc sống tiện nghi v&agrave; đẳng cấp. Với những thiết kế vượt trội v&agrave; đẳng cấp của một kh&aacute;ch sạn 4 sao ti&ecirc;u chuẩn quốc tế, chung cư Star City L&ecirc; Văn Lương được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch hiện đại v&agrave; cao cấp trong khu vực: ph&ograve;ng đọc s&aacute;ch ph&ograve;ng tập thể thao, khu giải tr&iacute;, ph&ograve;ng đọc s&aacute;ch, chơi cờ, khu c&acirc;u lạc bộ người gi&agrave;, nh&agrave; trẻ, ph&ograve;ng xem phim, chơi game, khu mua sắm&hellip; ngay trong nh&agrave;. Đặc biệt, hệ thống bể bơi tr&ecirc;n tầng thượng một trong những sự kh&aacute;c biệt v&agrave; độc đ&aacute;o tại Star City.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 15tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601689859_20200827093217-7357_wm.jpg', '1601689859_20200827093143-719c_wm.jpg|1601689859_20200827093143-8107_wm.jpg|1601689859_20200827093143-fe1b_wm.jpg|1601689859_20200827093211-7c77_wm.jpg|1601689859_20200827093215-cebd_wm.jpg|1601689859_20200827093217-7357_wm.jpg|1601689859_20200915103024-fe5a_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 01:50:59', '2020-10-03 01:53:35'),
