(480, 'Cho thuê căn 3PN full nội thất + 1P đa năng giá 18tr tại Star City Lê Văn Lương - Quận Thanh Xuân', 'cho-thue-can-3pn-full-noi-that-1p-da-nang-gia-18tr-tai-star-city-le-van-luong-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '153', 18000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 153m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, 1 ph&ograve;ng chức năng,&nbsp;nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch</p>\r\n\r\n<p>Chung cư Star City nằm tại đường L&ecirc; Văn Lương, Phường Nh&acirc;n Ch&iacute;nh, Quận Thanh Xu&acirc;n, một trong những trục đường huyết mạch v&agrave; đẹp nhất của khu vực ph&iacute;a T&acirc;y H&agrave; Nội.</p>\r\n\r\n<p>Từ vị tr&iacute; dự &aacute;n, c&oacute; thể dễ d&agrave;ng kết nối với c&aacute;c khu vực trong v&agrave; ngo&agrave;i th&agrave;nh phố th&ocirc;ng qua c&aacute;c tuyến đường: V&agrave;nh Đai 3, Đường L&aacute;ng, Nguyễn Ch&iacute; Thanh, L&aacute;ng Hạ&hellip; C&aacute;ch BigC Thăng Long chỉ 3 ph&uacute;t, về trung t&acirc;m Bờ Hồ 20 ph&uacute;t&hellip;Ngo&agrave;i ra, trong v&ograve;ng b&aacute;n k&iacute;nh 500m từ Star City l&agrave; hệ thống c&aacute;c si&ecirc;u thị, ng&acirc;n h&agrave;ng, trường học, trung t&acirc;m y tế, mua sắm&hellip;&nbsp; Tiếp gi&aacute;p c&aacute;c KĐTM ph&aacute;t triển, hạ tầng đồng bộ: Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, The Manor, Trung Y&ecirc;n,&hellip; Trung t&acirc;m hội nghị Quốc Gia, Si&ecirc;u thị BigC, Trung t&acirc;m thương mại Grand Plaza, Keangnam Landmark&hellip;</p>\r\n\r\n<p>Hệ thống dịch vụ, trường học, y tế đầy đủ. Star City L&ecirc; Văn Lương được đ&aacute;nh gi&aacute; l&agrave; một trong những vị tr&iacute; v&agrave;ng của thủ đ&ocirc; H&agrave; Nội, mang đến cho cư d&acirc;n nơi đ&acirc;y một cuộc sống tiện nghi v&agrave; đẳng cấp. Với những thiết kế vượt trội v&agrave; đẳng cấp của một kh&aacute;ch sạn 4 sao ti&ecirc;u chuẩn quốc tế, chung cư Star City L&ecirc; Văn Lương được thừa hưởng đầy đủ c&aacute;c tiện &iacute;ch hiện đại v&agrave; cao cấp trong khu vực: ph&ograve;ng đọc s&aacute;ch ph&ograve;ng tập thể thao, khu giải tr&iacute;, ph&ograve;ng đọc s&aacute;ch, chơi cờ, khu c&acirc;u lạc bộ người gi&agrave;, nh&agrave; trẻ, ph&ograve;ng xem phim, chơi game, khu mua sắm&hellip; ngay trong nh&agrave;. Đặc biệt, hệ thống bể bơi tr&ecirc;n tầng thượng một trong những sự kh&aacute;c biệt v&agrave; độc đ&aacute;o tại Star City.&nbsp;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 18tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 3, 'Full nội thất', NULL, '1601690304_11.jpg', '1601690304_1.jpg|1601690304_2.jpg|1601690304_3.jpg|1601690304_4.jpg|1601690304_5.jpg|1601690304_6.jpg|1601690304_7.jpg|1601690304_8.jpg|1601690304_9.jpg|1601690304_10.jpg|1601690304_11.jpg|1601690304_12.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 01:58:24', '2020-10-03 01:58:24'),
