(485, 'Cho thuê căn 3PN giá 12tr tại Chung cư Ban cơ yếu Chính phủ - Khuất Duy Tiến - Quận Thanh Xuân', 'cho-thue-can-3pn-gia-12tr-tai-chung-cu-ban-co-yeu-chinh-phu-khuat-duy-tien-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '124', 12000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 124m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung Cư Ban Cơ Yếu &nbsp;tọa lạc tại ng&otilde; 164 Khuất Duy Tiến &ndash; quận Thanh Xu&acirc;n &ndash; th&agrave;nh phố H&agrave; Nội. Đ&acirc;y l&agrave; một trục đường quy hoạch kết nối giao th&ocirc;ng từ Nguyễn Tu&acirc;n đến Nguyễn Xiển, ngo&agrave;i ra n&oacute; c&ograve;n kết nối thuận lợi ra đường L&ecirc; Văn Lương. Giao th&ocirc;ng l&agrave; một trong những điểm mạnh của dự &aacute;n.Ph&iacute;a T&acirc;y Bắc gi&aacute;p đường L&ecirc; Văn Lương v&agrave; nh&igrave;n về ph&iacute;a c&ocirc;ng vi&ecirc;n Trung H&ograve;a Nh&acirc;n Ch&iacute;nh, ph&iacute;a đ&ocirc;ng gi&aacute;p đường view nh&igrave;n về th&agrave;nh phố về Hapulico, ph&iacute;a T&acirc;y Nam gi&aacute;p đường view nh&igrave;n trực diện về đường Khuất Duy Tiến.<br />\r\nNgo&agrave;i ra, dự &aacute;n chung cư Ban Cơ Yếu &ndash; L&ecirc; Văn Lương tọa lạc vị tr&iacute; đắc địa n&ecirc;n những tiện &iacute;ch hạ tầng đồng bộ, cư d&acirc;n rất dễ di chuyển đến nhiều địa điểm li&ecirc;n quan đến gi&aacute;o dục v&agrave; y tế. Gần cTrường học: C&aacute;ch tiểu học Thanh Xu&acirc;n (600 m), THPT Amsterdam (1,5 km), THPT Nh&acirc;n Ch&iacute;nh (2 km), Đại học H&agrave; Nội (1 km), C&aacute;ch bệnh viện nội tiết chỉ 3,3 km, c&aacute;ch C&ocirc;ng vi&ecirc;n, hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh 500 m.<br />\r\nCuộc sống tại chung cư Ban Cơ Yếu &ndash; L&ecirc; Văn Lương được thừa hưởng kh&ocirc;ng gian xanh v&agrave; được bố tr&iacute; đầy đủ c&aacute;c tiện &iacute;ch phục vụ cho cư d&acirc;n sinh sống tại đ&acirc;y. Si&ecirc;u thị, trung t&acirc;m thương mại, nh&agrave; trẻ, trường học, khu sinh hoạt cộng đồng&hellip;tất cả đều được chủ đầu tư ch&uacute; trọng đ&aacute;p ứng đầy đủ nhất.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp;12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1601691902_20200731140809-dd14_wm.jpg', '1601691902_20200731140809-79b7_wm.jpg|1601691902_20200731140809-7374_wm.jpg|1601691902_20200731140809-dd9a_wm.jpg|1601691902_20200731140809-dd14_wm.jpg|1601691902_20200731140832-dfe9_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 02:25:02', '2020-10-03 02:30:44'),
