r&iacute;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601693767_20200212075917-60e4_wm.jpg', '1601693768_20200212075916-2a4b_wm.jpg|1601693768_20200212075916-2cb7_wm.jpg|1601693768_20200212075916-9fa2_wm.jpg|1601693768_20200212075917-60e4_wm.jpg|1601693768_20200212075917-c19e_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 02:56:08', '2020-10-03 02:56:08'),
(493, 'Cho thuê căn 3PN full nội thất giá 13tr tại Golden West Complex Lê Văn Thiêm - Quận Thanh Xuân', 'cho-thue-can-3pn-full-noi-that-gia-13tr-tai-golden-west-complex-le-van-thiem-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '96', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 96m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n tọa lạc tại KĐT mới &quot;Trung H&ograve;a - Nh&acirc;n Ch&iacute;nh&quot; thuộc quận Thanh Xu&acirc;n, HN, nơi đ&acirc;y giao th&ocirc;ng thuận lợi, giao thương ph&aacute;t triển, l&agrave; đầu mối giao th&ocirc;ng giữa c&aacute;c con đường V&agrave;nh đai 3 với khu C&aacute;t Linh - Giảng V&otilde;.&nbsp;</p>\r\n\r\n<p>Nằm gần c&aacute;c trung t&acirc;m đạo tạo, gi&aacute;o dục lớn, c&aacute;c trường Đại học lớn của HN như: Đại học H&agrave; Nội, Đại học Kiến Tr&uacute;c, ĐH KHXH v&agrave; Nh&acirc;n Văn, ĐH An Ninh, ĐH SP Nghệ Thuật trung ương, Đại Học Khoa Học Tự nhi&ecirc;n, HV C&ocirc;ng Nghệ Bưu Ch&iacute;nh Viễn Th&ocirc;ng, Đại Học X&acirc;y Dựng ...Nằm gần c&aacute;c trường tiểu học, trung học, phổ th&ocirc;ng như: Trường Mầm non Họa My, Trường tiểu học QT Bredon, Trường Cở Sở Phan Đ&Igrave;nh Gi&oacute;t, Trường Phổ Th&ocirc;ng Nh&acirc;n Ch&iacute;nh, Trường trung cấp Achimedes, trường PT chuy&ecirc;n Amsterdam ...</p>\r\n\r\n<p>Gần c&aacute;c bệnh viện: Bệnh viện x&acirc;y dựng, Bệnh viện Y cổ truyền (198 - BCA), Bệnh Viện Y Học Tuệ Tĩnh (Đường Nguyễn Tr&atilde;i), Bệnh viện 103 (H&agrave; Đ&ocirc;ng), Bệnh Viện Đa Khoa H&agrave; Đ&ocirc;ng, Gần viện y học h&agrave;ng kh&ocirc;ng, v&agrave; c&aacute;c t&ograve;a nh&agrave; chung cư lớn: Royal City Nguyễn Tr&atilde;i, T&ograve;a nh&agrave; KeangNam . Đồng thời nằm ngay tổ hợp c&aacute;c t&ograve;a nh&agrave; lớn như: T&ograve;a nh&agrave; Hapulico Center Building Vũ trọng phụng, T&ograve;a nh&agrave; Mandarin Garden ...<br />\r\nĐến với Golden West bạn sẽ cảm nhận được một cuộc sống ho&agrave;n mỹ nhất.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601693892_676e7d975d2aa274fb3b.jpg', '1601693892_6e765b8e7b33846ddd22.jpg|1601693892_7a6fdc95fc2803765a39.jpg|1601693892_676e7d975d2aa274fb3b.jpg|1601693892_b5b3ff46dffb20a579ea.jpg|1601693892_e40bd2f0f24d0d13545c.jpg|1601693892_ec688892a82f57710e3e.jpg|1601693892_f40637f81745e81bb154.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 02:58:12', '2020-10-03 02:58:12'),
