(502, 'Cho thuê căn 2PN full nội thất giá 13tr tại CC Gold Season Nguyễn Tuân - Quận Thanh Xuân', 'cho-thue-can-2pn-full-noi-that-gia-13tr-tai-cc-gold-season-nguyen-tuan-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '65', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Gold Season tọa lạc tại vị tr&iacute; đắc địa Q.Thanh Xuận, nơi c&oacute; giao th&ocirc;ng thuận lợi, cơ sở hạ tầng đồng bộ, hệ thống gi&aacute;o dục TOP đầu H&agrave; Nội. Mua sắm, vui chơi giải tr&iacute; v&agrave; di chuyển dễ d&agrave;ng bằng c&aacute;c con đường huyết mạch: L&ecirc; Văn Lương, Nguyễn Tr&atilde;i, Trần Duy Hưng, L&aacute;ng, V&agrave;nh đại 3.<br />\r\nNgo&agrave;i ra với lợi thế nằm tr&ecirc;n tuyến xe Bus nhanh BRT đ&atilde; đi v&agrave;o hoạt đồng, tuyến t&agrave;u điện tr&ecirc;n cao sắp đưa v&agrave;o vận h&agrave;nh.&nbsp;<br />\r\nSống tại Gold Season cư d&acirc;n được hưởng tới 99 tiện &iacute;ch kh&aacute;c nhau, với an ninh 3 lớp kh&eacute;p k&iacute;n an to&agrave;n tuyệt đối, hệ thống quản l&yacute; t&ograve;a nh&agrave; th&ocirc;ng minh, hệ thống ph&ograve;ng ch&aacute;y tự động, đơn vị quản l&yacute; t&ograve;a nh&agrave; chuy&ecirc;n nghiệp. Điểm nhấn của dự &aacute;n l&agrave; c&ocirc;ng vi&ecirc;n Manhattan, đ&acirc;y được v&iacute; như l&aacute; phổi xanh của dự &aacute;n. Nơi sẽ đ&acirc;y diễn ra mọi hoạt đồng ngo&agrave;i trời của cư d&acirc;n từ giải tr&iacute;, thể thao đến thư gi&atilde;n.</p>\r\n\r\n<p>Ngo&agrave;i ra dự &aacute;n Gold Season c&ograve;n được đầu tư ri&ecirc;ng một trường học mẫu gi&aacute;o chất lượng cao d&agrave;nh ri&ecirc;ng cho con em cư d&acirc;n, được kết nối trực tiếp với c&ocirc;ng vi&ecirc;n tạo m&ocirc;i trường mở trong c&aacute;c hoạt đồng ngo&agrave;i trời.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;:13&nbsp;tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601696878_9.jpg', '1601696878_1.jpg|1601696878_2.jpg|1601696878_3.jpg|1601696878_4.jpg|1601696878_5.jpg|1601696878_6.jpg|1601696878_7.jpg|1601696878_8.jpg|1601696878_9.jpg|1601696878_10.jpg|1601696878_11.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 03:47:58', '2020-10-03 03:47:58'),
