(508, 'Cho thuê căn 3PN giá 9.5tr tại Licogi 13 Tower Khuất Duy Tiến - Quận Thanh Xuân', 'cho-thue-can-3pn-gia-95tr-tai-licogi-13-tower-khuat-duy-tien-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '92', 9500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 92m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTừ vị tr&iacute; t&ograve;a nh&agrave;, dễ d&agrave;ng di chuyển tới đường Nguyễn Tr&atilde;i, V&agrave;nh Đai 3 - L&ecirc; Văn Lương, Trần Duy Hưng, L&aacute;ng Hạ... kết nối nhanh ch&oacute;ng tới quận Nam Từ Li&ecirc;m, Cầu Giấy v&agrave; Đống Đa.<br />\r\nGần với:&nbsp;Văn ph&ograve;ng C&ocirc;ng Chứng Thanh Xu&acirc;n, Nh&agrave; văn ho&aacute; quận Thanh Xu&acirc;n, Trường Đại học Ph&ograve;ng Ch&aacute;y Chữa Ch&aacute;y, di chuyển 01 km tới Trung T&acirc;m Hội nghị Quốc Gia, Bảo T&agrave;ng H&agrave; Nội, BigC Thăng Long, Đại Lộ Thăng Long.</p>\r\n\r\n<p>Đi khoảng 03 km tới Bến xe Mỹ Đ&igrave;nh, Khu li&ecirc;n hợp thể thao Mỹ Đ&igrave;nh, S&acirc;n vận động Mỹ Đ&igrave;nh. Tới trung t&acirc;m c&aacute;c quận l&acirc;n cận Đống Đa, Cầu Giấy chỉ mất 10 ph&uacute;t.<br />\r\nXung quanh t&ograve;a nh&agrave; c&oacute; nhiều nh&agrave; h&agrave;ng v&agrave; trung t&acirc;m thương mại, si&ecirc;u thị phục vụ kh&aacute;ch thu&ecirc; như: Nh&agrave; H&agrave;ng At, Anh H&ograve;a Bakery, Bami Bread Tố Hữu, Cafe Nguyễn, Si&ecirc;u thị BigC, Vinmart+...</p>\r\n\r\n<p>Trong t&ograve;a nh&agrave; v&agrave; l&acirc;n cận t&ograve;a nh&agrave; c&oacute; c&aacute;c ng&acirc;n h&agrave;ng: Ng&acirc;n H&agrave;ng Tmcp Ti&ecirc;n Phong (Tpbank), Agribank-Chi nh&aacute;nh L&aacute;ng Hạ, ATM- BIDV, ATM Techcombank, ATM - Maritime Bank&hellip;phục vụ nhu cầu giao dịch t&agrave;i ch&iacute;nh của kh&aacute;ch thu&ecirc;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1601708993_20200911112245-cd48_wm.jpg', '1601708993_20200911112245-cd48_wm.jpg|1601708993_20200911112249-5dc8_wm.jpg|1601708993_20200911112253-66b6_wm.jpg|1601708993_20200911112258-8bb4_wm.jpg|1601708993_20200911112258-e7bd_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 07:09:53', '2020-10-03 07:09:53'),
