(511, 'Cho thuê căn 3PN full nội thất giá 14tr tại Hapulico Complex Thanh Xuân', 'cho-thue-can-3pn-full-noi-that-gia-14tr-tai-hapulico-complex-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '110', 14000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 110m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 03 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nDự &aacute;n Hapulico Complex l&agrave; tổ hợp c&aacute;c c&ocirc;ng tr&igrave;nh khu thương mại, văn ph&ograve;ng, nh&agrave; ở cao cấp, nh&agrave; trẻ được x&acirc;y dựng&nbsp;ở vị tr&iacute; cực kỳ đắc địa: 3 mặt phố Nguyễn Huy Tưởng, Vũ Trọng Phụng v&agrave; Ngụy Như Kon Tum.</p>\r\n\r\n<p>C&aacute;c tiện &iacute;ch nhằm phục vụ tối đa bao gồm những căn hộ cao cấp, những văn ph&ograve;ng hiện đại v&agrave; trung t&acirc;m mua sắm lớn bậc nhất nh&igrave; H&agrave; Nội, trường học, bể bơi, ph&ograve;ng tập thể thao, s&acirc;n chơi cho trẻ em, khu vui chơi cho gia đ&igrave;nh &hellip; tất cả đều được bao quanh bởi những khu&ocirc;n vi&ecirc;n tr&agrave;n ngập m&agrave;u xanh v&agrave; &aacute;nh nắng.<br />\r\nHapulico Complex được x&acirc;y dựng theo ti&ecirc;u chuẩn quốc tế nhằm l&agrave;m h&agrave;i l&ograve;ng những chủ nh&acirc;n kh&oacute; t&iacute;nh nhất.&nbsp;Khu trung t&acirc;m thương mại được coi l&agrave; một điểm nhấn của khu Tổ hợp, với kh&ocirc;ng gian rộng lớn, được ph&acirc;n bổ đều tại c&aacute;c khối đế trong tất cả c&aacute;c t&ograve;a nh&agrave; của khu Hapulico Complex. Vị tr&iacute; thuận lợi cho việc đi lại, mua sắm, v&agrave; giải tr&iacute;.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601709666_20200925103304-9771_wm.jpg', '1601709666_20200925103304-0f7a_wm.jpg|1601709666_20200925103304-5fb6_wm.jpg|1601709666_20200925103304-9771_wm.jpg|1601709666_20200925103304-cb75_wm.jpg|1601709666_20200925103304-d148_wm.jpg|1601709666_20200925103331-ed99_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 07:21:06', '2020-10-03 07:21:06'),
