, 2, 'Nội thất cơ bản', NULL, '1601710560_thumb.jpg', '1601710560_1.jpg|1601710560_4.jpg|1601710560_5.jpg|1601710560_6.jpg|1601710560_7.jpg|1601710560_8.jpg|1601710560_9.jpg|1601710560_10.jpg|1601710560_12.jpg|1601710560_thumb.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 07:36:00', '2020-10-03 07:36:00');
