ong khu vực c&oacute; cơ sở hạ tầng về giao th&ocirc;ng, kinh tế, gi&aacute;o dục ph&aacute;t triển hiện đại nhất H&agrave; nội. Tiện &iacute;ch nội khu với bể bơi bốn m&ugrave;a, GYM, SPA, khu vui chơi trẻ em, khu mua sắm, hệ thống gi&aacute;o dục quốc tế.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 14tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601711354_1.jpg', '1601711354_1.jpg|1601711354_2.jpg|1601711354_3.jpg|1601711354_4.jpg|1601711354_5.jpg|1601711354_6.jpg|1601711354_7.jpg|1601711354_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 07:49:14', '2020-10-03 07:49:14'),
