(523, 'Cho thuê căn 2PN giá 9tr tại Chung cư 282 Nguyễn Huy Tưởng - Quận Thanh Xuân', 'cho-thue-can-2pn-gia-9tr-tai-chung-cu-282-nguyen-huy-tuong-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '65', 9000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm tại khu đất v&agrave;ng của Quận Thanh Xu&acirc;n, chung cư Bộ C&ocirc;ng An 282 Nguyễn Huy Tưởng tọa lạc tr&ecirc;n tuyến đường Nguyễn Huy Tưởng. Với lợi thế vượt trội, dự &aacute;n được kết nối với nhiều con phố lớn như: Nguyễn Tr&atilde;i, L&ecirc; Văn Lương, Vũ Trọng Phụng, Ngụy cư Kom Tum, đường v&agrave;nh đai 3&hellip; cũng như tuyến đường sắt tr&ecirc;n cao H&agrave; Đ&ocirc;ng &ndash; C&aacute;t Linh.</p>\r\n\r\n<p>Với vị tr&iacute; n&agrave;y, cũng như những cư d&acirc;n chung cư quận Thanh Xu&acirc;n, cư d&acirc;n sẽ rất thuận tiện trong việc di chuyển qua lại tới những khu vực trong v&agrave; ngoại th&agrave;nh. Đặc biệt, vị tr&iacute; dự &aacute;n tọa lạc gần với nhiều trung t&acirc;m h&agrave;nh ch&iacute;nh, nền gi&aacute;o dục của Thủ Đ&ocirc; từ cấp mầm non đới đại học, dễ d&agrave;ng với những bệnh viện, c&ocirc;ng vi&ecirc;n, c&aacute;c trung t&acirc;m thương mại lớn, nhiều khu đ&ocirc; thị l&acirc;n cận.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 9tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601712025_5.jpg', '1601712025_1.jpg|1601712025_2.jpg|1601712025_3.jpg|1601712025_4.jpg|1601712025_5.jpg|1601712025_6.jpg|1601712025_7.jpg|1601712025_8.jpg|1601712025_9.jpg|1601712025_10.jpg', NULL, NULL, 'Vũ