(526, 'Cho thuê căn 2PN full nội thất giá 10tr tại Mỹ Sơn Tower Nguyễn Huy Tưởng - Quận Thanh Xuân', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-my-son-tower-nguyen-huy-tuong-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '70', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 70m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Mỹ sơn tọa lạc tại 62 Nguyễn Huy Tưởng, nằm ở trung t&acirc;m Quận Thanh Xu&acirc;n, Mỹ Sơn Tower nằm trong khu d&acirc;n cư với hệ thống hạ tầng hiện đại đồng bộ v&agrave; c&oacute; c&aacute;c tiện &iacute;ch c&ocirc;ng cộng như gi&aacute;o dục, thể thao, văn h&oacute;a v&agrave; h&agrave;nh ch&iacute;nh.</p>\r\n\r\n<p>T&ograve;a nh&agrave; kết nối giao th&ocirc;ng thuận lợi với c&aacute;c đường giao th&ocirc;ng ch&iacute;nh như L&ecirc; Văn Lương, Nguyễn Tr&atilde;i, L&aacute;ng v&agrave; Khuất Duy Tiến nhưng vẫn c&oacute; được kh&ocirc;ng kh&iacute; y&ecirc;n tĩnh. Tiểu khu c&oacute; m&ocirc;i trường gi&aacute;o dục cao với nhiều trường học tốt từ cấp nh&agrave; trẻ đến đại học.<br />\r\nNgo&agrave;i ra, chung cư Mỹ Sơn c&ograve;n tiếp gi&aacute;p nhiều trung t&acirc;m mua sắm lớn hiện đại, khu vui chơi giải tr&iacute;, c&aacute;c trung t&acirc;m h&agrave;nh ch&iacute;nh&hellip; C&ocirc;ng tr&igrave;nh c&oacute; yếu tố l&yacute; tưởng cho cuộc sống gia đ&igrave;nh hạnh ph&uacute;c v&agrave; th&agrave;nh c&ocirc;ng.<br />\r\nTừ dự &aacute;n bạn c&oacute; thể đi đến c&aacute;c khu thương mại, si&ecirc;u thị mua sắm kh&ocirc;ng c&ograve;n l&agrave; vấn đề quan ngại: C&aacute;ch tổ hợp Hapulico 100m, dự &aacute;n Mardarin Garden 500m, si&ecirc;u thị BigC 1km, trường Amsterdam 1km, Royal City 1km, Đại học Khoa học X&atilde; hội v&agrave; Nh&acirc;n văn 1km, trung t&acirc;m Hội nghị Quốc Gia , Bảo t&agrave;ng H&agrave; Nội 1, rạp chiều phim Quốc Gia 1.5km.&nbsp;<br />\r\nMỹ Sơn Tower kh&ocirc;ng chỉ được hưởng một tiện &iacute;ch khu vực hiện đại v&agrave; chất lượng cao, bản th&acirc;n Khu chung cư cao cấp Mỹ Sơn Tower c&ograve;n được bố tr&iacute; một kh&ocirc;ng gian sống v&agrave; l&agrave;m việc hết sức tiện nghi v&agrave; ho&agrave;n hảo, t&ograve;a nh&agrave; c&oacute; đầy đủ c&aacute;c hạng mục tiện &iacute;ch cho cư d&acirc;n sống tại đ&acirc;y.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601712852_20200901135244-ca12_wm.jpg', '1601712852_20200901135243-6d4e_wm.jpg|1601712852_20200901135243-1478_wm.jpg|1601712852_20200901135243-2239_wm.jpg|1601712852_20200901135243-be81_wm.jpg|1601712852_20200901135243-c29d_wm.jpg|1601712852_20200901135244-39a4_wm.jpg|1601712852_20200901135244-95da_wm.jpg|1601712852_20200901135244-ca12_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 08:14:12', '2020-10-03 08:14:12'),
