rc;n văn 1km, trung t&acirc;m Hội nghị Quốc Gia , Bảo t&agrave;ng H&agrave; Nội 1, rạp chiều phim Quốc Gia 1.5km.&nbsp;<br />\r\nMỹ Sơn Tower kh&ocirc;ng chỉ được hưởng một tiện &iacute;ch khu vực hiện đại v&agrave; chất lượng cao, bản th&acirc;n Khu chung cư cao cấp Mỹ Sơn Tower c&ograve;n được bố tr&iacute; một kh&ocirc;ng gian sống v&agrave; l&agrave;m việc hết sức tiện nghi v&agrave; ho&agrave;n hảo, t&ograve;a nh&agrave; c&oacute; đầy đủ c&aacute;c hạng mục tiện &iacute;ch cho cư d&acirc;n sống tại đ&acirc;y.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cơ bản', NULL, '1601713282_4.jpg', '1601713282_4.jpg|1601713282_6.jpg|1601713282_7.jpg|1601713282_8.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-03 08:21:22', '2020-10-03 08:21:22'),
(529, 'Cho thuê căn 2PN full nội thất giá 10tr tại Rivera Park Vũ Trọng Phụng - Quận Thanh Xuân', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-rivera-park-vu-trong-phung-quan-thanh-xuan', 'Quận Thanh Xuân, Thành phố Hà Nội', 2, '134', '75', 10000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 75m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTọa lạc tại 69 Vũ Trọng Phụng, Thanh Xu&acirc;n &ndash; &nbsp; vị tr&iacute; đặc địa thuộc quận trung t&acirc;m cũ của Thủ đ&ocirc; H&agrave; Nội, cư d&acirc;n của Chung cư Rivera Park Hà N&ocirc;̣i c&oacute; thể tận hưởng tất cả c&aacute;c tiện &iacute;ch cần thiết cho cuộc sống tiện nghi h&agrave;ng ng&agrave;y trong v&ograve;ng b&aacute;n k&iacute;nh tối đa 3 Km như trường học, bệnh viện, si&ecirc;u thị, trung t&acirc;m thể thao, c&ocirc;ng tr&igrave;nh t&ocirc;n gi&aacute;o&hellip;</p>\r\n\r\n<p>Dự &aacute;n nằm trong khu vực d&acirc;n cư đ&ocirc;ng đ&uacute;c, hạ tầng x&atilde; hội v&agrave; hạ tầng kỹ thuật đầy đủ: ngay gần chợ, si&ecirc;u thị, bệnh viện, c&aacute;c trường học (gần nhiều trường đại học lớn: Đại học khoa học tự nhi&ecirc;n; X&atilde; hội v&agrave; nh&acirc;n văn; Kiến tr&uacute;c; H&agrave; Nội); tương đối gần c&aacute;c khu vui chơi giải tr&iacute;, rạp chiếu phim lớn như TT chiếu phim Quốc gia, TTTM Mipectower, Parkson, Big C, Cineplex, Lotte cinema. Rivera Park H&agrave; Nội gần c&aacute;c bệnh viện lớn như Bệnh Viện X&acirc;y Dựng, Trung t&acirc;m Y tế quận Thanh Xu&acirc;n, Bệnh viện 103...<br />\r\nTại Rivera Park Hà N&ocirc;̣i, Chủ đầu tư đ&atilde; đầu tư d&agrave;nh ri&ecirc;ng 01(một) tầng với đầy đủ c&aacute;c loại tiện &iacute;ch d&agrave;nh ri&ecirc;ng cho cư d&acirc;n như Bể bơi, ph&ograve;ng Gym, Nh&agrave; c&acirc;u lạc bộ (Club house), Khu vui chơi trẻ em (Kid corner) &hellip;</p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, Chủ đầu tư c&ograve;n đầu tư c&aacute;c loại tiện &iacute;ch kh&aacute;c m&agrave; cư d&acirc;n cần để c&oacute; thể đ&aacute;p ứng mọi nhu cầu trong cuộc sống h&agrave;ng ng&agrave;y như trung t&acirc;m thương mại, qu&aacute;n cafe, cửa h&agrave;ng tiện &iacute;ch...Khu vực vườn hoa c&acirc;y xanh rộng r&atilde;i xen lẫn kh&ocirc;ng gian khối nh&agrave; mang lại bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh, kh&ocirc;ng gian sinh hoạt cộng đồng văn minh, l&agrave;nh mạnh.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601865329_20200131101025-fb46_wm.jpg', '1601865329_20200131101025-fb46_wm.jpg|1601865329_20200131101114-3462_wm.jpg|1601865329_20200131101134-875e_wm.jpg|1601865329_20200131101157-2c83_wm.jpg|1601865329_20200131101206-3e0c_wm.jpg|1601865329_20200131101233-218c_wm.jpg|1601865329_20200131101726-9964_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-05 02:35:29', '2020-10-05 02:35:29'),
