(535, 'Cho thuê căn 2PN full nội thất giá 10tr tại CC Vinaconex 1 - Khúc Thừa Dụ - Quận Cầu Giấy', 'cho-thue-can-2pn-full-noi-that-gia-10tr-tai-cc-vinaconex-1-khuc-thua-du-quan-cau-giay', 'Phố Khúc Thừa Dụ, P. Dịch Vọng, Q. Cầu Giấy, Hà Nội', 2, '135', '65', 12000000, 0, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 65m2.<br />\r\nThiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm tại trung t&acirc;m quận Cầu Giấy, c&aacute;ch C&ocirc;ng vi&ecirc;n Cầu Giấy chỉ 500m, chung cư Vinaconex 3 sở hữu vị tr&iacute; đắc địa cho cư d&acirc;n tại đ&acirc;y sinh sống v&agrave; l&agrave;m việc.&nbsp;<br />\r\nXung quanh l&agrave; hệ thống c&aacute;c trường tiểu học, mầm non nổi tiếng của quận Cầu Giấy như: Alaska, Gate Way, Sakura, Thăng Long kidmart, Fuji...<br />\r\nThuận tiện di chuyển ra c&aacute;c khu phố lớn như Duy T&acirc;n, Trần Th&aacute;i T&ocirc;ng, Phạm H&ugrave;ng, Trung K&iacute;nh, Xu&acirc;n Thủy, Cầu Giấy...<br />\r\nVới lợi thế nằm gần c&ocirc;ng vi&ecirc;n, mặt chung cư hướng về c&ocirc;ng vi&ecirc;n Cầu Giấy, chung cư Vinaconex được hưởng kh&ocirc;ng kh&iacute; trong l&agrave;nh, m&aacute;t mẻ v&agrave; h&agrave;ng loạt tiện &iacute;ch ngoại khu kh&aacute;c.&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 12tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601869860_ceb320eb63a19dffc4b0.jpg', '1601869861_2aa313f850b2aeecf7a3.jpg|1601869861_64c5a7ebe4a11aff43b0.jpg|1601869861_09717020336acd34947b.jpg|1601869861_96120671453bbb65e22a.jpg|1601869861_ceb320eb63a19dffc4b0.jpg|1601869861_f4e652531119ef47b608.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-05 03:51:01', '2020-10-05 03:51:01'),
(536, 'Cho thuê căn 2PN giá 8.5tr tại Chung cư Thái Hà BCA Phạm Văn Đồng', 'cho-thue-can-2pn-gia-85tr-tai-chung-cu-thai-ha-bca-pham-van-dong', '43 Phạm Văn Đồng, P. Cổ Nhuế 2, Bắc Từ Liêm, Hà Nội', 2, '39', '72', 8500000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 72m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nChung cư Th&aacute;i H&agrave; &ndash; Bộ c&ocirc;ng an Cổ Nhuế 2 tọa lạc Số 43 Phạm Văn Đồng &ndash; Quận Bắc Từ Li&ecirc;m, H&agrave; Nội sở hữu một trong những vị tr&iacute; bậc nhất H&agrave; Nội:<br />\r\nĐ&acirc;y l&agrave; vị tr&iacute; huyết mạch kết nối giao th&ocirc;ng của Thủ Đ&ocirc; bằng c&aacute;c con đường như: Ho&agrave;ng Quốc Việt đi T&acirc;y Hồ ,Hồ T&ugrave;ng Mậu, Xu&acirc;n Thuỷ kết nối quận Cầu Giấy đi Sơn T&acirc;y, đường Phạm Văn Đồng.<br />\r\nTừ vị tr&iacute; dự &aacute;n bạn dễ d&agrave;ng di chuyển thuận tiện v&agrave; nhanh ch&oacute;ng đến S&acirc;n bay Quốc Tế Nội B&agrave;i,Khu c&ocirc;ng nghiệp Thăng Long, C&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y, KĐT&nbsp;Ngoại Giao đo&agrave;n.<br />\r\nGần c&ocirc;ng vi&ecirc;n hồ điều h&ograve;a Th&agrave;nh Phố Giao Lưu, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Mai Dịch, c&ocirc;ng Nghĩa Đ&ocirc; v&agrave; C&ocirc;ng vi&ecirc;n Cầu Giấy,&hellip;.<br />\r\nC&aacute;c si&ecirc;u thị mua sắm lớn như Metro, Vinmart,&hellip;mua sắm thả ga.<br />\r\nGần nhiều bệnh viện lớn, nhỏ như Bệnh viện E, bệnh viện 198, bệnh viện Y học cổ truyền&hellip;.<br />\r\nGần nhiều trường Đại Hoc nổi tiếng nhất tại Việt Nam như ĐH Quốc Gia, Thương Mại, Ngoại ngữ, Sư phạm, học viện B&aacute;o ch&iacute; v&agrave; Tuy&ecirc;n Truyền,&hellip;<br />\r\nTại đ&acirc;y cư d&acirc;n c&oacute; thể tận hưởng dịch vụ tiện &iacute;ch v&ocirc; c&ugrave;ng nổi bật: Hệ thống trung t&acirc;m thương mại, mua sắm được x&acirc;y dựng đồng bộ ngay dưới sảnh t&ograve;a nh&agrave;; Trung t&acirc;m tập Gym, Spa...;Khu vui chơi giải tr&iacute; cho c&aacute;c bạn nhỏ trong to&agrave;n t&ograve;a nh&agrave;.<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 8.5tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Nội thất cơ bản', NULL, '1601870152_a18e835c95166b483207.jpg', '1601870152_01ea38312e7bd025896a.jpg|1601870152_1a3d68e77ead80f3d9bc.jpg|1601870152_1c29c48dd2c72c9975d6.jpg|1601870152_14cb69147f5e8100d84f.jpg|1601870152_121f36cc2086ded88797.jpg|1601870152_584cdeebc8a136ff6fb0.jpg|1601870152_387317ab01e1ffbfa6f0.jpg|1601870152_957232d5249fdac1838e.jpg|1601870152_6730319727ddd98380cc.jpg|1601870152_a18e835c95166b483207.jpg|1601870152_c86cf1b1e7fb19a540ea.jpg|1601870152_f6c11c190a53f40dad42.jpg|1601870152_ffeacc36da7c24227d6d.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-05 03:55:52', '2020-10-05 03:55:52'),
(537, 'Cho thuê căn 2PN full nội thất giá 13tr tại Goldmark City Hồ Tùng Mậu', 'cho-thue-can-2pn-full-noi-that-gia-13tr-tai-goldmark-city-ho-tung-mau', '136 Hồ Tùng Mậu, Phường Phú Diễn, Bắc Từ Liêm, Hà Nội', 2, '8', '83', 13000000, 1, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 83m2, t&ograve;a S3.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất: giường, tủ, điều h&ograve;a, n&oacute;ng lạnh, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Tọa lạc tại vị tr&iacute; đắc địa, nơi sẽ l&agrave; trung t&acirc;m h&agrave;nh ch&iacute;nh v&agrave; kinh tế của Thủ đ&ocirc; trong tương lai, đầu mối trung t&acirc;m kết nối c&aacute;c trục đường lớn. GoldMark City &ndash; nằm ngay tr&ecirc;n mặt đường Nguyễn Cơ Thạch k&eacute;o d&agrave;i, đối diện khu c&ocirc;ng vi&ecirc;n v&agrave; hồ điều h&ograve;a Mai Dịch gần 2 ha đ&atilde; được quy hoạch. Một vị tr&iacute; đắc địa, một điểm cộng vượt trội cho Goldmark City.</p>\r\n\r\n<p>Đặc biệt, đ&acirc;y cũng l&agrave; nơi tập trung tất cả c&aacute;c tuyến xe li&ecirc;n tỉnh, đặc biệt l&agrave; c&aacute;c tỉnh ph&iacute;a Đ&ocirc;ng, ph&iacute;a Nam Thủ đ&ocirc; như Bắc Ninh, Hưng Y&ecirc;n, Hải Dương, H&agrave; Nam, Ninh B&igrave;nh, Th&aacute;i B&igrave;nh, Nam Định, Thanh H&oacute;a, Nghệ An&hellip;</p>\r\n\r\n<p>Dễ d&agrave;ng di chuyển đến c&aacute;c địa điểm bệnh viện, trường đại học, bến xe: C&aacute;ch Đại học Thương Mại, Đại học S&acirc;n khấu Điện ảnh, Đại học Quốc Gia, Đại học Ngoại ngữ 0.3km; C&aacute;ch bệnh viện 198 0.9km; đi xe m&aacute;y đến S&acirc;n vận động Mỹ Đ&igrave;nh khoảng 3p;gần c&aacute;c si&ecirc;u thị Fivimart, Pico Plaza, Media mart&hellip; Chung cư TNR GoldMark City t&iacute;ch hợp hơn 20 tiện &iacute;ch đẳng cấp như: Khu vui chơi trẻ em, Trung t&acirc;m thương mại hiện đại, Bar &ndash; Caf&eacute;, Vườn BBQ ngo&agrave;i trời, Spa thư gi&atilde;n &ndash; X&ocirc;ng hơi, Ph&ograve;ng tập Gym hiện đại&hellip;</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 1, 'Full nội thất', NULL, '1601870434_9785845d5c16a248fb07.jpg', '1601870434_7e0753a76d1d9243cb0c.jpg|1601870434_69aa2c0df4460a185357.jpg|1601870434_6895132d2d97d2c98b86.jpg|1601870434_9785845d5c16a248fb07.jpg|1601870434_b02ff5abcb11344f6d00.jpg|1601870434_bd2cf38c2bc7d5998cd6.jpg|1601870434_c205a1dc799787c9de86.jpg|1601870434_dedc0e7a30c0cf9e96d1.jpg|1601870434_df573ce7025dfd03a44c.jpg|1601870434_e0824c26946d6a33337c (1).jpg|1601870434_e0824c26946d6a33337c.jpg|1601870434_ef53caf7f44d0b13525c.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-05 04:00:34', '2020-10-05 04:00:34'),
(538, 'Cho thuê căn 2PN full nội thất giá 11tr tại CC 18T2 Trung Hòa Nhân Chính', 'cho-thue-can-2pn-full-noi-that-gia-11tr-tai-cc-18t2-trung-hoa-nhan-chinh', 'Đường Hoàng Đạo Thúy, Trung Hoà, Cầu Giấy, Hà Nội', 2, '136', '107', 11000000, 1, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 107m2.</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nTổ hợp chung cư Ho&agrave;ng Đạo Th&uacute;y &ndash; Trung H&ograve;a Nh&acirc;n ch&iacute;nh nằm tr&ecirc;n mặt đường Ho&agrave;ng Đạo Th&uacute;y. . Tuyến đường Ho&agrave;ng đạo th&uacute;y gồm 2 l&agrave;n đường nối 2 tuyến đường lớn l&agrave; Trần Duy Hưng v&agrave; L&ecirc; Văn Lương. N&ecirc;n c&oacute; thể n&oacute;i vị tr&iacute; n&agrave;y rất thuận tiện kh&ocirc;ng những cho hộ gia đ&igrave;nh ở m&agrave; c&aacute;c c&ocirc;ng ty thu&ecirc; l&agrave;m văn ph&ograve;ng cũng rất hợp l&yacute; bởi từ đ&acirc;y c&oacute; thể đi sang mảnh &ldquo;đất v&agrave;ng Đống Đa&rdquo; một khu kinh tế ph&aacute;t triển của H&agrave; Nội.</p>\r\n\r\n<p>Từ chung cư Ho&agrave;ng Đạo Th&uacute;y &ndash; Trung H&ograve;a Nh&acirc;n Ch&iacute;nh đi v&agrave;o Quận Đồng Đa chỉ mất 7 Ph&uacute;t, Sang tuyến đường V&agrave;nh Đai 3, khu H&agrave; Đ&ocirc;ng, Mỹ Đ&igrave;nh, Cầu Giấy chỉ mất từ 10 đến 15 ph&uacute;t. Chung cư 17T Trung H&ograve;a Nh&acirc;n Ch&iacute;nh chỉ c&aacute;ch trung t&acirc;m thương mại Big C, Grand Plaza chỉ hơn 1Km, v&agrave; c&aacute;ch bến xe Mỹ Đ&igrave;nh 15 ph&uacute;t đi xe.C&aacute;ch Trung t&acirc;m văn ho&aacute; của Thủ đ&ocirc; như: Keang Nam, S&acirc;n vận động Quốc gia Mỹ Đ&igrave;nh, Trung t&acirc;m hội nghị quốc gia... chỉ với 10 ph&uacute;t l&aacute;i xe.<br />\r\nTổ hợp chung cư Ho&agrave;ng Đạo Th&uacute;y &ndash; Trung H&ograve;a Nh&acirc;n ch&iacute;nh gồm gần 20 &nbsp;t&ograve;a chung cư về cơ bản tất cả những tiện &iacute;ch sinh hoạt h&agrave;ng ng&agrave;y đ&atilde; ho&agrave;n thiện,<br />\r\n&ndash; Hệ thống si&ecirc;u thị đ&atilde; hoạt động tại dưới tầng thương mại t&ograve;a chung cư hoặc tại khu thương mại Vinmart<br />\r\n&ndash; &nbsp;Hệ thống cửa h&agrave;ng ăn uống dọc tuyến đường Ho&agrave;ng Đạo Th&uacute;y, Nguyễn Thị Định, Trần Duy Hưng.<br />\r\n&ndash; Hệ thống giải tr&iacute; Karaoke tại Dọc trục Trần Duy Hưng&hellip;<br />\r\n&ndash; Hệ Thống Gara sửa chữa oto tr&ecirc;n đường Trần Duy Hưng, L&ecirc; Văn Lương, Hệ thống ng&acirc;n h&agrave;ng tại từng t&ograve;a nh&agrave; lớn<br />\r\n&ndash; Hệ thống Trường Học gần t&ograve;a 17T7<br />\r\nV&agrave; nhiều tiện &iacute;ch kh&aacute;c&hellip;&hellip;&hellip;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 11tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;<br />\r\n4. Li&ecirc;n hệ<br />\r\nSĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601870886_5afeca9974df8a81d3ce.jpg', '1601870886_4bebc58d7bcb8595dcda.jpg|1601870886_5afeca9974df8a81d3ce.jpg|1601870887_5ffcf99b47ddb983e0cc.jpg|1601870887_94f8e49f5ad9a487fdc8.jpg|1601870887_229a80fd3ebbc0e599aa.jpg|1601870887_5518b57c0b3af564ac2b.jpg|1601870887_5846f0214e67b039e976.jpg|1601870887_c4b84edef0980ec65789.jpg|1601870887_c3324a55f4130a4d5302.jpg|1601870887_cd69020dbc4b42151b5a.jpg|1601870887_fdf16696d8d0268e7fc1.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-05 04:08:07', '2020-10-05 04:08:07'),
(539, 'Cho thuê căn 3PN full nội thất giá 13tr khu Ngoại Giao Đoàn', 'cho-thue-can-3pn-full-noi-that-gia-13tr-khu-ngoai-giao-doan', 'P. Xuân Đỉnh, Q. Bắc Từ Liêm, Hà Nội', 2, '9', '95m', 13000000, 2, '<p>1. Th&ocirc;ng tin căn hộ</p>\r\n\r\n<p>Căn hộ rộng 95m2, nằm tại t&ograve;a N01T1.</p>\r\n\r\n<p>Căn hộ thiết kế hợp l&yacute; bao gồm 03&nbsp;ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.</p>\r\n\r\n<p>Full nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...</p>\r\n\r\n<p>T&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p>2. Tiện &iacute;ch</p>\r\n\r\n<p>Nằm trong quy hoạch tổng thể lớn với tổng diện t&iacute;ch l&ecirc;n đến 62.8ha, Khu Ngoại Giao Đo&agrave;n h&ocirc;i tụ đầy đủ c&aacute;c chức năng tiện &iacute;ch vượt trội v&agrave; đẳng cấp: khu mua sắm, vui chơi &ndash; giải tr&iacute;, khu trường học hiện đại, khối nh&agrave; ở gồm 23 t&ograve;a từ 21 đến 45 tầng/t&ograve;a, c&ugrave;ng rất nhiều tiện &iacute;ch như rạp chiếu phim, s&acirc;n tennis, bể bơi trong nh&agrave;, bể bơi ngo&agrave;i trời, ph&ograve;ng tập gym, spa, khu tập golf mini, s&acirc;n b&oacute;ng đ&aacute;, cầu l&ocirc;ng&hellip;</p>\r\n\r\n<p>Vị tr&iacute; thuận lợi, dễ d&agrave;ng di chuyển: gần c&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, c&ocirc;ng vi&ecirc;n Ngoại Giao Đo&agrave;n, Hồ T&acirc;y; đi xe ra đường Phạm Văn Đồng khoảng 3 ph&uacute;t,đường Nguyễn Văn Huy&ecirc;n, Ho&agrave;ng Quốc Việt khoảng 4 ph&uacute;t.</p>\r\n\r\n<p>3. Gi&aacute; thu&ecirc;:</p>\r\n\r\n<p>Gi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT&nbsp;0985622139 hoặc Zalo&nbsp;0985622139</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất', NULL, '1601884025_cb7a648d7ed88086d9c9.jpg', '1601884025_0f3d74f26ea790f9c9b6.jpg|1601884025_1df8f024ea71142f4d60.jpg|1601884025_2e2c8ce896bd68e331ac.jpg|1601884025_3cf7