052bfb75a23a.jpg|1601889019_72d6ada737f3c9ad90e2.jpg|1601889019_87b1a29339c7c7999ed6.jpg|1601889019_0566ed0b775f8901d04e.jpg|1601889019_927eb3cd2899d6c78f88.jpg|1601889019_5683e32378778629df66.jpg|1601889019_9271f77773238d7dd432.jpg|1601889019_a2490bf090a46efa37b5.jpg|1601889019_ad93eaf270a68ef8d7b7.jpg|1601889019_b7085b92c0c63e9867d7.jpg|1601889019_c692d63e4f6ab134e87b.jpg|1601889019_e3c1d33a486eb630ef7f.jpg|1601889019_f97f62c4f99007ce5e81.jpg|1601889019_f305f2ab69ff97a1ceee.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-05 09:10:19', '2020-10-05 09:10:19'),
(544, 'Cho thuê căn 2PN giá 10tr tại CC Kosmo Tây Hồ', 'cho-thue-can-2pn-gia-10tr-tai-cc-kosmo-tay-ho', '101 Đường Xuân La, Phường Xuân Tảo, Bắc Từ Liêm, Hà Nội', 1, '19', '86', 10000000, 0, '<p>1. Th&ocirc;ng tin căn hộ<br />\r\nCăn hộ rộng 86m2</p>\r\n\r\n<p>Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất cơ bản: giường, tủ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống&nbsp;<br />\r\n2. Tiện &iacute;ch<br />\r\nNằm ngay giữa trung t&acirc;m Quận T&acirc;y Hồ, số 101 Xu&acirc;n La, thuộc phường Xu&acirc;n Tảo, T&acirc;y Hồ, đ&acirc;y được xem l&agrave; trọng đi&ecirc;̉m trong chi&ecirc;́n lược quy hoạch phát tri&ecirc;̉n của thủ đ&ocirc; cả v&ecirc;̀ giao th&ocirc;ng và kh&ocirc;ng gian đ&ocirc; thị.</p>\r\n\r\n<p>Dự &aacute;n Kosmo T&acirc;y Hồ là sự k&ecirc;́t hợp hoàn hảo giữa vị trí đắc địa, h&ecirc;̣ th&ocirc;́ng ti&ecirc;̣n ích đẳng c&acirc;́p, thi&ecirc;́t k&ecirc;́ hi&ecirc;̣n đại, kh&ocirc;ng gian s&ocirc;́ng xanh cùng góc nhìn lý tưởng v&ecirc;̀ phía H&ocirc;̀ T&acirc;y phong cảnh hữu tình.<br />\r\nDự &aacute;n c&oacute; vị tr&iacute; đắc địa, gần c&aacute;c bệnh viện lớn như: Bệnh viện E, Bệnh viện Tim H&agrave; Nội, B&ecirc;nh viện quốc tế Thu C&uacute;c, Bệnh viện Giao Th&ocirc;ng Vận Tải, bệnh viện Lao Phổi TW&hellip;</p>\r\n\r\n<p>Về gi&aacute;o dục gần c&aacute;c trường nổi tiếng: C1, C2, C3 Xu&acirc;n Đỉnh, Trường Song Ngữ H&agrave; Nội Academy, United Nations International School, Trường Chu Văn An, Đại học Nội Vụ.<br />\r\nC&aacute;c điểm Vui chơi, giải tr&iacute; lớn như Si&ecirc;u thi Metro, C&ocirc;ng vi&ecirc;n nước Hồ T&acirc;y, C&ocirc;ng vi&ecirc;n H&ograve;a B&igrave;nh, C&ocirc;ng vi&ecirc;n Nghĩa Đ&ocirc;, trung t&acirc;m thể thao quận T&acirc;y Hồ, trung t&acirc;m tiện &iacute;ch c&ocirc;ng cộng (Ngoại giao đo&agrave;n)<br />\r\nDự &aacute;n Kosmo T&acirc;y Hồ l&agrave; dự &aacute;n đầu ti&ecirc;n c&oacute; rạp chiếu phim 5* tại khu vực T&acirc;y Hồ T&acirc;y. Ngo&agrave;i ra, với 03 tầng trung t&acirc;m thương mại kết hợp văn ph&ograve;ng c&ugrave;ng với c&aacute;c tiện &iacute;ch phục vụ ri&ecirc;ng cho cư d&acirc;n Kosmo T&acirc;y Hồ như : si&ecirc;u thị, trường mần non đạt ti&ecirc;u chuẩn quốc tế, ph&ograve;ng tập Gym , Spa, khu ẩm thực , khu thời trang ; khu vui chơi ngo&agrave;i trời cho trẻ em, s&acirc;n vườn dạo bộ , vườn nướng BBQ , bể bơi bốn m&ugrave;a trong nh&agrave; , bể bơi ngo&agrave;i trời&hellip;&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 10tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Nội thất cơ bản', NULL, '1601950176_20200930153504-f336_wm.jpg', '1601950176_20200930153503-6d93_wm.jpg|1601950176_20200930153504-27c4_wm.jpg|1601950176_20200930153504-f336_wm.jpg|1601950176_20200930153505-6668_wm.jpg|1601950176_20200930153506-413a_wm.jpg|1601950176_20200930153507-2386_wm.jpg|1601950176_20200930153507-fe36_wm.jpg|1601950176_20200930153508-872b_wm.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-06 02:09:36', '2020-10-06 02:09:36'),
