n)<br />\r\nDự &aacute;n Kosmo T&acirc;y Hồ l&agrave; dự &aacute;n đầu ti&ecirc;n c&oacute; rạp chiếu phim 5* tại khu vực T&acirc;y Hồ T&acirc;y. Ngo&agrave;i ra, với 03 tầng trung t&acirc;m thương mại kết hợp văn ph&ograve;ng c&ugrave;ng với c&aacute;c tiện &iacute;ch phục vụ ri&ecirc;ng cho cư d&acirc;n Kosmo T&acirc;y Hồ như : si&ecirc;u thị, trường mần non đạt ti&ecirc;u chuẩn quốc tế, ph&ograve;ng tập Gym , Spa, khu ẩm thực , khu thời trang ; khu vui chơi ngo&agrave;i trời cho trẻ em, s&acirc;n vườn dạo bộ , vườn nướng BBQ , bể bơi bốn m&ugrave;a trong nh&agrave; , bể bơi ngo&agrave;i trời&hellip;&nbsp;<br />\r\n3. Gi&aacute; thu&ecirc;:&nbsp;<br />\r\nGi&aacute; thu&ecirc;: 13tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.&nbsp;</p>\r\n\r\n<p>4. Li&ecirc;n hệ</p>\r\n\r\n<p>SĐT 0985622139 hoặc Zalo 0985622139</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full nội thất', NULL, '1601950341_872cfa8497d3698d30c2.jpg', '1601950341_2b6eb8c0d5972bc97286.jpg|1601950341_365f19f474a38afdd3b2.jpg|1601950341_872cfa8497d3698d30c2.jpg|1601950341_5590fc3291656f3b3674.jpg|1601950341_57804d372060de3e8771.jpg|1601950341_ef2313857ed2808cd9c3.jpg', NULL, NULL, 'Vũ Việt Dũng', NULL, '0985622139', '0985622139', NULL, 0, 0, '2020-10-06 02:12:21', '2020-10-06 02:12:21'),
(546, 'CHO THUÊ CHUNG CƯ  2PN TÒA VIỆT ĐỨC COMPLEX 39 LÊ VĂN LƯƠNG 13TR Full Nội Thất', 'cho-thue-chung-cu-2pn-toa-viet-duc-complex-39-le-van-luong-13tr-full-noi-that', '39 Lê Văn Lương', 2, '80', '73', 13000000, 1, '<p><strong>I. Th&ocirc;ng tin căn Hộ</strong></p>\r\n\r\n<p>Căn hộ rộng 73m2. Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ, nh&agrave; vệ sinh, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nFull nội thất gồm: Tivi, tủ lạnh, m&aacute;y giặt, điều h&ograve;a, giường, sopha, đệm, tủ bếp...<br />\r\nT&igrave;nh trạng căn hộ : Căn hộ hiện đang trống</p>\r\n\r\n<p><strong>II. TỔNG QUAN DỰ &Aacute;N C&Aacute;C CĂN HỘ CHO THU&Ecirc; CHUNG CƯ VIỆT ĐỨC COMPLEX &ndash; 39 L&Ecirc; VĂN LƯƠNG</strong></p>\r\n\r\n<h3><strong><em>Vị tr&iacute; dự &aacute;n cho thu&ecirc; căn hộ Việt Đức Complex:</em></strong></h3>\r\n\r\n<p>Chung cư Việt Đức Complex nằm tại địa chỉ số 39 L&ecirc; Văn Lương hoặc địa chỉ kh&aacute;c 164 Khuất Duy Tiến</p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:12.0pt\">Chung cư Việt Đức Complex nằm ở vị tr&iacute; thuận lợi tiếp gi&aacute;p nhiều trục đường lớn H&agrave; Nội: Phạm H&ugrave;ng, Đại Lộ Thăng Long&hellip;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Di chuyển mất 10 ph&uacute;t tới BigC Thăng Long, 5 ph&uacute;t tới Vinmart Ho&agrave;ng Đạo Th&uacute;y.</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Di chuyển 25 ph&uacute;t tới S&acirc;n Bay Nội B&agrave;i.</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Gần ngay trường cấp 1, cấp 2, cấp3: Trường Li&ecirc;n cấp Ng&ocirc;i Sao, Trường Amsterdam, THPT Nh&acirc;n Ch&iacute;nh&hellip;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Gần ngay c&ocirc;ng vi&ecirc;n Thanh Xu&acirc;n v&agrave; hồ điều h&ograve;a mới đi v&agrave;o hoạt động.</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>III. TIỆN &Iacute;CH CĂN HỘ CHO THU&Ecirc; CHUNG CƯ CHO THU&Ecirc; TẠI VIỆT ĐỨC COMPLEX:</strong></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:12.0pt\">Quảng trường trung t&acirc;m v&agrave; c&ocirc;ng vi&ecirc;n c&acirc;y xanh.</span></li>\r\n	<li><span style=\"font-size:12.0pt\">S&acirc;n chơi, quảng trường, th&aacute;c nước c&ocirc;ng vi&ecirc;n c&acirc;y xanh.</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Gym bể bơi fitness, yoga&hellip;</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Bể bơi 4 m&ugrave;a ngo&agrave;i trời phục vụ nhu cầu của cư d&acirc;n sống tại đ&acirc;y.</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Đường chạy bộ ven hồ C&ocirc;ng vi&ecirc;n Thanh Xu&acirc;n.</span></li>\r\n	<li><span style=\"font-size:12.0pt\">S&acirc;n chơi, khu vui chơi trẻ em.</span></li>\r\n	<li><span style=\"font-size:12.0pt\">C&oacute; 8 căn hộ/s&agrave;n chung cư với 4-5 thang m&aacute;y hoạt động 24/24h</span></li>\r\n	<li><span style=\"font-size:12.0pt\">Hầm đỗ xe hiện đại gần 20.000m2 phục vụ nhu cầu đỗ xe của cư d&acirc;n sống tại đ&acirc;y.</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Full Nội Thất', NULL, '1602209825_6.jpg', '1602209826_1.jpg|1602209826_2.jpg|1602209826_3.jpg|1602209826_4.jpg|1602209826_5.jpg|1602209826_6.jpg', NULL, NULL, 'Ngọc Thanh Hoàng', NULL, NULL, '0969856985', NULL, 0, 0, '2020-10-09 02:17:06', '2020-10-09 07:55:50'),
