(554, 'CHO THUÊ CHUNG CƯ  GOLDEN WEST SỐ 2 LÊ VĂN THIÊM 12TR ĐỒ CƠ BẢN', 'cho-thue-chung-cu-golden-west-so-2-le-van-thiem-12tr-do-co-ban', 'Số 2 Lê Văn Thiêm', 2, '42', '96', 12000000, 1, '<p>Th&ocirc;ng tin m&ocirc; tả</p>\r\n\r\n<p>Ch&iacute;nh chủ muốn cho thu&ecirc; căn hộ tầng 15 chung cư Golden West số 2 L&ecirc; Văn Thi&ecirc;m:<br />\r\n- Diện t&iacute;ch 96m2, thiết kế 3 ngủ, 2wc.<br />\r\n- Nh&agrave; đ&atilde; c&oacute; đầy đủ nội thất bao gồm điều h&ograve;a, n&oacute;ng lạnh, tủ bếp. ph&ugrave; hợp l&agrave;m văn ph&ograve;ng, để ở.<br />\r\nGi&aacute; thu&ecirc; đề xuất 12 triệu/th&aacute;ng ( C&oacute; Thương lượng )</p>\r\n\r\n<p>Dưới ch&acirc;n t&ograve;a nh&agrave; l&agrave; si&ecirc;u thị Vinmart, Unimart, Rạp chiếu phim Beta. Xung quanh l&agrave; ng&acirc;n h&agrave;ng VPbank, Agribank, Tech,... V&agrave; c&aacute;c qu&aacute;n ăn, qu&aacute;n cơm văn ph&ograve;ng<br />\r\n<br />\r\n* Golden West l&agrave; t&ograve;a nh&agrave; được đầu tư quy m&ocirc; hiện đại bậc nhất quận Thanh Xu&acirc;n tr&ecirc;n đường L&ecirc; Văn Thi&ecirc;m v&agrave; L&ecirc; Văn Lương.<br />\r\nVới thuận lợi vị tr&iacute; trung t&acirc;m kinh tế quận Thanh Xu&acirc;n c&oacute; hệ thống giao th&ocirc;ng th&ocirc;ng tho&aacute;ng ra c&aacute;c tuyến ch&iacute;nh L&ecirc; Văn Lương, L&aacute;ng Hạ, Tố Hữu, Nguyễn Tu&acirc;n, Ho&agrave;ng Minh Gi&aacute;m đường tr&ecirc;n cao V&agrave;nh đai 3...<br />\r\nHạ tầng văn ph&ograve;ng phong ph&uacute; đa dạng như: Ng&acirc;n h&agrave;ng, cafe, nh&agrave; h&agrave;ng, ph&ograve;ng c&ocirc;ng chứng, photo coppy, trung t&acirc;m thương mại, rạp chiếu phim, trung t&acirc;m ngoại ngữ...</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Đồ cơ bản', NULL, '1602250085_d9e92aed3981c7df9e90106.jpg', '1602250085_0f5d6d597e35806bd924105 - Copy.jpg|1602250085_0f5d6d597e35806bd924105.jpg|1602250085_2acb8ccf9fa361fd38b297.jpg|1602250085_6b12a116b27a4c24156b100.jpg|1602250085_13a113a500c9fe97a7d8111.jpg|1602250085_0036d73ec4523a0c634396.jpg|1602250085