(565, 'Chính chủ cần cho thuê căn hộ 3PN Full nội thất giá 12tr/tháng FLC 36 Phạm Hùng', 'chinh-chu-can-cho-thue-can-ho-3pn-full-noi-that-gia-12trthang-flc-36-pham-hung', '36 Phạm Hùng Nam Từ Liêm', 2, '32', '100', 12000000, 1, '<p><strong>- Cần cho thu&ecirc; gấp căn hộ cao cấp&nbsp;FLC 36 phạm h&ugrave;ng</strong></p>\r\n\r\n<p><strong>-&nbsp;</strong>Diện t&iacute;ch: 100m2</p>\r\n\r\n<p>- 3PN + 2WC Full nội thất đẹp</p>\r\n\r\n<p>- FLC Complex c&oacute; vị tr&iacute; tọa lạc tại 36 Phạm H&ugrave;ng</p>\r\n\r\n<p>-&nbsp;Nơi đ&acirc;y nằm ngay cạnh hai c&ocirc;ng vi&ecirc;n lớn của thủ đ&ocirc;, hồ điều h&ograve;a Nh&acirc;n Ch&iacute;nh</p>\r\n\r\n<p>- Nằm giữa 2 si&ecirc;u thị lớn BigC - Metroo</p>\r\n\r\n<p>- Tiện &iacute;ch ph&ograve;ng ph&uacute;, gym, bể bơi, spa</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất trẻ trung', NULL, '1610689617_z2278258241821_42a67a901079983f842700f09b7c4dde.jpg', '1610689617_z2278258222133_a9065f5f18faa6cf784e1c289bd659db.jpg|1610689617_z2278258225353_25073606081948896aea0b740b8134ba.jpg|1610689617_z2278258226689_eb4d0c04fcd0ebb6fbeab9f5f8cbdb17.jpg|1610689617_z2278258231471_11caf4de910bca73f03c30243e869dc1.jpg|1610689617_z2278258236941_a5088e740c1046cc7beabe735a334427.jpg|1610689617_z2278258246350_455b1ee054235218d624224595861a8d.jpg|1610689617_z2278258254208_e211ad92c22d9fbec775d4324c1fc3f5.jpg|1610689617_z2278258255667_fe960e8463966b8aea708769a06a3d94.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '2021-01-15 12:46:57', '2021-01-15 12:46:57'),
(566, 'Cho thuê chung cư FLC 36 Phạm hùng 2PN 2WC giá chỉ từ 8tr/tháng', 'cho-thue-chung-cu-flc-36-pham-hung-2pn-2wc-gia-chi-tu-8trthang', '36 Phạm Hùng Nam Từ Liêm', 2, '32', '68', 8000000, 1, '<p><strong>T&ocirc;i cần cho thu&ecirc; gấp căn hộ 2PN 2WC đồ cơ bản gi&aacute; 8tr/th&aacute;ng setup full đồ gi&aacute; 10tr/th&aacute;ng</strong></p>\r\n\r\n<p>- Tổng diện t&iacute;ch: 68m2</p>\r\n\r\n<p>- 2PN + 2WC</p>\r\n\r\n<p>- nội thất: tủ bếp, bếp, 3 điều h&ograve;a, 2 n&oacute;ng lạnh, r&egrave;m....</p>\r\n\r\n<p>+ Với thiết kế sang trọng, ph&ograve;ng tho&aacute;ng, đồ đạc gọn g&agrave;ng, ph&ugrave; hợp với kh&aacute;ch gia đ&igrave;nh, văn ph&ograve;ng....</p>\r\n\r\n<p>+ Vị tr&iacute; gần bến xe mỹ đ&igrave;nh, giao th&ocirc;ng thuận lợi</p>\r\n\r\n<p>+ gần trường đại học quốc gia, học viện kỹ thuật qu&acirc;n sự....</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'từ cơ bản đến full đồ', NULL, '1610690008_z2276961011363_a3ca86ce8d00104b9da832f7bf949c5f.jpg', '1610690008_z2276961005354_ce46fe6485d6baae1f1dbba3d1650e8c.jpg|1610690008_z2276961007066_f27495ce8baeba7d4fa4911c4ebb1e6c.jpg|1610690008_z2276961008392_61a63ecc99c6461024a358d998f3c5f9.jpg|1610690008_z2276961009784_af136340b02df965b5b8bab6154daeda.jpg|1610690008_z2276961010661_a5c5824d9127e8936704de95a3e24be3.jpg|1610690008_z2276961011363_a3ca86ce8d00104b9da832f7bf949c5f.jpg|1610690008_z2276961014780_e961ca148934a09e954c205251fadad6.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '2021-01-15 12:53:28', '2021-01-15 12:53:28'),
(567, 'Cần Cho thuê gấp chung cư FLC 18 Phạm Hùng 2PN đồ cơ bản giá 8tr/tháng', 'can-cho-thue-gap-chung-cu-flc-18-pham-hung-2pn-do-co-ban-gia-8trthang', 'số 2 Nguyễn Hoàng Nam Từ Liêm', 2, '31', '68', 8000000, 1, '<p><strong>Gia đ&igrave;nh chuyển c&ocirc;ng t&aacute;c cần cho thu&ecirc; lại căn hộ FLC Green Apartment, số 2 đường Nguyễn Ho&agrave;ng</strong></p>\r\n\r\n<p><strong>1. Th&ocirc;ng tin căn hộ:</strong><br />\r\n- Căn hộ rộng 65m2.</p>\r\n\r\n<p>- Thiết kế hợp l&yacute; bao gồm 02 ph&ograve;ng ngủ,&nbsp; 2 nh&agrave; vệ sinh , ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp, ban c&ocirc;ng.<br />\r\nNội thất gồm: điều h&ograve;a,tủ bếp, n&oacute;ng lạnh, r&egrave;m...</p>\r\n\r\n<p><strong>2. Tiện &iacute;ch:</strong></p>\r\n\r\n<p>-&nbsp;nằm tiếp gi&aacute;p với rất nhiều cơ quan kinh tế &ndash; ch&iacute;nh trị &ndash; văn h&oacute;a của thủ đ&ocirc; H&agrave; Nội thuận tiện cho việc c&ocirc;ng t&aacute;c cũng như n&acirc;ng cao chất lượng cuộc sống cho cư d&acirc;n : Trung t&acirc;m hội nghị quốc gia, kh&aacute;ch sạn Grand Palaza, BigC, Trường ĐH Sư Phạm , ĐH C&ocirc;ng Nghiệp, ĐH S&acirc;n Khấu Điện Ảnh, Trường Amsetdam H&agrave; Nội&hellip;</p>\r\n\r\n<p><strong>3. Gi&aacute; thu&ecirc;:</strong>&nbsp;<br />\r\nGi&aacute; thu&ecirc;:&nbsp; 8tr/th&aacute;ng, thanh to&aacute;n 3 th&aacute;ng cọc 1 th&aacute;ng.</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Điều hòa, nóng lạnh, tủ bếp....', NULL, '1610690589_z2276963095612_f3197ef17194361912030f7950bc0813.jpg', '1610690589_z2276963078593_b40da16f4628325c244ecd41a0ae735f.jpg|1610690589_z2276963082315_09b32b37ebb1a95ba44138e8e8191253.jpg|1610690589_z2276963083714_036f766e7c3d04b09e0d5c12377763b7.jpg|1610690589_z2276963086111_59bffcde11f8fc4fa8e71121997499ae.jpg|1610690589_z2276963088062_5ab9c6531db3a18bd9bbfac816257ec4.jpg|1610690589_z2276963091099_14c4fce786219d5b331b68dfb491ef2d.jpg|1610690589_z2276963092559_10be213d6835b9c8de2bf14db9e60582.jpg|1610690589_z2276963093771_b79e2d6f1e70345e3633e8cb83ad81df.jpg',