(568, 'Cần cho thuê gấp căn hộ cao cấp GlodMark City 136 Hồ Tùng Mậu', 'can-cho-thue-gap-can-ho-cao-cap-glodmark-city-136-ho-tung-mau', '136 Hồ Tùng Mậu', 2, '8', '110', 15000000, 1, '<p><strong>Ch&iacute;nh chủ cần cho thu&ecirc; căn hộ cao cấp GoldMark&nbsp;136 Hồ T&ugrave;ng Mậu</strong></p>\r\n\r\n<p><strong>-&nbsp;</strong><strong>Tổng Diện t&iacute;ch</strong>: 110m2</p>\r\n\r\n<p>- <strong>Thiết kế: </strong>3 ph&ograve;ng ngủ ( 1 ph&ograve;ng master) 2 ph&ograve;ng vệ sinh, đầy đủ nội thất sang trong.</p>\r\n\r\n<p>+ <strong>Tiện &iacute;ch</strong></p>\r\n\r\n<p>-&nbsp;GYM, Bể bơi, Spa, Trường học, ph&ograve;ng kh&aacute;m, khu vui chơi .....&nbsp;</p>\r\n\r\n<p><strong>+ Vị Tr&iacute;</strong></p>\r\n\r\n<p>&nbsp;- Gần c&aacute;c đặc khu kinh tế lớn của H&agrave; Nội với c&aacute;c doanh nghiệp, c&aacute;c ng&acirc;n h&agrave;ng lớn<br />\r\n- Gần c&aacute;c trường ĐH lớn như ĐH Quốc Gia H&agrave; Nội, ĐH Thương Mại, ĐH Sư Phạm&hellip;<br />\r\n- Gần bến xe Mỹ Đ&igrave;nh, gần tuyến Metro Nhổn &ndash; Ga H&agrave; Nội<br />\r\n- Gần trung t&acirc;m Hội Nghị Quốc Gia, s&acirc;n vận động Mỹ Đ&igrave;nh</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Full nội thất cao cấp', NULL, '1610693838_z2275689626108_a6410b84d62c38c2a650f88e3864f6f4.jpg', '1610693839_z2275689529825_aa4e9b0fc2a2c70857c1d5aa60dfbef6.jpg|1610693839_z2275689540633_92346e751ea40e6f55377419c0eff241.jpg|1610693839_z2275689569206_88309575980e7adc788c0b93521c0ab1.jpg|1610693839_z2275689606473_35b8dff893a83163d42ea2d5274ef2b7.jpg|1610693839_z2275689626108_a6410b84d62c38c2a650f88e3864f6f4.jpg|1610693839_z2275689637160_cea4a71036268d8fd7eb5ecbfe496988.jpg|1610693839_z2275689645471_4fb47cb11570be21ca395eced4c54ee4.jpg|1610693839_z2275689670919_bfd65291c303f5286cf982b79cfa0c56.jpg|1610693839_z2275689679261_8d929d7f847b9f4521f4f5255ca3b6f3.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '2021-01-15 13:57:19', '2021-01-15 13:57:19'),
(569, 'Cho thuê gấp căn hộ GoldMark City 136 Hồ Tùng Mậu 2PN giá 10tr/tháng', 'cho-thue-gap-can-ho-goldmark-city-136-ho-tung-mau-2pn-gia-10trthang', '136 Hồ Tùng Mậu', 2, '8', '78', 10000000, 1, '<p><strong>+ Ch&iacute;nh chủ cần cho thu&ecirc; căn hộ GoldMark 136 hồ t&ugrave;ng mậu</strong></p>\r\n\r\n<p>DT:78m2 2PN 2WC nội thất: tủ bếp, điều h&ograve;a, n&oacute;ng lạnh....</p>\r\n\r\n<p><strong>+Tiện &iacute;ch</strong></p>\r\n\r\n<ul>\r\n	<li>Trung t&acirc;m thương mại</li>\r\n	<li>Văn ph&ograve;ng cao cấp</li>\r\n	<li>Khu vui chơi giải tr&iacute;</li>\r\n	<li>Khu vui chơi trẻ em trong nh&agrave; v&agrave; ngo&agrave;i trời</li>\r\n	<li>C&ocirc;ng vi&ecirc;n c&acirc;y xanh rộng lớn</li>\r\n	<li>Hồ điều h&ograve;a</li>\r\n	<li>Đ&agrave;i phun nước</li>\r\n	<li>Khu giao lưu Goldmark City</li>\r\n</ul>\r\n\r\n<p><strong>+ Vị Tr&iacute;</strong></p>\r\n\r\n<p>- Từ Vành Đai 3 đi các tỉnh vùng kinh t&ecirc;́/công nghiệp trọng đi&ecirc;̉m của Mi&ecirc;̀n Bắc.<br />\r\n- Cách sân bay qu&ocirc;́c t&ecirc;́ nội bài 25p thuận tiện di chuy&ecirc;̉n trong nước và qu&ocirc;́c t&ecirc;́.<br />\r\n- Goldmark City - Tọa lạc tại 136 H&ocirc;̀ Tùng Mậu, nằm ngay trên mặt ti&ecirc;̀n 2 trục đường lớn: Nguy&ecirc;̃n Cơ Thạch kéo dài và đường H&ocirc;̀ Tùng Mậu, ti&ecirc;́p cận Xuân Thủy - C&acirc;̀u Gi&acirc;́y v&ecirc;̀ trung tâm thành ph&ocirc;́.</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'đồ cơ bản ( tủ bếp, điều hòa, nóng lạnh)', NULL, '1610694296_z2269231604947_3e440aa9cdf8f20b09703082da234844.jpg', '1610694296_z2269231604947_3e440aa9cdf8f20b09703082da234844.jpg|1610694296_z2269231615935_9f88cf4384f0ed4590425740bd934705.jpg|1610694296_z2269231627178_d262c4627998c01bc3e2f59527286d38.jpg|1610694296_z2269231638674_a55c765b44681c020fe553c7193d9861.jpg|1610694296_z2269231649881_c42fd47736b690d83ac2411e8fa9eaf6.jpg|1610694296_z2269231661255_b6f74ca4d693235ed1dd432d5a2178f1.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668'