(570, 'Cần cho thuê gấp căn hộ 2PN 2WC Full nội thất giá 13tr/tháng GoldMark 136 Hồ Tùng Mậu', 'can-cho-thue-gap-can-ho-2pn-2wc-full-noi-that-gia-13trthang-goldmark-136-ho-tung-mau', '136 Hồ Tùng Mậu', 2, '8', '76', 12000000, 1, '<p><strong>Ch&iacute;nh chủ cho thu&ecirc; căn hộ cao cấp t&ograve;a ruby GoldMark 136 hồ t&ugrave;ng mậu.</strong></p>\r\n\r\n<p>+ <strong>DT</strong>: 76m2 2PN 2WC Full nội thất cao cấp.</p>\r\n\r\n<p><strong>+ GoldMark</strong> Cung cấp tới 3 bể bơi lớn nhỏ được bố tr&iacute; đều quanh dự &aacute;n. Hệ thống trung t&acirc;m thương mại v&agrave; mua sắm hiện đại. Khu vui chơi cho trẻ nhỏ v&agrave; người cao tuổi được t&iacute;ch hợp tới hơn 30 tiện &iacute;ch.</p>\r\n\r\n<p><strong>+ Goldmark City</strong>&nbsp;c&ograve;n được trang bị hệ thống an ninh kh&eacute;p k&iacute;n nghi&ecirc;m ngặt sẽ gi&uacute;p gia đ&igrave;nh bạn ho&agrave;n to&agrave;n y&ecirc;n t&acirc;m. Hệ thống quản l&yacute; t&ograve;a nh&agrave; th&ocirc;ng minh, hệ thống ph&ograve;ng ch&aacute;y chữa ch&aacute;y tự động. Đ&acirc;y l&agrave; một trong những điều l&agrave;m n&ecirc;n sự kh&aacute;c biệt của dự &aacute;n Goldmark City với c&aacute;c dự &aacute;n kh&aacute;c.</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'Đầy đủ nội thất sang trọng', NULL, '1610694867_1.jpg', '1610694868_z2270142330728_58968dd8f881d0505be37f80513c78cc.jpg|1610694868_z2270142381655_fccbce506fe06d8d69f0196d4296b79a.jpg|1610694868_z2270142396254_fa3c559479c5ee3774ce6abe5687e570.jpg|1610694868_z2270142424072_a49df6e89d1f43f1a3379e82b94d9638.jpg|1610694868_z2270142507931_3488761e9254ac11cdc2c62fa8289186.jpg|1610694868_z2270142569477_c2735136322a7ab0d96a69d537d66dd8.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '2021-01-15 14:14:28', '2021-01-15 14:14:28'),
(571, 'Cho thuê chung cư GoldMark R3 136 Hồ Tùng Mậu 2PN Full nội thất giá 11tr', 'cho-thue-chung-cu-goldmark-r3-136-ho-tung-mau-2pn-full-noi-that-gia-11tr', '136 Hồ Tùng Mậu', 2, '8', '78', 11000000, 1, '<p><strong>Ch&iacute;nh chủ&nbsp;cho thu&ecirc; gấp căn hộ GoldMark 136 Hồ T&ugrave;ng Mậu</strong></p>\r\n\r\n<p>- Tổng diện t&iacute;ch: 78m2, với thiết kế 2 ph&ograve;ng ngủ, 2 ph&ograve;ng vệ sinh, nội thất đầy đủ.</p>\r\n\r\n<p><strong>+ Tiện &iacute;ch:</strong></p>\r\n\r\n<p><img alt=\"\" src=\"http://diamond136hotungmau.com/Uploads/44/images/icon_footer.png\" />&nbsp;GYM + SPA cao cấp.<br />\r\n<img alt=\"\" src=\"http://diamond136hotungmau.com/Uploads/44/images/icon_footer.png\" />&nbsp;Khu vui chơi trẻ em<br />\r\n<img alt=\"\" src=\"http://diamond136hotungmau.com/Uploads/44/images/icon_footer.png\" />&nbsp;Hệ thống an ninh 3 lớp<br />\r\n<img alt=\"\" src=\"http://diamond136hotungmau.com/Uploads/44/images/icon_footer.png\" />&nbsp;Dịch vụ y tế: Bệnh viện 19.8, đa khoa, y học cổ truyền,...</p>\r\n\r\n<p><img alt=\"\" src=\"http://diamond136hotungmau.com/Uploads/44/images/icon_footer.png\" />&nbsp;C&ocirc;ng vi&ecirc;n hồ điều h&ograve;a<br />\r\n<img alt=\"\" src=\"http://diamond136hotungmau.com/Uploads/44/images/icon_footer.png\" />&nbsp;Trường Newton, Monoloxop, Đo&agrave;n Thị Điểm, Việt &Uacute;c, L&ecirc; Qu&yacute; Đ&ocirc;n,...&nbsp;<br />\r\n<img alt=\"\" src=\"http://diamond136hotungmau.com/Uploads/44/images/icon_footer.png\" />&nbsp;ĐƯỜNG DẠO BỘ &amp; C&ocirc;ng vi&ecirc;n<br />\r\n<img alt=\"\" src=\"http://diamond136hotungmau.com/Uploads/44/images/icon_footer.png\" />&nbsp;Bể bơi 4 m&ugrave;a</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'full nội thất', NULL, '1610695224_1.jpg', '1610695224_z2261379693574_e8447bbc963ca8864a2c975f5f5e3928.jpg|1610695224_z2261379705735_8da8f13fd7dd2c078e3ce5f10f4d47bb.jpg|1610695224_z2261379722333_a8df467e46a0fa5f83681452c761fb6e.jpg|1610695224_z2261379788097_05c7c4ba4bfaf5ca125f4ef1f522c8f1.jpg|1610695224_z2261379