(572, 'Chính chủ cho thuê căn hộ cao cấp Goldmark City 136 Hồ Tùng Mậu 3PN full đồ cao cấp', 'chinh-chu-cho-thue-can-ho-cao-cap-goldmark-city-136-ho-tung-mau-3pn-full-do-cao-cap', '136 Hồ Tùng Mậu', 2, '8', '124', 17000000, 1, '<p><strong>M&igrave;nh chuyển c&ocirc;ng t&aacute;c n&ecirc;n muốn cho thu&ecirc; lại căn hộ 3PN Full nội thất cao cấp.</strong></p>\r\n\r\n<p>-DT: 124m2 3PN 2WC đầy đủ nội thất, Tivi, tủ lạnh, m&aacute;y giặt, hệ thống đ&egrave;n th&ocirc;ng minh...</p>\r\n\r\n<p>Nằm trong qu&acirc;̀n th&ecirc;̉ khu đô thị Goldmark City là chung cư&nbsp;đẳng c&acirc;́p bậc nh&acirc;́t tại khu vực phía Tây Thủ đô, nơi thu hút vượng khí, tài lộc dành cho những Quý chủ nhân xứng t&acirc;̀m. GoldMark&nbsp;không chỉ là nơi s&ocirc;́ng mà còn là nơi tận hưởng những giây phút hòa mình với thiên nhiên, gia đình và đặc biệt hơn h&ecirc;́t là chinh phục những đỉnh cao thành công mới với thời gian ngắn nh&acirc;́t bởi vị trí &ldquo;Rubi&nbsp;- thuận đường k&ecirc;́t n&ocirc;́i&rdquo;, thuận tiện trong từng bước di chuy&ecirc;̉n của Quý chủ nhân.</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'Nội thất cao cấp', NULL, '1610696216_z2275627039397_9bb91f9aae6e3aee8e4e36fbfbaccbfc.jpg', '1610696216_z2275627012273_9ca251d0c2dce6eb61af7d5eb9c1c047.jpg|1610696216_z2275627028308_7b4c44910b619af5fb9be460052091e1.jpg|1610696216_z2275627051357_c5906005e823d125070d25152b01381a.jpg|1610696216_z2275627074138_cdf3d5a37df23c74251a5de8650ab033.jpg|1610696216_z2275627095020_4a1732704fe1859474a12af5e192a6bf.jpg|1610696216_z2275627112279_5c2413d7fe1c680d49b647dc47e37ba4.jpg|1610696216_z2275627124285_ebebbe523b0f9efb09774126e8d71bbd.jpg|1610696216_z2275627169980_8a28afd35e4e19dfcd316e55d5700666.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '2021-01-15 14:36:56', '2021-01-15 14:36:56'),
(573, 'Chính chủ cần cho thuê gấp căn hộ GoldMark city 2PN đồ cơ bản giá 9tr/tháng', 'chinh-chu-can-cho-thue-gap-can-ho-goldmark-city-2pn-do-co-ban-gia-9trthang', '136 Hồ Tùng Mậu', 2, '8', '70', 9000000, 1, '<p>Ch&iacute;nh chủ cần cho thu&ecirc; căn hộ 2PN đồ cơ bản CC GoldMark city 136 hồ t&ugrave;ng mậu</p>\r\n\r\n<p>DT: 70m2 2PN 2WC, đ&atilde; c&oacute; s&agrave;n gỗ, tủ bếp, điều h&ograve;a, n&oacute;ng lạnh...</p>\r\n\r\n<p>Ph&ugrave; hợp với kh&aacute;ch gia đ&igrave;nh v&agrave; kh&aacute;ch văn ph&ograve;ng.</p>\r\n\r\n<p>Tiện &iacute;ch khu vực: gym, bể bơi 4 m&ugrave;a, si&ecirc;u thị, spa, lớp dậy tiếng anh, khu&ocirc;n vi&ecirc;n nội khu rộng r&atilde;i.</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'cơ bản', NULL, '1610768662_z2278851999665_124e9ddf78539d75fe5379f36bf0a97b.jpg', '1610768662_z2278852012565_fe228397cacf7dda7bdbe91c394eb324.jpg|1610768662_z2278852025376_13709dd62edf01b4003dfc8fe506a6f6.jpg|1610768662_z2278852052029_e3ea23d02c70894cb84abd6e86510fe7.jpg|1610768662_z2278852064131_dc92b82ffe7304af898dea18b3ce526a.jpg|1610768662_z2278852089585_fe5f8900e4b6ede7bfaaa346de2b2790.jpg|1610768662_z2278852138878_059a169cdcf2a636b792f40ffea412f2.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '2021-01-16 10:44:22', '2021-01-16 10:44:22'),
(574, 'Cần cho thuê gấp căn hộ GoldMark 136 Hồ Tùng mậu 3PN 2WC giá 10tr/tháng', 'can-cho-thue-gap-can-ho-goldmark-136-ho-tung-mau-3pn-2wc-gia-10trthang', '136 Hồ Tùng Mậu', 2, '8', '92', 10000000, 1, '<p>Do kh&ocirc;ng c&oacute; nhu cầu ở gia đ&igrave;nh t&ocirc;i muốn cho thu&ecirc; căn hộ GoldMark 136 Hồ T&ugrave;ng Mậu</p>\r\n\r\n<p>DT:92m2 3PN 2WC, nội thất: s&agrave;n gỗ, tủ bếp, kệ bếp, m&aacute;y h&uacute;t m&ugrave;i, điều h&ograve;a, n&oacute;ng lạnh....</p>\r\n\r\n<p>Gi&aacute; cho thu&ecirc; 11tr/th&aacute;ng, c&oacute; thể thương lượng với kh&aacute;ch thu&ecirc; l&acirc;u d&agrave;i hoặc c&oacute; thiện ch&iacute; thu&ecirc; nh&agrave;.</p>\r\n\r\n<p>H&igrave;nh thức đ&oacute;ng 3 th&aacute;ng cọc 1 th&aacute;ng.</p>\r\n\r\n<p>Khu vực đ&ocirc;ng d&acirc;n cư, c&oacute; thể l&agrave;m spa hoặc văn ph&ograve;ng.....</p>\r\n\r\n<p>tiện &iacute;ch phong ph&uacute;: gym, spa, bể bơi 4 m&ugrave;a, si&ecirc;u thị......</p>\r\n\r\n<p>3</p>', NULL, NULL, NULL, NULL, NULL, 3, 2, 'tủ bếp, điều hòa, nóng lạnh', NULL, '1610769104_z2277364491068_1df78f1536986202f3bf8710ab6ead95.jpg', '1610769104_z2277364420221_ec0dbaf65e0f99c9960484f79211cfe6.jpg|1610769104_z2277364430767_caf44b9cbcc35c198696af1e321ea288.jpg|1610769104_z2277364513329_cd8ec67b1a82f7d9a522dd3aedda9589.jpg|1610769104_z2277364634929_fa35ede7f73a55910cc3cf031ca532a3.jpg|1610769104_z2277364678053_0f706153f9a81d431f8b66c6319061d8.jpg|1610769104_z2277364689734_7627d624705a731cfea4e5872871550a.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '2021-01-16 10:51:44', '2021-01-16 10:51:44'),
(575, 'Chính chủ cần cho thuê căn hộ cao cấp Thăng Long Number one', 'chinh-chu-can-cho-thue-can-ho-cao-cap-thang-long-number-one', 'số 1 đại lộ thăng long', 2, '51', '138', 17000000, 1, '<p><strong>Ch&iacute;nh chủ cần cho thu&ecirc; gấp căn hộ cao cấp&nbsp; Thăng Long Nember one, Số 1 đại lộ thăng long.</strong></p>\r\n\r\n<p>DT:138m2 4PN Full nội thất đẹp.</p>\r\n\r\n<p><strong>Tiện &iacute;ch: </strong></p>\r\n\r\n<p>- Gym, bể bơi, spa...</p>\r\n\r\n<p>- Si&ecirc;u thị Big C, Khu CC cao cấp The Manor, Tổ hợp TM kh&aacute;ch sạn Grand Plaza...</p>\r\n\r\n<p>- Trung t&acirc;m thương mại, CGV...</p>\r\n\r\n<p><strong>vị tr&iacute;:</strong></p>\r\n\r\n<p>Chung cư Thăng Long Number One tọa lạc nằm tại số 1 Đại Lộ Thăng Long, một trong những vị tr&iacute; t&acirc;m điểm của c&aacute;c trục giao th&ocirc;ng đường bộ, đường cao tốc tr&ecirc;n cao, hệ thống t&agrave;u điện tr&ecirc;n cao c&ugrave;ng với Khu li&ecirc;n cơ h&agrave;nh ch&iacute;nh của H&agrave; nội v&agrave; 64 tỉnh th&agrave;nh, trung t&acirc;m ch&iacute;nh trị, t&agrave;i ch&iacute;nh &ndash; b&aacute;n lẻ, văn h&oacute;a &ndash; thể thao h&agrave;ng đầu của đất nước như: Trung t&acirc;m Hội nghị Quốc gia, si&ecirc;u thị big C, Tổ hợp thể thao Mỹ Đ&igrave;nh, Trung t&acirc;m thương mại Grand Plaza</p>', NULL, NULL, NULL, NULL, NULL, 4, 2, 'đầy đủ nội thất cao cấp', NULL, '1610938164_z2281921138184_02745c4aecb4814aa6c3227afa7d98be.jpg', '1610938164_z2281921138184_02745c4aecb4814aa6c3227afa7d98be.jpg|1610938164_z2281921148380_b1fcda89a7761201849fccbccfb6421b.jpg|1610938164_z2281921160165_7e4c230b7f02d95d640b8114686b168a.jpg|1610938164_z2281921170810_a7245f7d04fef921b1c64321559ab9df.jpg|1610938164_z2281921181578_6803e6d1b2326b79068537b40095b7f9.jpg|1610938164_z2281921204188_34992f9bbaff574901e9e4338537e67e.jpg|1610938164_z2281921214999_34ae2e3752dc1c5e8a468d7d30eb9da8.jpg|1610938164_z2281921224790_b5c0ad2077a37c450538bdd06b2dc1d8.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '