(579, 'Cần cho thuê gấp căn hộ Golden Palace đường mễ  trì, quận Nam Từ Liêm', 'can-cho-thue-gap-can-ho-golden-palace-duong-me-tri-quan-nam-tu-liem', 'mễ trì, quận nam từ liêm', 2, '90', '68', 13000000, 1, '<p>Ch&iacute;nh chủ nhờ cho thu&ecirc; gấp căn hộ cao cấp&nbsp;Golden Palace đường mễ tr&igrave; quận bắc từ li&ecirc;m h&agrave; nội.</p>\r\n\r\n<p>DT:68m2 2PN 2WC Full nội thất.</p>\r\n\r\n<p><strong>- Tiện &iacute;ch</strong>:&nbsp;C&aacute;c tiện &iacute;ch nổi bật v&agrave; phong ph&uacute; đ&aacute;p ứng ti&ecirc;u chuẩn quốc tế gồm: si&ecirc;u thị, nh&agrave; h&agrave;ng, Spa, trung t&acirc;m thể thao, bể bơi, nh&agrave; trẻ, bệnh viện được thiết kế hợp l&yacute; giữa c&aacute;c t&ograve;a nh&agrave; tạo n&ecirc;n sự thuận tiện khi sử dụng, phục vụ tốt nhất những nhu cầu cuộc sống của cư d&acirc;n.</p>\r\n\r\n<p>-<strong> Vị tr&iacute;:&nbsp;</strong>Nằm trong quy hoạch tổng thể của C&ocirc;ng vi&ecirc;n văn h&oacute;a thể thao T&acirc;y Nam H&agrave; Nội, trung t&acirc;m h&agrave;nh ch&iacute;nh mới của thủ đ&ocirc;, tr&ecirc;n trục giao th&ocirc;ng Mễ&nbsp;tr&igrave; &ndash; Phạm H&ugrave;ng, nơi kết nối những c&ocirc;ng tr&igrave;nh cao cấp v&agrave; ti&ecirc;u biểu bậc nhất của Th&agrave;nh phố, Golden Palace c&oacute; vị tr&iacute; v&ocirc; c&ugrave;ng thuận tiện, giao th&ocirc;ng kết nối nhanh ch&oacute;ng.</p>', NULL, NULL, NULL, NULL, NULL, 2, 2, 'full nội thất', NULL, '1610940908_z2281903130372_e07271185d11ac9162dff8221dc880e3.jpg', '1610940908_z2281903130372_e07271185d11ac9162dff8221dc880e3.jpg|1610940908_z2281903141362_a582c5c09eadb26bf0de26444f401129.jpg|1610940908_z2281903150744_ef34427deca80d59ebfefd0ae2c8d98e.jpg|1610940908_z2281903160760_5df24399cb5491607a71cd6f59d8e1c1.jpg|1610940908_z2281903172949_386eae14ad72db3df2f2d255a1491255.jpg', NULL, NULL, 'Mr. Minh', NULL, '0877303668', '0877303668', NULL, 0, 0, '2021-01-18 10:35:08', '2021-01-18 10:35:08'),
